INSERT INTO `applications` VALUES ('air.com.adobe.pstouch', 'PS Touch', '1004001', '1.4.1', '13', 'Transforme sus imÃ¡genes con las funciones principales de Adobe Photoshop en una aplicaciÃ³n diseÃ±ada para tabletas.<p>Combine imÃ¡genes, aplique efectos profesionales, comparta resultados con amigos y familiares a travÃ©s de Facebook y Twitter. Todo cÃ³modamente desde la tableta.<p>â€¢ Utilice las funciones mÃ¡s populares de Photoshop adaptadas exclusivamente para tabletas, como capas, herramientas de selecciÃ³n, ajustes y filtros, para crear imÃ¡genes impactantes.   <br>â€¢ Utilice la cÃ¡mara de su tableta para rellenar un Ã¡rea de una capa con la exclusiva funciÃ³n de relleno de la cÃ¡mara. <br>â€¢ Seleccione parte de una imagen para extraerla con la herramienta de selecciÃ³n Garabatear. Con la herramienta Perfeccionar borde, puede utilizar el dedo para capturar elementos de la imagen con facilidad, incluso los mÃ¡s difÃ­ciles de seleccionar (por ejemplo, cabello). <br>â€¢ Trabaje en imÃ¡genes en alta resoluciÃ³n y mantenga la mÃ¡s alta calidad de imagen. Admite imÃ¡genes de hasta 12 megapÃ­xeles.<br>â€¢ Siga tutoriales paso a paso para aprender fÃ¡cilmente las tÃ©cnicas utilizadas por los profesionales para obtener resultados de gran calidad. <br>â€¢ Busque y consiga imÃ¡genes con la funciÃ³n integrada de bÃºsqueda de imÃ¡genes de Google. <br>â€¢ Examine una galerÃ­a de estilos y resultados que le ayudarÃ¡n a inspirarse.<br>â€¢ Cargue proyectos en Adobe Creative Cloud* y abra archivos con capas de Adobe Photoshop Touch en Photoshop CC, CS6 o Photoshop CS5.1.<br>â€¢ La modalidad de inscripciÃ³n gratuita de Creative Cloud le ofrece 2 GB de almacenamiento en la nube y la posibilidad de sincronizar manualmente archivos entre la tableta y el ordenador, acceder a archivos desde la Web y compartir archivos con otras personas fÃ¡cilmente. MÃ¡s informaciÃ³n &gt; <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.adobe.com/es/products/creativecloud.html%26sa%3DD%26usg%3DAFQjCNGbIF1L68nz6PX0FdsIATNWNLcnFQ&amp;sa=D&amp;usg=AFQjCNEyKA0FrvzXh5JUUcUHG1fn3L52pQ\" target=\"_blank\">http://www.adobe.com/es/products/creativecloud.html</a><p>Al hacer clic en el botÃ³n Instalar, confirma que ha leÃ­do y aceptado el Acuerdo de licencia del software de Adobe de <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.adobe.com/go/eulas_es%26sa%3DD%26usg%3DAFQjCNEVxh9OMJc5WcFHfo3AEq9AVoT9jQ&amp;sa=D&amp;usg=AFQjCNEaAOecBstt1BwmnIinlLVKCC3ozQ\" target=\"_blank\">http://www.adobe.com/go/eulas_es</a>.<p><br>* Se necesita una conexiÃ³n a Internet e inscripciÃ³n en Adobe Creative Cloud. Los servicios en lÃ­nea de Adobe, entre los que se encuentra el servicio de Adobe Creative Cloud*, estÃ¡n disponibles Ãºnicamente para usuarios mayores de 13 aÃ±os y requieren registro, la aceptaciÃ³n de condiciones adicionales y de la polÃ­tica de privacidad en lÃ­nea de Adobe descrita en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.adobe.com/special/misc/privacy.html%2523spanish%26sa%3DD%26usg%3DAFQjCNGAXEq--dtCoJn5przPaj0uwg4IZA&amp;sa=D&amp;usg=AFQjCNF50RC8OBjzaH4iLoYLwqrBaoWVtw\" target=\"_blank\">http://www.adobe.com/special/misc/privacy.html#spanish</a>.<p>Los servicios en lÃ­nea no estÃ¡n disponibles en todos los paÃ­ses e idiomas. Del mismo modo, es posible que precisen el registro del usuario y que estÃ©n sujetos a cambios o interrupciones sin previo aviso.<p>Impuestos incluidos en los precios de la UniÃ³n Europea, Noruega y Suiza.</p></p></p></p></p></p>', '9', '49590955', '0', '0', '0', '2015-03-20 18:33:37', '2015-03-20 18:33:37', '0', '1', '0', '0', 'Adobe');
INSERT INTO `applications` VALUES ('alterforce.huntress', 'Devilry Huntress', '125', '1.2.5', '8', 'Devilry Huntress is a sign-swapping puzzler, similar to our game Jewellust. Medieval decorations and comic Halloween theme make the game stylish and funny. Swap and burst evil spirits to clean the Kingdom from devilry! <p>Devilry Huntress has: <br>- 40 levels<br>- 2 game modes<br>- various bonuses and power-ups <br>- 2 kind of bonus-games <br>- online score table<p>Note: you can find the free lite version of the game on Google Play to estimate gameplay.<p>***Foreword***<p>In the history of the Five Counties the dark times have come. People have fled from their villages, lands have become infested with evil spirits and immortals. Many exorcists and vampire hunters have vanished in the struggle against the Dark Earl - the lord of the Central county, who has opened infernal gates and has become the master of immortals.<p>A young devilry huntress has been sent to stop the Dark Earl. One old cleric has revealed the secret of the immortals: every &quot;dark nest&quot; holds the magic plate with spells. Once created, they can not be destroyed, and the Dark Earl has scattered them over the Five Counties. Existance of &quot;dark nests&quot; depends on those plates. &quot;Collect them all and you will put an end to the Dark Earl&#39;s power&quot;, - cleric said.  Armed by this knowledge, devilry huntress goes to the Counties to clear lands with sacred fire.<p>***The Game Rules****<p>Exchange signs with each other to destroy a combination of 3 or more creatures of one kind. If youâ€™ve burst four or more creatures at once, a bonus sign will appear. In campaign mode new bonuses become available as your journey goes.<p>To fight against evil you have flask of vampire blood. You must collect all the letters to get a plate before the &quot;black blood&quot; runs out.<p>You will visit 5 counties. From county to county you will travel through magic portals created by Dark Earl for his awful army. Fire lamps in right order to turn on the portal. For each county you have scrolling map where you&#39;ll find 8 evil nests. Some of them own magic plates, others do not.<p>At last you are in a heart of the Earl&#39;s sanctuary. You have all the magic plates with spells. Now you have to put them together to seal up an infernal gateway from which the Earl gets his power upon dead. But you need only 20 of 30 existing spells. Drag them into the magic circle - one by one. Wrong plate will throw away one spell from circle and you will have to try again and again. <p>Don&#39;t give up, future of Five Counties depends on you!<p>***Power-ups***<p>Sometimes it seems that it&#39;s impossible to win, but there are 9 bonus signs, a Pick Hammer and Defensive Pentagrams to help you on your way. <p>***Online scores***<p>Using ONLINE SCORES button from main menu you can see your own score in online rate table. When you look the rate table from your device (not from PC browser) you can see your score highlighted. <p>***Customer reviews about the game***<p>&quot;Another great game from an awesome developer. I think I like this one even more than Jewellust&quot;<p>&quot;Best android game I&#39;ve seen. Highly recommend.&quot;<p>&quot;Lots of fun, great graphics and game play, highly recommended!&quot;<p>&quot;A devilishly delightful diversion!&quot;<p>&quot;Lots of fun! A++++!!!!!!&quot;<p>&quot;Absolutely awesome! Addictive!&quot;<p>&quot;Best. Gem. Game. Ever!&quot;</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '3645524', '0', '0', '0', '2015-03-20 18:35:55', '2015-03-20 18:35:55', '0', '1', '0', '0', 'Smartpix Games');
INSERT INTO `applications` VALUES ('anykode.rdc', 'akRDC', '13002', '1.3.2', '4', 'akRDC - VNC viewer - Remote desktop control (Free version)<p>If akRDC doesn&#39;t work for you, please ask for help through the â€œSend email&quot; button in Google Play, we will certainly be able to resolve the problem. thank you.<p>-&gt; <a href=\"https://play.google.com/store/apps/details?id=anykode.rdcpro\">PRO Version</a>:<br>- Compressed files transfer stream<br>- Compressed directory files list (with TightVNC server, akRDC PRO only)<br>- Direct support.<br>- No Ad<p>-&gt; The Free version displays an Advertisement at the application startup only.<p>akRDC is a Remote Desktop Control software compatible with the RFB protocol (VNC Client) and tested on servers: TightVNC, UltraVNC, RealVNC (without encryption), Ubuntu Remote Desktop (servers ready with the RFB protocol...)<p>* App languages: English, French, Russian, Italian, German, Espagnol, Japanese, Korean<p>* Files Transfer (For TighVNC and UltraVNC servers only right now + X11VNC in Ultra VNC mode):<br>- Transfer (download and upload) files and complete directories structure.<br>- Compressed files transfer stream (akRDC PRO only).<br>- Compressed directory files list (with TightVNC server, akRDC PRO only)<br>- Create / Delete directories.<br>- Delete files.<p>* Supports UltraVNC repeater/proxy in mode 1<p>* Function keys: <br>- connection shortcuts<br>- 3 buttons mouse + wheel emulation (volume key)<br>- keyboard, quick keys (CTRL+C, ...),<br>- Esc (Back key)<br>- special keys (F1, F2...),<br>- Zoom<br>- Drag&amp;drop<br>- network band optimization.<br>- configuration Import / export<br>- hardware acceleration management (if the remote session view become BLACK, you have to disable the hardware acceleration)<p>* RFB Protocol implementation: <br>- supports TIGH, RAW, COPYRECT, RRE, HEXTILE and ZRLE encodings. <br>- VNC password (DES encrypted authentication).<br>- MS-Logon authentication ( for UltraVNC server)<p>How to use: install a VNC server (TightVNC recommended) on your PC, create a new connection shortcut in AKRDC then connect to your server. The documentation available on www.akrdc.eu<p>To make the CTRL ALT DEL command works, run the VNC server as a service, and allow the CTRL ALT DEL feature in your system.</p></p></p></p></p></p></p></p></p></p></p>', '8', '725506', '0', '0', '0', '2015-03-20 18:33:50', '2015-03-20 18:33:50', '0', '1', '0', '0', 'ANYKODE');
INSERT INTO `applications` VALUES ('appinventor.ai_progetto2003.SCAN', 'Qr Barcode Scanner', '9', '1.4.2', '3', 'SCAN, DECODE, CREAR y COMPARTIR con Barcode Scanner QR <p>MÃ¡s de 40 millones de usuarios  descargar esta aplicaciÃ³n premium que  SCANS  formatos de cÃ³digos de barras mÃºltiples y  cÃ³digos QR  para decodificar automÃ¡ticamente su contenido.<br>EscÃ¡ner de cÃ³digo de barras QR es muy rÃ¡pido y fÃ¡cil de usar.<br>Usted puede decodificar   de texto, urls, ISBN, correo electrÃ³nico, informaciÃ³n de contactos, eventos de calendario y mucho mÃ¡s con un solo clic utilizando la cÃ¡mara del smartphone, archivos de imagen, los cÃ³digos de lÃ­nea.<br>DespuÃ©s de decodificar serÃ¡s redirigido a los enlaces de pÃ¡gina web, revisiÃ³n de libros, multimedia e informaciones de calendario en lÃ­nea.<p>Usted puede crear su  CÃ³digos QR Â¿ y cÃ³digos de barras muy rÃ¡pido!<br> COMPARTIR  con tus amigos a travÃ©s de aplicaciones, redes sociales, correo electrÃ³nico, mensajes de texto, guardarlos para su uso posterior o impresiÃ³n.<p>Echa un vistazo a nuestra aplicaciÃ³n de imÃ¡genes y no dude en compartir esta aplicaciÃ³n con sus amigos.<br>Descargar esta aplicaciÃ³n y transformar tu smartphone Android o una tableta en una poderosa estaciÃ³n de lectura de cÃ³digos QR.<br>Visite nuestro catÃ¡logo  en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/T7VXz%26sa%3DD%26usg%3DAFQjCNFoDVG4cyThcxARSAF5LwtZTEDhtw&amp;sa=D&amp;usg=AFQjCNEd4vPP9QwRZgYp0evme6ZvvADK6g\" target=\"_blank\">http://goo.gl/T7VXz</a><p>CaracterÃ­sticas:<br>- Leer cÃ³digos QR y cÃ³digos de barras de<br>Â Â &gt; CÃMARA<br>Â Â &gt; ARCHIVOS DE IMAGEN<br>Â Â &gt; URLS<br>- Crea tu propia codificaciÃ³n CÃ“DIGOS QR:<br>Â Â &gt; DIRECCIONES DE CORREO ELECTRÃ“NICO<br>Â Â &gt; TelÃ©fonos<br>Â Â &gt; CONTACTOS INFORMACIONES<br>Â Â &gt; Calendario de Eventos<br>Â Â &gt; INFORMACIÃ“N GEOGRÃFICA<br>Â Â &gt; TEXTO SIMPLE<br>Â Â &gt; Favoritos<br>- Crea tu propio &quot;oldy&quot; cÃ³digos de barras (EAN8, EAN13, Code39, Code 128)<br>- Comparte tus cÃ³digos QR a travÃ©s de:<br>Â Â &gt; EMAIL<br>Â Â &gt; Mensajes de texto<br>Â Â &gt; Redes Sociales (Facebook, Twitter, Flipboard, Google Plus)<br>Â Â &gt; WIFI<br>Â Â &gt; BLUETOOTH<br>- AUTO-ARCHIVE cada cÃ³digo QR descifrado en una simple cronologÃ­a.<br>- Pasar directamente a direcciones web decodificados.<p>________________________<p>Idiomas de interfaz de usuario: InglÃ©s, EspaÃ±ol, Italiano.<br>________________________<p><br>CHANGELOG<p> Nueva versiÃ³n 1.4.2:<br>1) correcciÃ³n de errores principal para dispositivos Android 2.1 en la actividad resultado de la exploraciÃ³n;<br>2) resolviÃ³ accidente al azar en la historia;<br>3) la correcciÃ³n de errores menores.<p>Antigua versiÃ³n 1.4.1<br>1) Interfaz de usuario mejorada y la experiencia del usuario;<br>2) IntegraciÃ³n completa con ICS 4.x;<br>3) AÃ±adida la posibilidad de guardar contactos en la agenda;<br>4) Se agregÃ³ la opciÃ³n para guardar el resultado al portapapeles;<br>5) AÃ±adida la posibilidad de buscar a travÃ©s de la historia;<br>6) AÃ±adida la posibilidad de activar / desactivar la vibraciÃ³n;<br>7) AÃ±adida la posibilidad de activar / desactivar el sonido de escaneo se completo;<br>8) AÃ±adida la posibilidad de guardar los eventos de calendario directamente en su calendario;<br>9) AÃ±adida la posibilidad de cambiar el color del qr codificado.<br>______________________________<br>Antigua versiÃ³n 1.4:<br>1) la revoluciÃ³n de la interfaz de usuario (deslizar, etc);<br>2) Se ha aÃ±adido la funciÃ³n de decodificaciÃ³n de imÃ¡genes;<br>3) Se ha aÃ±adido la funciÃ³n para la descodificaciÃ³n de URL.<br>______________________________<p>Antigua versiÃ³n 1.3:<br>1) El soporte completo para el idioma InglÃ©s, espaÃ±ol e italiano;<br>2) nuevo estilo de interfaz de usuario;<br>3) aÃ±adir el reconocimiento automÃ¡tico del tipo del escaneado qr / cÃ³digo de barras;<br>4) aÃ±adir la redirecciÃ³n automÃ¡tica al contenido de la qr / cÃ³digo de barras cuando sea posible;<br>5) fija errores menores<br>______________________________<p>Antigua versiÃ³n 1.2.1:<br>1) Standalone funciÃ³n de exploraciÃ³n<br>2) mÃ¡s opciones para refinar su bÃºsqueda<br>3) posibilidad de codificar muchas informaciones como la direcciÃ³n, el nÃºmero telefÃ³nico, correo electrÃ³nico, URL, ubicaciÃ³n, posiciÃ³n actual, marcadores, eventos del calendario. usted puede compartir toda esta informaciÃ³n a travÃ©s de SMS, correo electrÃ³nico, redes sociales, DLNA, Picasa y otros servicios. <br>________________________</p></p></p></p></p></p></p></p></p></p></p>', '7', '1496812', '0', '0', '0', '2015-03-20 18:35:40', '2015-03-20 18:35:41', '0', '1', '0', '0', 'WB Development Team');
INSERT INTO `applications` VALUES ('at.theengine.android.gesturelauncher', 'Gesture Launcher', '4', '1.3', '3', 'With Gesture Launcher you can launch every application on your device by performing a gesture.<p>USE WIDGET TO START IT TO AVOID DELAY ON START!<p>Just define your own gestures for your most used apps and start them without having to search through the standard app launcher.<p>I wanted to add a widget with a GestureOverlay, but this is not possible, because app widgets do not support this control.<br>But there is a fast starter widget which starts the application a lot faster than a standard shortcut, because it preloads the application list.<p>Project Page: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://wordpress.the-engine.at/gesture-launcher/%26sa%3DD%26usg%3DAFQjCNHW6ccELllzlHA6iAaOs_QyHEwZuQ&amp;sa=D&amp;usg=AFQjCNHeup2wYFRwF8o9kqX2weMWGJC0YQ\" target=\"_blank\">http://wordpress.the-engine.at/gesture-launcher/</a></p></p></p></p>', '7', '64703', '0', '0', '0', '2015-03-20 18:34:47', '2015-03-20 18:34:47', '0', '1', '0', '0', 'Bruno Hautzenberger');
INSERT INTO `applications` VALUES ('az.mecid.appadmin', 'AppAdmin', '16', '1.2.8', '3', 'AppAdmin application manager.<p>Features:<br>* batch uninstall  <br>* batch backup<br>* batch install from apk<br>* batch system applications uninstall (need BusyBox, only for root users)<br>* batch move, show which apps can be moved on sd and move them (only for 2.2 and higher)<br>* export list of apps into html file with link on market<p>You can purchase AppAdmin from Market. <br>Just US$0.99 to purchase an Ad-free version.</p></p>', '3', '137621', '0', '0', '0', '2015-03-20 18:35:57', '2015-03-20 18:35:57', '0', '1', '0', '0', 'Mecid');
INSERT INTO `applications` VALUES ('blackdroid.anatomy', 'Human Anatomy', '3', '3.0(All Bugs Resolved)', '36', 'The Human Anatomy application is a very simple quick reference guide to Human Anatomy.<p>The Features that are offered in this application include:<p>â— TTS - Text To speech conversion for all those who hate reading.<br>â— Share - A way to Share the Content that you just found helpful.<br>â— Easy Navigation from Home Screen and to the Spotting Screens.<br>â— Wiki Link for Extra information on the topic you are reading.<br>â— Pinch to zoom to have a more clear picture.<p>It gives brief information on the following topics<p>â— Cardio Vascular System <br>â— Digestive system <br>â— Endocrine - Central Nervous <br>â— Endocrine - Reproductive <br>â— Endocrine - Alimentary <br>â— The Eye <br>â— Female Reproductive System <br>â— Lymphatic System <br>â— Male Reproductive System <br>â— Muscular System - Back <br>â— Muscular System - Front <br>â— Nervous System<br>â— Respiratory System <br>â— Skeletal System - Back <br>â— Skeletal System - Front <br>â— Urinary System<p>Go ahead and Enjoy these bits.<p>If you encounter any kind of bugs, feel free to report them at <a href=\"mailto:blackdroidinc@gmail.com\">blackdroidinc@gmail.com</a></p></p></p></p></p></p>', '8', '3575886', '0', '0', '0', '2015-03-20 18:38:15', '2015-03-20 18:38:15', '0', '1', '0', '0', 'Black Droid Inc.');
INSERT INTO `applications` VALUES ('com.acrodesign.acrobiblelite', 'AcroBible Lite', '312', '3.1.2', '18', 'AcroBible Lite is a Bible application that includes the entire text of the King James Version (KJV) Bible.  The lite version features touch navigation, bookmarks, keyword search, a subject index of commonly referenced verses, and copy to clipboard.  AcroBible is an off-line Bible (a network connection is not required).<p>This product is being discontinued, please download the full version &quot;Study Bible&quot; by AcroDesign Technologies for FREE.</p>', '4', '1404046', '0', '0', '0', '2015-03-20 18:35:47', '2015-03-20 18:35:47', '0', '1', '0', '0', 'AcroDesign Technologies');
INSERT INTO `applications` VALUES ('com.aircreek.filamente.lite', 'Filamente Lite', '119', '1.0.9', '20', 'Simple, intuitive way to interact with Microsoft SharePoint for Android users. Have full functionality for SharePoint activities at your fingertips while you&#39;re on the go.<p>Filamenteâ„¢ does not require any server side components. Simply add your SharePoint site with your SharePoint credentials to Filamente, and you are ready.<p>Content Management:<br>â€¢ Search and sort SharePoint data and change SharePoint views<br>â€¢ Calendar with month, week and day view<br>â€¢ Browse sites, subsites, document libraries and lists even when you do not have an internet connection<br>â€¢ Local data is protected via encryption&#39; (Full version only)<br>â€¢ Easy email of documents<p>Favorites:<br>â€¢ Boost productivity by making a SharePoint list and data as a Favorite<br>â€¢ Have an aggregated view of Favorite data from multiple SharePoint sites and subsites<p><br>See All Your Sites:<br>â€¢ Register multiple SharePoint sites and subsites<br>â€¢ Supports self-signed SSL certificates<br>â€¢ Supports SharePoint 2007, SharePoint 2010 and SharePoint 2013<br>â€¢ Supports Office 365<br>â€¢ Secure access over HTTPS with username and password<p>Buy full version of Filamente to be able to:<br>â€¢ Create, Open, Edit and Delete a SharePoint data<br>â€¢ Upload any photos, videos or documents to your SharePoint site<p>Filamente Enterprise is also available with custom branding and volume licensing (50+ users). The benefits of Filamente Enterprise include:<br>â€¢ Company branding<br>â€¢ Company specific customization<br>â€¢ Feature trimming<br>â€¢ Enterprise deployment assistance and support<p>Stay tuned, because we&#39;re always developing something new for Filamente and Filamente Lite.<p>== LEARN MORE ==<br>Homepage: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.filamente.com%26sa%3DD%26usg%3DAFQjCNE65IklIpQZFYSJTOyKLFHknfeo5Q&amp;sa=D&amp;usg=AFQjCNFFJ5m3SmCjjH8_h5hSo7LyIz1Szw\" target=\"_blank\">http://www.filamente.com</a><br>Twitter @Filamente<br>Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/pages/Filamente/152476454771614%26sa%3DD%26usg%3DAFQjCNEdl6EUH4bXJLHaSl3-i9tfrx9_Kw&amp;sa=D&amp;usg=AFQjCNGYp9c95B7ussfxeNeo6KvN8NtqPA\" target=\"_blank\">http://www.facebook.com/pages/Filamente/152476454771614</a> Feature request: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://aircreek.uservoice.com%26sa%3DD%26usg%3DAFQjCNHNcy2ZGcAuDfJgDj3BC-Y6EmWrFQ&amp;sa=D&amp;usg=AFQjCNEtHJFw5te9mm2hBw5cAF9MXTu3Vw\" target=\"_blank\">http://aircreek.uservoice.com</a></p></p></p></p></p></p></p></p>', '14', '11179157', '0', '0', '0', '2015-03-20 18:34:25', '2015-03-20 18:34:25', '0', '1', '0', '0', 'Aircreek, Inc.');
