obre la pÃ¡gina principal.<p>âœ” Actualizaciones mÃ¡s rÃ¡pidas.<p>âœ” Sin publicidad.</p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '7', '5391822', '0', '0', '0', '2015-03-20 18:34:30', '2015-03-20 18:34:30', '0', '1', '0', '0', 'Aldiko Limited');
INSERT INTO `applications` VALUES ('com.android.bartender', 'Bartender', '18', '1.5.4', '23', 'Bartender is your personal drink-making assistant.<p>Drinks can be easily viewed, rated, marked as favorite, filtered by title and searched through two different modes. New recipes can be submitted and shared.</p>', '4', '210430', '0', '0', '0', '2015-03-20 18:28:52', '2015-03-20 18:28:52', '0', '1', '0', '0', 'Magente Corporation');
INSERT INTO `applications` VALUES ('com.androidactivity.tetherWifi', 'tetherWifi', '8', '1.0.1', '4', 'This app only works with phones that have root/super user access. This app tethers your cell phone internet (3g, edge) connection to your PC. The connection between your phone and PC is over wifi. Visit the website before installing!<p>-MAC Filtering<br>-DHCP Settings<br>-Clients List<br>-change SSID<p>Contact me with any questions</p></p>', '', '550630', '0', '0', '0', '2015-03-20 18:36:11', '2015-03-20 18:36:11', '0', '1', '0', '0', 'moussa');
INSERT INTO `applications` VALUES ('com.androidandme.betterkeyboard.skins.ice', 'Ice', '50', '2.0', '6', 'Skin for Better Keyboard featuring a glossy white look with touches of blue for a slick, tech feel.<p>You must download app &quot;Better Keyboard&quot; to apply.<p>Designed by Clark Wimberly and Justin Shapcott.<p>v2.0 removed icon from app drawer</p></p></p>', '3', '28362', '0', '0', '0', '2015-03-20 18:36:45', '2015-03-20 18:36:45', '0', '1', '0', '0', 'Android and Me Labs');
INSERT INTO `applications` VALUES ('com.androidcan.fourInARow', '4 in a Row', '1', '2.0', '30', 'Play 4 in a Row against a friend or the challenging CPU player.<p>Connect four pieces before your opponent does.<p>Game features<br>- 8 difficulty levels<br>- One and two player mode<br>- Switch levels while you play<br>- Unlimited Undos<br>- High res (HD) graphics<br>- Optimized for phones, tablets, Google TV and Android TV<br>- Two color schemes<p>Free, with ads.<p>With downloading the game, you explicitly agree to the Terms of Usage set forth at: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.apptebo.com/game_tou.html%26sa%3DD%26usg%3DAFQjCNGo10nfFQEnP2R29rmM_6NOlW0u4w&amp;sa=D&amp;usg=AFQjCNFTUnGfhRJut203nELJiSw1k6sj2A\" target=\"_blank\">http://www.apptebo.com/game_tou.html</a></p></p></p></p>', '', '64599', '0', '0', '0', '2015-03-20 18:35:59', '2015-03-20 18:35:59', '0', '1', '0', '0', 'Tobias Eckert');
INSERT INTO `applications` VALUES ('com.antutu.powersaver', 'Battery Saver', '8', '1.3', '5', 'AnTuTu Battery Saver is a power saving for Android phone/pad. (need root)<p>To maintain normal for 2 days in order to know is truly your saving power of the software, you can set your sleep time, in order to better saving electricity.</p>', '4', '698623', '0', '0', '0', '2015-03-20 18:35:44', '2015-03-20 18:35:44', '0', '1', '0', '0', 'AnTuTu');
INSERT INTO `applications` VALUES ('com.ap.AppDock', 'Launcher Dock', '4', '3', '3', 'A Simple app dock WIDGET!!<p>* Docks up to 8 apps/contacts and a custom name.<br>* Longpress app icon and drag to move its location<br>* Tap center icon to reconfigure.<br>* Download icon packs and choose your own icon<p>If you have issues after 1.6 update - Uninstall and reinstall.<p>Coming soon Multi select apps.</p></p></p>', '3', '73161', '0', '0', '0', '2015-03-20 18:35:45', '2015-03-20 18:35:45', '0', '1', '0', '0', 'Bratag');
INSERT INTO `applications` VALUES ('com.app.inventorydroid', 'Inventory Droid', '206', '2.6', '32', 'Android&#39;s only full Inventory Management App.<br>Get a FREE PC Inventory Desk app at www.InventoryDroid.com<p>EMAIL ME ANY UPC BUGS OR CSV IMPORT ISSUES YOU MIGHT HAVE.<p>Visit InventoryDroid.com for a complete Inventory Droid features list, screenshots, demo video, and more. <p>Inventory Features:<br>-Scan Barcode for item info and photo<br>-Add Custom fields, field units, scannable fields<br>-CSV import/export/email<br>-Account Backup/Restore<br>-Save Photos, receipts on SD in special folders<br>-Support multiple accounts &amp; categories<br>-Loan reminder<br>-Inventory Asset Grid<br>-Shopping features<br>-move items between Inventory Accounts<p><br>***IMPORTANT*** <br>It is essential to backup all your accounts before any update. This will insure that you have backups in case an issue arises while doing the update. <p>RomiSys is NOT responsible to any loss of data due any issues occurring on the device or application for any reason whatsoever.<p>To backup your accounts, enter EACH account and press Menu-&gt;Settings-&gt;Import\\Export-&gt;Export to Backup (with Photos)<br>****************</p></p></p></p></p></p>', '3', '427293', '0', '0', '0', '2015-03-20 18:36:19', '2015-03-20 18:36:19', '0', '1', '0', '0', 'RomiSys');
INSERT INTO `applications` VALUES ('com.av.mac', 'Math Alarm Clock', '39', '2.5.1', '5', 'Two in one - Alarm and Bedside Clock<p>Optionally requires you solve math equation(s)(4 difficulty levels) to snooze/dismiss the alarm. Power naps. Many options: Snoozes before math, Number of problems, Multiple choice, Random Song Alarm, more.. 24 Options!!</p>', '2', '168044', '0', '0', '0', '2015-03-20 18:36:21', '2015-03-20 18:36:21', '0', '1', '0', '0', 'AV Productions');
INSERT INTO `applications` VALUES ('com.blogspot.imapp.imandroscale', 'Andro Ruler', '7', '1.6', '3', 'Integrate two most frequently used scale in our daily life, ruler and leveler<br>Pitch of ruler can be adjusted if ruler&#39;s pitch on screen is not accurate<p>Try to adjust it with a real scale. Put a scale attached by side of the device along with pitches on the screen. Then, press button which brings out adjustment buttons, change pitch of on screen ruler with left and right buttons.<p>Multi touch support<br>Show level of leveler in degree or graph<br>Inch and metric supported<br>Ruler&#39;s color can be changed<br>Fine tune measure with Track Ball <br>See blog for details<p>** ALL PERMISSIONS ARE USED ONLY FOR DISPLAYING ADS..</p></p></p>', '7', '428170', '0', '0', '0', '2015-03-20 18:38:15', '2015-03-20 18:38:15', '0', '1', '0', '0', 'INAPP');
INSERT INTO `applications` VALUES ('com.boatbrowser.license.key', 'Boat Browser License Key', '2497', '1.0', '4', '<b>40% OFF now!</b> <br>Boat Browser Pro License Key is used to unlock Pro features in Boat Browser (Attention: Not for tablet version and Mini version)... It has many Pro features: <br>1. Floating tab feature which will float on any app. <br>2. Removes the banner Ads in the bookmark page and the interstitial Ads when exit browser.<br>3. Supports the ability to delete ALL speed dial icons, including the preset icons.<br>4. Supports folders for speed dial icons.<br>5. Firefox bookmark sync support.<br>6. Support up to 32 tabs.<p>More advanced Pro features will be added. <p>The Pro License Key is an apk file, which should be download and installed. After it is installed, it works when you launch Boat Browser.<br>!!! Please DO NOT uninstall the license key apk, if you do, it may not work.<p>Boat Browser is a fast, smart and cool mobile browser.<br>If you&#39;re looking for a fast and powerful Android web browser, this is the best choice.<br>Boat Browser will bring you an amazing and premium web experience. It is fully customizable, you can easily change the button locations as you like, and you can install your favorite add-ons to make your browser even more powerful. With Boat Browser there is no limit to the way you can surf the Net. <br>Check for more via https://play.google.com/store/apps/details?id=com.boatbrowser.free<br>SUPPORT:<br>If you have any problem about it, please feel free to let us know.<br>Our Email: <a href=\"mailto:boatbrowser@gmail.com\">boatbrowser@gmail.com</a><br>Twitter - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/BoatBrowser%26sa%3DD%26usg%3DAFQjCNFjiKPJFuZevNph-mapwk0ZLIzCGw&amp;sa=D&amp;usg=AFQjCNEYgEKtzTZWc5rEdRGwyIYGa0i47Q\" target=\"_blank\">http://twitter.com/BoatBrowser</a><br>Facebook - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/boatmobile%26sa%3DD%26usg%3DAFQjCNFf5wsxhQCugOX-fUrAO6V027RrzA&amp;sa=D&amp;usg=AFQjCNE2KJgNhgLZU1fDNNsW8RSH3Jrwjw\" target=\"_blank\">http://www.facebook.com/boatmobile</a><br>Website - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.boatmob.com/%26sa%3DD%26usg%3DAFQjCNELljCnhrUXSxOqJkOKkOw05PEfqQ&amp;sa=D&amp;usg=AFQjCNFtJ218Dp2s-8Sl5sebPt9eTwg2uw\" target=\"_blank\">http://www.boatmob.com/</a></p></p></p>', '7', '34992', '0', '0', '0', '2015-03-20 18:34:46', '2015-03-20 18:34:46', '0', '1', '0', '0', 'Boat Browser Addon');
INSERT INTO `applications` VALUES ('com.bravogamestudios.touchracingnitro', 'Touch Racing Nitro', '123', '1.2.3', '19', 'OFERTA ESPECIAL!!! <p>&quot;Touch Racing Nitro&quot; es un juego de carreras como no hay otro. Los controles, 100% diseÃ±ados para una pantalla tÃ¡ctil, te permiten conducir, derrapar, frenar, acelerar y lanzar nitros que te harÃ¡n volar por encima de tus contrincantes al toque de tu dedo! Hemos dejado atrÃ¡s el control basado en cruceta virtual y en vez de eso tus dedos se convierten en el acelerador, freno, volante y lanzador de nitros. El vehÃ­culo reacciona a la posiciÃ³n y movimientos de tus dedos. Nunca un juego de carreras ha tenido una experiencia de juego tan intuitiva! <br> <br> ENTORNOS DE CARRERA Y TORNEO DIFERENTES Demuestra tus habilidades como piloto en la Copa de pista cubierta. Domina &quot;Monster&quot; 4x4 en la copa Off-Road, o lleva tu super-coche al lÃ­mite en la copa Supertrax!<p>HASTA 12 VEHÃCULOS DIFERENTES Una gran variedad de increÃ­bles bÃ³lidos a desbloquear. Incluye Buggies, 4x4&#39;s, Monster Trucks y Super Cars.<p> HASTA 18 CIRCUITOS DESAFIANTES Una gran variedad de circuitos a desbloquear que requerirÃ¡n diferentes estilos de conducciÃ³n y diferentes habilidades en el manejo de distintos tipos de vehÃ­culos.<p> SORPRENDENTES GRÃFICOS 3D CÃ¡maras que barren todos los Ã¡ngulos del circuito y todo tipo de impactos realistas te traen una trepidante experiencia de juego<p> 2 MODOS DE JUEGO, Torneo a 6 carreras o Contra-reloj en la que te medirÃ¡s contra el reloj y contra tu propio &quot;fantasma&quot;, que harÃ¡ que te pongan al lÃ­mite y te conviertas en un experto!<br> <br>Conoce las novedades de Bravo Games: <br>BÃºscanos en Facebook: bravogames <br>SÃ­guenos en Twitter: @Bravo_Games <br>www.bravogames.com</p></p></p></p></p>', '4', '15460814', '0', '0', '0', '2015-03-20 18:38:13', '2015-03-20 18:38:13', '0', '1', '0', '0', 'Bravo Game Studios');
INSERT INTO `applications` VALUES ('com.cdroid.dominoes', 'Dominoes', '30', '1.0.12', '29', '&quot;Dominoes&quot; es un juego de dominÃ³ tanto para un jugador como para varios jugadores.<p>Tu objetivo es hacer coincidir las piezas con el mismo nÃºmero de puntos y conseguir la mÃ¡xima puntuaciÃ³n. Â¡Compite contra un mÃ¡ximo de 3 oponentes en este clÃ¡sico juego!<p># Modos de juego del dominÃ³<br>- Muggins, Todos los cincos: Consigue todos los cincos<br>- Block: Juega tus fichas y gana puntos teniendo el menor nÃºmero de fichas posible al acabar la partida<br>- Draw: Igual que block, pero dibujando al quedarte bloqueado<p>- Un jugador contra la mÃ¡quina o contra jugadores locales<br>- Multijugador (online) con chat, puntuaciones y perfiles</p></p></p>', '7', '1323082', '0', '0', '0', '2015-03-20 18:38:17', '2015-03-20 18:38:17', '0', '1', '0', '0', 'Carl Hopf');
INSERT INTO `applications` VALUES ('com.CharSoftware.GPSSpeedometer', 'GPS Speedo', '4', '2.1', '3', '*FIXED RANDOM SPEEDS BUG*<p>The original Speedometer app. GPS Speedo uses the builtin GPS to show your current, max, and average speed, direction, and distance travelled. Works as a temporary fix for a broken car speedo, shows how far your run was, or records your max speed on the ski slope.</p>', '2', '87915', '0', '0', '0', '2015-03-20 18:34:49', '2015-03-20 18:34:49', '0', '1', '0', '0', 'Char Software, inc.');
INSERT INTO `applications` VALUES ('com.chartcross.gpstestplus', 'GPS Test Plus', '20', '1.1.9', '3', 'All the features of GPS Test plus:-<br>â˜… <b>WAYPOINT NAVIGATION</b><br>â˜… <b>HEAD UP DISPLAY</b><br>â˜… <b>DIGITAL FONTS (Great in the car)</b><p>Now shows symbols for <b>GLONASS</b> satellites <p>The GPS Test Plus app for Android is a utility that shows GPS information read from your phones internal GPS. Will support GLONASS phones.<p>The navigation functions can replace your &#39;Car Finder&#39; app and also be used for Geocaching. It records the last twelve saved locations, so you can navigate a simple route as well.<p>If you like this app, please like GPS Test on Facebook: -<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/GpsTest%26sa%3DD%26usg%3DAFQjCNGMtNTGyoCRN4wWmufzKwdprPRhrA&amp;sa=D&amp;usg=AFQjCNEoDqxShyaEuEtvtF4yB_lSGNqGQg\" target=\"_blank\">http://www.facebook.com/GpsTest</a><p>GPS Test Plus has five screens full of information: -<p>1) GPS signal (SNR) bar chart, showing the signal strength for each satellite, as well as the accuracy and status of the GPS.<p>2) Satellite positions in the sky (skyview), shown on a rotating compass.<p>3) Your current location on the earth shown as text and on a world map. The current position of the sun and the day/night transition curve is also shown.<p>4) Your current speed, heading and altitude shown as text or as dials.<p>5) The current time read from the GPS and the local time in your current timezone, as well as the sunrise and sunset times at your location.<p>Useful for navigation or geocaching. <p>Supported Coordinate Grids:-<br>OSGB, UTM, MGRS, USNG, CH1903, Maidenhead.<p>Supported Datums:-<br>WGS84, NAD83, NAD27, ED50, AGD66, AGD84, SAD69<p>All the features of GPS Test, plus:-<p>* Speedometer, Altimeter and Compass dials.<br>* Seven segment display font.<br>* Dot matrix display font.<br>* HUD display mode for windscreens.<br>(The display is mirrored so that it shows the right way round when the phone is placed on a car&#39;s dash and the reflection is viewed in the windscreen).<br>* Share location.<p>The app has several colour schemes, which could be used to match other instrumentation, used along side the app. It has a &quot;night mode&quot; colour scheme as well.<p>Works on Honeycomb O/S and large screen tablets.<p>Blog for GPSTest <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://gpstestapp.blogspot.com/%26sa%3DD%26usg%3DAFQjCNFeFe984JLgHnxzNQVw_9RBgMKD1g&amp;sa=D&amp;usg=AFQjCNH954xmDq64kEgnBZ2MoGXGNjkfnA\" target=\"_blank\">http://gpstestapp.blogspot.com/</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '398449', '0', '0', '0', '2015-03-20 18:35:35', '2015-03-20 18:35:35', '0', '1', '0', '0', 'Chartcross Limited');
INSERT INTO `applications` VALUES ('com.chase.sig.android', 'Chase', '36', '3.17', '33', 'Do your banking right from your Androidâ„¢ device <p>You can manage your accounts, make deposits, find ATMs and more. <p>Now itâ€™s easy to bank 24/7, right from your Androidâ„¢ device. To start, just enroll in Chase Online(SM).<p>To view the Chase Mobile app in Spanish language, please ensure your Androidâ„¢ deviceâ€™s language setting is set to Spanish (AsegÃºrate de que tu aparato Androidâ„¢ estÃ© configurado en el idioma espaÃ±ol)<p>MONITOR YOUR ACCOUNT<br>â€¢ View account balances and transaction history<br>â€¢ View your credit and debit card rewards status<p>PERFORM TRANSACTIONS<br>â€¢ Pay bills and credit cards<br>â€¢ Transfer money between Chase accounts<br>â€¢ Deposit checks with Chase QuickDeposit(SM)<br>â€¢ Send and request money with Chase QuickPay(SM)<br>â€¢ Send wire transfers<br>â€¢ Make changes to pending transactions<p>CONTACT CHASE<br>â€¢ Find the nearest Chase branches and ATMs<br>â€¢ Speak with a customer service representative<p>MANAGE AND RECEIVE THE FOLLOWING ACCOUNT ALERTS THROUGH THE CHASE MOBILE APP<br>â€¢ Deposits<br>â€¢ Account balances <br>â€¢ ACH transfers <p>MANAGE YOUR CHASE CREDIT CARD<br>â€¢ View your credit card balance and activity<br>â€¢ Make payments<br>â€¢ View Ultimate RewardsÂ® information <p>Notes on Permissions:<br>â€¢ Location permissions are needed to determine your current location in order to find Chase bank branches and ATMs near you<br>â€¢ Read Contact permissions are needed to access your contacts to send money via Chase QuickPay(SM)<br>â€¢ Camera permissions are needed to deposit checks via Chase QuickDeposit(SM)<br>â€¢ USB storage permissions are needed to view file attachments<p>Disclosure:<br>Some features are available for eligible customers and accounts only.<p>There is no charge from Chase, but message and data rates may apply. Such charges include those from your communications service provider. Delivery of account alerts may be delayed for various reasons, including service outages affecting your mobile device, wireless or internet provider; technology failures; and system capacity limitations. Any time you review your balance, keep in mind it may not reflect all transactions including recent debit card transactions or checks you have written. A qualifying Chase account is required to transfer funds via text. Account alerts are not available for Chase Basic Checking(SM) accounts.<p><br>Android is a registered trademark of Google, Inc.</p></p></p></p></p></p></p></p></p></p></p></p>', '8', '2120393', '0', '0', '0', '2015-03-20 18:36:38', '2015-03-20 18:36:38', '0', '1', '0', '0', 'JPMorgan Chase');
INSERT INTO `applications` VALUES ('com.cityjams.calculators', 'Percent Calculator', '10', '1.9', '3', '1. Calculate Percents &amp; Percentages<br>2. Percent Discounts (sale price)<br>3. Percent Markups (increase by)<br>4. Percent Margin (selling price)<br>5. Calculate Tips.<br>6. Percentage Difference (Change)<br>7. Percentage (what % of) i.e. x is what percentage of y<p>Tip:<br>Enter any two values and the third is computed e.g. [23]% of [x] = 115. X will be computed (20).<br>Customize background colors.</p>', '3', '79530', '0', '0', '0', '2015-03-20 18:35:46', '2015-03-20 18:35:46', '0', '1', '0', '0', 'CityJams');
INSERT INTO `applications` VALUES ('com.colapps.reminder.license', 'COL Reminder Donate', '1', '1.0', '3', '<b>ATTENTION:<br>You have to activate it in COL Reminder after installation!<br>Tap on the lock symbol in the action bar at the top!</b><p><br>COL Reminder Donate is only a key to extend COL Reminder with great features.<p>You will support further development!<p>Download only if you have COL Reminder installed from Android Market.<p><b>Without</b> COL Reminder installed, this application does nothing!<p><b>Important Note:<br>You need to KEEP COL Reminder donate installed, this application just extends COL Reminder extra features and will not pollute your phone!</b></p></p></p></p></p>', '3', '39102', '0', '0', '0', '2015-03-20 18:33:31', '2015-03-20 18:33:31', '0', '1', '0', '0', 'COLapps');
INSERT INTO `applications` VALUES ('com.com2us.sliceit', 'Slice It!', '22', '1.8.3', '17', 'â˜…â˜…Winner of the 2011 Best App Ever Awards - Casual Game<p>ONCE YOU SLICE, YOU CAN&#39;T STOP SLICING!<br>Silver AWARD Winner - Pocket Gamer<p>This app does not support Android 5.0 Lollipop.<br>The app will be updated to support Lollipop in the near future. Sorry for the trouble!<br>\\<br>â˜…â˜…â˜…This game supports English, Deutsch, franÃ§ais, EspaÃ±ol, Italiano, and æ—¥æœ¬èªžâ˜…â˜…â˜…<p>Fast Fun with a Geometric Flair! <br>&quot;Slice It!&quot; is all about slicing shapes into fragments that are equal in size.<p>Sound easy? It may start out that way, but soon you&#39;ll be cutting into fragments that will puzzle you like never before. <br>Brainteasing puzzles: over 200 Basic Stages and a five-star rating system so you can play until you get it right!<p>â˜… â˜… â˜… â˜… â˜…<p>New time attack mode, â€œSlice it! QUICK!â€<br>Try to slice as many, as accurate, and as fast as you can in 1 minute! Also, compete with friends to get higher rankings. <p>â˜… â˜… â˜… â˜… â˜…<p>200 STAGESâ€¦ and growing! <br>Each level is a new shape, and each stage has increasingly difficult fragmentation levels.<p>In the most advanced stages, new obstacles, like line-refracting mirrors, make Slice It! the hardest puzzler out there.<p>Get a perfect score on any level and earn a Hint! <br>If you just can&#39;t cut it with an obstacle, all is not lost: use a Hint!<br>You can get additional Hints, when you tap AD.<p>Itâ€™s time to start thinking and slicing!<p>â˜… â˜… â˜… â˜… â˜…<p>WHAT THE PRESS SAYS ABOUT SLICE IT!<p>&quot;...if you&#39;re looking for a new type of puzzle game with a charming style that&#39;s easy to pick up and play, take a look at Slice It!&quot; - TouchArcade.com<p>&quot;It may look like a toy, but youâ€™d have to be a genius not to get stuck at some point while playing this clever, challenging game.&quot; - PocketGamer.co.uk<p>&quot;Simple in its shape, Slice It brings us along this game which is unpretentious but terribly addictive.&quot; - Hitphone.fr</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '8', '11762623', '0', '0', '0', '2015-03-20 18:33:35', '2015-03-20 18:33:35', '0', '1', '0', '0', 'Com2uS USA');
