INSERT INTO `applications` VALUES ('com.contapps.android', 'Contacts+', '228', '3.23.8', '4', 'Contacts+ es la aplicaciÃ³n lÃ­der de discado y directorio de telÃ©fono del mundo, impulsada con mensajes, identificaciÃ³n de discador, SMS / bloqueo de discador y reserva de contactos - todo en un sÃ³lo lugar.<p>Conocido y amado por millones en el mundo, Contacts Plus Team - Reconocido como â€˜desarrollador topâ€™ por Google play, te trae Contacts+ .<p>CONECTATE CON TUS AMIGOS, BLOQUEA A LOS SPAMMERS.<br>Contacts+ es una verdadera aplicaciÃ³n todo-en-uno. Discador, SMS e historial de llamadas que hacen que sea fÃ¡cil conectarte con tus amigos y bloquear a gente no deseada o a telemarketers por medio de su identificaciÃ³n y bloqueo. AsÃ­ sea un sms o una llamada - siempre estarÃ¡s en control de con quiÃ©n te conectas.<p><br>PROTEGE A TUS CONTACTOS<br>AdemÃ¡s de bloquear las llamadas de spam y sms , Contacts + te protege con un servicio de backup y sincronizaciÃ³n integrada - haz fÃ¡cilmente copias de seguridad de tus contactos , mensajes y registros de llamadas para que nunca los pierdas de nuevo.<p>HAZLA TUYA<br>Por encima de todo , Contacts+ es una aplicaciÃ³n privada y personalizable. Tus contactos son tuyos y nunca se comparten con nadie. Puedes personalizar Contacts+ seleccionando quÃ© caracterÃ­sticas deseas usar, cambiando los temas y hacer que satisfaga tus necesidades.<p>CaracterÃ­sticas<br>+ IdentificaciÃ³n de quien llama<br>+ Bloqueo de llamadas y SMS<br>+ BackUp de llamadas, SMS e historial de llamadas<br>+ AcciÃ³n rÃ¡pida de llamadas/SMS<br>+ OrganizaciÃ³n inteligente<br>+ 5 temas<br>+ Lista de vista de contactos<br>+ Whatsapp, Facebook, Twitter, Linkedin y Foursquare integrados en tus contactos<br>+ SincronizaciÃ³n de Fotos y cumpleaÃ±os con Facebook<br>+ Combina contactos duplicados<br>+ Widget de contactos personalizables<br>+ BÃºsqueda rÃ¡pida de discador<br>+ Apoyo de Android Wear<p>CONTACTANOS:<br>Nos encantarÃ­a saber lo que piensas:<br><a href=\"mailto:support@contactspls.com\">support@contactspls.com</a><br>www.contactspls.com/faq<p>* Contacts+ usa data/WiFi para enviar SMS gratis entre usuarios de Contacts+ y para identificar y bloquear a spammers. Cargos de la compaÃ±Ã­a telefÃ³nica pueden aplicar.</p></p></p></p></p></p></p>', '7', '8955730', '0', '0', '0', '2015-03-20 18:35:39', '2015-03-20 18:35:39', '0', '1', '0', '0', 'Contacts Plus team');
INSERT INTO `applications` VALUES ('com.cpuid.cpu_z', 'CPU-Z', '7', '1.07', '3', 'Android version of the popular CPU identification tool for PC/Windows., CPU-Z is a free application that reports information about your device.<p>- SoC (System On Chip) name, architecture, clock speed for each core ;<br>- System information : device brand &amp; model, screen resolution, RAM, storage.;<br>- Battery information : level, status, temperature, capacity ;<br>- Sensors.<p>Requirements :<br>- Android 2.2 and above (version 1.03 and +)<p>Permissions :<br>- INTERNET permission is required for the online validation (see notes below for more dÃ©tails about the validation process) <p>Notes : <br>Online Validation (version 1.04 and +)<br>The validation allows to store the hardware specification of your Android device in a database. After the validation, the program opens your validation URL into your current internet browser. If you enter your e-mail address (optional), an e-mail with your validation link will be sent to you as a reminder.<p>Settings screen and debug (version 1.03 and +)<br>If CPU-Z closes abnormally (in case of bug), the settings screen will appear at the next run. You can use that screen to remove the main detection features of the application, and make it run.<p>Bug report<br>In case of bug, please open the application menu and choose &quot;Send Debug Infos&quot; to send a report by email<p>FAQ and troubleshooting<br>You can visit the FAQ at that address : <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.cpuid.com/softwares/cpu-z-android.html%2523faq%26sa%3DD%26usg%3DAFQjCNHDmUjuLTmmiivtAJSd3Zf2feZrqg&amp;sa=D&amp;usg=AFQjCNHV-CtXG36JrEbGFMg5Q2M8ZyElqQ\" target=\"_blank\">http://www.cpuid.com/softwares/cpu-z-android.html#faq</a></p></p></p></p></p></p></p>', '8', '815711', '0', '0', '0', '2015-03-20 18:35:49', '2015-03-20 18:35:49', '0', '1', '0', '0', 'CPUID');
