INSERT INTO `applications` VALUES ('com.disney.WheresMyHoliday_GOO', 'Valentine?', '2', '1.1.0', '17', 'WHEREâ€™S MY VALENTINE? CONTIENE 12 NIVELES EXCLUSIVOS DEL DÃA DE SAN VALENTÃN PROTAGONIZADOS POR SWAMPY Y PERRY!<p>Swampy y Perry necesitan un poco de amor: Â¿todo listo para afrontar el desafÃ­o?<p>HISTORIA DE SWAMPY<br>Swampy es un pelÃ­n diferente a los demÃ¡s lagartos de las alcantarillas porque le encanta ducharse. Abre un camino entre la suciedad para guiar el agua hasta la ducha de Swampy en estos 6 trepidantes niveles, pero ten cuidado con las algas, los trucos y las trampas.<p>HISTORIA DE PERRY<br>En los niveles de Perry, utiliza el agua en todos sus estados (hielo, vapor y lÃ­quido) para resolver los puzles y ayudar asÃ­ al Agente P a llegar al cuartel general. Â¡Hasta los superdetectives necesitan ayuda!<p>Â¡PARA DISFRUTAR DE UNA EXPERIENCIA SIN PUBLICIDAD Y CON MÃS NIVELES EXCLUSIVOS, HAZTE HOY MISMO CON LAS VERSIONES COMPLETAS DE Â¿DÃ“NDE ESTÃ MI AGUA? Y Â¿DÃ“NDE ESTÃ MI PERRY?!<p>Â¿DÃ“NDE ESTÃ MI AGUA?<p>â€¢ Ahora con mÃ¡s de 250 niveles con mucha agua<br>â€¢ Para resolver el puzle, haz uso de ventiladores, globos de agua, agua tÃ³xica, interruptores, bombas y algas<br>â€¢ Conoce a los amigos de Swampy, incluidos Cranky y el Pato Misterioso<p>Â¿DÃ“NDE ESTÃ MI PERRY?: mÃ¡s de 100 retos de espionaje, Â¡y vendrÃ¡n muchos mÃ¡s!<p>El malvado Dr. Doofenshmirtz ha colocado todo tipo de lÃ¡seres en las alcantarillas. TendrÃ¡s que utilizarlos para cambiar el estado del agua y hacer funcionar los conductos de transportaciÃ³n del Agente P.<p>â€¢ MÃ¡s de 120 niveles de espionaje con mogollÃ³n de -izadores<br>â€¢ Consigue todos los expedientes ocultos y desbloquea niveles extra<br>â€¢ Prueba los nuevos niveles del Dr. Doofenshmirtz, en el que aparece el nuevo subalternizador<p>Â¡Visita www.facebook.com/WheresMyWater para conseguir pistas, consejos, trucos y mÃ¡s material confidencial!<p>Condiciones de Uso <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://disneytermsofuse.com/spanish/%26sa%3DD%26usg%3DAFQjCNHHew9OVVWYvVBykHEuHt0KhphEZQ&amp;sa=D&amp;usg=AFQjCNHKmKU3XuMCUsQemYHCejUVdw4gyQ\" target=\"_blank\">http://disneytermsofuse.com/spanish/</a></p></p></p></p></p></p></p></p></p></p></p>', '7', '43052591', '0', '0', '0', '2015-03-20 18:38:02', '2015-03-20 18:38:02', '0', '1', '0', '0', 'Disney');
INSERT INTO `applications` VALUES ('com.distdevs.deadrunner', 'Dead Runner', '4', '1.3', '17', 'Voted #1 in Mashable&#39;s &quot;The 10 Most Beautiful Mobile Games&quot;! <p>You wake up in a dark forest, surrounded by the sounds of the wailing souls. The howling wind is delivering a chilling message of evil which is drawing closer by the second. The cold whispers of the forgotten souls tell you to run as far as you can, as fast as you can before itâ€™s too late.</p>', '4', '2518210', '0', '0', '0', '2015-03-20 18:35:58', '2015-03-20 18:35:58', '0', '1', '0', '0', 'Distinctive Wireless Inc.');
