INSERT INTO `applications` VALUES ('com.doubledragonbatii.Acva', 'Aquarium live wallpaper', '6', '1.5', '10', 'Acuario de pantalla en vivo con peces animados y burbujas de aire.<br>En la animaciÃ³n de fondo es de alta calidad, la creaciÃ³n de<br>peces muy realistas flotando sobre un fondo de coral del mar.', '7', '9835177', '0', '0', '0', '2015-03-20 18:38:11', '2015-03-20 18:38:11', '0', '1', '0', '0', 'DoubleDragon');
INSERT INTO `applications` VALUES ('com.dvidearts.crusadeofdestiny', 'CrusadeOfDestiny', '2', '1.4.5', '11', 'First ever full true scale 3D RPG for Android!<br>In a time of magic and dragons, become the hero you were meant to be and embark on the crusade of your destiny. Everything you expect in a solid action adventure RPG delivered in stunning 3D. Prepare To Quest!<p>* The First of it&#39;s kind to introduce the innovative easy use multi-touch control scheme for touch screen mobile devices that allow full 3D freedom of movement plus 360 degree camera panning.<br>* XPERIA PLAY Optimized [PlayStation Phone support].<br>* 3 trainable skill lines. Become a better warrior, archer or mage. Some abilities available only to high trained skill lines.<br>* Countless hours of gameplay.<br>* 360 degree swimming! Go fishing for food! Even ride horses!<br>* Detailed side quests.<br>* 3D sound effect positioning.<br>* Challenging bosses to defeat.<br>* In-game cycles of real night and day on a readable 24 hour based time system. Some events based on night and day.<br>* Multiple damage types including slashing, blunt, piercing, fire, ice, and energy within a unique combat resist system. Certain creatures are more resistant or vulnerable to certain attacks.<br>* High quality sound effects and original music soundtracks each with individual volume controls.<br>* Multiple lands and caverns to explore with many secrets to uncover.<br>* Single target and area effect skills available for both melee and magic lines.<br>* Easy to learn combat system with auto-face targeting.<br>* Balanced economy system. Visit shops. Buy and sell items.<br>* Right and left handed joystick and controls option.<br>* In-game help tutorial. Go to Inventory - Options - Help for more instructions.<br>* Customizable hot keys. Arrange skills in any order.<br>* 3 game slots to save multiple player&#39;s adventures.<br>* Large variety of mystical creatures<br>* Multiple languages: English, French, German, Spanish, Italian, Polish and Korean.</p>', '5', '14006933', '0', '0', '0', '2015-03-20 18:33:35', '2015-03-20 18:33:35', '0', '1', '0', '0', 'DVide Arts Incorporated');
INSERT INTO `applications` VALUES ('com.dynamixsoftware.printershare.premium', 'PrinterShare Premium Key', '3', '1.2', '20', 'This key unlocks premium features of free PrinterShare application. It cannot be used on its own! If you haven&#39;t done so already, please install main free PrinterShare app and print test page before purchasing this key.<p>With PrinterShare Mobile Print you can instantly print Office documents, bills and invoices (Word, Excel, PowerPoint, PDF, text files and more) directly from your tablet or phone (from internal memory, SD card or cloud source such as Google Drive / Google Docs) to a printer right next to you or anywhere in the world!<p>You can also print emails from Gmail, print photos and images (JPG, PNG, GIF), print contacts, agenda, sms/mms, call log, web pages (HTML) and other digital content. You may configure many print options including paper size, page orientation, number of copies, page range, one- or two-sided printing (duplex mode), print quality (resolution), printout mode (color or monochrome), output tray and more.<p>Premium Features:<br>* Unlimited Nearby direct printing via Wi-Fi, Bluetooth and USB without PC;<br>* Unlimited Remote printing. The receiving end (Windows or Mac) would not have to buy pages or subscribe.<br>* No advertisements<p>PrinterShare are supporting a wide variety of HP, Epson, Canon, Brother, Samsung, Kodak, Dell, Lexmark and other printers including legacy networkable.<p>Have a good print!</p></p></p></p></p>', '3', '9210', '0', '0', '0', '2015-03-20 18:35:45', '2015-03-20 18:35:45', '0', '1', '0', '0', 'Mobile Dynamix');
INSERT INTO `applications` VALUES ('com.ea.games.r3_row', 'Real Racing 3', '2200', '2.2.0', '19', 'Real Racing 3 es una reconocida franquicia que reinventa los juegos portÃ¡tiles de carreras: hay que vivirlo en persona.<p>Cuenta con gran variedad de circuitos con licencia, una parrilla de 22 pilotos y mÃ¡s de 100 vehÃ­culos reproducidos hasta el Ãºltimo detalle de fabricantes como Ferrari, Porsche, Chevrolet, Lamborghini, Mercedes-Benz, Bugatti y Audi. Los marcadores sociales, las contrarrelojes, los retos contra fantasmas y la tecnologÃ­a Time Shifted Multiplayerâ„¢ (TSM) permiten competir con quien quieras donde quieras.<p>Se ofrecen compras integradas en la aplicaciÃ³n. Se puede desactivar esta funciÃ³n en los ajustes de tu dispositivo.<p>** El juego requiere muchos recursos e incluye imÃ¡genes de la mÃ¡xima calidad. Se necesita al menos 1,5 GB de espacio libre en tu dispositivo. **<p>COCHES REALES<br>Conduce mÃ¡s de 100 coches reproducidos con todo detalle de fabricantes legendarios como Ford, Aston Martin, McLaren, Koenigsegg y Pagani. Pon a prueba tus habilidades en una parrilla para 22 coches en la experiencia competitiva mÃ¡s Ã©pica jamÃ¡s vista en un dispositivo mÃ³vil.<p>CIRCUITOS REALES<br>Quema rueda en la selecciÃ³n de 12 circuitos reales con mÃºltiples configuraciones en los rincones mÃ¡s selectos del mundo: Silverstone, Hockenheimring, Circuit des 24 heures du Mans, DubÃ¡i Autodrome y muchos mÃ¡s.<p>GENTE REAL<br>EnfrÃ©ntate a tus amigos y adversarios en el multijugador global para 8 jugadores para todas las plataformas, en tiempo real y con rebufo. Y si no estÃ¡n conectados, compite con sus versiones controladas por IA e interactivas en Time-Shifted Multiplayerâ„¢.<p>MÃS OPCIONES QUE NUNCA<br>Compite en mÃ¡s de 2000 pruebas: carreras de copa, eliminatorias, desafÃ­os de resistencia y carreras de aceleraciÃ³n. Personaliza tu coche con una gran variedad de pinturas, vinilos y llantas. Vive la acciÃ³n desde diversas cÃ¡maras, cambia el HUD y ajusta los controles como quieras.<p>UNA EXPERIENCIA COMPETITIVA DE LUJO<br>Gracias al nuevo y notable motor Mintâ„¢ 3, Real Racing 3 reproduce los detalles de los daÃ±os de tu coche, la imagen de los espejos retrovisores completamente funcionales y los reflejos dinÃ¡micos para vivir una experiencia en alta definiciÃ³n. Es un juego de nueva generaciÃ³n lleno de matices, con diversas plataformas sociales y unan gran comunidad de competidores. Real Racing 3 sube el listÃ³n con cada actualizaciÃ³n.<p>Bienvenido a la mejor experiencia automovilÃ­stica portÃ¡til para todos.<br>___<br>Real Racing 3 aumenta la lista de dispositivos compatibles constantemente. Consulta las novedades aquÃ­ &gt;&gt; bit.ly/RR3DeviceSupport<p>TÃ©rminos de servicio: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/terms-of-service%26sa%3DD%26usg%3DAFQjCNEmDOJlNgFrLyebXgdth3qsCaJA1Q&amp;sa=D&amp;usg=AFQjCNHg74TpJRtGAFHkvQauj4fQ5mLNFg\" target=\"_blank\">http://www.ea.com/terms-of-service</a><br>PolÃ­tica de privacidad y de cookies: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.ea.com/privacy-policy%26sa%3DD%26usg%3DAFQjCNE97o3wXT0SW8AoyOZ4SJsE1841xQ&amp;sa=D&amp;usg=AFQjCNEnvrPp6toK-geij6xEvn1BxUkeqw\" target=\"_blank\">http://www.ea.com/privacy-policy</a><br>Licencia de usuario del juego: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tos.ea.com/legalapp/mobileeula/US/en/GM/%26sa%3DD%26usg%3DAFQjCNFhlC0H5c0rrXtWi0odNbp4j4NP8g&amp;sa=D&amp;usg=AFQjCNGY3xFWBQjVGrH4sprQu2TEVn0H0g\" target=\"_blank\">http://tos.ea.com/legalapp/mobileeula/US/en/GM/</a><br>Visita <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://help.ea.com/%26sa%3DD%26usg%3DAFQjCNGJtFhhKZ2izQ3xjgxZdv8uhc6evg&amp;sa=D&amp;usg=AFQjCNFylF1MBXik8QoY8aPQXY0vPrMSyg\" target=\"_blank\">https://help.ea.com/</a> si necesitas ayuda o tienes alguna pregunta.<p>EA puede retirar caracterÃ­sticas y servicios en lÃ­nea 30 dÃ­as