INSERT INTO `applications` VALUES ('com.edwardkim.android.carlocatorfull', 'Car Locator', '34', '2.93', '37', 'As seen on the Verizon commercial, Techcrunch, Wired Magazine and more. 1st place winner in Verizon&#39;s Power Your App Contest!<p>Save your location when you park and Car Locator will help you find your car<p>-Radar/Map/Split-Screen view<br>-Parking timer<br>-Beam your current or saved location to another phone/email<br>-Home screen widget for quick save<br>-Shake to save<br>-Double tap on map to save <br>-Save notes and photos<br>-Location history<br>-Location favorites<br>-Manual coordinate entry<br>-View current and car coordinates (great for geocaching)<br>-Driving directions<br>-Sonar sound<br>-Customizable background images<br>-Radar visualizations<br>-Live wallpaper always points to your car<br>-Customizable radar visualization<br>-Automatically save location on bluetooth disconnect or car undock<br>-Automatically save, sync, and import location with your Evernote account.<p>Permissions explanation: <p>READ_CONTACTS - Car Locator has the ability to &quot;beam&quot; your location to another user who has Car Locator installed. You can select the recipient of your location by using your contact list<p>SEND_SMS/RECEIVE_SMS - The &quot;beam&quot; communication is done through SMS. This is why the SMS permission is required. No SMS&#39;s are sent without your explicit action. <p>Tags: Find Car, Car Locator, Car Finder</p></p></p></p></p></p>', '3', '297971', '0', '0', '0', '2015-03-20 18:37:10', '2015-03-20 18:37:10', '0', '1', '0', '0', 'Edward Kim');
INSERT INTO `applications` VALUES ('com.eig.zombie', 'I Love Zombies FREE', '1', '1.0', '14', 'I love zombies! - Fast action shooter with really scary zombies, really pretty girls and handsome boys! Dodge style graphics and a lot of fun!<p>The current version contains 8 full of zombies scenarios and 8 deadly weapons.<p>Thanks for your all comments and suggestions, we will have them in mind!<br>Update will be released soon!</p></p>', '6', '21942657', '0', '0', '0', '2015-03-20 18:36:25', '2015-03-20 18:36:25', '0', '1', '0', '0', 'Evil Indie Games');
INSERT INTO `applications` VALUES ('com.emerginggames.LogoQuiz', 'Logos Quiz', '19', '1.31', '8', 'What is Logo Quiz?<br>This is a quiz game where you have to guess the logos of different brands. There&#39;re tons of logos that surround us every day: how many of the logos do you know? Throughout the game you&#39;ll be presented with a bunch of different level packs, each containing logos of various brands or companies.<p>More than 1000 logos of different brands and companies! <p>Don&#39;t worry if you&#39;re stuck on the logo â€“Â you can always get some clue by using hints (Each logo has 3 of them), or ask your friends on facebook or twitter.<p>Game features:<br>â€¢ More than 1000 logos of different brands and companies<br>â€¢ For every logo in the quiz, there are 3 hints that help you<br>â€¢ Reveal the full logo once it&#39;s guessed<br>â€¢ Ask your friends on facebook or twitter to help you complete the quiz<br>â€¢ Many hours of fun gameplay <br>... That&#39;s Logo Quiz Game<p>Like us on facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/LogoQuizApp%26sa%3DD%26usg%3DAFQjCNGVLpb-rn70NZirwFgKnlLFq_8hfw&amp;sa=D&amp;usg=AFQjCNFXjjhS8y6qsRglyCdlY9ujbgabmQ\" target=\"_blank\">http://www.facebook.com/LogoQuizApp</a><p>Follow us on Twitter:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/EmergingGames%26sa%3DD%26usg%3DAFQjCNGw2b5s5SMp5_mzUvlZjupSXteUEg&amp;sa=D&amp;usg=AFQjCNGRQl9vBa05W374Fjo1SDBh_z0Azg\" target=\"_blank\">https://twitter.com/EmergingGames</a></p></p></p></p></p>', '7', '12373617', '0', '0', '0', '2015-03-20 18:33:32', '2015-03-20 18:33:32', '0', '1', '0', '0', 'Emerging Games');
INSERT INTO `applications` VALUES ('com.ericjohnson.calcplusfree', 'Calc+ Free', '6', '1.0.6', '5', 'Scientific calculator with advanced features.<p>Simple or advanced mode, just by turning your phone.<p>Get the paid version for more features including unit convertions, loan calculator.<p>Ver 1.0.8:<br>Fixed back button not exiting.<br>Fixed larger screens.<br>Added Deg,Rad,Grad options.<br>Ver 1.0.4:<br>Fixed % key to be more natural (i.e. &quot;10-10%=9&quot;)<br>Fixed rounding errors.</p></p></p>', '3', '56550', '0', '0', '0', '2015-03-20 18:36:49', '2015-03-20 18:36:49', '0', '1', '0', '0', 'EricJohnson');
INSERT INTO `applications` VALUES ('com.facebook.katana', 'Facebook', '6695629', '28.0.0.0.5', '7', 'MantÃ©n el contacto con tus amigos mÃ¡s rÃ¡pido que nunca.<p>â€¢ Ve quÃ© estÃ¡n haciendo tus amigos.<br>â€¢ Comparte actualizaciones, fotos y vÃ­deos.<br>â€¢ Recibe notificaciones cuando tus amigos comenten tus publicaciones o indiquen que les gustan.<br>â€¢ Juega y utiliza tus aplicaciones favoritas.<p>Ahora puedes acceder antes a la prÃ³xima versiÃ³n de Facebook para Android si participas en las pruebas beta. En el servicio de ayuda encontrarÃ¡s informaciÃ³n para registrarte, enviar comentarios y salir del programa: [<a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://on.fb.me/133NwuP%26sa%3DD%26usg%3DAFQjCNGsqSTbt7clgKsNP1-kXA7VfYSQyw&amp;sa=D&amp;usg=AFQjCNGk8vXSzrJP4iViUsfKxzo-Tc-SRg\" target=\"_blank\">http://on.fb.me/133NwuP</a>]<p>Â¿Tienes problemas para descargar o instalar la aplicaciÃ³n? Ve a <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://bit.ly/GPDownload1%26sa%3DD%26usg%3DAFQjCNErhCeQ2y1iI8JnCZl1hW6kzclEqQ&amp;sa=D&amp;usg=AFQjCNFTkBEgqHAWDR3tGDi9xR0m1L4i-w\" target=\"_blank\">http://bit.ly/GPDownload1</a><br>Â¿Sigues necesitando ayuda? ProporciÃ³nanos mÃ¡s informaciÃ³n sobre el problema. <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://bit.ly/invalidpackage%26sa%3DD%26usg%3DAFQjCNF52abPXM8gDY7vlGYJMo4tTe_3qA&amp;sa=D&amp;usg=AFQjCNHR-DwGQ3uRXRlILTFKdaOjgTGPNA\" target=\"_blank\">http://bit.ly/invalidpackage</a><p>Facebook solo estÃ¡ disponible para usuarios de 13 aÃ±os como mÃ­nimo.<br>Condiciones del servicio: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://m.facebook.com/terms.php%26sa%3DD%26usg%3DAFQjCNGrqpuQ6bO8akXW353UTrOXgTz_mA&amp;sa=D&amp;usg=AFQjCNEyhIEGQvhfO3mh3GAqjWz3Tj_JqA\" target=\"_blank\">http://m.facebook.com/terms.php</a>.</p></p></p></p>', '14', '29011260', '0', '0', '0', '2015-03-20 18:35:16', '2015-03-20 18:35:33', '0', '1