INSERT INTO `applications` VALUES ('com.fde.avpevolution', 'AVP Evolution', '560', '1.4', '28', 'Las criaturas mÃ¡s letales del universo se enfrentan por primera vez en tu telÃ©fono y tablet. Juega como Alien o Depredador en este juego oficial que presenta Angry Mob Games, creadores de PREDATORSâ„¢, Guerrilla Bob y Muffin Knight.<p>En un planeta distante, la sangrienta lucha entre los clanes de Depredadores continÃºa. En su intento final de erradicar al Clan de Cazadores de la Selva, los Super Depredadores aprovechan las habilidades de una especie inesperada que se resiste: los Aliens. Como Alien, tu objetivo es destruir a los Super Depredadores y liberar a tu especie esclavizada. Como Depredador Cazador de la Selva, debes eliminar a la Reina Alien para evitar que los Super Depredadores aniquilen a tu Clan. <p>PERSONAJES IMPLACABLES Y COMBATE ENCARNIZADO<br>*Dos experiencias de juego distintas, ya que puedes participar de la batalla final como Alien y como Depredador<br>*Los ataques implacables y los movimientos brutales para acabar con las criaturas les ofrecen a los jugadores un arsenal letal para destruir al enemigo<p>CREA TU PROPIA Y TEMIBLE MÃQUINA DE MATAR<br>*DiseÃ±a tus propios Aliens y Depredadores mediante mejoras a los personajes, capacidades aumentadas y una multitud de potentes armaduras y armamentos<br>*Saca ventaja en la batalla con las llamadas a atrapacaras, recargadores de furia, armas de red, minas de proximidad, visiÃ³n Alien, caÃ±ones de plasma y mucho mÃ¡s<p>ATERRADORES ESCENARIOS<br>*Es matar o morir a medida que avanzas por el Ruedo del Templo, la Base de los Marines, la Colmena Alien y muchos otros escenarios espeluznantes<p>INCREÃBLES GRÃFICOS SIN LÃMITES<br>*Detalles intensos, excelentes modelos de personajes e iluminaciÃ³n distintiva</p></p></p></p></p>', '9', '13567525', '0', '0', '0', '2015-03-20 18:38:09', '2015-03-20 18:38:09', '0', '1', '0', '0', 'Fox Digital Entertainment, Inc');
INSERT INTO `applications` VALUES ('com.fgol.HungrySharkEvolution', 'Hungry Shark', '28', '2.1.1', '14', 'Hazte con el control de un tiburÃ³n muy hambriento en esta aventura acuÃ¡tica repleta de acciÃ³n.<br>Â¡Sobrevive tanto tiempo como puedas comiÃ©ndote todo lo que se ponga en tu camino!<p>Â¡Con muchos tiburones diferentes para coleccionar y evolucionar, como el tiburÃ³n martillo, el gran tiburÃ³n blanco y el megalodÃ³n! <p>CaracterÃ­sticas:<br>+ GrÃ¡ficos 3D dignos de una consola<br>+ 10 clases de tiburÃ³n para desbloquear<br>+ Un enorme mundo abierto al que aterrorizar<br>+ Intuitivos controles tÃ¡ctiles o de giro<br>+ 15 tesoros hundidos para descubrir<br>+ MÃ¡s de 60 misiones para completar<br>+ Equipa a tus tiburones con artilugios y objetos especiales<br>+ Desbloquea bebÃ©s tiburÃ³n para aumentar tus poderes de depredador<br>+ Bonificaciones de combo y carrera dorada para superar tu rÃ©cord<br>+ Funciones sociales tales como Google Play Games, Facebook<p>Â¡Hungry Shark Evolution se actualiza a menudo con funciones, contenidos y desafÃ­os nuevos para que sigas viniendo a por mÃ¡s!<p>Â¡Juega tanto como quieras! Â¡Nada de mecÃ¡nicas arbitrarias de tiempo ni de energÃ­a!<p>***Â¡Juego del aÃ±o 2013! (Premios TIGA)***<p>Esta aplicaciÃ³n contiene compras que te permitirÃ¡n adquirir gemas y monedas, las cuales podrÃ¡s gastar en mejoras y accesorios. TambiÃ©n puedes ganar gemas y dinero en el juego sin tener que comprar nada o si ves los vÃ­deos de anuncios de la pantalla Tesoro.<p>Este juego contiene publicidad.<br>Puede desactivarse al realizar una compra cualquiera.</p></p></p></p></p></p></p>', '9', '9883730', '0', '0', '0', '2015-03-20 18:34:53', '2015-03-20 18:34:53', '0', '1', '0', '0', 'Future Games of London');
INSERT INTO `applications` VALUES ('com.foosegames.pepiskate3d', 'PEPI Skate 3D', '5', '1.4', '28', 'Speed Up, Jump, Crouch and Turn as Fast as you Can!<br>PEPI Skate 3D is a free game with a lot of challenge, players and levels to Unlock!<p>It&#39;s easy and fun to Play! You need to perform the tricks and avoid crashing against cars or roadblocks!<p>Download the game for free and have Fun!</p></p>', '6', '21995947', '0', '0', '0', '2015-03-20 18:37:20', '2015-03-20 18:37:20', '0', '1', '0', '0', 'Foose Games');
INSERT INTO `applications` VALUES ('com.frozenlogicstudios.soccerfreekicks', 'Free Kicks', '15', '1.4.3', '12', 'Show your friends and all people you are the best free kick taker in the world! Experience realistic ball physics, providing you the best experience you have ever had on a soccer game.<p>Play in 4 different fun game modes:<p>- Beat The Wall<br>You have 5 chances to score as higher as you can!<p>- Beat The Clock<br>Play against the clock and try to score as much as you can!<p>- Sudden Death<br>Do not miss any chance!<p>- Two Players Mode<br>Challenge your friend to compete against you on the &quot;Two Players Mode&quot; and check who is going to score the most amazing goals!<p>Reviews<br>&quot;The Most Realistic Soccer Game You Will Find On The Market - AppEggs.com&quot;<p>Follow us on twitter: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/frozen_logic%26sa%3DD%26usg%3DAFQjCNGYIMEJBQGmH4dG69pQMqoEtcM9Bg&amp;sa=D&amp;usg=AFQjCNG_x48tbgu41bj5LdpoqmOhIDUKwg\" target=\"_blank\">http://twitter.com/frozen_logic</a><br>Like us on Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/frozenlogicstudios%26sa%3DD%26usg%3DAFQjCNGnIWVO9x1xjqXIV8Al19podnmaJA&amp;sa=D&amp;usg=AFQjCNGOijtnz2O-2GIERw5Z0TzjmDpkgA\" target=\"_blank\">http://facebook.com/frozenlogicstudios</a></p></p></p></p></p></p></p>', '7', '18326707', '0', '0', '0', '2015-03-20 18:34:28', '2015-03-20 18:34:28', '0', '1', '0', '0', 'Frozen Logic Studios LTDA');
INSERT INTO `applications` VALUES ('com.gamestar.perfectpiano', 'Perfect Piano', '1200612', '6.1.2', '34', 'Utiliza esta aplicaciÃ³n para aprender a tocar el piano y con sonidos musicales realistas. <p><b>[ Teclado ]</b><br>  â€¢ Compatible con todas las teclas de un piano. <br>  â€¢ Modo hilera simple. Modo hilera doble. Modo de dos jugadores. <br>  â€¢ Multi-Touch. <br>  â€¢ Detectando respuesta tÃ¡ctil. <br>  â€¢ Ajusta el ancho de las teclas. <br>  â€¢ Programa de cinco teclados: piano, caja de mÃºsica, Ã³rgano, Rhodes, sintetizador. <br>  â€¢ GrabaciÃ³n y reproducciÃ³n. Compatible con MIDI y audio. <br>  â€¢ Comparte grabaciones de amigos. <br>  â€¢ Ajusta los archivos grabados como tono de llamada. <br>  â€¢ Modo &quot;aprender a tocar&quot;. Carga previa de 70 canciones de muestra. <br>  â€¢ Aprende a tocar canciones de muestra descargables. Se estÃ¡n cargando mÃ¡s canciones. <p><b>[ Multiplayer Piano ]</b><br>  â€¢ Play Piano online with your friends or Strangers around the world.<br>  â€¢ Chatting in the room.<br>  â€¢ Login with Google Account<p><b>[ Teclados MIDI externos a travÃ©s de USB ]</b><br>  â€¢ Admite teclados MIDI externos a travÃ©s de USB. Puedes tocar Piano Perfect a travÃ©s del teclado MIDI externo (como el YAMAHA P105, Roland F-120, Xkey, etc) a travÃ©s de USB. <br>  â€¢ Aviso: Los dispositivos deben admitir un host USB con Android mayor o igual a 3.1 y poder conectarse a un puerto USB OTG. <p><b>[ Sound Plugins ]</b><br>  â€¢ Cello, Flute, High Quality Grand Piano, Soprano Sax, Violin, Strings Ensemble, Electronic Piano, Clean Electric Guitar, Nylon Guitar<br>  â€¢ Download from &#39;More by developer&#39; link in bottom of this page.<p><b>[ Aviso ]</b><br>  â€¢ SÃ­ganos en Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/PerfectPiano%26sa%3DD%26usg%3DAFQjCNElIfcvugC7xSfQgZVlURpsBLnvuQ&amp;sa=D&amp;usg=AFQjCNHefcXirOhfhZRzkIBks15EUfyKrQ\" target=\"_blank\">https://www.facebook.com/PerfectPiano</a><br>  â€¢ Por favor, envÃ­e su pregunta o comentario sobre el uso de esta aplicaciÃ³n. Nuestro correo electrÃ³nico: <a href=\"mailto:revontuletstudio@gmail.com\">revontuletstudio@gmail.com</a>. <br>  â€¢ Teachers are welcomed to use it on music class. We are excited if this app help.<p>Â¿QuÃ© estÃ¡s esperando? Â¡Crea mÃºsica con tus dedos!<p><br><b>[Some Required Permissions]</b><br>  â€¢ android.permission.RECORD_AUDIO<br>    This permission allow Perfect Piano to record through phone MIC. The use case is when you playing the piano keyboard even sing along, You can record the sound at same time.<p>  â€¢ android.permission.READ_EXTERNAL_STORAGE<br>  â€¢ android.permission.WRITE_EXTERNAL_STORAGE<br>    These 2 permission is required by Perfect Piano to access external storage(or SD card). The use cases include:<br>      - Save downloaded MIDI file to external storage<br>      - Save MIDI recordings to external storage<br>      - Save Audio recordings to external storage<br>      - Read and Playback recordings from external storage<br>      - Load instrument plugins&#39; sound from external storage<p>  â€¢ android.permission.WRITE_SETTINGS<br>    This permission allow Perfect Piano to set midi/audio recordings as Ringtone.</p></p></p></p></p></p></p></p></p>', '12', '11127930', '0', '0', '0', '2015-03-20 18:36:50', '2015-03-20 18:36:50', '0', '1', '0', '0', 'Revontulet Soft Inc');
INSERT INTO `applications` VALUES ('com.gau.go.launcherex.gowidget.calendarwidget', 'GO Calendar Widget', '46', '4.0', '5', 'GO Calendar widget brings the calendar and the agenda to your home screen. It was a great calendar that makes your calendar more simple and faster.You can use month view or agenda view to display your upcoming events. At the same time, It supports showing Chinese Lunar and Moon phase. <br>To make it work, you must install the latest version of GO Launcher EX which is the most popular home launcher app in Android Market.<p>FEATURES<br>â— intuitive navigation with smooth transitions<br>â— Available Size: 4x3 2x2 4x4 new 3x3 new<br>â— View month<br>â— View agenda<br>â— Flip<br>â— Add agenda<br>â— View Chinese Lunar<br>â— View Moon phase</p>', '8', '2183985', '0', '0', '0', '2015-03-20 18:36:52', '2015-03-20 18:36:52', '0', '1', '0', '0', 'GO Launcher Dev Team');
INSERT INTO `applications` VALUES ('com.gau.go.launcherex.gowidget.emailwidget', 'GO Email Widget', '22', '1.85', '4', 'â˜…Multi-Account is supported nowï¼â˜…<p>Are you still worried about missing your important emails? Are you still searching for a simple and useful email app? Now you have GO Email Widget.<br>Once you have it, you can just send/receive emails directly on your screen. Absolutely no need to open any email app!<br>GO Email Widget supports most of the popular email boxes in the world. It provides you a fast and simple way to configure your account. You can do everything you want just like how you do it in any email app.<br>To make it work, you must install the latest version of GO Launcher EX which is the most popular home launcher in Android Market.<p>If you have install the beta version of the Email Widget, Please uninstall it first before you install the V1.0.<p>Available Size:<br>- 4Ã—4<p>Actions:<br>- Send/Receive emails<br>- Support POP3/IMAP<br>- Download/Send Attachment<br>- Change Themes<p>How to add GOWidgets on your home screen?<br>-Long press on your home screen in GO Launcher, press the GOWidget option and choose the widget you like. Make sure you have enough room for the widget.<p>How to set the Yahoo Email?<br>-You should Manual setup your account.<br>-If you choose the IMAP,please enter the &quot;android.imap.mail.yahoo.com&quot; in the IMAP sever<br>-If you choose the POP3,please enter the &quot;pop.mail.yahoo.com &quot; in the POP3 server</p></p></p></p></p></p>', '5', '1299019', '0', '0', '0', '2015-03-20 18:38:20', '2015-03-20 18:38:20', '0', '1', '0', '0', 'GO Launcher Dev Team');
INSERT INTO `applications` VALUES ('com.Gnathonic.SystemStatsLivePro', 'System Stats Live Pro', '109', '0.5.9.1', '3', 'Now includes an app in the launcher, for those who like System Stats, just not as a wallpaper<p>Lets you use WiFi, Cellular, CPU, RAM usage stats and a (or several) logcat as your live wallpaper<p>Or use the same stats in a widget on your homescreen<p>Vote for and suggest new features in app<p>App also adds easy access to the editor<p>Highly customizable<p>Wallpaper supports multiple layouts and lets you switch between them by double tapping<p>Scrollable logs that can be halted for easy reading<p>13 fonts to choose from<p>Efficient data collection<p>Can report in internals faster than any other perpetual resource tracking app on the market (up to 8 updates per second)<p>Can aggregate and report on over 6 months worth of data<p>Built-in layout editor so you can customize your layouts on the go.<p>Coming Soon: Dynamic Labels, Layout Sharing (import/export/send), Battery Stats, More Graph Options, Website, and some Documentation.<p>Don&#39;t see the feature you want in that list? Ask for it. With the exception of Dynamic Labels, all of the soon to be introduced features were suggested by users like yourself.<br>Got any other comments or complaints? Send me an Email.</p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '7', '287043', '0', '0', '0', '2015-03-20 18:36:49', '2015-03-20 18:36:49', '0', '1', '0', '0', 'Gnathonic');
INSERT INTO `applications` VALUES ('com.GoodwillEnterpriseDevelopment.AnatronicaPro', 'AnatronicaPro', '110', '1.47', '36', 'â˜… A 3D educational guide to the human anatomy (available also as FREE web app and for Windows/MacOS desktop as well) featuring an advanced interactive 3D touch interface. Wikipedia and Grays anatomy info available.<p>â˜… Best 3D Anatomy Application for Android ads free with more then skeletal and muscular systems!<p>â˜… Easy to navigate and explore human body (skeletal and muscular system in free version)<br>â˜… Fast search function<br>â˜… High detail 3D model (Male and Female)<br>â˜… Details about every object from wikipedia<br>â˜… Improved interface<br>â˜… Improved performance<br>â˜… Frequent updates! <br>â˜… Available for android phones and tablets<p>â˜… Visit www.anatronica.com for free complete online web version of interactive anatomy with all human anatomy systems!<p>â˜… If you like the app do not forget to rate it (Please do not give poor rating for no reason, tell us if app is not working properly and we will try to resolve the issue)<p>â˜… Please feel free to forward any suggestions or complaints to <a href=\"mailto:android.support@anatronica.com\">android.support@anatronica.com</a> or developer directly <a href=\"mailto:mirko.jugurdzija@anatronica.com\">mirko.jugurdzija@anatronica.com</a></p></p></p></p></p>', '7', '24585953', '0', '0', '0', '2015-03-20 18:36:55', '2015-03-20 18:36:55', '0', '1', '0', '0', 'Goodwill Enterprise Development Limited');
INSERT INTO `applications` VALUES ('com.google.android.apps.docs', 'Drive', '1322229', '1.3.222.29', '5', 'Empieza a utilizar Google Drive de forma gratuita y ten todos tus archivos a mano desde cualquier smartphone, tablet u ordenador. Todos los archivos que subas a Drive (como vÃ­deos, fotos y documentos) se guardan de forma segura mediante una copia de seguridad para que no los pierdas. Puedes invitar fÃ¡cilmente a otros usuarios para que vean, editen o dejen comentarios en cualquiera de tus archivos o carpetas.<p>Con Drive puedes:<p>* Ver documentos, archivos PDF, fotos, vÃ­deos y mÃ¡s<br>* Buscar archivos por nombre y contenido<br>* Compartir de forma sencilla archivos y carpetas con otros usuarios<br>* Configurar archivos o carpetas para que cualquiera que tenga el enlace pueda verlos, editarlos o aÃ±adir comentarios<br>* Acceder rÃ¡pidamente a archivos recientes<br>* Ver los detalles y la actividad de los archivos<br>* Habilitar la visualizaciÃ³n de archivos sin conexiÃ³n</p></p>', '14', '8516406', '0', '0', '0', '2015-03-20 18:36:53', '2015-03-20 18:36:54', '0', '1', '0', '0', 'Google Inc.');
INSERT INTO `applications` VALUES ('com.google.android.gms', 'Google Play services', '6603034', '6.6.03 (1681564-034)', '3', 'Servicios de Play se utiliza para actualizar las aplicaciones de Google y de Google Play.<br>Este componente proporciona funciones principales, como la autenticaciÃ³n para servicios de Google, contactos sincronizados, acceso a la Ãºltima configuraciÃ³n de privacidad del usuario, asÃ­ como servicios basados en la ubicaciÃ³n de mayor calidad y menor potencia.<br>Asimismo, servicios de Play mejora la experiencia de tu aplicaciÃ³n. Permite agilizar las bÃºsquedas sin conexiÃ³n, proporciona mapas mÃ¡s envolventes y mejora la experiencia de juego.<br>Es posible que las aplicaciones no funcionen correctamente si desinstalas servicios de Play.', '9', '28737269', '0', '0', '0', '2015-03-20 18:36:39', '2015-03-20 18:36:39', '0', '1', '0', '0', 'Google Inc.');
INSERT INTO `applications` VALUES ('com.google.android.stardroid', 'Google Sky Map', '1108', '1.6.1', '18', 'De cÃ³digo abierto y donado por Google.<p>TambiÃ©n nos puedes encontrar en:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/XWjRg%26sa%3DD%26usg%3DAFQjCNGgKGh-7iZiWcmxuQmiEYE9H-goKw&amp;sa=D&amp;usg=AFQjCNET0bJol98gNgk3Pc9n4H80qJNgpA\" target=\"_blank\">http://goo.gl/XWjRg</a> (Google Plus)<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://groups.google.com/group/google-sky-map%26sa%3DD%26usg%3DAFQjCNGogS9PqsqVN0D0g8q8zrQPjCr9Ag&amp;sa=D&amp;usg=AFQjCNEiWwCkevgNKoWjPIpPuFJU052ixA\" target=\"_blank\">http://groups.google.com/group/google-sky-map</a><br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/skymapdevs%26sa%3DD%26usg%3DAFQjCNH9UeNEq-BBp28_xfDZJ0gu78GDog&amp;sa=D&amp;usg=AFQjCNE3Tfz0wc-krXIhTNZG6SROEF_FnA\" target=\"_blank\">http://twitter.com/skymapdevs</a><p>Palabras clave: planetario, la astronomÃ­a, mapa del cielo</p></p>', '3', '2176145', '0', '0', '0', '2015-03-20 18:36:46', '2015-03-20 18:36:46', '0', '1', '0', '0', 'Sky Map Devs');
INSERT INTO `applications` VALUES ('com.google.android.voicesearch', 'Voice Search', '213', '2.1.3', '3', 'A veces necesitas encontrar informaciÃ³n pero no tienes tiempo para teclear. Esta aplicaciÃ³n te permite hablar para buscar en Google. Toca el icono de micrÃ³fono junto al cuadro de bÃºsqueda. Cuando aparezca el mensaje â€œHablar ahoraâ€, di tu bÃºsqueda en voz alta.', '8', '2242305', '0', '0', '0', '2015-03-20 18:38:21', '2015-03-20 18:38:21', '0', '1', '0', '0', 'Google Inc.');
INSERT INTO `applications` VALUES ('com.greenbeansoft.Checkmark', 'Checkmark Pro', '43', '3.12', '5', 'Checkmark is a leading task list and to do list manager in the Android market and a complete solution for your to-do list management, from simple task to complex hierarchical checklist. Ideally for packing list, shopping list, project management, inventory management and much more... Best used with our Checkmark Calendar (also available on Play Store).<p>Besides the android version, we also have a windows desktop companion product for it. The Checkmark Personal Assistant is our suite of personal management products on windows platform, including Checkmark To Do List Manager and Checkmark Account and Password Manager. It is fully integrated with our mobile versions and provides easy data input and more advanced features. Download today at desktop.greenbeansoft.com/download and give it a try!<p>Intuitive easy-to-navigate user interface and extensive support functionality are designed for better user experience. Features include:<br>  <br>*Hierarchical checklist structure supporting multiple level subgroups.<br>*Widget support<br>*Sync to Google Tasks<br>*Sync to Calendar<br>*Actions Items(can attach contacts to tasks or checklist item directly)<br>*Reusable Templates<br>*Repeating Tasks with extensive repeat settings<br>*Alarm Settings(snooze, ringtone, etc.)<br>*Import/Export<br>*Share via Email(for share and printing)<br>*Backup/restore<br>*Multiple Sort Options and more...<p>From the first release of this product, our intent was and remains to offer a superior app that will be:<p>- Designed specifically for Android OS to ensure perfect user experience<br>- Powerful enough to handle large checklists with complex hierarchical task structure<br>- Flexible to enable a wide range of to-do list needs<br>- Simple and intuitive, taking only a few minutes for a new user to get started<br>- Constantly improving in response to user feedback<p>Find more information at checkmark.greenbeansoft.com</p></p></p></p></p>', '3', '994141', '0', '0', '0', '2015-03-20 18:34:29', '2015-03-20 18:34:29', '0', '1', '0', '0', 'Greenbeansoft');
INSERT INTO `applications` VALUES ('com.gyc.ace.kjv', 'Bible KJV', '20100724', 'hazel.f8', '18', 'Features :<br>-KJV Bible offline<br>-Book/Chapter/Verse locate<br>-Bookmark<br>-Share<br>-Search<br>-Online Search Engine like search abiblity<br>-Auto start<br>-3 yrs daily read plan<br>-favorite<br>-Red Letter<br>-Speaking/Reading<br>-user friendly navigation and verse locating<p>please remove any shortcut on your screen and create new one if you can&#39;t open the app, <br>sorry for the inconvenience!  <p>if you could not download from google play market here, <br>please visit our website guanyc.com/android-apps<p>update 40<br>desktop widget with random verse <br>pinch to zoom font size everywhere<br>long touch/tap list item to enter/exit full screen mode<br>make navigation buttons optional for some pages<br>other fixes<p>u23 <br>-fix search result order<br>-fix to keep search result for screen change<br>-add touch scroll(fling/swipe)<p>u24<br>-larger font <br>-support for 3.0 device<br>-change drop-down list text color (particuarly  for some motorola devices)<br>-save settings :) hope it works<br>-minr fix for daily reading for 2012-1-7<p>u25<br>the &quot;exit/back&quot; button is back and improved<br>save to sd-card for system 2.2 or later<p>u26 <br>fix the crash :)<br>fix font-dialog minor bug<br>remove adfree detector<br>fix swipe minor error<p>u27<br>**improved local search**<br>rearrange some ui buttons<br>fix font-size dialog bug<br>fix startup failure <br>fix daily reading  minor bug<br>others<p>u28<br>-remember scroll position<br>-fix search error that some books are not indexed( try search the word &#39;witchcraft&#39; in 1 Sam 15:23,  if you can&#39;t find it, pls update)<p>u29<br>-add text-to-speech, you can listen to the verses now<br>-other minor improvements<p>u30<br>-make tts an option for those don&#39;t needd or want TTS feature<br>-bring the lacate button back in front panel<p>u31 <br>-fix tts crash<br>-continue reading when screen orientation change<br>-keep screen on for daily reading tts<br>-change default verse per page to whole chapter<br>-change default font to large system font size<p>u32<br>-fix titles for context menu<br>-list fast scroll <br>-read a little bit slower<br>-remove &quot;return&quot; buttons<br>-add horizontal layout for daily reading selection and verse quick location<br>-listview item style<br>-even more large font size <br>-many minor improvements<br>-internal improments<p>u33<br>-Keep Search History<br>-Fix TTS on ICS<br>-other minor improvements<p>update 34<br>-Fixed menu bug on android 3.0 and above devices<br>-Fixed bookmark and favorite lists minor bug<br>-Fixed some possible causes for Application Not Responding error<br>-removed verses per pages option<p>update 35<br>Fixed empty locator list error<br>Fixed Locator Crash error<br>Fixed Search Crash with *started search criteria<p>update 36<br>Red letters in bookmark, favorite and daily reading<br>Change the green label to orange<br>Fix search minor error<p>update37 <br>add context menu for search history<br>fix return button in search result list<br>add color for bookmark tag<br>fix minor daily reading plan bug<p>update 38<br>New Theme<br>Action Bar<br>Move to SD Card<br>Improved/Reorganized User Interface<br>Pinch to Zoom<br>New Daily Reading Progress Calendar<br>New Icons<br>Many others<p>update 39<br>new front page<br>red letters in search results<br>some other minor adjustments<p>custom search result highlight color<br>daily reading and search result title for sdk 2.x<br>fix search result limit illegal input error<p>A simple, powerful design will enable you to easily read the KJV Bible, navigate, search,share(through Facebook, twitter, Gmail goolge+, email, sms, evernote, bluetooth,ColorNote,Messaging, Yahoo Mail and many others), highlight verses, bookmark, make/copy/paste notes.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '1683281', '0', '0', '0', '2015-03-20 18:35:13', '2015-03-20 18:35:13', '0', '1', '0', '0', 'right');
INSERT INTO `applications` VALUES ('com.halfbrick.jetpackjoyride', 'Jetpack Joyride', '1601', '1.6.1', '14', 'Vamos a dar una vuelta: Â¡De los creadores de FRUIT NINJA! Â¡Uno de los juegos para mÃ³viles mÃ¡s chulos ya estÃ¡ disponible gratis en Google Play!<p>** Ganador ** <br>- Pocket Gamer â€“ Mejor juego de acciÃ³n/Arcade 2012<br>- Pocket Gamer â€“ Juego del aÃ±o 2012<br>- Gamasutra  â€“ Juego para mÃ³viles de 2011 <br>- Game Revolution â€“  Mejor juego para mÃ³viles 2011<br>****<p>Â¡Hazte con una selecciÃ³n de los propulsores mÃ¡s chulos nunca vistos y llega al cielo como Barry Steakfries, el adorable hÃ©roe, en un viaje solo de ida a la aventura! De los creadores del fenÃ³meno mundial Fruit Ninja, llega lleno de acciÃ³n Jetpack Joyride, Â¡el juego de Halfbrick para Android mÃ¡s esperado!<p>****<br>&quot;Jetpack Joyride es, sencillamente, un juego fantÃ¡stico&quot; -- IntoMobile<p>&quot;Como los mejores juegos para mÃ³viles, Jetpack Joyride es brutalmente sencillo&quot; -- Kotaku<p>â€œUn milagro en todos los aspectosâ€ - PocketGamer<br>****<p>Ãšnete a Barry al introducirse en un laboratorio secreto para requisar los propulsores experimentales a unos malvados cientÃ­ficos. Tras el despegue, simplemente toca la pantalla para ascender y deja de tocarla para descender, Â¡caerÃ¡n balas, burbujas, arcoÃ­ris y lÃ¡seres mientras vuelas hacia puntuaciones cada vez mÃ¡s altas!<p>ComenzarÃ¡s con el legendario propulsor ametralladora para dispersar a los cientÃ­ficos de Investigaciones LegÃ­timas, pero en cada partida recogerÃ¡s monedas y completarÃ¡s misiones para ganar dinero y comprar nuevos equipamientos en Tu Alijo. Escoge tu propulsor favorito, tu elegante traje y abastÃ©cete de objetos para volver a salir ahÃ­ fuera.<p>Aumenta tu velocidad y tu potencia usando el pequeÃ±o apisonador, el pÃ¡jaro de los beneficios y el teletransportador loco, solo una selecciÃ³n de los vehÃ­culos disponibles: todos pueden manejarse con control tÃ¡ctil.<p>AnÃ­mate, enloquece y piÃ©rdete en Jetpack Joyride. Â¡Tienes mucho por ver y por hacer, todo el tiempo del mundo y muchos propulsores! Como siempre, Â¡Barry Steakfries te proveerÃ¡!<p>****<p>Â¡DALE A ME GUSTA JETPACK JOYRIDE EN FACEBOOK!<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/jetpackjoyride%26sa%3DD%26usg%3DAFQjCNFHVUcgh9s3Gbh30ImXGip3eoeQmw&amp;sa=D&amp;usg=AFQjCNEV4JydMWJnVndfMTEBJQmwFoErYw\" target=\"_blank\">http://www.facebook.com/jetpackjoyride</a><p>Â¡SIGUE A HALFBRICK EN TWITTER!<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.twitter.com/halfbrick%26sa%3DD%26usg%3DAFQjCNFrWbH2ulOx-gGYTB8lrJ73BX6fOA&amp;sa=D&amp;usg=AFQjCNGum1fPMEEXl2sew3xWGjREaBAO7Q\" target=\"_blank\">http://www.twitter.com/halfbrick</a><p>****<p>Debido a limitaciones tÃ©cnicas, los dispositivos con 1000 Mhz o menos no podrÃ¡n ejecutar Jetpack Joyride. Halfbrick intenta lograr la compatibilidad con el sistema operativo mÃ¡s inferior posible para que podamos ofrecer al mÃ¡ximo nÃºmero de gente la oportunidad de disfrutar de nuestros juegos. Actualmente el juego es compatible con el sistema operativo v2.2 y superiores.<p>Los dispositivos no compatibles son:<br>HTC Wildfire S<br>Huawei M865<br>Samsung Galaxy Mini<br>LG Optimus One<br>HTC myTouch 3G Slide<br>HTC Explorer<br>ZTE X500<br>Samsung Replenish<br>LG Ally<br>Samsung Dart<br>Samsung Galaxy Y Duos</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '10', '46149541', '0', '0', '0', '2015-03-20 18:35:05', '2015-03-20 18:35:08', '0', '1', '0', '0', 'Halfbrick Studios');
INSERT INTO `applications` VALUES ('com.handcent.fontpack.pack4', 'Handcent Font Pack4', '2', '1.1', '4', 'Font package for handcent sms &amp; other handcent applications<p>*** DON&#39;T TRY TO LAUNCH IT ***,you need install the package and setup fonts parameters from Handent SMS or other handcent application<p><br>How to use additional font package at Handcent SMS?<br> <br>First,Laucn Handcent SMS ,then click &quot;menu&quot; button,choose &quot;Settings&quot; Then &quot;Custom Style&quot;,then you can choose &quot;ConversationList Settings&quot; to define fonts at handcent conversation list(main) window or &quot;bubble settings&quot;to define fonts at conversation window<p>Click &quot;ConversationList Settings&quot; Then Choose &quot;Contact Font&quot;,Click &quot;Font Pack&quot; drop down list, And you will see a list,for example: Handcent SMS font pack1,Handcent SMS font pack2,Handcent SMS font pack3,Handcent SMS font pack4,Handcent font pack5...choose one of these packs,if you haven&#39;t installed it ,handcent will navigate you to the market and you can install it directly. after you have choosen font pack ,you can choose font at the packs and define the style ,size and so on<br> <br>You also can scan external font pack that  you installed and apply them to Handcent SMS by going to &quot;Custom Style&quot; option and  &quot;Scan external Font packages&quot;<p>keyword: Handcent SMS ,handcent sms,Handcent SMS ,handcent sms ,Handcent SMS ,handcent sms ,Handcent SMS ,handcent sms</p></p></p></p>', '3', '379087', '0', '0', '0', '2015-03-20 18:35:47', '2015-03-20 18:35:47', '0', '1', '0', '0', 'handcent_market');
