INSERT INTO `applications` VALUES ('com.hyperaware.videoplayertrial', 'Act 1 Video Player Fullâ€‹', '50', '3.0.1', '25', 'THE BEST PLAYER for video media on your sdcard. Lots of unique features!<p>Full paid version available; Select &quot;View More Applications&quot; on this screen to find it.  This trial version is fully functional but limited to two minutes of continuous video playback for evaluation purposes.<p>â†’ PLEASE READ THE DEV WEB SITE for a complete feature list and important information about play videos on Android devices.  Not all devices can play all kinds of videos.<p>Trouble/suggestions? We like your email.<p>Feature Highlights:<p>âœ“ Playlists (with random play)<br>âœ“ Thumbnails (only on devices with Android 2.0 or newer)<br>âœ“ Video zoom options (aspect, full, custom)<br>âœ“ SRT subtitle support<br>âœ“ Bookmarks (up to 20 for each video)<br>âœ“ Home screen shortcuts to videos and playlists<br>âœ“ Play in the background while you run other apps or turn off the screen<br>âœ“ A-B repeat<br>âœ“ Video sharing<br>âœ“ On-screen clock, timer, and battery meter<br>âœ“ Seeking by seekbar, screen gestures, trackball, and D-pad<br>âœ“ Screen brightness and button brightness controls (buttons on Froyo only)<br>âœ“ Resume points remembered for all your videos<br>âœ“ Video sorting and grouping options<br>âœ“ Delete/rename videos<br>âœ“ Video streaming<br>âœ“ Lots of shortcuts, conveniences, and configurations</p></p></p></p></p>', '4', '190971', '0', '0', '0', '2015-03-20 18:37:57', '2015-03-20 18:37:57', '0', '1', '0', '0', 'HyperAware');
INSERT INTO `applications` VALUES ('com.icloudzone.DeathMoto', 'Death Moto', '18', '1.1.4', '14', 'Come and experience gives you unlimited pleasure, you know!<br>How to play:<br>â˜…As long as you do in the game, pick up the tools, and targeting, and to threw other motorcycle riders.<br>â˜…Please note that the closer you can knock down other riders you will get more helmets that can be used to unlock cool vehicles.<br>â˜…Acceleration you will consume the nitrogen, so remember to collect nitrogen, or you will fall behind.<br>â˜…Of course, you can share your score to the ranking. Who is stronger with players from around the world?<br>â˜…Can be shared to various social networks, such as Facebook, twiter ...<p>Come onï¼ŒLet&#39;s Go!</p>', '7', '10819646', '0', '0', '0', '2015-03-20 18:36:27', '2015-03-20 18:36:27', '0', '1', '0', '0', 'ICLOUDZONE INC.');
INSERT INTO `applications` VALUES ('com.ideashower.readitlater.pro', 'Pocket', '501', '5.0.1', '24', 'Pocket ha sido seleccionada como una de las mejores aplicaciones para Android de Google Play.<br> <br>MÃ¡s de 12 millones de personas usan Pocket para guardar fÃ¡cilmente artÃ­culos, vÃ­deos y mÃ¡s para disfrutarlos mÃ¡s tarde. Con Pocket, todo tu contenido se centraliza en un Ãºnico lugar, para que puedas verlo en cualquier momento y en cualquier dispositivo. Ni siquiera necesitas conexiÃ³n a Internet.<br> <br>No te pierdas las cosas interesantes que te vayas encontrando enviÃ¡ndote enlaces al correo o dejando que se te acumulen las pestaÃ±as abiertas en el navegador. Simplemente guÃ¡rdalas en Pocket.<br> <br>Â¿QUÃ‰ PUEDO GUARDAR?<br>Guarda artÃ­culos, vÃ­deos, recetas y pÃ¡ginas web que encuentres en Internet o en tus aplicaciones favoritas.<br> <br>DISFRUTA EN CUALQUIER SITIO, INCLUSO SIN CONEXIÃ“N<br>Si estÃ¡ en Pocket, estÃ¡ en tu telÃ©fono, tableta y ordenador, incluso cuando no tienes conexiÃ³n a Internet. Es perfecto de camino al trabajo, viajando o acurrucado en el sofÃ¡.<br> <br>MEJOR EXPERIENCIA VISUAL<br>Puedes ver tus artÃ­culos guardados en un diseÃ±o sencillo, agradable a la vista y que mejora la experiencia visual de cualquier pÃ¡gina.<br> <br>FUNCIONA SIN CONEXIÃ“N<br>Accede a lo que hayas guardado en Pocket incluso aunque no tengas conexiÃ³n a Internet. Configura Pocket para que haga las descargas cuando te conectes a una Wi-Fi para reducir el consumo de datos mÃ³viles.<br> <br>ÃšSALO CON TUS APLICACIONES Y WEBS FAVORITAS<br>Ya estÃ©s navegando en Internet o con tus aplicaciones favoritas, Pocket va contigo para que puedas guardar cualquier contenido genial dondequiera que lo encuentres. DespuÃ©s de que hayas terminado de leer, envÃ­a los artÃ­culos y vÃ­deos que te hayan gustado al Pocket de otro amigo, o compÃ¡rtelos en Facebook, Twitter, Evernote o por correo electrÃ³nico.<br> <br>DESTACADOS PERSONALIZADOS<br>Guarda tanto como quieras: Pocket destacarÃ¡ los contenidos mÃ¡s relevantes y de mayor calidad de tu lista.<p>POCKET PREMIUM<br>Para tener una experiencia mÃ¡s completa, pÃ¡sate a Pocket Premium cuando quieras. El servicio Premium da acceso a una biblioteca permanente de los artÃ­culos y pÃ¡ginas que has guardado. PodrÃ¡s encontrar exactamente lo que buscabas gracias a la bÃºsqueda Premium por texto completo, tema, etiqueta o autor. Y ademÃ¡s te sugiere automÃ¡ticamente etiquetas que hacen que organizar tu lista no te cueste ningÃºn trabajo. <br> <br>Pocket estÃ¡ disponible para todos los dispositivos Android.<br> <br>TambiÃ©n puedes guardar en Pocket con nuestras extensiones para los navegadores Chrome, Safari, Firefox e Internet Explorer.<br> <br>ConÃ³cenos mejor en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.getpocket.com/%26sa%3DD%26usg%3DAFQjCNHaeTdy4uZ44XureOKYQxr-uQ9LAw&amp;sa=D&amp;usg=AFQjCNHUWWHUiQwfE1fqxQBsd5EiZLFIIw\" target=\"_blank\">http://www.getpocket.com/</a>.<br>Â¿Tienes preguntas sobre los permisos? Visita <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://getpocket.com/permissions%26sa%3DD%26usg%3DAFQjCNFcCU62wvgMJIdAul7RpAVMcmkrug&amp;sa=D&amp;usg=AFQjCNFCQCmgBlTKp32o7R9MyYUbPsrCIQ\" target=\"_blank\">http://getpocket.com/permissions</a></p>', '8', '6947922', '0', '0', '0', '2015-03-20 18:36:07', '2015-03-20 18:36:07', '0', '1', '0', '0', 'Read It Later');
INSERT INTO `applications` VALUES ('com.ihandysoft.carpenter.level', 'Level', '6', '1.1.4', '3', '! Nivelador iHandy (uno de las cinco herramientas en Carpintero iHandy) es ahora gratuita ! ! AprovÃ©cha esta oportunidad y bajatela ahora !<p>Este serÃ¡ el nivelador mÃ¡s atractivo que puedes tener en mano. <p>A diferencia de otras aplicaciones en android market, esta es completamente funcional con la capacidad de calibrarse. DespuÃ©s del calibraje es precisa.<br>!Disfrutalas!<p>**********************************************<br>Carpintero iHandy estÃ¡ ahora de rebajas, hoy mismo puedes conseguir estas 5 herramientas en una sola aplicaciÃ³n con un descuento.<br>! Compruebalo !<br>**********************************************<p>*** INFORMACIÃ“N IMPORTANTE. POR FAVOR LEER***<br>Debido a que el sensor interior de cada device puede ser ligeramente diferente, para hacer mÃ¡s preciso el nivelador en tu dispositivo, necesitas calibrarlo antes de usarlo.<br>Para calibrarlo:<br>1. Encuentra una superfÃ­cie plana.<br>2. Manten tu dispositivo en posiciÃ³n vertical, pon el borde posterior del dispositivo en la superfÃ­cie plana, ahora pulsa el boton de calibrado (el que tiene una imÃ¡gen de una diana) para calibrar el modo normal.<br>3. Da la vuelta a tu dispositivo 90 grados en el sentido de las agujas del reloj, de nuevo ponlo en position vertical y pon el actual borde de la parte posteriro (el borde largo) en la superfÃ­cie plana, ahora pulsa el boton de Calibrar y calibra el modo horizontal.<br>4. Pon la parte posterior de tu dispositivo contra la superfÃ­cie, ahora pulsa el boton de calibrado para calibrar el modo cara arriba.<br>5. !Ya lo tienes listo para usarlo!</p></p></p></p>', '3', '3368786', '0', '0', '0', '2015-03-20 18:37:57', '2015-03-20 18:37:57', '0', '1', '0', '0', 'iHandySoft Inc.');
INSERT INTO `applications` VALUES ('com.ihandysoft.carpenter.toolkit', 'Carpenter', '11', '1.1.8', '3', '! Las herramientas de Carpintero mÃ¡s ligeras, atractivas y utiles del mundo, ahora en tu Phone! <p>!Consigue 5 herramientas profesionales en UNA sola aplicaciÃ³n por la mitad de precio de comprar una!<p>***************************************************<p>Puedes leer de crÃ­ticos de aplicaciones y usuarios satisfechos:<p>Â¨No solo son utiles estas herramientas, tambiÃ©n son fabulosas, con efectos de madera y brillo que las hacen parecer salidas del taller de Leonardo da VinciÂ¨ - OÂ´Reilly Media, Â¨Mejor AplicaciÃ³n IphoneÂ¨<p>Â¨Top 20 Aplicaciones para el iPhone de 2009Â´ Tribune Media<p>Â¨AplicaciÃ³n del DÃ­a del Padre para el papa NÃºmero 1Â¨ -CNN <p>Â¨Verdaderamente Ãºtil y me gusta mucho el estilo de la experiencia de usuario. Soy un usuario quisquilloso pero tengo que decir que estas herramientas estÃ¡n bien hechas y que merecen el precioÂ¨ -- nuestro cliente<p>***************************************************<p>Hay 5 herramientas en esta aplicaciÃ³n:<br>- Un peso de plomada,, la forma que tienes mÃ¡s sencilla de comprobar la verticalidad de lÃ­neas o paredes.<br>- Un Nivelador de superfÃ­cie, la mejor herramienta para nivelar cualquier superfÃ­cie plana.<br>- Un nivel de burbuja, el mismo que puedes encontrar en una ferreteria, y mÃ¡s atractiva. <br>- Un transportador de Ã¡ngulos para medir angulos de 0 a 180 grados.<br>- Un Regla de centimetros o pulgadas. !Pasandola de izquierda a derecha, tu regla puede medir cosas mÃ¡s largas que tu Phone! <br>- Una vez calibrada, el peso plomada, el nivelador de superfÃ­cie y el nivel de burbuja pueden ser usadas como un inclinÃ³metro/ clinÃ³metro para averigurar los Ã¡ngulos en la pantalla.<p>!Disfrutalos! <p>***************************************************<p>Unos pocos trucos para mejorar la experiencia de Carpintero iHandy<p>- El peso plomada, nivelador de superfÃ­cie y nivel de burbuja<br>Calibralos antes de usarlos para una medida profesional.<p>- Usa el peso plomada para medir la verticalidad de una pared.<br>Dos maneras de comprobar la verticalidad de una pared: <br>1. Pon la parte posterior de tu Phone en la pared que quieras medir ( Recomendado) <br>Si la sombra del peso plomada estÃ¡ en el eje de las X ( y igual a 0) es que tu pared esta perfectamente recta y vertical con respecto al suelo. Acuerdate que de esta manera la lectura de Â¨xÂ¨ NO tiene porque ser cero.<br>La parte posterior del Phone no es totalmente plana. Pero es lo bastante precisa para usar la parte plana de tu Phone.<br>2. Pon un extremo de tu Phone en la pared que mides.<br>Si la sombra del peso plomada estÃ¡ en el eje de las Y (x igual a cero), esto indica que tu pared esta perfectamente plana y vertical con respecto al suelo. Por favor acuerdate de esta manera &quot;y&quot; NO tiene que ser cero.<p>- COMO MEDIR LA PENDIENTE DE UNA SUPERFÃCIE<br>Varios modos para medir la pendiente de una superfÃ­cie son: <br>1. Usar el Nivelador de superfÃ­cie ( Recomendado)<br>Coloca tu Phone en una superfÃ­cie inclinada ( El borde del Phone debe estar alineado con la pendiente de la superfÃ­cie. Para comprobar esto, simplemente comprueba que la lectura de la &quot;y&quot; es igual a cero).<br>La lectura de Â´xÂ´ es el Ã¡ngulo de la pendiente de la superfÃ­cie medida.<br>2. Uso de Nivel de burbuja<br>Coloca un borde o la parte posterior de tu Phone encima de la superfÃ­cie inclinada.<br>(El borde del Phone debe estar alineado con la direcciÃ³n inclinada de la superfÃ­cie).<br>La lectura es el Ã¡ngulo de la superfÃ­cie inclinada.<p>Si la superfÃ­cie es casi vertical con respecto al suelo, sugerimos que uses el peso plomada para medir la superfÃ­cie.<p><br>- INSTRUCCIONES DE CALIBRAJE<p>Por favor vaya a &quot;Ayuda e Instrucciones&quot; en la pÃ¡gina de ajustes de iHandy Flotador</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '7071338', '0', '0', '0', '2015-03-20 18:35:51', '2015-03-20 18:35:51', '0', '1', '0', '0', 'iHandySoft Inc.');
INSERT INTO `applications` VALUES ('com.imohoo.DevilsAtTheGate', 'Devils At The Gate', '6', '1.05', '14', 'Devils at the Gate:Total Resistance is a Tower Defense game based on a war scenario between the Patriots and the Devils. <p>Players are required to rationally manage the Patriots to combat the Devils. <p>this game is as addictive as other tower defense game.if you like Fieldrunners,Crystal Defenders: Vanguard Storm,Star Defense,Earth Defense,Tower Madness,you may also like this.<p>Game characters are witty, and pictures are exquisite. What has made this game even remarkable is that this game uses different perspectives effect, an unprecedented innovation to TD game in the market. We believe this game will render players a totally new experience!<p>Game Features:<br>-Maps with unique perspective effect Players will notice the nicely designed perspective effect maps when they launch the game, and magnificent and beautiful scenes are a plus.<p>-Different combinations of Patriots can be used to complete a level The game players are to use a combination of as many as 10 types of Patriots (saber man, striker, guerrilla forces, etc) to ace each level. Each Patriot is armed with a specific weapon with unique function, and game player is able to, at his/her own will, choose the combination of the Patriots.<p>-Delicate and various game maps Eight delicate maps are available, including villages, ports, snow mountain and etc. Players can ace difficult levels by using weapons according to characteristics of the maps.<p>-Witty Characters Characters have rich actions, and both the Patriots and the Devils act witty in their every movement.</p></p></p></p></p></p></p>', '7', '28065558', '0', '0', '0', '2015-03-20 18:36:05', '2015-03-20 18:36:05', '0', '1', '0', '0', 'Feelingtouch Inc.');
INSERT INTO `applications` VALUES ('com.incorporateapps.walktext', 'Walk&Text', '10', '1.3.5', '4', 'As seen on the Queen Latifah show:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.youtube.com/watch?v%253DmVO5GW7AeLE%26sa%3DD%26usg%3DAFQjCNHlFSpo-bEqmtobDd-EafJZfU0o4A&amp;sa=D&amp;usg=AFQjCNGg8jJBDtGJLNEhGMvXXYt0b9Cjxg\" target=\"_blank\">https://www.youtube.com/watch?v=mVO5GW7AeLE</a><p><br>Walk and text freely with a transparent screen- see what is going on in front of you with the help of your back camera. Write text messages or notes and share them with any social network, message app or email client on the device or simply browse the net while walking.<p>Update 2013: Please note that the app can now be used as a transparent window behind any other app (even other messaging app) or launcher in our &quot;universal mode&quot;! <br>Make sure to press the menu button for the  advanced features and the transparent mode.<p><br>Features:<br>âœ” Full custom transparent QWERTY keyboard along with any other input keyboards installed on your device are supported! <br>âœ” SMS Threads full support, iPhone like bubble view!<br>âœ” Voice2Text - you can now walk and talk at the same time.<br>âœ” Camera preview is displayed while you walk. Click send and share the text with any client installed on your device.<br>âœ” Works in Portrait (2.2 and above) or Landscape (all devices). <br>âœ” Text Message can be send and added directly from within the app. <br>âœ” Change the background and color of the text you type<br>âœ” Change the color of the soft keyboard<br>âœ” Stop the camera while writing.<br>âœ” Take pictures via screenshot button<br>âœ” Users with physical keyboard, as well as all other users can hide the keyboard. <br>âœ” Hide the icons for better visibility<br>âœ” Walking at night or at dark? No problem, just click on the flash icon and the LED Flash of your device will light up the way.<br>âœ” Text Message character count. The app will count your characters and display to you how many text messages will be send, also useful for Twitter messages.<br>âœ” Widget for Universal mode-1 click will turn camera on behind any app<p><p>Disclaimer: The app is provided &quot;as is&quot; and we can not be held responsible for any damage caused when or by using this app. Safety first, never use the app while driving! <br>The app is made for walking and not texting while driving! <p>Make sure to check out our  apps!</p></p></p></p></p></p>', '3', '327461', '0', '0', '0', '2015-03-20 18:36:59', '2015-03-20 18:36:59', '0', '1', '0', '0', 'IncorporateApps');
