ponÃ©s, danÃ©s, holandÃ©s, finlandÃ©s, francÃ©s, alemÃ¡n, hÃºngaro, italiano, noruego, portuguÃ©s, espaÃ±ol y sueco <p>-Requisitos: Android2.x, cÃ¡mara auto-enfoque, apoya Nexus, Droid, Desire, etc <br>Palabras Clave: BCR lector de tarjetas comerciales, EscÃ¡ner LÃ­der Mundial, CamCard, Reconocimiento de tarjetas, EscÃ¡ner <p>CamCard Lite: el usuario puede guardar 10 tarjetas en la primera semana, luego 2 tarjetas por semana.<p>We&#39;d love to hear your feedback: <a href=\"mailto:asupport@intsig.com\">asupport@intsig.com</a><br>Follow us on Twitter: @CamCardIntSig<br>Like us on Facebook: CamCard<br>Follow us on Google+: CamCard</p></p></p></p></p>', '5', '8751635', '0', '0', '0', '2015-03-20 18:38:11', '2015-03-20 18:38:11', '0', '1', '0', '0', 'INTSIG Information Co.,Ltd');
INSERT INTO `applications` VALUES ('com.intsig.camdict', 'CamTranslator', '3', '1.3', '18', 'License: 60% off  for the celebration of Oxford Dictionaries joining in.<p>Got stuck in a totally unfamiliar language environment? When you could not manually input to search for results, even the most powerful electronic dictionaries would be just useless! CamDictionary â€“ your personal translator anytime and anywhere!<p>CamDictionary is a professional instant translator application.<p>Why choose CamDictionary?<br>â—†â—†Because it is professionalâ—†â—†<br>ã€Collins dictionariesã€‘<br>---- Together with the world-famous publisher Collins, now weâ€™re glad to bring multiple Collins dictionaries to you, allowing you to get the most authoritative word explanations.<br>ã€Instantly translateã€‘<br>---- No need to take photos, no need to wait. Focus words in the camera viewfinder, and the translation results will be just there.<br>ã€Capture and translateã€‘<br>---- Get the translation results for full sentences easily and conveniently.<br>ã€Translate between 36 Languagesã€‘<br>---- CamDictionary supports translation between 36 languages.<br>ã€Built-in local dictionariesã€‘<br>---- Get results from local dictionaries when no network is available. The application has built-in Chinese-English Dictionary and English-Chinese Dictionary.<br>ã€Text-to-speechã€‘<br>---- Listen to pronunciations of translated text by native speakers.<br>ã€Vocabulary book, search history , result sharing, and moreã€‘<p>â—†â—†Because it is uniqueâ—†â—†<br>ã€Recognition and translation of the entire lineã€‘<br>---- Load pictures, and select the entire line for recognition and translation.<br>ã€Manually select pictures for recognition and translationã€‘<br>---- Just select a picture, and CamDictionary will automatically recognize and translate the text on it.<br>ã€Chinese Pinyinã€‘<br>---- CamDictionary can now show Pinyin for Chinese characters. Learn Chinese more easily from now on.<p>â—†â—†And also becauseâ—†â—†<br>1.	CamDictionary is able to recognize up to 16 languages, including Simplified Chinese, Traditional Chinese, English, Korean, Japanese, French, Spanish, Portuguese, German, Italian, Dutch, Swedish, Finnish, Danish, Norwegian, Hungarian and etc.<br>2.	CamDictionary supports up to 18 languages for pronunciation, including English, Spanish, Simplified Chinese, Traditional Chinese, Japanese, Korean, French, German, Russian, Portuguese, Catalan, Danish, Dutch, Finnish, Italian, Norwegian, Polish, and Swedish.<p>The differences of CamDictionary Free version from the full version include:<br>1. Text-to-Speech is not available in free version.<br>2. Free version contains advertisements.<br>3. Free version has the â€œTrialâ€ mark.</p></p></p></p></p></p>', '5', '9848043', '0', '0', '0', '2015-03-20 18:35:39', '2015-03-20 18:35:39', '0', '1', '0', '0', 'IntSig');
INSERT INTO `applications` VALUES ('com.isitbroken.android.stardroid', 'Sky Map +', '1176', '1.7.3', '18', 'see <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.n2yo.com/satellites/%26sa%3DD%26usg%3DAFQjCNFT-uoMsjexDWzAfwJdxDK8KmsBjQ&amp;sa=D&amp;usg=AFQjCNF8zPxTgTKU6bBP6aKr17_lZEIPPg\" target=\"_blank\">http://www.n2yo.com/satellites/</a> for list of the new extra beta category.<p>Sky Objects turns your Android-powered device into a window on the night sky.<p>The Plus adds the new ability to track any near earth objects with a NORAD Id in real time. Follow satellites, the international space station, and more!<p>Sat Locks My take up to 1-2 minutes over cell networks!<p>You can get predictions for Iridium Flares for the next 7 days. Think shooting star like flares.<p>Based on code Open sourced and donated by Google.<br>https://play.google.com/store/apps/details?id=com.google.android.stardroid<p>Inspired by<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.instructables.com/id/How-to-use-Iridium-to-get-her-to-say-Yes/%26sa%3DD%26usg%3DAFQjCNEHNtv4gzcKI3KNRXtEfA5x9Hsy_A&amp;sa=D&amp;usg=AFQjCNFh3DKrUmc45XQdMcVkKVwKWEzh-A\" target=\"_blank\">http://www.instructables.com/id/How-to-use-Iridium-to-get-her-to-say-Yes/</a><p>Predictions By<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.heavens-above.com/%26sa%3DD%26usg%3DAFQjCNHYTnPqi0RIoR6-MXgv_PeCmedQug&amp;sa=D&amp;usg=AFQjCNFFzGtCHc46N7PSKSa1TdBHOo9jyQ\" target=\"_blank\">http://www.heavens-above.com/</a><p>Tracking data is courtesy of www.n2yo.com<p>Anyone interested in helping? Fell free to email.</p></p></p></p></p></p></p></p></p>', '8', '2654140', '0', '0', '0', '2015-03-20 18:34:45', '2015-03-20 18:34:45', '0', '1', '0', '0', 'Is It Broken');
