p>EnvÃ­enos sus opiniones, comentarios, solicitudes de funcionalidades y problemas a <a href=\"mailto:info@killermobile.com\">info@killermobile.com</a> o visite nuestros foros en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.killermobile.com/forums.html%26sa%3DD%26usg%3DAFQjCNESmbhlHp10JI6AAqYxz-4NW0ssBg&amp;sa=D&amp;usg=AFQjCNEoa6qc1vSGdH1Pb9-ORhmneQlkcg\" target=\"_blank\">http://www.killermobile.com/forums.html</a></p></p></p></p></p></p>', '4', '438140', '0', '0', '0', '2015-03-20 18:38:23', '2015-03-20 18:38:23', '0', '1', '0', '0', 'Killer Mobile');
