INSERT INTO `applications` VALUES ('com.levelup.beautifulwidgets', 'BeautifulWidgets', '5020307', '5.2.3b7', '10', 'Beautiful Widgets es tu mejor compaÃ±ero para personalizar tu pantalla de inicio. <br>Se Ãºnico, exprÃ©sate.<p>Gracias a sus numerosos widgets personalizables y a la biblioteca de temas mÃ¡s surtida de Google Editorâ€™s choice, podrÃ¡s personalizar tu pantalla de inicio con arreglo a tus gustos y tu estado de Ã¡nimo.<p>Beautiful Widgets ha sido la primera aplicaciÃ³n en alcanzar el millÃ³n de descargas de pago. Fue seleccionada como Â«Google Editorâ€™s choiceÂ» durante mÃ¡s de un aÃ±o, y desde hace mÃ¡s de 4 aÃ±os figura entre las principales 10 aplicaciones de pago en Google Play Store.<p><br>Al igual que los otros 4 millones de usuarios, podrÃ¡s disfrutar de una informaciÃ³n meteorolÃ³gica completa y de tus widgets preferidos en versiÃ³n HD en los telÃ©fonos y tablets compatibles.<p>Funciones principales:<br>- Relojes completos (hora, fecha, alarma, etc.)<br>- Todos los widgets (6x4, 6x1 y 6x2 solo para tablets)<br>- Descargas ilimitadas de temas<br>- La informaciÃ³n meteorolÃ³gica esencial de tu ubicaciÃ³n actual y de todas tus localidades preferidas <br>- InformaciÃ³n meteorolÃ³gica ofrecida tambiÃ©n mediante notificaciones, animaciones de desbloqueo o el protector de pantalla interactivo (DayDream)<br>- Un fondo de pantalla interactivo con la informaciÃ³n meteorolÃ³gica<p>Si deseas obtener mÃ¡s informaciÃ³n, visita el sitio web: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.beautiful-widgets.com%26sa%3DD%26usg%3DAFQjCNHs6lMZYGpQQAyAbzqIwqGwyg8IUA&amp;sa=D&amp;usg=AFQjCNFQW7cFTUhdOvfS-G4D71TkBTmP3Q\" target=\"_blank\">http://www.beautiful-widgets.com</a><p><br>InformaciÃ³n importante:<br>- Esta aplicaciÃ³n no puede moverse a la SD Card a causa de los widgets.<br>- No garantizamos el funcionamiento en las Roms y las pantallas de inicio alternativas.<br>- DayDream solo es compatible a partir de la versiÃ³n 4.2 de Android.<p>*** Permissions ***<br>- Location : for geolocated forecast<br>- SDCard : to save the themes<br>- Wifi, Bluetooth, System tools : for toggle widgets<br>- Affects battery : for updates<br>- Alarm : to display the next alarm<p>*** Important ***<br>We allow more than 15 minutes for the refund policy because we think it is too short. You can contact us from Google Checkout within 24 hours with an explanation on why you are not interested in keeping it. Warning: this do not apply during sales and promotions!</p></p></p></p></p></p></p></p>', '8', '13094905', '0', '0', '0', '2015-03-20 18:37:22', '2015-03-20 18:37:48', '0', '1', '0', '0', 'LevelUp Studio');
INSERT INTO `applications` VALUES ('com.lima.doodlejump', 'Doodle Jump', '2100005', '2.1.0', '14', 'Â¡Por fin estÃ¡ disponible uno de los juegos para mÃ³viles mÃ¡s populares de todos los tiempos, de manera totalmente GRATIS y completamente optimizado para Android por el mismo equipo que creÃ³ la versiÃ³n original!<br> <br>Comprueba por ti mismo por quÃ© Touch Arcade dijo de Doodle Jump que fuera posiblemente â€œel mejor juego [para mÃ³vil] jamÃ¡s creadoâ€, y Macworld lo calificÃ³ como â€œun micro juego perfecto, altamente adictivo y al que querrÃ¡s jugar una y otra vezâ€.<br> <br>Â¿CuÃ¡nto puedes saltar?<br>Recorre una hoja de papel cuadriculado saltando sin parar de una plataforma a otra, recogiendo mochilas propulsoras, evitando agujeros negros y atacando a los malos con las bolas de tu nariz a lo largo del camino. Disfruta dejando atrÃ¡s la puntuaciÃ³n de otros jugadores que estÃ¡ garabateada en los mÃ¡rgenes. Pero ojo: Â¡este juego es perdidamente adictivo!<br> <br>CaracterÃ­sticas:<br>-	Un montÃ³n de mundos fantÃ¡sticos en los que jugar: espacio, selva, fÃºtbol, bajo el mar, nieve, Halloween, hielo, Pascua y ahora NINJA!<br>-	IncreÃ­bles potenciadores para recoger: mochilas propulsoras, gorras con hÃ©lice, cohetes, camas elÃ¡sticas...<br>-	Estrafalarios obstÃ¡culos que evitar: OVNIS, agujeros negros y muchos, muchos monstruos.<br>-	Plataformas descabelladas en las que saltar (rotas, en movimiento, que desaparecen, cambiantes, explosivas...).<br>-	Â¡Tablas de clasificaciÃ³n mundiales y divertidos logros! Â¡Supera la puntuaciÃ³n de tus amigos!<p>CÃ³mo jugar: <br>Inclina el dispositivo para ir a izquierda o derecha y toca la pantalla para disparar.<p><br>Averigua por quÃ© Doodle Jump es un verdadero fenÃ³meno cultural: ha aparecido en series (Big Bang Theory, Parks &amp; Rec, Bad Girls), pelÃ­culas (Battleship), programas de TV (Jimmy Fallon) e incluso se ha ido de gira con Lady Gaga.<p>* ADVERTENCIA: Â¡Este juego es PERDIDAMENTE adictivo! <br>* Â¡Si dodleas, no conduzcas!<p>:::::::::::::::::::::::::::::::::::::::::::::::::<br>Â¡Si compraste la versiÃ³n Plus de Doodle Jump, comprueba que la tienes instalada en tu telÃ©fono cuando instales esta nueva versiÃ³n! AsÃ­ se eliminarÃ¡n los anuncios. Si ya has desinstalado y/o borrado la versiÃ³n de pago Plus de Doodle Jump, puedes volver a descargarla de la nube  (&quot;My Android Apps&quot; -&gt; &quot;Other apps in my library&quot; or <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.bit.ly/oldpaid%26sa%3DD%26usg%3DAFQjCNEp3c7Imi_Ipv8tR5MANmQaq5klGA&amp;sa=D&amp;usg=AFQjCNE_Wr25AG0Ysa1Kcc30uKa_MDVdeA\" target=\"_blank\">http://www.bit.ly/oldpaid</a> ).<p>Funciona con todos los dispositivos, excepto con los que no son compatibles con la anterior versiÃ³n de pago de GameHouse. Estamos trabajando para solucionar este problema.<br>::::::::::::::::::::::::::::::::::::::::::::::::</p></p></p></p></p>', '9', '38757593', '0', '0', '0', '2015-03-20 18:36:12', '2015-03-20 18:36:12', '0', '1', '0', '0', 'Lima Sky LLC');
INSERT INTO `applications` VALUES ('com.mathworks.matlabmobile', 'MATLAB', '10', '2.0.4', '3', 'Note: To use MATLAB Mobile, you will need a MATLAB license that is current on MathWorks Software Maintenance Service.<p>Connect to MATLAB remotely from your Android smartphone or tablet.<p>MATLAB Mobileâ„¢ is a lightweight desktop on your Android device that connects to a MATLAB session running on MathWorks Cloud or on your computer. From the convenience of your Android device, you can run scripts, create figures, and view results.<p>Features<br>* Command-line access to MATLAB<br>* Access to MATLAB workspace<br>* Ability to view MATLAB figures on your Android device<br>* Record of commands typed on the device in your command history<br>* MathWorks Cloud connectivity and storage<br>* Windows, Mac, and Linux connectivity<br>* Acquire data from device sensors<p>Limitations<br>MATLAB Mobile does not support:<br>* MATLAB apps such as Curve Fitting or Signal Analysis<br>* Creating graphical interfaces using GUIDE<br>* MATLAB Editor<br>* Simulink graphical environment, but the &#39;sim&#39; command is supported at the MATLAB Mobile command line<br>* Interaction with 3D figures<p>About MATLAB<br>MATLAB is the leading technical computing software for algorithm development, data visualization, data analysis, and numeric computation. MATLAB is used in a wide range of applications, including signal and image processing, communications, control design, test and measurement, financial modeling and analysis, and computational biology.<p>Requirements<br>1. One of the following MATLAB licenses:<br>* Professional or academic license for R2012a or later with an up-to-date MathWorks Software Maintenance Service contract.<br>* MATLAB Student or MATLAB and Simulink Student Suite R2014a or later.<br>* MATLAB and Simulink Student Version R2012a or later.<br>* MATLAB Home.<p>2. MATLAB Connector installed on the same computer as MATLAB. Starting with R2013a, the MATLAB Connector will be installed with MATLAB. For R2012a and R2012b, download MATLAB Connector at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.mathworks.com/mobile/%26sa%3DD%26usg%3DAFQjCNF1LOGuL2RWBSi4zHWquWhRYe5HJQ&amp;sa=D&amp;usg=AFQjCNGQBiKS5Q3BrCu8uKUeHzN2O2GqYw\" target=\"_blank\">http://www.mathworks.com/mobile/</a>.<p>3. Android 4.0 or later<p>MATLAB Mobile and the MATLAB Connector are intended for use behind a firewall on a private network. Virtual Private Network (VPN) use is recommended when used over the public Internet or via 3G or 4G.</p></p></p></p></p></p></p></p></p>', '14', '1281732', '0', '0', '0', '2015-03-20 18:34:40', '2015-03-20 18:34:40', '0', '1', '0', '0', 'The MathWorks, Inc.');
INSERT INTO `applications` VALUES ('com.metago.astro', 'ASTRO File Manager', '582', 'ASTRO-4.4.582', '5', 'ASTRO File Manager. Top archivos y gestor de la nube en Android.<br>Organizar, buscar, ver y recuperar: imÃ¡genes, mÃºsica, videos, documentos y otros archivos desde el:<br>- TelÃ©fono<br>- Tablet<br>- Nubes (Dropbox, Google Drive, Facebook, Box o SkyDrive)<br>- PC, Mac, Linux (vÃ­a construida en la creaciÃ³n de redes)<p>CaracterÃ­sticas *** incluyen:<br>- GestiÃ³n de archivos<br>- BÃºsqueda de archivos<br>- IntegraciÃ³n de la nube<br>- Ver imÃ¡genes<br>- Networking<br>- Zip<br>- Task Killer<br>- Copia de seguridad de aplicaciones<br>- El uso de tarjetas SD<p>- PANTALLA pase a la derecha para llegar a las nubes, ubicaciones de red o bÃºsquedas guardadas rÃ¡pida<br>- PANTALLA Pase a la izquierda para llegar a Herramientas (App Backup, Task Killer, SD Card Uso), ConfiguraciÃ³n y Ayuda<p>ASTRO soporta 11 idiomas incluyendo: InglÃ©s, francÃ©s, espaÃ±ol, italiano, alemÃ¡n, japonÃ©s, coreano, chino tradicional, chino simplificado, ruso y portuguÃ©s.</p></p></p>', '8', '7048112', '0', '0', '0', '2015-03-20 18:34:49', '2015-03-20 18:34:51', '0', '1', '0', '0', 'Metago');
INSERT INTO `applications` VALUES ('com.microsoft.office.outlook', 'Outlook', '12', '1.0.2', '5', 'La aplicaciÃ³n oficial de Microsoft Outlook para telÃ©fonos con sistema Android y tabletas.<br>Outlook es una aplicaciÃ³n gratuita de correo electrÃ³nico que, con una vista unificada de su correo, calendario, contactos y adjuntos, le permite realizar mÃ¡s tareas desde cualquier lugar. Outlook saca a la superficie automÃ¡ticamente sus mensajes mÃ¡s importantes en todas sus cuentas de correo electrÃ³nico. Con solo deslizar, podrÃ¡ eliminar, archivar o programar rÃ¡pidamente los mensajes que desee ver mÃ¡s tarde. TambiÃ©n le permite acceder fÃ¡cilmente al calendario, compartir horarios disponibles y programar reuniones. AdemÃ¡s, con solo unos toques, podrÃ¡ adjuntar archivos de su correo electrÃ³nico, OneDrive, o Dropbox.<p>Outlook funciona con Microsoft Exchange, Office 365, Outlook.com (incluye Hotmail, MSN), Gmail, Yahoo Mail, e iCloud.<p>------------------------------<p>Â¿Por quÃ© utilizar Outlook?<p>Administre su bandeja de entrada<br>â€¢ Outlook clasifica automÃ¡ticamente su bandeja de entrada y destaca sus mensajes mÃ¡s importantes. Los menos importantes se ubican en la bandeja de entrada â€œOtrosâ€. <br>â€¢ Deslice para eliminar, archivar o programar mensajes rÃ¡pidamente.<br>â€¢ Programe mensajes para que regresen mÃ¡s tarde a su bandeja de entrada.<p>Calendario integrado<br>â€¢ Cambiar entre las pantallas de correo y calendario ya es cosa del pasado. Outlook incluye su calendario y lo notifica con recordatorios de citas o reuniones. <br>â€¢ Busque los horarios disponibles y compÃ¡rtalos por correo electrÃ³nico o programe una reuniÃ³n.<p>Facilita la gestiÃ³n de archivos adjuntos<br>â€¢ Lea y adjunte con unos toques cualquier archivo desde su correo electrÃ³nico, OneDrive, Dropbox y otras cuentas. <br>â€¢ EnvÃ­e archivos grandes aunque no los haya descargado en su telÃ©fono.<p>EncuÃ©ntrelo todo rÃ¡pidamente<br>â€¢ Filtre su bandeja de entrada con un solo toque para mostrar los mensajes no leÃ­dos, marcados o con archivos adjuntos. <br>â€¢ Encuentre rÃ¡pidamente el mensaje, la persona o el archivo buscado escribiendo solo unas letras.<br>â€¢ Outlook muestra las personas con las que se comunica con mayor frecuencia y le permite explorar en profundidad para ver los mensajes, reuniones y archivos relacionados.<p>------------------------------<p>Â¿Tiene comentarios o preguntas?<p>â€¢ EnvÃ­enos sus comentarios para poder mejorar Outlook. DirÃ­jase a Ajustes&gt;Ayuda&gt;Contacte con el servicio tÃ©cnico. Leemos todos los comentarios. <br>â€¢ Lea las respuestas de las preguntas frecuentes dirigiÃ©ndose a Ajustes&gt;Ayuda&gt;Preguntas frecuentes.  <br> <br>------------------------------  <br> <br>Â¿Le gusta Outlook?<p>Pruebe nuestras otras aplicaciones de Microsoft para tabletas con sistema Android: Word, Excel, PowerPoint, OneNote, OneDrive, y Skype.</p></p></p></p></p></p></p></p></p></p></p>', '14', '9726897', '0', '0', '0', '2015-03-20 18:35:37', '2015-03-20 18:35:37', '0', '1', '0', '0', 'Microsoft Corporation');
INSERT INTO `applications` VALUES ('com.microsoft.rdc.android', 'Microsoft Remote Desktop', '7', '8.0.4.24341', '20', 'With the Microsoft Remote Desktop app, you can connect to a remote PC and your work resources from almost anywhere. Experience the power of Windows with RemoteFX in a Remote Desktop client designed to help you get your work done wherever you are.<br><b>Getting Started</b><br>Windows Professional and Windows Server editions are supported. To view the full list of supported Windows versions and successfully connect to a Windows PC, read the FAQ at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://technet.microsoft.com/en-us/library/dn473007.aspx%26sa%3DD%26usg%3DAFQjCNER_WaHmfzPrMe0M-24tsqJlLE2HA&amp;sa=D&amp;usg=AFQjCNHvs1jhOns1ALZ5NHXFTvyYIKoyOA\" target=\"_blank\">http://technet.microsoft.com/en-us/library/dn473007.aspx</a><br><b>Features</b><br>+ Access to remote resources through your Remote Desktop Gateway<br>+ Rich multi-touch experience with remote desktop protocol (RDP) and RemoteFX supporting Windows gestures<br>+ Secure connection to your data and applications with breakthrough Network Layer Authentication (NLA) technology<br>+ Simple management of all remote connections from the connection center<br>+ High quality video and sound streaming with improved compression and bandwidth usage<br>+ Support for Azure RemoteApp<br><br>', '8', '4747108', '0', '0', '0', '2015-03-20 18:35:12', '2015-03-20 18:35:12', '0', '1', '0', '0', 'Microsoft Corporation');
INSERT INTO `applications` VALUES ('com.mobilityflow.awidget', 'Animated Widget', '35', '1.2.0', '5', 'Este widget te ayudarÃ¡ a iniciar aplicaciones y llamar amigos rÃ¡pido y fÃ¡cilmente.<p>Set de widgets de contactos, grupos de contactos, lanzador de aplicaciones y marcadores.<p>El widget de contactos muestra una foto del contacto y da acceso instantÃ¡neo a varias acciones de contactos: llamar, SMS, make calls and sending messages through instant messengers. Inicia cualquier acciÃ³n con uno o dos toques.<p>El widget lanzador de aplicaciones muestra aplicaciones que elijas en un icono. Puedes agrupar aplicaciones utilizadas con frecuencia y abrirlas con dos toques. Si mantienes el toque se abre la pÃ¡gina de informaciÃ³n, que te permite detenerla rÃ¡pidamente.<p>El grupo de contactos es una carpeta de contactos avanzada que te permite iniciar cualquier acciÃ³n en un contacto con 2 o 3 toques. PodrÃ¡s personalizar la apariencia, color o foto de tus contactos para encontrarlos rÃ¡pidamente.<p>Todos los widget te dan la posibilidad de utilizar varios tipos de gestos, deslizar, desplazar, pellizcar, aumentar. Puede realizar gestos de hasta 3 dedos. No pierdas tiempo buscando el icono que quieres abrir. Simplemente abre tu widget y realiza el gesto que abre tu aplicaciÃ³n favorita o llama a tu amigo.<p>PodrÃ¡s ahorrarte espacio en tu pantalla principal. Agrupa elementos con las etiquetas y crea carpetas y widgets totalmente personalizables. Puedes organizar tus aplicaciones, contactos y marcadores de forma muy eficaz.</p></p></p></p></p></p>', '7', '402789', '0', '0', '0', '2015-03-20 18:37:07', '2015-03-20 18:37:07', '0', '1', '0', '0', 'Kbitubit &amp; Mobilityflow');
INSERT INTO `applications` VALUES ('com.moneymanager.android', 'MoneyManager', '62', '2.5', '33', 'It&#39;s a small finance app that shows you where your money is.<br>With &gt;300 000 downloads it is one of the famoust finance apps at the android market ! <p>This app is ad supported. If you don&#39;t like ads please look for MoneyManager Pro. Please support us to improve MoneyManager.<p>Some of the features: <p>âœ“In and out entries<br>âœ“categorymanagement<br>âœ“charts<br>âœ“CSV Export<br>âœ“wiget<br>âœ“Backup/Restore<br>âœ“choose date and currency<br>âœ“and many more<p>The permissions we need to use are for the advertising component.<p>Please give us some feedback via email or ratings. Thanks a lot to all of our users!<p>You can find more information at our website: www.swordiApps.com</p></p></p></p></p></p>', '3', '361430', '0', '0', '0', '2015-03-20 18:37:11', '2015-03-20 18:37:11', '0', '1', '0', '0', 'swordiApps');
INSERT INTO `applications` VALUES ('com.motorbike.driving.simulator', 'Motorbike Driving Simulator 3D', '4', '1.3', '19', 'Motorbike Driving Simulator 3D is a real physics motor engine game.<p><br>If you like Simulator Games and Motorbike Driving, try it for FREE.<br>Reach the top of the Skyscraper in a big city. I think it is not possible.<p><br>***FEATURES***<p>* Traffic System - AI Cars and Motorbikes<br>* NITRO Power<br>* Easy controllers<br>* Fantastic suspension<br>* Race and Cross Motorbike<br>* Huge Real CITY Maps<br>* Real World Environments<br>* Realistic Camera Views<br>* Beautiful Full HD Graphics<br>* Realistic engine sounds<br>* Realistic physics behavior<br>* Realistic acceleration control</p></p></p>', '9', '21170774', '0', '0', '0', '2015-03-20 18:36:23', '2015-03-20 18:36:23', '0', '1', '0', '0', 'Pudlus Games');
INSERT INTO `applications` VALUES ('com.movinapp.dict.esit.free', 'Spanish Italian Dictionary FREE', '4', '2.1.1', '35', 'Dizionario Spagnolo-Italiano offline<br>Diccionario EspaÃ±ol-Italiano offline.<p>* MÃ¡s de 77.000 palabras y expresiones<br>* Â¡No necesita conexiÃ³n a Internet! perfecto para tus viajes o cuando no hay conexiÃ³n de datos disponible <br>* Escucha la pronunciaciÃ³n correcta utilizando el sintetizador de voz de Android<br>* Guarda tus traducciones favoritas<br>* BÃºsqueda ultra-rÃ¡pida<br>* Comparte las traducciones por SMS, email, etc.<br>* Se puede mover a la tarjeta SD.<p>Esta versiÃ³n incluye anuncios. Si te gusta la aplicaciÃ³n, por favor considera adquirir la versiÃ³n libre de publicidad para apoyar los desarrolladores. Gracias :) <p>FAQ:<br>- Â¿CÃ³mo puedo cambiar la velocidad de la voz? La velocidad de la voz esta controlada por el motor TTS instalado en Android. Se puede configurar a travÃ©s de: ConfiguraciÃ³n -&gt; Entrada de voz y los ajustes de salida -&gt; Ajustes de voz -&gt; velocidad de la voz<p>- Â¿CÃ³mo puedo cambiar el idioma de la voz?<br>SÃ³lo tienes que ir a MenÃº -&gt; ConfiguraciÃ³n y seleccionar el idioma. Hay dos idiomas disponibles: <br>  * EspaÃ±ol<br>  * Italiano</p></p></p></p>', '4', '3335477', '0', '0', '0', '2015-03-20 18:36:52', '2015-03-20 18:36:52', '0', '1', '0', '0', 'movin\'App');
INSERT INTO `applications` VALUES ('com.mtorres.phonetester', 'Phone Tester', '8', '1.6', '3', 'Esta aplicaciÃ³n te permite comprobar y analizar el correcto funcionamiento del hardware y los distintos componentes de tu dispositivo (telÃ©fono o tablet).<br>PodrÃ¡s probar lo siguiente:<p>***SENSORES***<br> AcelerÃ³metro, giroscopio, brÃºjula, sensor de proximidad, sensor de luz, sensor de presiÃ³n...<p>***WIFI***<br>PodrÃ¡s ver tu estado en la red: IP externa e interna, puerta de enlace...<p>***TELEFONÃA***<br>Intensidad y tipo de seÃ±al, IP externa, datos de la SIM...<p>***GPS***<br>PodrÃ¡s ver los datos reales que obtiene tu GPS: satÃ©lites, latitud, longitud, altitud...<p>***BATERÃA***<br>Se muestra el nivel de carga, tiempo encendido, salud, temperatura...<p>***MULTITOUCH***<br>Â¿Cuantos dedos reconoce tu pantalla?<p>***INFORMACIÃ“N DEL SISTEMA***<br>Muestra informaciÃ³n del sistema como propiedades de la CPU, RAM, versiÃ³n del kernel, pantalla...<p>Esta aplicaciÃ³n es similar EVEREST o AIDA64 usados para PC, pero ademÃ¡s de mostrar los componentes e informaciÃ³n del sistema, permite hacer lecturas de los sensores.<p>La versiÃ³n Phone Tester Pro muestra mÃ¡s informaciÃ³n (velocidad de la CPU, memoria de telÃ©fono, memoria de la tarjeta sd) y elimina la publicidad.</p></p></p></p></p></p></p></p></p>', '5', '179344', '0', '0', '0', '2015-03-20 18:34:29', '2015-03-20 18:34:29', '0', '1', '0', '0', 'Miguel Torres');
