le.com/site/mxvpen/download%26sa%3DD%26usg%3DAFQjCNFVy6-l6Iow2-l-YwxNChmw6F66Cw&amp;sa=D&amp;usg=AFQjCNGr0975shUpiXfZycayKjh5ST22lQ\" target=\"_blank\">https://sites.google.com/site/mxvpen/download</a>)<br>******<p><br>Si tiene cualquier duda, visite el foro XDA de Reproductor MX.<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forum.xda-developers.com/apps/mx-player%26sa%3DD%26usg%3DAFQjCNGUFBQxEmvOIdAm3TKlz-ZzUb2nzg&amp;sa=D&amp;usg=AFQjCNGsCQorCSmzbyVYl_GO6bUEHXnD9w\" target=\"_blank\">http://forum.xda-developers.com/apps/mx-player</a><p>Some of the screens are from the Elephants Dreams licensed under the Creative Commons Attribution 2.5.<br>(c) copyright 2006, Blender Foundation / Netherlands Media Art Institute / www.elephantsdream.org<p>Some of the screens are from the Big Buck Bunny licensed under the Creative Commons Attribution 3.0 Unported.<br>(c) copyright 2008, Blender Foundation / www.bigbuckbunny.org</p></p></p></p></p></p></p></p></p></p></p>', '9', '10909769', '0', '0', '0', '2015-03-20 18:36:27', '2015-03-20 18:36:37', '0', '1', '0', '0', 'J2 Interactive');
INSERT INTO `applications` VALUES ('com.mycolorscreen.themer', 'Themer', '108', 'BETA 1.8', '10', '* SegÃºn lo visto en The New York Times, CNET, WIRED, Lifehacker, y XDA-Developers *<p>Themer lanzador tiene temas con fondos de escritorio de alta definiciÃ³n, paquetes de iconos, y los widgets preconfigurados para cualquier estado de Ã¡nimo o la ocasiÃ³n. Flip a travÃ©s de nuestra amplia biblioteca de temas, premium gratis. El telÃ©fono al instante se vea mejor y sentirse completamente nuevo. Simplemente pulse en &quot;Aplicar&quot; y todo estÃ¡ listo para usted. <p>Themer tambiÃ©n hace que el telÃ©fono inteligente con CategorÃ­as inteligentes que auto-categorizan sus aplicaciones, lo que facilita la bÃºsqueda y puesta en marcha. Otras caracterÃ­sticas incluyen un cajÃ³n de aplicaciÃ³n completamente personalizable (con su elecciÃ³n de un tema oscuro o claro) y la plena integraciÃ³n de Zooper Widget Pro que permite la mÃ¡xima personalizaciÃ³n. <p><i> &quot;Themer siente como un truco de magia.&quot; -The New York Times <p>&quot;Themer harÃ¡ que su telÃ©fono Android increÃ­ble ... Tanto atractivo y funcional.&quot; -WIRED <p>&quot;Mi telÃ©fono se ve mejor que nunca antes, y que ni siquiera tiene que hacer nada mÃ¡s que pulsar un par de botones. Si tuviera que recomendar alguna aplicaciÃ³n para probar en este momento, este serÃ­a el Ãºnico.&quot; -PhoneDog  <p>CaracterÃ­sticas: <br>- Todos los temas son libres, mÃ¡s de 10 nuevos temas aÃ±adidos a la semana! <br>- Soporte completo paquete de iconos. <br>- MÃ¡s de 325 temas de primera calidad para elegir: Tarjeta de interfaz de usuario, naturaleza, espacio, mÃ­nimo, y muchos mÃ¡s. <br>- FÃ¡cil de volver a su vieja pantalla de inicio si lo desea. <br>- Todos los temas son personalizables, o puede utilizar tal como son. <br>- App Icon gestos. <br>- Acciones Themer aprenden las preferencias de la aplicaciÃ³n. No importa si usted estÃ¡ usando Pandora o Spotify para la mÃºsica, o WeatherBug o AccuWeather para el clima. Themer aprenderÃ¡ lo que te gusta y siempre hacer las cosas bien. <p>Si quieres algo de ayuda, pÃ³ngase en contacto con nuestro excelente equipo de soporte en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://support.themerapp.com%26sa%3DD%26usg%3DAFQjCNFZ6cSVl9TBd7wNxZ5DeeaD6u-n6A&amp;sa=D&amp;usg=AFQjCNEzG9acqrhbc2TurLDJmvf0iuTxSQ\" target=\"_blank\">http://support.themerapp.com</a>. <p><b> Por cierto: Themer todavÃ­a estÃ¡ en beta, lo que significa que estamos trabajando duro para corregir los errores, mejorar el rendimiento, aÃ±adir nuevas funciones, y aumentar la compatibilidad con mÃ¡s dispositivos. Gracias por su paciencia y apoyo.  <p>Lista de dispositivos compatibles: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://support.themerapp.com/knowledgebase/articles/263019-what-devices-are-supported-*As%26sa%3DD%26usg%3DAFQjCNEiEoEAVChl3oeJ-uyu_IQ_CgoFTg&amp;sa=D&amp;usg=AFQjCNGhLp8QZmWzW8Al8q1owomKItSuBg\" target=\"_blank\">http://support.themerapp.com/knowledgebase/articles/263019-what-devices-are-supported-*As</a> seen on The New York Times, CNET, WIRED, Lifehacker, and XDA-Developers*<p>Themer launcher has themes with HD wallpaper, icon packs, and pre-configured widgets for any mood or occasion. Flip through our extensive library of free, premium themes. Your phone will instantly look amazing and feel brand new. Just hit &quot;Apply&quot; and everything is set up for you. <p>Themer also makes your phone smarter with Smart Categories that auto-categorize your apps, making them easier to find and launch. Other features include a completely customizable app drawer (with your choice of a dark or light theme) and full integration of Zooper Widget Pro allowing for the utmost in customizability. <p><i>&quot;Themer feels like a magic trick.&quot; -The New York Times<p>&quot;Themer will make your Android phone look amazing... Both attractive and functional.&quot; -WIRED</p></i><p>Features:<br>- All themes are free, more than 10 new themes added per week!<br>- Full icon pack support.<br>- Over 325 premium themes to choose from: Card UI, Nature, Space, Minimal, and many more.<br>- Easily go back to your old homescreen if you want.<br>- All themes are customizable, or you can use them as they are.<br>- App icon gestures.<br>- Themer Actions learn your app preferences. It doesn&#39;t matter if you&#39;re using Pandora or Spotify for music, or WeatherBug or AccuWeather for weather. Themer will learn what you like and always get it right.<p>If you want some help, contact our excellent support team at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://support.themerapp.com%26sa%3DD%26usg%3DAFQjCNFZ6cSVl9TBd7wNxZ5DeeaD6u-n6A&amp;sa=D&amp;usg=AFQjCNEzG9acqrhbc2TurLDJmvf0iuTxSQ\" target=\"_blank\">http://support.themerapp.com</a>.<p><b>By the way: Themer is still in beta, which means that we are working hard to fix bugs, improve features, etc. Thanks for your patience and support. </b></p></p></p></p></p></p></p></b></p></p></p></p></p></i></p></p></p>', '16', '9980234', '0', '0', '0', '2015-03-20 18:34:32', '2015-03-20 18:34:32', '0', '1', '0', '0', 'MYCOLORSCREEN');
INSERT INTO `applications` VALUES ('com.nextmobileweb.dialzero', 'DialZero', '3', '1.02', '5', '&quot;Top 9 Google Android Apps&quot; --CNET<p>Quickly dial the customer service numbers of over 600 companies and skip directly to a person. Don&#39;t wait through annoying voice prompts any longer. Dial Zero is useful, fast, and simple.<p>Learn how others got what they wanted from these companies (refunds, canceling their account, etc.).</p></p>', '', '105674', '0', '0', '0', '2015-03-20 18:36:47', '2015-03-20 18:36:47', '0', '1', '0', '0', 'Next Mobile Web');
