INSERT INTO `applications` VALUES ('com.nimbuzz', 'Nimbuzz', '15', '2.0.5', '7', 'Free messages, Free Calls. Unlimited! <br>Nimbuzz Messenger lets you make cheap international voice calls, send unlimited chat messages, share files etc across popular messengers. Nimbuzz Messenger is available on Android, iOS, Windows Phone, Blackberry, Symbian, Java, Windows and Mac.<p>Nimbuzz Messenger is super-popular and our 150+ million registered users across platforms prove that. <p>Below is the list of Nimbuzz Messengerâ€™s amazing features that take your mobile IM experience to the next level:<br>â€¢ FREE HD VOICE CALLS â€“ Cheap International HD quality voice calls for free <br>â€¢ FREE MESSAGING - Replace SMS with unlimited free chat. <br>â€¢ GROUP CHAT - Enjoy group conversations by sending text messages to your contacts in a single group.<br>â€¢ STICKERS - Express yourself better with super cool Sticker packs.<br>â€¢ CHATROOMS â€“ Discover new friends in chat rooms <br>â€¢ CHEAP INTERNATIONAL CALLS (VOIP) â€“ Buy Nimbuzz Out credits and make cheap international VOIP calls to mobile and landlines<br>â€¢ SIP VOIP ACCOUNTS â€“ Connect to any SIP provider through Nimbuzz and enjoy extremely low cost VOIP calls <br>â€¢ FILE SHARING â€“ Share photos, documents, music and videos with all your friends. <br>â€¢ CHAT BUDDIES â€“ Use our popular chat buddies for Cricket, Astrology, Meet a Stranger, Jokes, Games.<br>â€¢ AND MORE: Custom chat wallpaper, N-world, Virtual Goods, Free Avatars, Games and more.<br>Your active feedback is greatly appreciated. For any questions, concerns, feedback or ideas, drop us an email at: <a href=\"mailto:support@nimbuzz.com\">support@nimbuzz.com</a><p>Visit Nimbuzz communities at:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/nimbuzz%26sa%3DD%26usg%3DAFQjCNHFYqmWg2H3Kryz_JVCSgoF96ANXg&amp;sa=D&amp;usg=AFQjCNFNzSHHxh4g7NvxnzVI_mXwoC-m5A\" target=\"_blank\">http://facebook.com/nimbuzz</a><br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/nimbuzz%26sa%3DD%26usg%3DAFQjCNEPcErUs_LwwBGbSXch7XGC_LMzYQ&amp;sa=D&amp;usg=AFQjCNGiZEZiQgYQStfxMHc6qIaegIbjLQ\" target=\"_blank\">http://twitter.com/nimbuzz</a><p>For more info please visit:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.nimbuzz.com%26sa%3DD%26usg%3DAFQjCNEjk-chQsBcOn5Qs1z76e7qCDRCUw&amp;sa=D&amp;usg=AFQjCNGQL_aLVbo-xS1-wS1XWkVZjUxxPQ\" target=\"_blank\">http://www.nimbuzz.com</a><br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://blog.nimbuzz.com%26sa%3DD%26usg%3DAFQjCNH2SIeNEcdXkamsEsiolgl41vj9vA&amp;sa=D&amp;usg=AFQjCNHyNan-okH2nRyl3d3Yss29HEAHJA\" target=\"_blank\">http://blog.nimbuzz.com</a></p></p></p></p>', '3', '5475938', '0', '0', '0', '2015-03-20 18:38:14', '2015-03-20 18:38:14', '0', '1', '0', '0', 'Nimbuzz BV');
INSERT INTO `applications` VALUES ('com.nitrodesk.droid20.nitroid', 'TouchDown (Android 2.0)', '50010030', '5.1.0030', '20', 'Knowledge Base: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.symantec.com/business/support/index?page%253Dproductlanding%2526key%253D63745%26sa%3DD%26usg%3DAFQjCNHg6nCC752JrbNIuRvvUrrtBa2sNw&amp;sa=D&amp;usg=AFQjCNFwJxYoc2ghFBWPO1HyFGkoeICFvw\" target=\"_blank\">http://www.symantec.com/business/support/index?page=productlanding&amp;key=63745</a><br>Much improved conversation view when you swipe right to left on an email<br>If you are on an android 4.x device, you will see richer notifications<br>Localization for 13 languages<p>This version of TouchDown is specially for SmartPhone devices running Android 2.x. This is a 30 day trial which you can activate by purchasing the license key separately.<p>When it comes to corporate data access on your device, you get what you pay for. For a fair comparison, compare the download counts along with the stars.<p>NitroDesk, Inc. has been building and improving TouchDown since October 2008. We have improved the product through hundreds of internal versions, to bring you the best and most downloaded Email solution for Android. <p>Comprehensive : Support for most number of data types (Email, Calendar, Contacts, Tasks) and Notes and SMS syncing for Exchange 2010 servers. <p>Customizable : Dozens of options to make the app behave just the way you want. Custom notifications, speech notifications, viewing tweaks, pinch-to-zoom, peak times and many more.<p>SD card support : Move your data to the SD card if necessary<p>Widgets : Email, Tasks, Calendar, Universal Widgets make it easy for you to see your status at a glance. Support for third party widgets give you a wide range of choice<p>Most Secure: TouchDown supports exchange activesync policies such as PIN, Remote Wipe, Data encryption and Storage card encryption of corporate data. Hundreds of organizations trust TouchDown to ensure security, privacy and confidentiality of their data. Discerning organizations mandate the use of TouchDown to ensure high usability along with security. <p>Corporate Data Separation: TouchDown keeps your corporate data separate from your personal data. Without TouchDown, your employer can actually flatten your phone to factory defaults. With TouchDown, they can only remove corporate data belonging to them, leaving behind your personal information. <p>S/MIME: TouchDown is the only android solution so far that supports sending and receiving S/MIME signed and encrypted emails. S/MIME signing and encryption ensures that your emails are not tampered with, and can ensure that emails you send can be ensured to be visible only to the intended recipient.<p>Manageable : TouchDown integrates with most popular Mobile Device Management solutions in the market today, increasing the chances that your phone can play well with your IT organization&#39;s security policies.<p><br>LiveWareâ„¢ extension for SmartWatch<br>Smart Connect extension for SmartWatch 2</p></p></p></p></p></p></p></p></p></p></p></p>', '5', '2698905', '0', '0', '0', '2015-03-20 18:35:34', '2015-03-20 18:35:34', '0', '1', '0', '0', 'NortonMobile');
INSERT INTO `applications` VALUES ('com.oldplanets.redalertwallpaperplus', 'ST', '6', '0.6', '10', 'A live wallpaper imitating the Star Trek Red Alert signal. But it&#39;s not just some eye candy, true to its original purpose it will help you to monitor your device and alert you about any important events. Missed a call from your friend without noticing? You won&#39;t ever again when the Red Alert flashes on your screen and the klaxon calls for your attention ;)<p><br>Currently the following events can be set to trigger the yellow or red alert:<br>- Messages: SMS, MMS, GMail, Skype*, WhatsApp*, Kik*, Viber* <br>- Missed Calls: Phone, Skype*, Viber*<br>- Alarm Clock<br>- Battery Level and charging state<br>- Phone Temperature<br>- Failed Unlock Attempts<br>- Signal Loss (WiFi or Mobile)<br>- Voice Commands (experimental)   <p>* Skype, Kik, Viber and WhatsApp support needs Android 4.3 or newer<p><br>Check out the free version to get an impression of this wallpaper.<p><br>Used Permissions:<br>&quot;Read Contacts/SMS/Call Logs&quot; permissions are used to switch the alert on new Phone Calls/SMS. Record Audio is used for Voice Commands.<br>No Networking permissions are requested.<p><br>If you found a bug, have a problem or want to send me feedback/suggestions, please write a mail (address is listed below).</p></p></p></p></p>', '7', '88115', '0', '0', '0', '2015-03-20 18:36:13', '2015-03-20 18:36:13', '0', '1', '0', '0', 'OldPlanets');
INSERT INTO `applications` VALUES ('com.piriform.ccleaner', 'CCleaner', '71410628', 'v1.06.28', '3', '<b>Keep your Android clean, safe and fast using CCleaner!</b><p><br>Piriform, the makers of the worldâ€™s most popular PC and Mac cleaning software bring you CCleaner for Android. <p><br>Remove junk, reclaim space, monitor your system and browse safely. Become the Master of your own device with the ultimate cleaning app for your Android!<p><br><b>Optimize and Clean</b><br>â—  Speed up your phone and remove junk safely<br>â—  Clean application cache, download folders, browser history, clipboard content and more<br>â—  Delete call logs and SMS messages individually, in bulk, by age or by contact<p><br><b>Reclaim Storage Space</b><br>â—  Streamline your Android smartphone or tablet<br>â—  Quickly and easily uninstall multiple unwanted applications<br>â—  Free up valuable storage space on your device<p><br><b>Easy to Use</b><br>â—  Optimize your Android in just a few clicks<br>â—  Simple, intuitive user interface which is easy to navigate<br>â—  Totally free from Ads and clutter<br>â—  Fast, compact and efficient with low memory and CPU usage<p><br><b>Monitor your System</b><br>â—  Check the usage of your CPU<br>â—  Keep track of your RAM and internal storage space<br>â—  Check out your battery levels and temperature</p></p></p></p></p></p>', '14', '2354938', '0', '0', '0', '2015-03-20 18:34:30', '2015-03-20 18:34:30', '0', '1', '0', '0', 'Piriform');
