INSERT INTO `applications` VALUES ('com.rafoid.multimountsdcard.widget', 'Multi Mount SD-Card', '51', '1.77', '3', 'If you don&#39;t have rooted your phone, you can use this application to simplify mounting sdcard.<p>Any problem to download ? <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://goo.gl/KCDyL%26sa%3DD%26usg%3DAFQjCNFOYFTdjc4fM3RBwCW6fxfvgxc-vQ&amp;sa=D&amp;usg=AFQjCNE8n4OAnLX_p26z-9hD9YVjwy6jxw\" target=\"_blank\">http://goo.gl/KCDyL</a><p>ROOT ACCESS NEEDED AND MANDATORY TO GET ALL OPTIONS ACTIVATE.<p>You go to your sdcard in your phone and PC simultaneously.<br>The changes are visible immediately.<br>Don&#39;t use Android mount<br>This application is a widget, but not only :)<p>DISABLE AUTO-MOUNT FROM ALL APP (ex: WinAmp)<p>â€¢ Auto mount on USB connection<br>â€¢ Choose what sd-card is mounted (for mobile with 2 sd-card)<br>â€¢ Hide notification after a delay<br>â€¢ Scan media on unmount<br>â€¢ Vibrate on un/mount<br>â€¢ Option to mount without check if usb cable is present<br>â€¢ Disable media scan<p>English, French, Russian (Vladimir), Italian (Luca T.), Danish (Rasmus B.), German (Flo.), Polish (Kamil S.), Chinese (Jen J.), Turkish (YaÅŸar M.), Korean (MoonHee C.) you want your language ? Send me an email <p>#2.50<br>â€¢ Add root privileges in manifest<br>â€¢ Remove bad messages<p>ROOT ACCESS NEEDED<p>FULL VERSION<p>Contact me for any problems<p>share|memory|mount|usb|sdcard</p></p></p></p></p></p></p></p></p></p></p>', '3', '251452', '0', '0', '0', '2015-03-20 18:35:59', '2015-03-20 18:35:59', '0', '1', '0', '0', 'rafoid');
INSERT INTO `applications` VALUES ('com.ratrodstudio.mikevskateparty', 'Skate Party', '3', '1.02', '12', 'Complete achievements, gain experience and upgrade your skaters. Customize your outfits, shoes, board, trucks, wheels and bearings. Challenge skaters from all over the world using our online leaderboards.<p>XPERIA PLAY SUPPORT<br>Xperia Play Optimized (The first PlayStationâ„¢ Certified Android smartphone).<p>MOGA CONTROLLER SUPPORT<br>Mike V Skateboard Party is now MOGA Enhanced! Available at major US retailers and online at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.powera.com/moga%26sa%3DD%26usg%3DAFQjCNHAk9tzo4GOqB5DbT3t450T6M6_uA&amp;sa=D&amp;usg=AFQjCNG2ZaJjWiSEAtNylo4Ykc7ZPJY6ZA\" target=\"_blank\">http://www.powera.com/moga</a><p>CAREER MODE<br>Complete over 25 achievements to unlock new items and locations. Gain experience to upgrade your favorite skaterâ€™s attributes to perform better and achieve higher scores.<p>FREE SKATE<br>Practice and improve your skateboarding skills without any constraints.<p>MASSIVE SELECTION<br>Select between 8 characters and customize each of them to your preference. From outfits to shoes, choose your favorite gear. A massive collection of boards, trucks, wheels and bearings are available including items from Airwalk, Powell &amp; Peralta, Bones, Tork Trux and Iron Fist Clothing.<p>LEARN TO SKATE<br>Over 40 unique tricks to master and hundreds of combinations. Follow the tutorial to get started and progress as you go. Execute the craziest combos and trick sequences to rack up some impressive high scores, gain experience and make a name for yourself.<p>NEW CONTROLS<br>New fully customizable control system; configure your own buttons layout and adjust the opacity. Use the right or left handed control mode, select a control preset or create your own. Use the analog stick or accelerometer option as you wish. Adjust your truck tightness to change your steering sensitivity. <p>FEATURES<br>â€¢ The only HD Skateboarding game available on the market.<br>â€¢ New, fully customizable control system.<br>â€¢ Learn over 40 tricks, create hundreds of combinations.<br>â€¢ Massive skateboard locations to ride including a community center, motel, downtown plaza, junkyard, indoor skatepark and vert ramp.<br>â€¢ Customize your skater or board with tons of exclusive content including outfits, shoes, boards, trucks, wheels and bearings. Select from your favorite brands including Airwalk, Powell &amp; Peralta, Tork Trux and Iron Fist Clothing.<br>â€¢ Gain experience and upgrade your skaterâ€™s attributes.<br>â€¢ Achievements &amp; leaderboards.<br>â€¢ Share your results with your friends on Facebook or Twitter.<br>â€¢ Soundtrack by Conditions &amp; Revolution Mother.<br>â€¢ Universal version for Android phones and tablets<p>â€¢Additional charges may apply (In-app purchase) to unlock specific locations.<p>HIGH DEFINITION<br>No other skateboarding game is available in HD. Mike V: Skateboard Party includes next generation graphics specially optimized for your mobile hardware to provide you with the best skateboarding experience on Android phone or tablet. <p><br>MIN HARDWARE REQUIREMENTS<br>â€¢Compatible with all Android based phones and tablets running a resolution of 800x480 or higher.<p>ABOUT MIKE VALLELY<br>From skateboard legend to rock star and movie actor, Mike Vallely is known as a pioneer and innovator in the skateboarding world. Discovered by Stacy Peralta (Z-Boys) and Lance Mountain in the 80s, Mike became the first East Coast street skater to emerge on the scene and became an overnight sensation.</p></p></p></p></p></p></p></p></p></p></p></p>', '6', '51886506', '0', '0', '0', '2015-03-20 18:37:09', '2015-03-20 18:37:09', '0', '1', '0', '0', 'Ratrod Studio Inc.');
INSERT INTO `applications` VALUES ('com.rechild.advancedtaskkillerpro', 'Advanced Task Killer', '65', '1.9.5', '5', 'Advanced Task Killer is also known as ATK. It is a tool to kill applications running. This version is pro version which doesn&#39;t contain ads.<p>ATK is often used to kill apps and clean memory. We do suggest people use ATK manually kill apps instead of auto killing apps.<br> <br>-Ignore List<br>-One tap widget<br>-Auto kill<br>-Customize item height<p>1. How to use it (for new users to quick start)?<p>It is pretty simple. Open this tool and take a look at the running applications list? Uncheck some apps you don&#39;t want to kill (such as Advanced Task Killer and some system apps) Tap the button &#39;Kill selected apps&#39;, it will kill all applications checked.<p> <p>2. How to use it (for new users to do more)?<p>If you don&#39;t want to kill any application, you can tap it on the running applications list. Then it&#39;s checking box will turn to gray.<p> <p>3. Why there are programs running that I haven&#39;t used or even opened?<p>Some applications will start up once you turn on your phone or be invoked by some events.<p> <p>4. What is ignore list/ignore?<p>Ignore list is for you to ignore some applications you don&#39;t want to kill. If you long press on the application listed on the main screen of ATK, the menu will pop up, then you can select &#39;Ignore&#39;, the application would be moved to ignore list. When you tap &#39;Kill selected apps&#39;, it won&#39;t be killed any more.<p> <p>5. What is default action for long press?<p>You can set your default action for long press and click on the settings. The system default action for long press is pop-menu. That means you when you long press on the application(displays on the running applications list), a pop-menu would shows up. For example, if you want to switch to the application after you long press on it, you can set the default action of long press to &#39;Switch to&#39;.<p> <p>6. Why I lost my network connection after I tap &#39;kill selected apps&#39;?<p> This is because some apps related with network connection are killed. Such as &#39;voicemail&#39;. You can ignore it instead of killing it.<p> <p>7. Why my Home reloaded?<p>This is because some apps related with Home are killed. Such as &#39;HTC Sense&#39;, &#39;Mail&#39;(if it is integrated with Home). You can ignore it instead of killing it.<p> <p>8. Why I cannot receive notification of Email?<p>This is because you killed &#39;Email&#39;. Instead of killing it, you need to ignore it.<p> <p>9. What is Auto Kill?<p>If you want to kill apps automatically you need to choose one of auto-kill level<p>- Safe: Only kill the apps aren&#39;t running but still consume memory.<p>- Aggressive: Kill the apps running background and apps aren&#39;t running.<p>- Crazy: All apps except for apps you are using with.<p>You should be able to see Auto Kill information shows on the title, like &#39;Auto-Kill: 12:20&#39;. That means auto kill will start at 12:20, you can also change the frequency to impact the auto kill start time. <p>Note: For android 2.2 and later version, task manager cannot kill services and front apps, you have to force stop them. If you use task manager to kill them, services might restart, also notification won&#39;t be ereased from the top bar. So we don&#39;t suggest people use task manager kill them.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '55518', '0', '0', '0', '2015-03-20 18:36:53', '2015-03-20 18:36:53', '0', '1', '0', '0', 'ReChild');
INSERT INTO `applications` VALUES ('com.remotefairy', 'Smart Remote', '61', '1.6.1', '3', 'Ahora puedes utilizar tu telÃ©fono como control remoto de infrarrojos (IR Remoto)<br>Â¿Por quÃ© deberÃ­as utilizar mÃ¡s de un mando a distancia para todos tus dispositivos?<p>Con Smart Remote para Samsung / HTC, puedes aÃ±adir, crear y personalizar cualquier nÃºmero de controles remotos, combinando controles de cualquiera de tus controles remotos existentes. Imagina un Ãºnico control remoto en el que el botÃ³n BAJAR CANAL controla el descodificador del proveedor de TV, los botones de VOLUMEN controlan el sistema de cine en casa y las teclas de flecha controlan el menÃº del televisor. <p>Â¿AdemÃ¡s, si tienes un telÃ©fono, por quÃ© no utilizar algunas de sus caracterÃ­sticas Ãºnicas?<p>GESTOS DE AIRE - Â¡exclusivo en tu telÃ©fono!<br>Simplemente deja la aplicaciÃ³n abierta y mueve la mano por encima de tu telÃ©fono para cambiar de canales (de izquierda a derecha) o el volumen (arriba y abajo)<p>MUDO AUTOMÃTICO CUANDO RECIBES UNA LLAMADA<br>Â¿No odias cuando recibes una llamada y no puedes oÃ­r a la otra persona porque la televisiÃ³n estÃ¡ demasiado alta? Ahora, Smart Remote puede silenciar automÃ¡ticamente tu dispositivo actual cuando alguien te llama.<p>COMANDOS MACRO<br>Â¡EnvÃ­a varios comandos con tan solo pulsar un botÃ³n!<p>Con infrarrojos - IR Blaster â€“ ya incluido en tu telÃ©fono, Â¿por quÃ© no sacar el mÃ¡ximo provecho? Smart Remote puede controlar la televisiÃ³n, el descodificador, las luces, los proyectores, etc... PrÃ¡cticamente cualquier cosa que tenga un receptor de infrarrojos puede ser controlado por Smart Remote con los cÃ³digos remotos correctos. Â¡Y estamos trabajando 24 horas al dÃ­a, 7 dÃ­as a la semana para aÃ±adir mÃ¡s! <p>Â¿Por quÃ© no deshacerte de una vez por todas de tu televisor remoto, del descodificador y del home center remoto?<p># Por favor, ten en cuenta que debido a la larga cola, normalmente se tarda 1-2 semanas en aÃ±adir nuevos dispositivos a nuestra base de datos despuÃ©s de que los comunicas<br># Por favor, ten en cuenta que debido a la limitaciÃ³n del hardware de Galaxy S4, no es posible el aprendizaje automÃ¡tico</p></p></p></p></p></p></p></p>', '15', '7829466', '0', '0', '0', '2015-03-20 18:34:41', '2015-03-20 18:34:44', '0', '1', '0', '0', 'Color Tiger');
INSERT INTO `applications` VALUES ('com.rocketmind.fishingfull', 'Big Sport Fishing', '12', '1.05', '12', 'This is the full version of Big Sport Fishing. Enjoy beautiful panoramic views and stunning 3D graphics in this exciting fishing game!<p>As you move your phone, the games view changes so you feel like you&#39;re really there. Realistic 3D fish can be seen swimming beneath the waves when they are close and will often jump to give away their location when farther away. When you see a big one just flick your wrist to cast. Pull back on your phone to hook a fish and fight it as you reel in your catch. After you catch a fish you can take a picture to view later or share with friends!<p>The full version has 10 fishing locations.<p>Free version available! Try before you buy!<p>In Big Sport Fishing you can earn virtual credits to acquire special bonus items. These credits can also be purchased using an In-App purchase.<p>Permissions:<p>Big Sport Fishing uses the WRITE_EXTERNAL_STORAGE permission to write save game data to your phone&#39;s external storage.</p></p></p></p></p></p>', '6', '5859328', '0', '0', '0', '2015-03-20 18:33:49', '2015-03-20 18:33:49', '0', '1', '0', '0', 'Rocketmind');
INSERT INTO `applications` VALUES ('com.rockstargames.gtasa', 'GTA', '7', '1.05', '28', 'Hace cinco aÃ±os, Carl Johnson dejÃ³ atrÃ¡s su vida en Los Santos, San Andreas, una ciudad consumida por las bandas callejeras, las drogas y la corrupciÃ³n. Una ciudad donde las estrellas de cine y los millonarios hacen lo posible por evitar a los traficantes y a las bandas.<p>Estamos a principios de los noventa y Carl debe regresar. Su madre ha sido asesinada, su familia se rompe en pedazos y sus amigos de la infancia llevan un mal camino.<p>Al regresar a su barrio, un par de policÃ­as corruptos lo acusan de homicidio. CJ se ve arrastrado a un viaje que lo llevarÃ¡ a cruzar todo San Andreas para salvar a su familia y hacerse con el control de las calles.<p>Rockstar Games presenta su mayor lanzamiento para dispositivos mÃ³viles hasta el momento con un amplio mundo abierto que alberga el estado de San Andreas y sus tres ciudades principales: Los Santos, San Fierro y Las Venturas; con fidelidad visual mejorada y mÃ¡s de 70 horas de juego.<p>CaracterÃ­sticas de Grand Theft Auto: San Andreas:  <br>â€¢ GrÃ¡ficos de alta resoluciÃ³n remasterizados y creados especÃ­ficamente para dispositivos mÃ³viles. Incluyen mejoras de iluminaciÃ³n, una paleta de colores mÃ¡s rica y modelos mejorados de personajes. <br>â€¢ Compatible con guardado en la nube para poder jugar en todos tus dispositivos mÃ³viles, para miembros del Social Club de Rockstar.<br>â€¢ Control mediante dos sticks analÃ³gicos para controlar la cÃ¡mara y el movimiento.<br>â€¢ Tres sistemas de control diferentes y controles personalizables con opciones contextuales para mostrar los botones solo cuando los necesites.<br>â€¢ Compatible con los mandos de juego inalÃ¡mbricos MoGa y ciertos gamepads Bluetooth y USB.<br>â€¢ Incluye efectos tÃ¡ctiles de Immersion.<br>â€¢ Modifica a tu gusto la experiencia visual con ajustes grÃ¡ficos personalizables.<p>Idiomas disponibles: inglÃ©s, francÃ©s, italiano, alemÃ¡n, espaÃ±ol, ruso y japonÃ©s. <p>Para obtener un rendimiento Ã³ptimo, recomendamos reiniciar el dispositivo despuÃ©s de la descarga y cerrar otras aplicaciones mientras juegas a Grand Theft Auto: San Andreas.<p>Para mÃ¡s informaciÃ³n sobre soporte de dispositivos y compatibilidad, visita: <br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://support.rockstargames.com/hc/en-us/sections/200251868-San-Andreas-Mobile-Support%26sa%3DD%26usg%3DAFQjCNGs2YmpDqGwkRGUR5bHRihtWwX9_Q&amp;sa=D&amp;usg=AFQjCNFrfSTSyergKOXJ-VS9hxZxdbdofw\" target=\"_blank\">http://support.rockstargames.com/hc/en-us/sections/200251868-San-Andreas-Mobile-Support</a><p>VersiÃ³n mÃ³vil desarrollada por War Drum Studios<br>www.wardrumstudios.com<p>MÃ¡s informaciÃ³n en:<br>www.rockstargames.com<p>Para ver vÃ­deos, visita:<br>www.youtube.com/rockstargames<p>SÃ­guenos:<br>www.facebook.com/rockstargames<br>www.twitter.com/rockstargames</p></p></p></p></p></p></p></p></p></p></p>', '11', '11915455', '0', '0', '0', '2015-03-20 18:36:25', '2015-03-20 18:36:25', '0', '1', '0', '0', 'Rockstar Games, Inc.');
INSERT INTO `applications` VALUES ('com.rovio.angrybirdstransformers', 'Angry Birds', '10125', '1.1.25', '14', 'Angry Birds y Transformers se dan la mano en esta aventura en 3D cargada de acciÃ³n y tiros. La Chispa oval ha transformado los huevos en unos robots mal de la cabeza que se estÃ¡n dedicando a destrozar Isla Cerdito. Â¡Â¿QuiÃ©n serÃ¡ capaz de detenerlos!? Â¡Adelante, AutopÃ¡jaros!<p>Â¿Has visto alguna vez un Angry Bird robot alienÃ­gena? Â¡Que pasen los AUTOPÃJAROS! Esta banda de hÃ©roes cuenta en sus filas con Red como Optimus Prime, Chuck, como Bumblebee y... bueno, muy pronto conocerÃ¡s al resto. Van armados de lÃ¡seres y se convierten en coches. Aparte de que tienen brazos y manos, claro, eso es imprescindible.<p>Pero los valientes AutopÃ¡jaros no pueden salvar Isla Cerdito por sÃ­ mismos: para detener a los Huebots tendrÃ¡n que unir fuerzas con sus archirrivales los Decepticerdos (que son como los decepticons pero huelen algo peor). Â¿SerÃ¡n capaces de limar asperezas y luchar codo con codo? Eso habrÃ¡ que verlo...<p>*NOTA: Angry Birds Transformers es un juego totalmente gratuito pero se pueden realizar compras dentro de la aplicaciÃ³n.<p>--------------<p>- Â¡COLECCIÃ“NALOS! Â¡Desbloquea todo el elenco de hÃ©roes (y villanos) con ataques y habilidades exclusivos!<p>- Â¡ARRASA CON TODO! DÃ©jate el tirachinas en casa: Â¡en esta ocasiÃ³n llevarÃ¡s ARMAS de verdad de la buena!<p>- Â¡VEHÃCULOS! Â¡SÃ­, seÃ±or! Coches, camiones, tanques y hasta aviones. Â¡TransfÃ³rmate para esquivar los peligros que caen del aire!<p>- Â¡MEJORAS! Â¡Consigue armas mÃ¡s potentes y nuevas habilidades para todos los Transformers!<p>- Â¡LUCHA EN EQUIPO! Â¡Toma prestado el personaje de algÃºn amigo y libera un devastador ataque con dos robots!<p>- Â¡TELEPODSâ„¢! Â¡EscanÃ©alos para desbloquear, revivir o potenciar tus robots!<p>*NOTA:<br>Para jugar se necesita una conexiÃ³n a Internet.<br>Cuando juegues por primera vez, se descargarÃ¡ en segundo plano un paquete Ãºnico de contenido adicional.<br>--------------<p>Visita la sede de Angry Birds Transformers:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://transformers.angrybirds.com/%26sa%3DD%26usg%3DAFQjCNH7EsUrC2kwpm11AVhg_YezzkeX9w&amp;sa=D&amp;usg=AFQjCNFZab5bjYr5IfItLWI1lYwed5ZFVw\" target=\"_blank\">http://transformers.angrybirds.com/</a><p>Sigue a la bandada:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.angrybirds.com%26sa%3DD%26usg%3DAFQjCNGE0C2MlIi4LJCNkUrWu6bBaJp2Cw&amp;sa=D&amp;usg=AFQjCNELMuE-WxwOsjoUNQ5LxQShg18BPQ\" target=\"_blank\">http://twitter.angrybirds.com</a><p><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/angrybirds%26sa%3DD%26usg%3DAFQjCNHGA0zHhSISaStUrDiZiOP9utIAqg&amp;sa=D&amp;usg=AFQjCNH9rQwjph1UktXT1JCcv2gNJXoyRg\" target=\"_blank\">http://facebook.com/angrybirds</a><p>Descubre el resto del universo Angry Birds:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.angrybirds.com/%26sa%3DD%26usg%3DAFQjCNGeAiJBE12_SeMy-GJqq9ZSIFdlTQ&amp;sa=D&amp;usg=AFQjCNELOeCZrbccKX6ZJ5OAtcqECSnUsQ\" target=\"_blank\">https://www.angrybirds.com/</a><p>--------------<p>Condiciones de uso: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.rovio.com/eula%26sa%3DD%26usg%3DAFQjCNEgtLJ08RdZefh3AxPrT6BLABUqPA&amp;sa=D&amp;usg=AFQjCNHjrwdzQgE6LXvUb9Pa_s8Xi4_jpA\" target=\"_blank\">http://www.rovio.com/eula</a><p>PolÃ­tica de privacidad: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.rovio.com/privacy%26sa%3DD%26usg%3DAFQjCNGt5frM4xE8I2NzBoydDHFuFHGA3g&amp;sa=D&amp;usg=AFQjCNE-3bLvZTo6iHFNlNujbZa_6ZKeYw\" target=\"_blank\">http://www.rovio.com/privacy</a><p>Aviso importante para padres:<br>- Enlaces directos a sitios web de redes sociales dirigidas a usuarios de mÃ¡s de 13 aÃ±os.<br>- Enlaces directos a Internet que permiten a los jugadores salir del juego y, potencialmente, visitar otros sitios web.<br>- Anuncios de productos de Rovio y de socios seleccionados.<br>- La opciÃ³n de realizar compras integradas. Pide permiso al titular de la cuenta antes de hacer ninguna compra.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '14', '41580618', '0', '0', '0', '2015-03-20 18:37:05', '2015-03-20 18:37:05', '0', '1', '0', '0', 'Rovio Entertainment Ltd.');
INSERT INTO `applications` VALUES ('com.sanels.tempcpupro', 'Temp+CPU PRO', '22', '3.9', '3', 'I&#39;m aware this app crashes on android 4.3. A new version is being developed currently.<p>This is the PRO version.<br>***Note to all users, this app DOES support duelcores(works perfectly fine on my tegra 2 transformer). I know that it has issues with sense ui for htc users. I am not sure why it does not work with your device until I get my hands on one)<br>*3.95 Changes:<br>  -added Network Rx/Tx speed stat<br>  -show all stats in notification<br>  -minor tweaks<br>**Problems after reboot? Do NOT install to sd! Install on phone and all problems after reboot are solved.<p>What you get in pro:<br>-Stats in Notification bar<br>-Network Rx/Tx speeds(KB/s)<br>-Changeable update time<br>-*C or *F<br>-Changeable text color and icon.<br>-Choose any 4 stats:<br>CPU freq<br>CPU %<br>CPU composite %<br>CPU temp(requires supported kernel)<br>Bat temp<br>RAM<br>Battery %<br>Date<br>SMS Stats</p></p>', '4', '106121', '0', '0', '0', '2015-03-20 18:34:27', '2015-03-20 18:34:27', '0', '1', '0', '0', 'SanelS');
INSERT INTO `applications` VALUES ('com.scan.places', 'SharesFinder', '11', '1.1.1', '3', 'SharesFinder is intended for scanning wireless local networks for shared resources (SMB, FTP, HTTP). You can explore SMB resources directly by SharesFinder, HTTP resources with Android browser and FTP resources with another tool supporting this protocol (FtpCafe or AndFTP).<p>Shares Finder is a simple analog of Windows &quot;My network places&quot;. Also, it can be used as SMB client.<p>Features:<br>- easy in use;<br>- fast scan;<br>- shows maximum network information with one click;<br>- provides downloading and uploading of files and folders;<br>- flexible scanner customization;<br>- tests if anonymous access to resource is available;<br>- determines and shows services vendor and version;<br>- shows DNS and NetBIOS names;<br>- shows hardware address(MAC) and wlan adapter vendor of remote devices.<p>Ad supported.<p>Tags: network discovery, security scanner, network scanner, smb client, shares finder.</p></p></p></p>', '7', '627569', '0', '0', '0', '2015-03-20 18:36:26', '2015-03-20 18:36:26', '0', '1', '0', '0', 'srcguardian');
INSERT INTO `applications` VALUES ('com.sec.pcw', 'Samsung Link', '8070', '1.8.1609', '5', '* AllShare Play se llama ahora Samsung Link. Al igual que AllShare Play, Samsung Link permite reproducir y administrar contenidos guardados en diversos dispositivos, como un telÃ©fono inteligente, un PC y una tableta. AdemÃ¡s, podrÃ¡ seguir utilizando sus dispositivos y servicios de almacenamiento registrados en AllShare Play. AdemÃ¡s, Samsung Link incorpora nuevas funciones.<p>ComparticiÃ³n y reproducciÃ³n de contenidos entre dispositivos digitales, en cualquier momento y en cualquier lugar.<p>Samsung Link es un servicio que permite a los usuarios reproducir contenidos guardados en varios dispositivos a travÃ©s de Internet. <br>Aunque los contenidos estÃ©n guardados en diferentes dispositivos, podrÃ¡ ver, reproducir y enviar cualquier contenido de un dispositivo a otro dispositivo, sitio web o servicio de almacenamiento a travÃ©s de Samsung Link. <br>Mediante Samsung Link, ahora puede administrar mÃ¡s fÃ¡cilmente los archivos que tiene guardados en sus dispositivos.</p></p>', '18', '30015483', '0', '0', '0', '2015-03-20 18:38:12', '2015-03-20 18:38:12', '0', '1', '0', '0', 'Samsung Electronics Co., Ltd. MSC');
INSERT INTO `applications` VALUES ('com.shredderchess.android', 'Shredder Chess', '1', '1.0', '29', 'Get the most successful chess program ever. Have fun and improve your play. You can play against Shredder, analyze with him and solve chess puzzles. It offers the usual Shredder standard for your pocket.<p>In addition to the outstanding playing strength of the 17 times computer chess world champion, Shredder is also able to mimic the play of a human chess player with any playing strength. He even deliberately makes typical human mistakes in those levels.<p>Solve 1000 built in chess puzzles. Shredder keeps track of your performance and offers advice if needed.<p>You can adjust Shredderâ€™s playing strength from beginner to master level. If you like, Shredder automatically adjusts his strength to yours. He even calculates an Elo rating for you. This is how the playing strength of chess players is typically measured.<p>During the game a coach is watching your moves and warns you if you are about to make a mistake.<p>See how you are getting better and better the more games you play and the more chess puzzles you solve.<p>Works fine on mobile phones and tablets.<p>* Adjustable playing strength<br>* Intuitive and very easy to operate<br>* 1000 built in chess puzzles<br>* Rates your play<br>* Outstanding playing strength<br>* Simulates opponent of any strength<br>* Analyze your games with Shredder, find your mistakes and improve your play<br>* Coach shows your mistakes<br>* Great variety with built-in opening book<br>* Enter and analyze any position you like<br>* Load and save games (incl. names, date, etc.)<br>* Import and export games in PGN format<br>* Many different chess boards and pieces<br>* Play blindfolded<br>* Improve your play whenever and wherever you like<p><br>Save 10 USD/EUR when buying Shredder 12 or Deep Shredder 12 for your desktop or notebook computer (Mac, Windows or Linux) on shredderchess.com. You will find your coupon code in the program info section.<p>Get the best!</p></p></p></p></p></p></p></p></p>', '3', '7524077', '0', '0', '0', '2015-03-20 18:35:43', '2015-03-20 18:35:43', '0', '1', '0', '0', 'shredderchess.com');
INSERT INTO `applications` VALUES ('com.silkenmermaid.colorup', 'ColorUp', '7', '3.5', '13', 'Pep up your pictures by turning selected regions to color and rest to black and white.<p>* On screen toolbar for ease of use<br>* Minimum price<p>TIP: Zoom picture to edit small regions instead of reducing brush size</p></p>', '2', '59190', '0', '0', '0', '2015-03-20 18:36:21', '2015-03-20 18:36:21', '0', '1', '0', '0', 'SilkenMermaid');
INSERT INTO `applications` VALUES ('com.skycode.atrance.enes.free', 'En-Es Free Offline Translator', '100000120', '1.20', '22', 'Traductor y diccionario OFFLINE - la herramienta Ãºltima de idioma extranjero cuando estÃ¡s en el extranjero! Ahorrar en las tarifas de itinerancia cuando viaje!<p>CARACTERÃSTICAS <br>- traducciÃ³n de texto;<br>- diccionario;<br>- historia<br> <br>Todas las funciones trabajan sin internet/3G/Wi-Fi. <br> <br>Usted puede probar la traducciÃ³n sin necesidad de comprar la aplicaciÃ³n en el sitio Web SkyCode Ltd. (clic en el botÃ³n del Sitio Web Developer).</p>', '9', '20158758', '0', '0', '0', '2015-03-20 18:15:38', '2015-03-20 18:15:38', '0', '1', '0', '0', 'SkyCode UK Limited');
INSERT INTO `applications` VALUES ('com.sourcebt.android.wifitalkie', 'WiFiTalkie', '100', '1.0', '4', 'Communication application over a local WiFi network.<p>Once connected on a WiFi network, select a channel, and start talking.<p>Press and hold the mic button to talk.<p>NOTE: some phones do not work correctly receiving UDP broadcast packets, such as:<p><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://code.google.com/p/android/issues/detail?id%253D8407%26sa%3DD%26usg%3DAFQjCNFmD7Zs8zBqkFfBKRMOZ6t4mfn_4w&amp;sa=D&amp;usg=AFQjCNHuEHOTS2jIvNZSZtQjpeDWeJaa4w\" target=\"_blank\">http://code.google.com/p/android/issues/detail?id=8407</a><p>So, this application is not compatible with those phones.</p></p></p></p></p>', '7', '236156', '0', '0', '0', '2015-03-20 18:38:19', '2015-03-20 18:38:19', '0', '1', '0', '0', 'SourceBT');
INSERT INTO `applications` VALUES ('com.spectrekking.light', 'SpecTrek Light', '27', '1.4-29', '27', '** ADC2 prize winner **<p>Experience this revolutionary augmented reality ghost hunting game. Walk or run around using GPS and your phone&#39;s camera to find and catch virtual ghosts.<p>The game offers statistics, awards, titles, records, and most of all a whole lot of fun!</p></p>', '3', '1245160', '0', '0', '0', '2015-03-20 18:38:18', '2015-03-20 18:38:18', '0', '1', '0', '0', 'Games4All');
INSERT INTO `applications` VALUES ('com.stylem.wallpapers', 'Backgrounds', '19', '1.9.9', '6', '10,000 awesome unique wallpapers by in-house design team.<br>New Backgrounds added daily.<p>Android 4.4 Users: Bug has been FIXED.<p>Categories: Funny,Cute,Quotes, Sunsets,Beaches,Cars,Girly,Guys,Games,Flowers,Models,Love,Christmas,Military,Money,Sports,City,Scary,Money,New Years,Music,Movies,Animals,Space, ...<p>40 million downloads.<p>Set Contact Icons. #1 iPhone Wallpaper app. Uses (but not endorsed by) Flickr API.</p></p></p></p>', '1', '119537', '0', '0', '0', '2015-03-20 18:36:48', '2015-03-20 18:36:48', '0', '1', '0', '0', 'Stylem Media');
INSERT INTO `applications` VALUES ('com.suxsem.slidelauncher', 'Slide Launcher', '22', '3.4', '10', '<b>â™£ 0% RAM AND BATTERY USAGE!<br>â™£ APP SIZE: LESS THEN 2mb!</b><p><i>This is <b>not</b> a traditional launcher (like Nova, Apex, Adw, ecc...) so you don&#39;t have to replace the one that you&#39;re currently using</i><p><br><p>Slide Launcher is a <b>fully customizable</b> and <b>extremely lightweight</b> quick launcher that let you to <b>start your favourite apps, direct messages, calls</b> (and everything that can be started) <b><u>FROM ANY SCREEN</u>!</b><br>It uses the <i>Google Now gesture (sliding up the home button)</i> so will always be there, <b>(even in the lockscreen!)</b> and doesn&#39;t require any battery-eater service and overlay, unlike others apps of this kind.<br>This is why Slide Launcher will <i>never run in background</i> and will <i>never slow down your phone or drain your battery.</i><p><br><p><b><u>MAIN FEATURES</u>:</b><br>â€¢ Supports <b>apps, direct messages, calls, shortcuts</b>, activities and custom intents<br>â€¢ Supports <b>themes</b> for the most common launchers (nova, apex, go, ecc...)<br>â€¢ Different icons arrangements (<b>circle, arc, grid, bar</b>, ecc...)<br>â€¢ Launch apps in popup mode (<b>floating window</b>) <i>(only for ParanoidAndroid ROM)</i><br>â€¢ Different <b>frames</b> can be applied on icons to make them more stylish<br>â€¢ Add, reorder and delete icons by <b>drag &amp; drop</b> gesture<br>â€¢ Fully customizable (<b>icons size, space between icons, haptic feedback, background color/image</b>, ecc...)<p><br><p>OTHER FEATURES:<br>â€¢ Advanced <b>cache engine</b> for an amazing fast start time<br>â€¢ <b>Fresh user interface</b> accordance with Android style<br>â€¢ Can be launched with search or camera buttons <b>for devices that don&#39;t have the navigation bar</b><p><br><p><i>Slide Launcher has just been released so expect improvements and new features in the future!</i><br>What are you waiting for? Download Slide Launcher right now... <b><u>it&#39;s absolutely free and you&#39;ll love it</u>! â™¥</b><p><br><p><b>Don&#39;t have navigation bar, search button or camera button?</b> We are working on a plugin to start Slide Launcher with a swipe gesture from the bottom of the screen...<i>stay tuned!</i><p><br><br><br><p>Do you have a <i>Samsung device with Android 4.1 or lower</i>? Download this little plugin to avoid some problems: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tiny.cc/slidelaunchertouchwiz%26sa%3DD%26usg%3DAFQjCNGNhhxBXuy9GDJTxOcwlbue56KRGw&amp;sa=D&amp;usg=AFQjCNECgl94zVfzK1-3OsTCcnZCIU1sNw\" target=\"_blank\">http://tiny.cc/slidelaunchertouchwiz</a><br><i>FAQs:</i> <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tiny.cc/slidelauncherfaqs%26sa%3DD%26usg%3DAFQjCNE02MsmyLY1Rqw7kDJF8l5S8u4BuA&amp;sa=D&amp;usg=AFQjCNH9grArm_e8WTLMiBKDDKfIqReukQ\" target=\"_blank\">http://tiny.cc/slidelauncherfaqs</a><br><i>Official XDA thread:</i> <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://tiny.cc/slidelauncherxda%26sa%3DD%26usg%3DAFQjCNGfhVTqJfiGs3wkYUNmp1K0Ohv7qg&amp;sa=D&amp;usg=AFQjCNGHI3XqsvGRrQpnk3fteZMCTXGT2g\" target=\"_blank\">http://tiny.cc/slidelauncherxda</a><p><br><p><b>An alternative to:</b> â€œWave Launcherâ€, â€œHome Button Launcherâ€, â€œSwipePadâ€, â€œSmart Taskbarâ€, â€œSidebarâ€ and others.<br>TAGS: google now navbar swipe home button quick shortcut lockscreen contact message call theme adw nova apex swipepad target paranoid floating popup rocket</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '14', '1681734', '0', '0', '0', '2015-03-20 18:37:11', '2015-03-20 18:37:11', '0', '1', '0', '0', 'Suxsem');
INSERT INTO `applications` VALUES ('com.tapsarena.celebrities', 'Guess the Celebrity!', '4', '1.3', '26', 'Â¡Adivina la celebridad! ~ Logo quiz gratis<p>El juego de moda en su clase! Ponte a prueba y acierta los nombres de famosos. Â¡Comprueba cuÃ¡nto sabes!<br> <br>Â¡DIVERSIÃ“N PURA Y ADICTIVA!<br>Â¡MÃ¡s de 200 iconos increÃ­bles en diferentes niveles de dificultad te estÃ¡n esperando! Â¿PodrÃ¡s llevar a cabo el desafÃ­o de adivinar todos?<br> <br>Â¡CONSIGUE MÃS PISTAS!<br>Â¡No temas! En caso de que te quedes atascado, siempre podrÃ¡s comprar pistas en la tienda.<br> <br>Â¡COMPARTE LA DIVERSIÃ“N CON TUS AMIGOS!<br>Â¿Problemas para reconocer el icono? CompÃ¡rtelo en Facebook y pide ayuda a tus amigos. Â¡O simplemente desafÃ­ales para ver quiÃ©n puede acertar mÃ¡s iconos!</p>', '8', '25739416', '0', '0', '0', '2015-03-20 18:35:01', '2015-03-20 18:35:01', '0', '1', '0', '0', 'Taps Arena');
INSERT INTO `applications` VALUES ('com.tbig.playerpro', 'PlayerPro', '12', '1.14', '9', 'This application is an advanced music and video player for Android devices.<p>PlayerPro features a beautiful, fast and intuitive interface, alongside powerful audio configuration options. In addition, there is a choice of several FREE plugins to complement it: skins, DSP Pack, Widget Pack ...<p>Note: the Pro version is standalone. Please uninstall the trial version after purchase. <p>Key features:<p>* Browse and play your music by albums, artists, genres, songs, playlists, folders, and album artists.<p>* Video browser/player.<p>* Liven up your music library with album artwork, artist pictures, and genre illustrations that you can select from a variety of sources: ID3 tags (embedded artwork), SD card folders, Gallery app, and Internet.<p>* Change the user interface of the Player by installing one of the many available SKINS (temporarily unavailable).<p>* Customize the layout, choosing between GRID or LIST views.<p>* View the LYRICS embedded in the ID3 tags of your music files.<p>* Single and group TAG EDITING: title, album, artist, album artist, track, year, genre, comment.<p>* Mixable AUDIO EFFECTS for Android &gt;2.3 devices: 5 band graphic EQUALIZER with default/customizable presets, STEREO WIDENING effect, REVERB effects (large hall, medium hall, plate, small room, medium room, large room), BASS BOOST effect, volume control.<p>* FREE additional DSP PLUGIN: 10 band graphic EQUALIZER with 15 default/customizable  presets, PRE-AMP control, BASS BOOST control, STEREO WIDENING control, left-right volume control. GAPLESS playback. Auto/Manual CROSSFADE. REPLAY GAIN. Audio Limiter. Go to Settings &gt; Audio and select &quot;Download DSP pack&quot; option to install the free plugin.<p>* Music stats and SMART PLAYLISTS: Recently added, Top rated, Most played, Recently played, Least played. Build additional custom playlists using the SMART PLAYLIST EDITOR and the many different criteria it offers: album, artist, genre, title, play/skip count, last played/added, rating, is a podcast, duration, year, file path etc. All smart playlists are AUTO-UPDATED.<p>* Import and export music history and ratings from your favorite desktop music player.<p>* Music folder selection.<p>* Choice of 2 LOCK SCREEN widgets with many customization options: unlock slider, sound toggler, skip tracks using volume buttons, swipe gestures, background selection, controls selection, time display, skin selection ...<p>* Choice of 5 different home screen WIDGETS (4x1, 2x2, 3x3, 4x4, 4x2). All widgets are customizable and skinnable: 6 different SKINS available, option to display artist picture instead of album artwork, option to display ratings, shuffle/repeat controls etc.<p>* NOTIFICATION STATUS support: display album artwork, title, album and artist, play/pause, skip forward and stop CONTROLS (ICS only) in notification status.<p>* Supports most popular SCROBBLERS.<p>* SLEEP TIMER with fade out.<p>* SHARE text notifications, album/artist artwork on your favorite social networks.<p>* HEADSET support. Customize long press and double/triple press actions.<p>* Library wide SEARCH. VOICE search support.<p>* SWIPE gestures (player: swipe album art to skip songs, browsers: swipe left to play next, swipe right to play last).<p>* SHAKE IT feature: give your phone a shake to play next/previous song (e.g.: shake top to bottom or bottom to top to play next/previous song).<p><br>... and many other features to discover!</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '5', '1799795', '0', '0', '0', '2015-03-20 18:38:07', '2015-03-20 18:38:07', '0', '1', '0', '0', 'BlastOn SA');
INSERT INTO `applications` VALUES ('com.tundem.aboutlibraries.sample', 'AboutLibraries Sample', '211', '2.1.1', '31', '<b>AboutLibraries</b><p>AboutLibraries is a library to offer you all the information you need of your libraries!<p>Most modern apps feature an &quot;Used Library&quot;-Section and for this some information of those libs is required. As it gets annoying to copy those strings always to your app I&#39;ve developed this small helper library to provide the required information.<p><br><b>This is the sample app for the library. You can find all details, how to use, ... on the github page!</b><p>--&gt; <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://github.com/mikepenz/AboutLibraries%26sa%3DD%26usg%3DAFQjCNHDCmm27hl3RxE5nYZIZ4bwk_Z9Rw&amp;sa=D&amp;usg=AFQjCNHgmIpB80jo_qu3EBGNzB1VJDmFgA\" target=\"_blank\">https://github.com/mikepenz/AboutLibraries</a> &lt;--</p></p></p></p>', '16', '1006181', '0', '0', '0', '2015-03-20 18:36:13', '2015-03-20 18:36:13', '0', '1', '0', '0', 'Tundem Media Group');
INSERT INTO `applications` VALUES ('com.ubisoft.assassin.pirates', 'Pirates', '10', '1.0.1', '28', '&quot;Un juego muy notable que seguro sabrÃ¡n apreciar los seguidores de esta gran franquicia.&quot; <br>*3DJuegos* <p><br>Â¡ConviÃ©rtete en uno de los piratas mÃ¡s temidos del Caribe en esta aventura exclusiva de Assassin&#39;s Creed!<p>Â¡MÃ©tete en la piel de Alonzo Batilla, un capitÃ¡n joven y ambicioso, saltÃ¡te todas las reglas, desafÃ­a a imperios y labra tu propia fortuna!<p>PARTICIPA EN BRUTALES BATALLAS NAVALES<br>Lucha en batallas navales a tiempo real a lo largo y ancho del mar Caribe.<br>Â¡Escoge el arma perfecta entre un amplio arsenal para destruir a tus rivales e ingeniÃ©rtelas para esquivar los disparos enemigos!<br>Â¡Derrota barcos legendarios y conviÃ©rtete en una autÃ©ntica leyenda entre los piratas!<p>CONSTRUYE TU PROPIA NAVE Y RECLUTA A TU TRIPULACIÃ“N<br>Hazte con los barcos mÃ¡s icÃ³nicos de la Edad Dorada de la piraterÃ­a, desde el menor de los caÃ±oneros hasta la fortaleza flotante Man Oâ€™War.<br>Utiliza los enormes botines saqueados en los mares para mejorar tu nave con personalizaciones legendarias.<br>Recluta a los mejores marineros para tu tripulaciÃ³n y aprende mÃ¡s de 50 nuevas tÃ©cnicas de piraterÃ­a para ser mejor capitÃ¡n y convertirte en un autÃ©ntico maestro del combate naval.<p>EXPLORA LA INMENSIDAD DEL CARIBE Y MUCHO MÃS...<br>Navega entre una infinidad de islas en tus viajes de exploraciÃ³n por el inmenso mapa.<br>Busca casi cien tesoros y pergaminos perdidos.<br>Recorre un montÃ³n de templos mayas perdidos para encontrar fragmentos de antiguos mapas del tesoro.<br>Completa tu colecciÃ³n de peces: desde el mÃ¡s pequeÃ±o alevÃ­n hasta los enormes tiburones.<br>Compite con tus amigos por el mejor botÃ­n.<p><br>DESCUBRE UNOS GRÃFICOS 3D SIN IGUAL EN TU MÃ“VIL O TABLET<br>TuÃ©state bajo el sol de las Indias Occidentales, disfruta de bellos atardeceres, recorre laberintos de hielo y navega de noche por impresionantes paisajes costeros.<br>Las cambiantes condiciones meteorolÃ³gicas tendrÃ¡n un impacto directo sobre el juego y redefinirÃ¡n los escenarios.<br>Presta atenciÃ³n a las tormentas y ten cuidado con la traicionera niebla que ocultarÃ¡ a tus enemigos hasta que ya sea demasiado tarde.<p><br>EMBÃRCATE EN UNA MISIÃ“N Ã‰PICA EN BUSCA DE UN TESORO LEGENDARIO<br>Vive una autÃ©ntica aventura en la que descubrirÃ¡s la verdad sobre el misterioso tesoro perdido de La Buse.<br>CrÃºzate en el camino de asesinos y templarios, y participa en su lucha ancestral.<br>Â¡Conoce a los piratas mÃ¡s famosos y pintorescos de la Ã©poca, como Sam Bellamy, Ben Hornigold, Charles Vane y Barbanegra!<p>Juego disponible en: inglÃ©s, francÃ©s, italiano, alemÃ¡n, espaÃ±ol, portuguÃ©s de Brasil, chino, japonÃ©s, coreano y ruso.<p><br>Â¡EntÃ©rate de todo sobre tu juego! Descubre las Ãºltimas noticias, ofertas y mucho mÃ¡s en...<br>FACEBOOK: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://facebook.com/UbisoftMobileGames%26sa%3DD%26usg%3DAFQjCNFr2V9OM5Z8NmnquJEXWD-rmorqlg&amp;sa=D&amp;usg=AFQjCNHN0jknDE2vNinpTTYCBsA5vBnRTg\" target=\"_blank\">http://facebook.com/UbisoftMobileGames</a> <br>TWITTER: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://twitter.com/ubisoftmobile%26sa%3DD%26usg%3DAFQjCNGCGNbszjIPSWW27s74d7IE3oXzhQ&amp;sa=D&amp;usg=AFQjCNFSn4glBxrDercFI_EF0mITe2_mjQ\" target=\"_blank\">http://twitter.com/ubisoftmobile</a> <br>YOUTUBE: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://youtube.com/user/Ubisoft%26sa%3DD%26usg%3DAFQjCNFy99JucASyYZVYlqkH5w0lzp6MnQ&amp;sa=D&amp;usg=AFQjCNHQTG6v9Rw8cWc4a7JpMgDEitNE1g\" target=\"_blank\">http://youtube.com/user/Ubisoft</a></p></p></p></p></p></p></p></p></p>', '13', '7469467', '0', '0', '0', '2015-03-20 18:35:14', '2015-03-20 18:35:14', '0', '1', '0', '0', 'Ubisoft Entertainment');
INSERT INTO `applications` VALUES ('com.usefl.filecover', 'fc', '31', '1.1.22', '25', 'Our Most popular paid app with full features is now available for free for limited time.Take advantage of it until we make it back to $5<br>_______________________________________<p>Password protect your images and videos.With Hide option too<p>Arrange your photos into named folders, making it easier to find photos or browse your collection.<p>Also hide your pictures and videos in a private mode.<br>________________________________________<p>For Gallery pictures: <p>Move photos from Camera or Download into folders like Holiday, Friends, or whatever you like.<p>You can choose the folder name and the location on your phone&#39;s memory card.<p><br>For hidden pictures:<p>Set a password to open the secret mode. <p>Arrange your hidden pictures and videos into as many folders as you like - Gift Ideas, Confidential Work Items, Nights Out, Song Ideas etc.<p><br>________________________________________<p><br>Why choose Gallery Security Lock ?<p>*** Password Protected<p>1. Multiple-select:<p>Easily choose lots of photos to move or hide at once.<p><br>2. Arrange your hidden pictures and videos into folders:<p>Unlike other apps you can arrange your collection into subfolders.<p>The folder view displays a random picture from each one, to remind you of the contents.<p><br>3. View photos in a grid or a &quot;sliding&quot; gallery:<p>Choose your favourite viewing mode to easily browse your hidden photos. You can order your photos by name or date order.<p><br>4. Slideshow mode:<p>Set a time interval to show each picture in the slideshow mode. You can also view in a random order.<p><br>5. Zoom mode:<p>Use pinch to zoom, if your device supports it, or the on-screen controls. You can choose whether to view in fullscreen or to see the top status bar.<p><br>6. Share via email or mms:<p>You can share your hidden photos via other apps such as MMS or Email.<p>(You can automatically reduce the picture sizes as you share, if you want.)<p><br>7. Encrypt photos:<p>File Copy normally just renames photos but you can encrypt the format, so they can&#39;t be viewed by file browsers. <p>You can also set the app to make filenames random when hiding.<p><br>8. Kill on screen-lock:<p>Set the app to automatically close when the screen-lock is activated.<p><br>9. Video playing options:<p>You can play all the videos in a folder, in portrait or landscape. You can also view one video and set it to loop continuously. <p>You can mute audio before playing a video.<p><br>10. Video browsing options:<p>Set video names and browse by thumbnail.<p><br>11. Long press options:<p>Long-press your images for more options such as rotate, move, delete etc.<p>Long-press your hidden folders for more options.<p><br>If your Android device supports these formats then File Cover will too:<p>Pictures:<br>jpeg, jpg, gif, png<p>Videos:<br>mp4, 3gp, 3g2, wmv, m4v, avi</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '241986', '0', '0', '0', '2015-03-20 18:38:03', '2015-03-20 18:38:03', '0', '1', '0', '0', 'Abazai and Focal games');
INSERT INTO `applications` VALUES ('com.wefi.wefi', 'WeFi Connect', '40', '1.8.0.12', '4', 'WeFi Pro mejora continuamente su experiencia en las conexiones a redes en su dispositivo Android. <p>Nuestra tecnologÃ­a inteligente conecta su dispositivo de forma automÃ¡tica a la mejor red disponible en su zona y en cualquier lugar que vaya. Esto significa: velocidades de datos dos veces mÃ¡s rÃ¡pidas para garantizar videos de mayor velocidad, imagÃ©nes mÃ¡s nÃ­tidas, juegos con mayor calidad y en general, una mejor experiencia en navegaciÃ³n.<p>Hemos construido la red mÃ¡s grande del mundo de zonas Wi-Fi, por lo que encontrar la mejor conexiÃ³n ya no serÃ¡ un problema. Nuestra masiva red de mÃ¡s de 170 millones de zonas de conexiÃ³n inalÃ¡mbrica funciona gracias a los usuarios de WeFi Pro, quienes nos ayudan a solucionar los problemas de conexiones lentas simplemente usando la aplicaciÃ³n.<p>SÃ³lo descargue WeFi Pro en su Android y cambie la experiencia de su dispositivo.<p><br>Etiquetas: WiFi, Wi-Fi, Auto, Internet, conexiÃ³n a Internet, InalÃ¡mbrico, Conectividad, Celular, Datos</p></p></p></p>', '3', '1501685', '0', '0', '0', '2015-03-20 18:36:07', '2015-03-20 18:36:07', '0', '1', '0', '0', 'WeFi');
INSERT INTO `applications` VALUES ('com.wsl.CardioTrainer.pro_feature', 'CardioTrainer Pro Module', '3', '2.8.0', '27', 'Go beyond CardioTrainer, and become a real Pro!<br>*This is an unlock module. Install CardioTrainer before buying!*<p>Pro includes:<br>* All current and future paid modules. Buy it now - we will increase price as we add more modules.<br>* Advanced Interval Training - 20 levels<br>* 30-day money back guarantee<br>* More Pro training to come</p>', '3', '27092', '0', '0', '0', '2015-03-20 18:36:06', '2015-03-20 18:36:06', '0', '1', '0', '0', 'Noom Inc.');
INSERT INTO `applications` VALUES ('com.xelacorp.android.batsnaps', 'Battery snap', '275', '2.9.9', '3', '- Los widgets de Control de la baterÃ­a con la elecciÃ³n de estilos.<br>- Resto de la vida y tiempo de carga y mucho mÃ¡s.<br>- Analizar el uso de la baterÃ­a durante semanas.<br>- Se vuelve mÃ¡s precisa despuÃ©s de algÃºn tiempo de uso.<br>- Nivel de la baterÃ­a de grÃ¡ficos.<br>- La baterÃ­a no estÃ¡ activa encuestados, lo que no hay descarga de la baterÃ­a.<br>- Motorola hack: conseguir un 1% de precisiÃ³n en el nivel de la baterÃ­a en los dispositivos Motorola (muchas gracias a Michal Veselovsky por haber sugerido y probado esta caracterÃ­stica)<p>Use el widget y mantener la aplicaciÃ³n al menos dos dÃ­as de lo contrario se perderÃ¡ la mayor parte de sus beneficios.<p>Una pregunta, un problema? MÃ¡ndeme un mail!<p>#BatterySnap</p></p></p>', '3', '207996', '0', '0', '0', '2015-03-20 18:36:09', '2015-03-20 18:36:09', '0', '1', '0', '0', 'Xhelas');
INSERT INTO `applications` VALUES ('com.xiam.snapdragon.app', 'BatteryGuru', '66', '2.3.5', '3', 'Snapdragonâ„¢ BatteryGuru es una aplicaciÃ³n de ahorro de baterÃ­a que prolonga el rendimiento de la baterÃ­a y mejora la experiencia general del usuario. Para ello, realiza cambios inteligentes que optimizan la funcionalidad del dispositivo en telÃ©fonos con procesadores mÃ³viles Snapdragon. Esta aplicaciÃ³n:<br>â€¢ Proporciona mayor duraciÃ³n de la baterÃ­a con menos cambios, ya que actÃºa como prolongador de duraciÃ³n de la baterÃ­a.<br>â€¢ Aprende de manera inteligente cÃ³mo usas tu smartphone con tecnologÃ­a Snapdragon y optimiza tu dispositivo sin desactivar la funcionalidad del smartphone.<br>â€¢ No requiere configuraciÃ³n por parte del usuario. Snapdragon BatteryGuru aprende y ajusta de manera automÃ¡tica las opciones del telÃ©fono por ti.<p>Una vez finalizado el breve perÃ­odo introductorio de 2 a 4 dÃ­as, Snapdragon BatteryGuru aprende el comportamiento del usuario y le notifica cuando ya estÃ¡ listo para prolongar la duraciÃ³n de la baterÃ­a y mejorar la experiencia. Snapdragon BatteryGuru continÃºa funcionando en segundo plano; profundiza asÃ­ su conocimiento del usuario y optimiza aÃºn mÃ¡s la experiencia con el correr del tiempo.<p>La aplicaciÃ³n de ahorro de baterÃ­a Snapdragon BatteryGuru es compatible con la mayorÃ­a de los dispositivos con tecnologÃ­a Snapdragon, y continuaremos trabajando para lograr la compatibilidad con otros dispositivos que usan esta tecnologÃ­a. Si tienes problemas al usar esta aplicaciÃ³n de ahorro de baterÃ­a, te agradeceremos que envÃ­es un email a <a href=\"mailto:batteryguru@qti.qualcomm.com\">batteryguru@qti.qualcomm.com</a> donde expliques el problema antes de dejar tu opiniÃ³n. Trataremos de responder lo antes posible.<p>Preguntas populares<br>P. Â¿Por quÃ© Snapdragon BatteryGuru debe conocer mi ubicaciÃ³n?<br>R. Snapdragon BatteryGuru utiliza tu ubicaciÃ³n para conocer los lugares donde tienes acceso a Wi-Fi. En lugar de utilizar GPS, utiliza el mecanismo de localizaciÃ³n de redes de bajo consumo de energÃ­a de Android para encontrar tu ubicaciÃ³n aproximada.<p>P. Â¿Por quÃ© a veces mi Wi-Fi estÃ¡ HABILITADA cuando deberÃ­a estar DESHABILITADA?<br>R. La funciÃ³n de administraciÃ³n de Wi-Fi de Snapdragon BatteryGuru habilita Wi-Fi cuando lo necesitas y lo deshabilita cuando no lo necesitas, por lo tanto, ahorra energÃ­a. No obstante, incluso cuando no tienes acceso a Wi-Fi, Snapdragon BatteryGuru HABILITARÃ Wi-Fi periÃ³dicamente durante algunos minutos para comprobar si hubo modificaciones en tu acceso a Wi-Fi. De la misma manera, cuando te mueves hacia una nueva ubicaciÃ³n, BatteryGuru encenderÃ¡ la radio durante algunos minutos para comprobar que haya acceso a Wi-Fi disponible. No temas, encender la radio durante algunos minutos de esta forma tiene muy poco impacto, o ninguno, en la duraciÃ³n de tu baterÃ­a.</p></p></p></p>', '14', '6694237', '0', '0', '0', '2015-03-20 18:36:23', '2015-03-20 18:36:23', '0', '1', '0', '0', 'Qualcomm Connected Experiences, Inc.');
INSERT INTO `applications` VALUES ('de.carknue.gmon2', 'G-MoN', '45', '1.8.2', '3', 'Now LTE ready! Fieldtest shows LTE RSRP and RSRQ. <p>A permanent RXL level of -115dBm on some Samsung phones is a Samsung bug! Only Samsung is able to fix that.<p>Powerful WarDriving scanner and GSM / CDMA / EVDO / UMTS and LTE Netmonitor and drive test tool with voice notifications. It scans for all WiFi networks in range &amp; saves the data with GPS coordinates into a file on your sd card. You can create a kml file for Google Earth. It shows you the encrytion, channel an signal strength. It shows all APs in range in a live map.<p>G-MoN is a Wardriving scanner to collect and map all received wifi access points. It is also a 2G/3G netmonitor and field test drive tool for radio planning engineers. Needs enabled GPS for correct position in map!<p>To import a V3.0 (decimal cell data and coordinates without characters) CLF file, remove all comment lines, rename it to import.clf and copy it to /sdcard/gmon/ then start import CLF from menu. <p>You can log  GSM or UMTS RX levels into a kml file for Google Earth or a csv file. There are 5 color groups for different levels. These levels can be defined by the user in the settings menue. This file is saved into the gmon folder on the sdcard or external memory. When the log is running, the G-MoN Notification Icon changes color to red. 2G/3G logging does not work when the screen is off!</p></p></p></p></p>', '7', '124839', '0', '0', '0', '2015-03-20 18:38:13', '2015-03-20 18:38:13', '0', '1', '0', '0', 'C. Knuetter');
INSERT INTO `applications` VALUES ('de.stohelit.playerwidgets', 'MortPlayer Widgets', '15', '0.3', '9', 'Home Screen Widgets for MortPlayer Music and Audio Books.<br>If both are installed and none is running, you can select which player to initialize.<p>ATTENTION: Although it shouldn&#39;t be allowed (there&#39;s an &quot;information file&quot; included in every app), some ROMs/devices might install this app to SD. This often causes the Widgets not to be enlisted in Widget selection. In this case, please move the app to main storage (you can do this with some entry in the system preferences).<p>If you experience troubles like weird display or nonresponsive widgets, try to remove an re-add the widget.</p></p>', '3', '227833', '0', '0', '0', '2015-03-20 18:35:00', '2015-03-20 18:35:00', '0', '1', '0', '0', 'Mirko Schenk');
INSERT INTO `applications` VALUES ('de.ub0r.android.smsdroid', 'SMSdroid', '108', '0.2.4', '4', 'SMSdroid is a special messaging app letting you send messages with any other messaging app (eg. WebSMS).<p>If you love WebSMS to send free messages, you&#39;ll probably love SMSdroid too.<p>This app is open source software build in spare time. Adding bad comments in market won&#39;t help much to make it better.<br>Please add your issues with this app on the app&#39;s website.<p>Feel free to help translating this app to your language here: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://ub0r.de/translate/smsdroid/%26sa%3DD%26usg%3DAFQjCNEkDI7HV8ya6nketLhC74rFIqL3qg&amp;sa=D&amp;usg=AFQjCNGgFMQXBjzdcZJxFHCfbbMYA4Fncw\" target=\"_blank\">http://ub0r.de/translate/smsdroid/</a></p></p></p>', '3', '244400', '0', '0', '0', '2015-03-20 18:35:53', '2015-03-20 18:35:53', '0', '1', '0', '0', 'Felix Bechstein');
INSERT INTO `applications` VALUES ('dialer.impact', 'Impact DIaler Widget', '5', '1.4', '10', 'A basic dialer widget tested only on Samsung Galaxy S I9000 and Android 2.2<p>Feedback will be highly appreciated and will help us to further improve the widget<p>also check out Impact T9 Dialer widget if you are looking for T9 Support.<br>Thanks</p></p>', '8', '107031', '0', '0', '0', '2015-03-20 18:37:08', '2015-03-20 18:37:08', '0', '1', '0', '0', 'Impactworks india Pvt. Ltd.');
INSERT INTO `applications` VALUES ('fishnoodle.gallerywp_free', 'Gallery Free Live Wallpaper', '8', '2.01', '10', 'Display your favorite images in a high-quality slideshow right on your Android home screen!  This live wallpaper allows you to select any images on your device and control how they&#39;re displayed -- complete with zooms, pans, transitions, crossfades, and more!  Display your photos with Ken Burns style camera motions or as a traditional slide show.  Also works as a Daydream on 4.2+ devices!<p>If you don&#39;t want to take your own pictures, stream them instead!  Full support for Picasa, Flickr and Reddit based streams allows you to always see what&#39;s new!  Enter your favorite subreddit, or pick Flickr search terms to control the results.<p>This free version is fully featured with no time limits, but will limit your selection to twenty images.  Phones and tablets are both supported as is both portrait and landscape orientations.  If you enjoy this, please get the full version!<p>PERMISSIONS:  Internet access is required to dynamically download images!  Accounts are required to allow display of personal images from Picasa.  Read external storage is required to read images on SD cards and some images on 4.4 devices.<p>A single admob ad is displayed on the settings screen, but not in the wallpaper itself.</p></p></p></p>', '7', '652680', '0', '0', '0', '2015-03-20 18:35:14', '2015-03-20 18:35:14', '0', '1', '0', '0', 'Kittehface Software');
INSERT INTO `applications` VALUES ('hongbo.callrecorder', 'CallRecorder', '20090330', '1.0', '4', 'Ever missed something important during a phone call?<p>CallRecorder automatically records your conversations.<p>â€¢ Powerful filters support Whitelist/Blacklist.<br>â€¢ Notify for Save/Discard after recording.<br>â€¢ Clear UI for playback and manage records.<br>â€¢ Store records in SD card.<p>(currently not work on Android 2.0, sorry)</p></p></p>', '', '35609', '0', '0', '0', '2015-03-20 18:34:30', '2015-03-20 18:34:30', '0', '1', '0', '0', 'Hongbo');
INSERT INTO `applications` VALUES ('kr.aboy.measure', 'Smart Measure', '21', '2.2.5', '3', 'Smart Measure Pro es la parte 2 del paquete Smart ToolsÂ® (distancia, altura, ancho, Ã¡rea).<p>Esta aplicaciÃ³n de telÃ©metro te permite medir la distancia, la altura, el ancho y el Ã¡rea de un objeto con tu telÃ©fono mediante trigonometrÃ­a.<p>Â¿EstÃ¡s listo para medir? Simplemente levÃ¡ntate y pulsa el obturador. Un punto importante es dirigir la cÃ¡mara al suelo, NO al objeto. (p.e. Para medir la distancia a alguien, apunta a sus zapatos )<p>Si la medida no es precisa, por favor, lee las instrucciones de la aplicaciÃ³n o lee el diagrama en el blog. Los sensores del telÃ©fono pueden cambiar debido a la versiÃ³n del sistema operativo, el firmware y el estado de la baterÃ­a.<br>Puedes calibrarlos por tÃ­ mismo en el menÃº de calibraciÃ³n dentro de la configuraciÃ³n.<p>* CaracterÃ­sticas aÃ±adidas a la versiÃ³n Pro<br>- Puedes medir el ancho y el Ã¡rea.<br>- Obturador rÃ¡pido<br>- Modo retrato<br>- Zoom de la cÃ¡mara<br>- Horizonte virtual<br>- Sin anuncios<p><br>* Ahora dispones de tres herramientas para medir distancias.<br>1) Smart Ruler (corta, tÃ¡ctil) : 1-50cm <br>2) Smart Measure (media, trigonomÃ©trico) : 1-50m<br>3) Smart Distance(larga, perspectiva) : 10m-1km<p>* Â¿Quieres mÃ¡s herramientas?<br>ObtÃ©n el paquete [Smart Tools].<p>Para obtener mÃ¡s informaciÃ³n, consulta el manual, el vÃ­deo de Youtube y el blog. Gracias.</p></p></p></p></p></p></p>', '4', '670673', '0', '0', '0', '2015-03-20 18:35:50', '2015-03-20 18:35:50', '0', '1', '0', '0', 'Smart Tools co.');
INSERT INTO `applications` VALUES ('la.droid.qr', 'QR Droid', '550', '5.5.0', '5', 'Convierte tu smartphone en una potente herramienta para escanear cÃ³digos QR, cÃ³digos de barras y matrices de datos. Importa, crea, utiliza y comparte datos en cuestiÃ³n de segundos.<p>Esta utilidad QR es intuitiva, muy completa, admite diversos idiomas y cambiarÃ¡ tu forma de interactuar con cÃ³digos QR, sus acciones y actividades inteligentes.<p>Consigue la aplicaciÃ³n a la que PCWorld y Android Magazine concedieron 5 de 5 estrellas. QR Droid te permite compartir digitalmente casi cualquier cosa. GRATIS y SIN PUBLICIDAD.<p>LAS OPCIONES DE LA ÃšLTIMA VERSIÃ“N INCLUYEN:<p>- Cuando pulses el botÃ³n MenÃº actuarÃ¡ como botÃ³n de Inicio y te llevarÃ¡ al comienzo del menÃº desplegable.<br>- Interfaces de usuario con diseÃ±os mÃ¡s estÃ©ticos aÃ±adidas a Mi Perfil en Zapper Technologiesâ„¢. <br>- La privacidad, menÃº y ajustes actualizados te permiten tener mÃ¡s control sobre Zapper Technologies. <br>- Clasifica y agrupa tu historial para poder acceder mÃ¡s rÃ¡pidamente a tus cÃ³digos QR mÃ¡s utilizados.<br>- Mi Perfil de Zapperâ„¢ - completa tu perfil una vez para registrarte, iniciar sesiÃ³n y pagar sin tener que volver a identificarte en las pÃ¡ginas web participantes utilizando tu perfil  Zapper (de la propietaria de QR Droid, Zapper Technologies).<p>TODAS LAS CARACTERÃSTICAS<p>- QR Droid es fiel a su idea: ser un escÃ¡ner de primera clase. Todas las opciones que puedas pensar y mÃ¡s, Â¡estÃ¡n aquÃ­!<br>- Crea un cÃ³digo de un contacto o favorito y deja que un amigo lo escanee en su dispositivo Â¡sin tener que escribir!<br>- Escanea artÃ­culos de compra, compara precios, lee crÃ­ticas de productos y compra con tan solo &quot;pulsar&quot; tu telÃ©fono.<br>- Coloca en un mapa tu posiciÃ³n y a dÃ³nde vas, compÃ¡rtelo con amigos, compaÃ±eros y familiares.<br>- Aprovecha descuentos y ofertas especiales escaneando cÃ³digos de barras en vales y cupones.<br>- Escanea un cÃ³digo QR de una pared del metro o de un catÃ¡logo y podrÃ¡s tener cualquier cosa directamente en la puerta de tu casa.<br>- Mira pÃ¡ginas web y videoclips mientras andas de un lado para otro.<br>- Escanea un cÃ³digo QR en una revista y mira un vÃ­deo inmediatamente.<br>- Escanea cÃ³digos QR desde tu cÃ¡mara, navegador, tarjeta SD o imagen guardada.<br>- Crea o comparte cÃ³digos QR en menos de un segundo de mapas, contactos, favoritos, aplicaciones instaladas y mÃ¡s.<br>- Opciones de &quot;Bandeja de entrada&quot; y &quot;Comentarios&quot;. Recibe actualizaciones importantes y ofrece tus comentarios directamente al equipo de atenciÃ³n al cliente de QR Droid utilizando el sistema de mensajerÃ­a integrado en la aplicaciÃ³n.<br>- Crea CÃ³digos XQR para grandes cantidades  de &quot;Texto sin formato&quot; y &quot;Contactos&quot; en cÃ³digos QR.<br>- Los cÃ³digos USSD nunca se abren de forma automÃ¡tica, con lo que se evitan posibles ataques que puedan eliminar datos de tu dispositivo de forma remota.<br>- AÃ±ade QR Droid Widgets gratis para poder sacarle el mÃ¡ximo partido a  QR Droid. Instala un widget en tu pÃ¡gina de inicio de Android para poder acceder directamente a la parte concreta de la aplicaciÃ³n que mÃ¡s utilizas: crea tarjetas de visita, historiales, favoritos y muchas cosas mÃ¡s. Descarga QR Droid Widgets  en <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://0.qr.ai%26sa%3DD%26usg%3DAFQjCNGo5DJfqBNpAuZCDFh7SAyo1Xsntw&amp;sa=D&amp;usg=AFQjCNHNyEZ1kAScWsAy6WLZFK-kyMwJjg\" target=\"_blank\">http://0.qr.ai</a> o utiliza los widgets preinstalados en la aplicaciÃ³n  QR Droid.<br>- Seleccione un cÃ³digo QR para obtener acceso a redes Wi-Fi privadas.<p>PERMISOS Y USABILIDAD<p>Ver los permisos detallados: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://qrdroid.com/adhoc/permissions_es.htm%26sa%3DD%26usg%3DAFQjCNGzocn1viCHNfUW87h1y-Axwi9Afw&amp;sa=D&amp;usg=AFQjCNGPO6boZ2RQOfDRRH2Jx1BSaED0Ww\" target=\"_blank\">http://qrdroid.com/adhoc/permissions_es.htm</a><p>Ver cÃ³mo escanear y crear cÃ³digos QR y cÃ³digos de barras: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://qrdroid.com/adhoc/how_scan_create_es.htm%26sa%3DD%26usg%3DAFQjCNHxcSnoYXxrva8Mkq8WEAAKofwHBw&amp;sa=D&amp;usg=AFQjCNGvroOKKduVRHnWkN2iGXzGIxEIAg\" target=\"_blank\">http://qrdroid.com/adhoc/how_scan_create_es.htm</a><p>SOCIAL<br>- Me gusta en Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/qrdroid%26sa%3DD%26usg%3DAFQjCNEQe5zCkPhga8f_olr_mWhoRklRfA&amp;sa=D&amp;usg=AFQjCNHAphl1RkRjPkAXofCYew6Z1M6DYg\" target=\"_blank\">https://www.facebook.com/qrdroid</a><br>- SÃ­guenos en Twitter: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/QrDroid%26sa%3DD%26usg%3DAFQjCNEVqvRsUrGbWbY-w_Ep5YzRbuw_Mg&amp;sa=D&amp;usg=AFQjCNGNxbhF1Nr-HlX6ZnfSUw9klnU9Ag\" target=\"_blank\">https://twitter.com/QrDroid</a><br>- Visita <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.qrdroid.com%26sa%3DD%26usg%3DAFQjCNGvyoulMT5eRK4zQWWGSuYsPN6bQg&amp;sa=D&amp;usg=AFQjCNGe-09Z7_IZLDsTDAiaELirpwwCNQ\" target=\"_blank\">http://www.qrdroid.com</a> y nuestro blog para obtener mÃ¡s informaciÃ³n<p>AVISO LEGAL<p>- &#39;QR Code&#39; es una marca comercial registrada por  Denso Wave Incorporated<br>- NO se recomienda utilizar los cÃ³digos QR con informaciÃ³n confidencial/secreta<br>- QR Droidâ„¢ utiliza la biblioteca Zxing. Licencia Apache 2.0<br>- Descarga directa de los APK instalables de QR Droidâ„¢ aquÃ­: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://g.qr.ai%26sa%3DD%26usg%3DAFQjCNEfV5R_KpXEKUd2NpAE9qIu0cMf6Q&amp;sa=D&amp;usg=AFQjCNFoUn__VM7XwFgwv8MBJOii5cSJpQ\" target=\"_blank\">http://g.qr.ai</a></p></p></p></p></p></p></p></p></p></p></p></p>', '5', '11362348', '0', '0', '0', '2015-03-20 18:34:36', '2015-03-20 18:34:36', '0', '1', '0', '0', 'DroidLa');
INSERT INTO `applications` VALUES ('maps.CarLocation', 'My Car Location', '8', '3.1', '22', 'Â¿Alguna vez as aparcado en tu ciudad o te has ido al campo a pasar el dÃ­a y no sabes dÃ³nde te has dejado tu coche? AquÃ­ esta tu soluciÃ³n. Esta aplicaciÃ³n le puedes decir que guarde la ubicaciÃ³n de tu coche cuando aparcas. Sirve para ver la localizaciÃ³n de tu coche.<p>Busca tu coche, es muy sencillo.<br>Busca tu parking.<br>Haz una foto.<br>Compartir en Facebook.<p>Compra Gps Car Park en el market. Mejoras:<p>-Widget para guardar tu localizaciÃ³n.<br>-Multi-idioma: en este momento Ingles y EspaÃ±ol.<br>-Sin anuncios.<p>-Etiquetas: busca mi coche, coche, aparcar, parking, gps, localizar</p></p></p></p>', '3', '29027', '0', '0', '0', '2015-03-20 18:36:06', '2015-03-20 18:36:06', '0', '1', '0', '0', 'pablosoftware');
