INSERT INTO `applications` VALUES ('net.alouw.alouwCheckin', 'FreeZone', '130', '9.3 (Arques)', '3', 'Accede gratuitamente a internet usando puntos de acceso Wi-Fi con FreeZone.<p>Descubre automÃ¡ticamente quÃ© puntos de acceso Wi-Fi gratuitos funcionan de verdad.<p>Utiliza contraseÃ±as compartidas por otros y accede a puntos de acceso Wi-Fi en bares, restaurantes, centros comerciales y otros lugares pÃºblicos.<p>Se te notificarÃ¡ automÃ¡ticamente cuando tengas al alcance un punto de acceso Wi-Fi gratuito.<p>PodrÃ¡s ver un mapa de lugares cerca de ti que ofrecen Wi-Fi gratuito.<p>Â¡Acceso instantÃ¡neo a mÃ¡s de 5 millones de puntos de acceso Wi-Fi!</p></p></p></p></p>', '10', '10688493', '0', '0', '0', '2015-03-20 18:36:57', '2015-03-20 18:36:57', '0', '1', '0', '0', 'Movile');
INSERT INTO `applications` VALUES ('net.cachapa.libra', 'Libra', '31', '1.7.3', '27', 'Libra tracks your daily weight changes and displays them in a beautiful interactive chart<p>- Simple data entry<br>- Scrollable, zoomable chart<br>- BMI<br>- Weight goal<br>- Time-to-goal estimate<br>- Daily KCal estimate<br>- Visualisation of your diet plan in the chart<br>- Statistics<br>- Import/Export to Excel (.csv)<br>- Synchronization with Withings (download only)<br>- Withings real-time push notifications<br>- Widget<p>Libra asks for the following permissions:<br>- Internet: Withings sync and showing ads<br>- Access network state: Required by the ads library<br>- Write external storage: Importing and exporting the database<br>- Receive boot completed: To reset the daily reminder on reboot<br>- Get accounts: Receive push notifications from the Withings service<br>- C2DM receive: Also required for push notifications<br>- Wake lock: Handling of received notifications</p></p>', '3', '279666', '0', '0', '0', '2015-03-20 18:35:03', '2015-03-20 18:35:03', '0', '1', '0', '0', 'Daniel Cachapa');
INSERT INTO `applications` VALUES ('net.yuvalsharon.android.launchx.pro', 'Launch-X Pro', '35', '1.7.2', '3', '** Check out AmazingText, our new app that makes your homescreen more beautiful, special and personalized! **<p>Create powerful widgets for your homescreen with Launch-X! *NEW*: STACK and SCROLLABLE widgets!<p>** NEW ** Check out our latest icons packs for Launch-X, ADW Launcher, Go Launcher and LauncherPro:<br>- Neon Blue Icons Pack<br>- Neon Blue+ Icons Pack<br>- Paper Icons Pack<br>- Neon Purple Icons Pack<br>- Neon Green Icons Pack<p>* Now fully optimized for Honeycomb tablets (Android 3.0/3.1/3.2) - such as Motorola Xoom, Samsung Galaxy Tab 8.9 and 10.1, Asus Eee Pad Transformer, Acer Iconia A100/A500, Lenovo ThinkPad, Sony S1, Toshiba AT100, Archo G9, Huawei MediaPad, ..<p>* Now also compatible with Ice Cream Sandwich (Android 4.0) - Samsung Galaxy Nexus.<p><br>Launch-X features various customizable configurations to allow very quick access to your favorite applications, contacts or generic shortcuts.<p>With Launch-X you can maximize the usage of your homescreen space. In fact, instead of having the &#39;4 icons on each row&#39; limitation of the stock Launchers, you can put much, much more in the same space!<p>There are several configurations options available in Launch-X that let you build a widget that best suits your needs. <p>Create widgets with multiple screens that contains over 40, 50, 100, or more shortcuts! You can even create scrollable widgets in which you can basically put an unlimited number of items!<br>Or, if you prefer not to use the multi-screens feature, you can instead keep a more clean single screen with up to 28 items (4 rows, with 7 icons each).<p>Features:<p>* NEW: Icons packs support - use the tons of icons packs / themes already available for ADW Launcher (EX), LauncherPro and GO Launcher (EX) with Launch-X.<br>* NEW: Custom icons - you can set a custom icon for each item in your Launch-X widget. It can be an icons pack icon, gallery picture or an icon from other apps that support &#39;pick icon&#39; (e.g. DroidIcon).<p>* Unlimited widgets: you can create and configure as many Launch-X widgets as you need.<br>* Widget sizes: you can choose between 2x1, 2x2, 2x3, 3x1, 3x2, 4x1, 4x2, 4x3, 4x4, 5x1 (for Tablets), 5x2 (for Tablets) and 5x3 (for Tablets).<br>* Scrollable widgets: you can create a scrollable widget, which allows you to have an unlimited number of items in it.<br>* Stack widgets: since Android 3.0 you can create stack widgets, in which you can swipe up and down to scroll through the Launch-X screens.<br>* Items types: the items that can be added to Launch-X are applications, contacts or generic shortcuts. A shortcut for a contact can start a call, send a message/sms or open the contact itself.<br>* Items order: You can easily sort your items as you want, with simple drag-and-drop.<br>* Icon size: the available sizes for the shortcut icons are &quot;Small&quot;, &quot;Medium&quot;, &quot;Large&quot; and &quot;X-Large&quot;.<br>* Number of icons: each row can have from 1 up to 7 icons.<br>* Number of rows: each widget can have from 1 up to 4 rows.<br>* Screen selection method: you can choose to use the arrows buttons to navigate through screens, or the direct buttons (which allow quicker access to the desired screen). You can also select &#39;None&#39; to have a single screen with more available space.<br>* Show/hide items names: the shortcuts/items names can be shown or hidden.<br>* Background/buttons transparency: select your preferred background and buttons transparency.<br>* Backup/restore: backup your widgets to the SD card and restore them when needed.<p>For more info &amp; tutorial visit: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.droidahead.com%26sa%3DD%26usg%3DAFQjCNEwPPvgZLte-bZeZn5fJfmf2M7ynQ&amp;sa=D&amp;usg=AFQjCNHA24QWOGEdiKuTUV7XGZKS8853cA\" target=\"_blank\">http://www.droidahead.com</a><br>Facebook page: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.droidahead.com/facebook%26sa%3DD%26usg%3DAFQjCNFPMpmGwYlUcSqdSJlN5Zqx7P_4TA&amp;sa=D&amp;usg=AFQjCNG4V0GzB6u4qVzE56_R1JRdifQ1zw\" target=\"_blank\">http://www.droidahead.com/facebook</a><br>Twitter: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.droidahead.com/twitter%26sa%3DD%26usg%3DAFQjCNEWfCD_ysWwYFbqUj37n6FTyOcjnw&amp;sa=D&amp;usg=AFQjCNGzkHnzpU47Z73ZE0oHD-4uknUGcA\" target=\"_blank\">http://www.droidahead.com/twitter</a><p>Launch-X Promo Video: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/watch?v%253DLwvpczWPQ6M%26sa%3DD%26usg%3DAFQjCNF6oTBP2vgiH3VC-YIwARMpY99ZbQ&amp;sa=D&amp;usg=AFQjCNF0uE3qSSGXbH5d1bGSwFqZsy-xRg\" target=\"_blank\">http://www.youtube.com/watch?v=LwvpczWPQ6M</a></p></p></p></p></p></p></p></p></p></p></p></p></p>', '4', '934381', '0', '0', '0', '2015-03-20 18:36:53', '2015-03-20 18:36:53', '0', '1', '0', '0', 'DroidAhead');
INSERT INTO `applications` VALUES ('nl.jsource.retroclock.android', 'Retro Clock', '4', '1.1.1', '10', 'Now customize style and shortcuts with the Retro Clock Settings app, for sale on Google Play!<p>Retro Clock Widget was one of the first clock widgets available for android and has been downloaded by millions of users over the years. Version 2.0 brings many improvements, while keeping the simplicity that made it famous.<p>This app provides a home screen clock and date widget based on the classical mechanical flipping clock. The widgets act as shortcuts to the systems alarm clock and calendar applications.<p>When you want to customize the look and feel (like the colors, transparency, or shortcut applications), you can do so using the Retro Clock Settings companion app also available on Google Play.<p>To use the widget on Android 4.0+:<br>- open the app drawer<br>- tap the &quot;Widgets&quot; tab<br>- find Retro Clock / Date and drag it to the home screen<p>To use the widget on older versions of android:<br>- long press an empty spot on the home screen<br>- select &quot;Widgets&quot;<br>- tap on Retro Clock / Date to add it to the home screen<p>NOTE: If you are using a Task Manager, make sure to add Retro Clock Widget to the ignore list. When the app is killed, the time will stop updating.</p></p></p></p></p></p>', '3', '15983', '0', '0', '0', '2015-03-20 18:33:20', '2015-03-20 18:33:20', '0', '1', '0', '0', 'lingen.me');
INSERT INTO `applications` VALUES ('nl.letsconstruct.channeldesign', 'Channel design', '8', '0.8', '5', 'Allows you to interactively design Open Channel Flow for rectangular, trapezoidal and rectangular shapes. Graphs your channel to scale and outputs your normal and critical water depths.<p>* Includes Share option<br>* Includes Feedback button<br>* Allows you to input width and slope both graphically or textually<br>* Includes predefined shapes (triangle, rectangle, trapozoid)<br>* Includes US units</p>', '7', '523381', '0', '0', '0', '2015-03-20 18:37:07', '2015-03-20 18:37:07', '0', '1', '0', '0', 'LetsConstruct');
INSERT INTO `applications` VALUES ('nl.letsconstruct.circlemohr', 'Circle of Mohr', '12', '0.12', '5', 'Interactive 2D and 3D Circle of Mohr, very useful for civil and mechanical engineering.<p>Features:<br>- input stresses<br>- principle stresses <br>- touch or input angle to view stresses in any direction<br>- export image</p>', '7', '484728', '0', '0', '0', '2015-03-20 18:37:06', '2015-03-20 18:37:06', '0', '1', '0', '0', 'LetsConstruct');
INSERT INTO `applications` VALUES ('org.dnaq.dialer2', 'Dialer2', '16', '2.80', '5', 'Dialer2 is a fast T9 dialer and call log application for android.<p>Note: I&#39;m considering open-sourcing Dialer2, if anyone is interested please contact me.<p>It is inspired by the HTC Dialer in functionality and the Twicca twitter application in design.<p>Features<br>* Speed Dial (long click on contact to set as speed dial, long click on number to call speed dial)<br>* Call Log<br>* Fast T9 dialer<br>* Facebook contact image sync (requires latest facebook version to be installed and contact sync to be on)<br>* Filtering on contacts based on contact names or numbers<br>* Click to call default number<br>* Long click to open alternate contact view<p>Notes<br>* Hardware phone button not working on some Samsung Galaxy S, anyone has that problem please send an email<br>* Not tested on too many different kinds of phones yet<br>* Requires the facebook client (latest version) to be installed to match contact pictures with facebook contacts<br>* Does not clear the missed calls notification on Gingerbread (android 2.3) due to google disallowing the MODIFY_PHONE_STATE permission for non-system applications<p>Follow @dnaqproductions on twitter for info on updates</p></p></p></p></p>', '7', '169162', '0', '0', '0', '2015-03-20 18:38:04', '2015-03-20 18:38:04', '0', '1', '0', '0', 'dnaq productions');
INSERT INTO `applications` VALUES ('org.iii.romulus.meridian', 'Meridian', '143', '1.7.1', '25', 'El reproductor de mÃºsica con espacio personalizable.<br>Control de gestos.<br>ConfiguraciÃ³n avanzada de la carpeta &quot;media&quot;, puedes incluir/excluir carpetas-- con cualquier profundidad. Ahora no solo un nivel sobre /sdcard<br>PlayQ en lugar de las listas de reproducciÃ³n, puede reproducir videos, mÃºsica y su Mezcla. TambiÃ©n puede poner una carpeta, un artista, un Ã¡lbum o un preferido en PlayQ<p>Otras caracterÃ­sticas:<br>- EdiciÃ³n del mp3, flac, ogg, mp4 audio...<br>- Soporte para subtÃ­tulos .srt<br>- Rancking de canciones, puedes sincronizarlo con la PC (versiÃ³n Pro)<br>- Reproduzca video como mÃºsica para sus videos de mÃºsica<br>- Kit de herramientas para buscar en la tarjeta SD, limpiar los datos<br>- Navegador de carpetas e Ã­ndices<br>- Tabs personalizables.<br>...y mucho mÃ¡s!!</p>', '3', '1421043', '0', '0', '0', '2015-03-20 18:36:13', '2015-03-20 18:36:18', '0', '1', '0', '0', 'Sais Workshop');
INSERT INTO `applications` VALUES ('org.koxx.pure_music', 'Pure music widget', '125', '1.2.5', '25', 'This widget allow to control the music player.<p>Skinnable (including fully transparent) to make a fancy widget.<p>*** NEED STOCK ANDROID, HTC SENSE, OR SAMSUNG MUSIC PLAYER ***<br>*** NO SONY Music Player such as X10 or Arc ***<p>Can&#39;t show Google Music player 3.0 online album art.<p>A problem ? PLEASE, mail me for support !</p></p></p></p>', '3', '282633', '0', '0', '0', '2015-03-20 18:34:54', '2015-03-20 18:34:56', '0', '1', '0', '0', 'Francois DESLANDES');
INSERT INTO `applications` VALUES ('org.prowl.torquefree', 'Torque (free)', '261', '1.1.49', '4', 'See what your car is doing in realtime, get fault codes, sensor data and more!<p>An OBD II engine ECU diagnostics tool that uses a cheap bluetooth ELM / OBD adapter to connect to your car OBD2 engine management system<p>Some features include:<p>* Shows and Resets engine fault codes / DTC trouble codes stored in your car<p>* Can export map/track log files to Google Earth KML / CSV<p>* Engine performance data(0 to 60, 0-100, quarter mile, etc) (full version)<p>* Head up Display / GPS HUD mode perfect for checking your speed at night<p>* Data Logging functions including web upload and file logging, you can even upload data to your own web server from sensors you choose<p>* Customisable dashboard with theme support - setup the dashboard with the gauges and dials that you want<p>* Can help you fix your car and helps keep car repair costs down!<p>* Turbo Boost gauge support for VW vehicles (in Pro version only)<p>* MPG for Petrol/Gasoline vehicles. (Pro version has diesel support)<p>This is the free/basic version - it lets you get a feel for the application and lets you find out if it works with your vehicle / obd2 adapter combination; but may contain some small bugs including not working on some nissan/chrysler/subaru ECUs. The paid version has support for more vehicles and ECU types, looks a lot nicer, and works with more cars / trucks<p>The paid version has more features (HorsePower,Torque, 0-60 , quarter mile tests, graph data, map / track views) + no adverts and exra dial/display types! and better ABS / Knock sensor support, Transmission temperature support for some makes of car / trucks (GM / Ford, etc), and Turbo Boost on many more vehicles (including VW)<p>Works on vehicles made by Ford, GM/Vauxhall/Opel, Chrysler, Mercedes, Volkswagen, Audi, Jaguar, Citroen, Peugoet, Skoda, Kia, Mazda, Lexus, Daewoo, Renault, Mitsubishi, Nissan, Honda, Hyundai, BMW, Toyota, Seat, Dodge, Jeep, Pontiac, Subaru and many more vehicle makes, European, US, Far East, etc. Some vehicle ECUs may support more/less features than others.<p>**PLEASE NOTE!** Any reports of hanging or freezing after quitting the app is due to a bug in the HTC Evo 4G and Galaxy Tab, this can be triggered by using the Pandora/Vlingo/Aldiko bluetooth enabled apps. Disabling Pandoras new bluetooth settings fixes the problem, but HTC/Samsung need to release a fix. Please contact their support and encourage them to fix, Thanks!<p>The pro version supports USB ELM adapters which are use &#39;Prolific&#39; or &#39;FTDI&#39; chips<p>* Update: A freeze/hang workaround has been found after a great amount of effort and is available in the full version in the General Preferences settings!</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '5', '1577476', '0', '0', '0', '2015-03-20 18:37:21', '2015-03-20 18:37:21', '0', '1', '0', '0', 'Ian Hawkins');
INSERT INTO `applications` VALUES ('org.rabold.android.wifibuddy', 'WiFi Buddy', '5', '0.9.3-beta', '3', 'WiFi Buddy is an easy yet functional Wi-Fi network scanner tool:<br>* Automatic scanning for access points<br>* Directly connect to open networks<br>* Quick and easy access to all Wi-Fi settings<br>* Keep Wi-Fi radio active while idle<p>UPDATE<br>- Fixed force close on HTC Hero<br>- Added VPN settings (2.x only)<p>BETA VERSION</p></p>', '3', '69530', '0', '0', '0', '2015-03-20 18:35:13', '2015-03-20 18:35:13', '0', '1', '0', '0', 'AndrÃ© Rabold');
INSERT INTO `applications` VALUES ('org.thinkjava.androidphotowidget', 'Android Photo Widget', '23', '1.43', '25', 'Add your favourite pictures on phone Home!<p>This is a WIDGET, not an app, long press on home screen and choose Widgets to add and configure it!<p>This WIDGET offers 12 different sizes from 2X2 to 6X6, scan your sdcard, choose a single picture, search Google for contents or connect to your Picasa albums! <p>Random and Recursive scan options, image rotation, many borders, timed slideshow and full screen view with pinch to zoom!<p>Please visit website for info and report any issue</p></p></p></p>', '3', '1903647', '0', '0', '0', '2015-03-20 18:35:45', '2015-03-20 18:35:45', '0', '1', '0', '0', 'Think In Java');
INSERT INTO `applications` VALUES ('org.wopnersoft.unitconverter', 'Unit Converter', '31', '2.6.12', '3', 'A simple and friendly unit converter with a clean user interface. It includes a favorites list for easy access to commonly used conversions and a Quick List View for an &quot;at-a-glance&quot; view of all conversions.<p>Over a millions users rely on and trust Unit Converter making it the #1 unit converter for Android.<p>Unit Converter will never contains Ads and includes a currency converter with over 60 currencies.<p>New!  Now you can unlock the full list of 169 currencies found in Unit Converter Plus for just $0.99 (USD).  This gives you full access to the same 169 currencies if you&#39;d rather not purchase the full Unit Converter Plus.<p>** Tips &amp; Tricks **:<p> ** You can filter the main list of conversions to only show the ones you want by going to Preferences -&gt; Filter Main List.<p> ** By default when you open the currency screen and it&#39;s been over a day since the rates have been downloaded, the app will attempt to download the current rates.  You can turn this off by going to Preferences -&gt; Auto Update Currency.<p> ** If you want to delete a particular favorite then on the Favorite conversion list Long-Press the one to delete and a pop-up will allow you to delete it.<p> ** If you would like to copy the output of a conversion Long-Press the result box and a pop-up will allow you to copy it to the clipboard.  Then you can Long-Press the input value box and select paste.<p>*** PLUS VERSION INFO ***<br>* If you are looking for more currencies and more features, please consider Unit Converter Plus.  It contains over 100 more currencies, several calculators (tip calculator, 4 function calculator, GPS converter) and the ability to add custom units.<p>Please email me with issues ( I can&#39;t directly respond to comments ).</p></p></p></p></p></p></p></p></p></p>', '4', '553620', '0', '0', '0', '2015-03-20 18:34:45', '2015-03-20 18:34:45', '0', '1', '0', '0', 'Wopnersoft');
INSERT INTO `applications` VALUES ('physlaunch.kiio.es', 'Gravity Home', '4', '0.93Beta', '10', 'Gravity Home es un Live Wallpaper interactivo que transforma tu home screen en un divertido launcher que te permite aÃ±adir los iconos de tus aplicaciones favoritas para que reaccionen con fÃ­sicas rebotando en tu escritorio.<p>* Incluido en &quot;Las mejores 5 aplicaciones&quot; en AppBrain.com  (26-27/06/2011)<p>Gira tu dispositivo en cualquier direcciÃ³n y los iconos configurados responderÃ¡n a la gravedad, moviÃ©ndose por toda la pantalla mientras siguen siendo completamente funcionales.<p>** El permiso de Acceso a Internet en la version gratuita es debido a la publicidad **<p>CaracterÃ­sticas:<p>- Modifica la gravedad, elasticidad y fricciÃ³n de tus iconos<br>- Lista configurable de apps que se mostrarÃ¡n en el live-wallpaper<br>- SelecciÃ³n de imagen de tu galerÃ­a para el fondo de pantalla<br>- TamaÃ±o de los iconos configurable<br>- Bloquear que solo se muestren los iconos con fÃ­sicas en el home screen, afectando solo un escritorio<p>Â¡Estamos trabajando en widgets de gps/data/wifi y mÃ¡s!</p></p></p></p></p></p>', '7', '378654', '0', '0', '0', '2015-03-20 18:36:20', '2015-03-20 18:36:20', '0', '1', '0', '0', 'Loading Home');
INSERT INTO `applications` VALUES ('slide.cameraZoom.propspack', 'Camera ZOOM FX Props Pack', '5', '1.0.4', '13', 'FREE new Camera ZOOM FX pack! Dazzling fun props for your photos!<p>Click here to install <a href=\"https://play.google.com/store/apps/details?id=slide.camZoomFree\">Camera ZOOM FX</a>!<p><b>&gt;&gt; Editor&#39;s Choice - Google Play, Gizmodo + SlashGear</b><br><b>&gt;&gt; &quot;The Best Camera for Android&quot; - lifehacker</b><p>The final choice for 2,000,000+ people!<p><b>POWERFUL FEATURES:</b><br>â— Fastest camera on Android<br>â— Best Photo Mode!<br>â— Stable Shot<br>â— Timer<br>â— Voice Activated<br>â— Burst Mode<br>â— Collage<br>â— Time Lapse<br>â— Silent camera mode<br>â— Grid overlays<br>â— Horizon level<br>â— Set actions for hardware buttons<p><b>POST PROCESSING:</b><br>â— Powerful editing suite<br>â— 1-click presets: Diana, Retro, Holga 35mm, Toy...<br>â— Total control of color, vignettes and fun effects<br>â— Collages: e.g. 2x2 selfie shots<br>â— Tilt-shift<br>â— Light leaks<br>â— Bokeh FX<p><b>FREE DOWNLOAD PACKS:</b><br>â— Fun camera props<br>â— Famous â€˜buddiesâ€™<br>â— Shutter animations<br>â— Scary Halloween ghouls<br>â— Frames<p><b>REVIEWS:</b><br>&quot;our choice for the best camera app around ... a ton of different effects if you&#39;re in the mood for a Hipstamatic type shot&quot; - lifehacker<br>&quot;grab this to show off to your Apple-loving buddies&quot; - SlashGear<br>&quot;greatly improves the usefulness of your Android&quot; - Gizmodo<br>&quot;Few apps offer as many options for shooting as this one&quot; - WIRED</p></p></p></p></p></p></p>', '3', '410380', '0', '0', '0', '2015-03-20 18:36:26', '2015-03-20 18:36:26', '0', '1', '0', '0', 'androidslide');
INSERT INTO `applications` VALUES ('uk.co.bbc.mundo', 'BBC Mundo', '2', '1.4', '24', 'BBC Mundo, mÃ¡s que las noticias<br> <br>Ahora es mÃ¡s fÃ¡cil y rÃ¡pido acceder al amplio contenido original de BBC Mundo desde en tu telÃ©fono Android.<p>No sÃ³lo encontrarÃ¡ las noticias las 24 horas del dÃ­a sino tambiÃ©n textos, videos y anÃ¡lisis para entender el acontecer mundial. Y la mÃ¡s actualizada cobertura de tecnologÃ­a, salud, ciencia, medio ambiente y cultura.<p>Aprovecha la red de corresponsales mÃ¡s amplia del planeta a la que tiene acceso BBC Mundo.<br> <br>Con la app de BBC Mundo podrÃ¡s:<p>Â· Personalizar la aplicaciÃ³n y ajustarla a tus intereses<br>Â· Mantenerte actualizado con las Ãºltimas noticias<br>Â· Ver el contenido por orden cronolÃ³gico o de acuerdo a su popularidad<br>Â· Aumentar o disminuir el tamaÃ±o del texto<br>Â· Compartir las historias por email o a travÃ©s de redes sociales<br>Â· Leer los tres principales artÃ­culos de cada categorÃ­a sin tener que estar conectado<br>Â· Ver videos a travÃ©s de conexiÃ³n Wi-Fi o vÃ­a 3G<p>Tus comentarios y sugerencias son mÃ¡s que bienvenidos.<p>La app funciona en la versiones 2.3.3 o superiores<br> <br>La app se ajustarÃ¡ a cualquier pantalla, pero estÃ¡ optimizada para pantallas medianas (dispositivos con pantallas hasta 7 pulgadas)<br> <br>Algunos dispositivos Android podrÃ­an experimentar dificultades para reproducir algunos de nuestros videos; si eso ocurre por favor intente descargar el Main Profile cÃ³dec h.264 o un reproductor que sea capaz de reproducirlo. Si tiene alguna duda le sugerimos contactar al fabricante de su dispositivo.</p></p></p></p></p>', '7', '1511833', '0', '0', '0', '2015-03-20 18:33:34', '2015-03-20 18:33:34', '0', '1', '0', '0', 'Media Applications Technologies for the BBC');
INSERT INTO `applications` VALUES ('varecka.sms', 'Sms', '26', '2.0-beta8', '4', 'Free text messages via gates:<br>Czech Vodafone<br>Czech Vodafone Park<br>Czech T-Mobile<p>Sent message is saved to outbox like normal text message. If the message cannot be sent for free, it can still be sent as usual message. <br>Automatic cyrilic-latin translit of the message.<p>Detail gates description in &#39;About app&#39;.</p></p>', '3', '131608', '0', '0', '0', '2015-03-20 18:38:10', '2015-03-20 18:38:10', '0', '1', '0', '0', 'Varbls');
INSERT INTO `applications` VALUES ('zausan.zdevicetest', 'Z-DeviceTest', '7', '1.5', '3', 'Z-DeviceTest te permite comprobar la &quot;salud&quot; de todos los sensores de tu dispositivo Android de una manera intuitiva y completa ofreciendo un anÃ¡lisis a fondo de las caracterÃ­sticas de tu Smartphone.<p>Utiliza la aplicaciÃ³n para:<br> <br>-Complementar la informaciÃ³n tÃ©cnica del fabricante.<br>-Comparar las diferencias tÃ©cnicas entre los mÃ¡s de 600 modelos de dispositivos en el mercado.<br>-Testear el buen funcionamiento de todos tus sensores.<br>-Medir la precisiÃ³n de cada uno de ellos.<p>Saca el mÃ¡ximo partido a tu Smartphone !<p>Comprueba la seÃ±al del GPS, las cÃ¡maras, la brÃºjula, los acelerÃ³metros, el micrÃ³fono, los altavoces, seÃ±ales WIFI, Bluetooth, GSM/UMTS, Radio FM, Pantalla, BaterÃ­a, CPU, Memoria, Vibrador,  USB, Salidas de audio/video, sistema operativo, sensor de luz, sensor de proximidad, sensor de temperatura, sensor del flash, NFC near field comunication, BarÃ³metro, detecciÃ³n de satÃ©lites en la constelaciÃ³n Navstar de manera conjunta e individual, ..etc.<p>No dudes en enviar tus comentarios a:<br>E-mail: <a href=\"mailto:z-devicetest@zausan.com\">z-devicetest@zausan.com</a><p>Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/topic.php?uid%253D145081415519605%2526topic%253D200%26sa%3DD%26usg%3DAFQjCNFe2Hk4X55K5E2xeaardPiprPCOcw&amp;sa=D&amp;usg=AFQjCNGC8u0mTSRC90xSxq69Csm_L30WPA\" target=\"_blank\">http://www.facebook.com/topic.php?uid=145081415519605&amp;topic=200</a><p>Youtube:  <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.youtube.com/user/zausaninnova?feature%253Dmhee%26sa%3DD%26usg%3DAFQjCNFEMNjREHA0Zs3n1CM_NlvXNhPikw&amp;sa=D&amp;usg=AFQjCNHOExZdMan2PW2LmWLCFMTg9cWA4w\" target=\"_blank\">http://www.youtube.com/user/zausaninnova?feature=mhee</a><p><br>Version 1.13<br>-Nuevo sensor de infrarojos aÃ±adido.<br>-Nuevo sensor virtual de detecciÃ³n