INSERT INTO `uploads` VALUES ('558', 'com.storm8.pets12', 'Pets Live', '4', '1.1.1', '14', 'So you want to be the best Pet Trainer around?<p>Explore the world to discover new pets of all shapes and sizes, from the ferociously fierce to the cute and huggable. Then raise them until they are strong enough to compete against other trainers in Pets LIVEâ„¢!<p>FEATURES:<br>- Massively Multiplayer ONLINE Pets game!<br>- Battle other trainers LIVE!<br>- FREE updates with new quests, abilities, habitats, and more!<br>- Begin with one of four types of pets -- Fire, Water, Air, and Earth -- and collect many others<br>- Show off your pets with the best moves and attacks<br>- Raise your pets by acquiring habitats<br>- Bring friends in as trainers to make your team stronger<br>- Use pets to perform numerous fun quests<br>- Enjoy gorgeous graphics<br>- Get real time updates<br>- Help tackle powerful trainers using the discipline list<br>- Comment on other trainersâ€™ profiles<br>- Broadcast messages to your fellow trainers<br>- Simple and easy-to-use tap interface<br>- ...and much, much more!<p><br>Storm8 is the #1 Mobile Social Game Developer on Android, iPhone, iPod Touch, and iPad. <p>Use of this application is governed by the Storm8 Terms of Service. Collection and use of data are subject to Storm8&#39;s Privacy Policy. Both policies are available at www.storm8.com/terms and www.storm8.com/privacy<p>Please note that Pets LIVEâ„¢ is free to play, but you can purchase in-app items with real money. To delete this feature, on your device go to the Google Play Store, tap the Menu button, select Settings &gt; Use PIN for purchase. Then, set up the four-digit PIN on the option below. In addition, Pets LIVEâ„¢ may link to social media services, such as Facebook, and Storm8 will have access to your information through such services.</p></p></p></p></p>', '3', '1528948', '0', null, null, null, '1', '2015-03-19 12:50:20', '2015-03-19 12:50:20', 'Storm8 Games');
