INSERT INTO `uploads` VALUES ('561', 'com.ancientdevelopers.droidcircuitcalcfree', 'Droid Circuit Calc Free', '10', '2.4.2', '3', 'Droid Circuit Calc Free is great tool for electronics student and hobbyists. It helps and makes it lot easier to do calculations for your circuits and design works.<p>The Free version has electronic calculators, electronic components guide, useful electronic resources guide,  huge collection of electronic circuits for hobbyists, electronic symbols and 74xx series pin outs etc.<p>You have now lots of electronic circuit calculators like<p>* Ohm Law Calculator<br>* Resistor Voltage Divider Calculator<br>* Parallel Resistors Calculator<br>* LED Resistor Calculator<br>* RC Filter calculator<br>* LC Filter Calculator (Pro)<br>* Op Amp Active Filter Calculator (Pro)<br>* Resonance Calculator<br>* Frequency and Wavelength Calculator<br>* RF Calculators (Microstrip, coaxial cable, pi attenuator, t attenuator calculators)<br>* 555 Timer astable and Monostable multivibrator calculator<br>* Op amp inverting and non inverting amplifier calculator<br>* Open air single layer inductance calculator (Pro)<br>* LM317 constant current calculator<br>* LM317 voltage regulator calculator<br>* Zener Diode series resistor calculator (Pro)<br>* PCB Trace Width Calculator<br>* Battery Charge Time Calculator (Pro)<p>In the electronic components section you can enjoy now<p>* SMD resistor value codes calculator<br>* Resistor color codes calculator<br>* Capacitor values code calculator (Pro)<br>* SMD resistor and capacitor packages guide <br>* Standard 2% and 5% resistance value table<br>* Standard 1% resistance value table (Pro)<br>* IC packages guide (DIP ICs, SO ICs, PLCC ICs etc)<br>* LM78xx and LM79xx (Pro) voltage regulators guide<br>* LM317 and LM337 voltage regulators guide<p>And in the resources section we have <p>* List of ASCII codes<br>* Radio frequencies list<br>* AWG wire gauge table for resistance and current<br>* Micro SD card pinouts (Pro)<br>* Different PC ports pinouts (like serial port, parallel port, joystick or game port (Pro), USB port, VGA port (Pro), mini VGA (Pro), PS2 mouse port, network port (Pro), mini USB, S Video, Scart Port, HDMI Port (Pro), Firewire (IEEE 1394) Port, GPIB Port (Pro), Sata, DVI (Digital Video Interface) Port, Extended IDE Port (Pro) and Apple 30 pin Dock Port (Pro))<br>* Microchip PIC microcontroller ICSP connector pinouts.<br>* Atmel AVR microcontroller ISP connector pinouts<br>* LCDs (for microcontrollers) Pinouts (16 x 2 LCD, Hitachi HD44780 LCD (Pro), 128 x 64 graphics LCD (Pro), Nokia 3310 LCD (Pro))<br>* ATX Power supply connector pinouts (Pro)<br>* GSM SIM module pinouts  (Pro)<br>* PICAXE pinouts and specs. (08M2, 14M2, 18M2, 20M2, 20X2, 28X2 and 40X2)<br>* Garmin GPS connectors pinouts (EM406, 4 pinround connector, Nuvi connector)<p>In circuits section we have came up with 7 categories and 40 circuits. But there is lot more to come soon. Circuits Categories are <p>* Audio amplifiers Circuits (Pro)<br>* Alarms and Bells Circuits (Pro)<br>* 555 Timer IC  Circuits<br>* LED  Circuits (Pro)<br>* Power Supply Circuits (Pro)<br>* RC Plane Circuits (Pro)<br>* Home Security  Circuits (Pro)<p>for you...........and still more to come very soon............. just stay tuned...............and enjoy<br>Electronic calculators, electronic circuits, electronics references, Pinouts, Cables &amp; Adapters and much more more.......</p></p></p></p></p></p></p></p></p></p>', '9', '15909408', '0', null, null, null, '1', '2015-03-19 12:50:20', '2015-03-19 12:50:20', 'AncientDevelopers');
INSERT INTO `uploads` VALUES ('562', 'com.hp.android.printservice', 'HP Print Service Plugin', '48', '1.0.48', '5', 'El complemento HP Print Service estÃ¡ preinstalado en determinados smartphones y tablets HP, Nexus y Samsung Android OS (consulte la lista de compatibilidad a continuaciÃ³n).<p>El complemento permite la impresiÃ³n en muchas impresoras HP inkjet y LaserJet, impresoras multifuncionales y dispositivos multifuncionales sin necesidad de aplicaciones de otros proveedores o controladores de impresiÃ³n adicionales. Imprima fÃ¡cilmente fotografÃ­as, pÃ¡ginas web y documentos cuando su dispositivo mÃ³vil estÃ© conectado a una impresora HP compatible a travÃ©s de una red inalÃ¡mbrica o de una conexiÃ³n inalÃ¡mbrica directa a la impresora. Controle los ajustes de impresiÃ³n, incluyendo el color, el nÃºmero de copias, la orientaciÃ³n del papel y el tipo de papel.<p>Cuando las actualizaciones del complemento estÃ©n disponibles, recibirÃ¡ una notificaciÃ³n de su dispositivo. Ajuste la configuraciÃ³n para actualizar automÃ¡ticamente este complemento o aceptar las actualizaciones manualmente. Este complemento estÃ¡ integrado en el sistema operativo y no se puede desinstalar o mover a la tarjeta SD.<p>Si su dispositivo no aparece a continuaciÃ³n, eso significa que este complemento no es compatible con su dispositivo en este momento. Si su dispositivo Android OS no tiene funcionalidad de impresiÃ³n integrada en el SO, descargue la aplicaciÃ³n HP ePrint en la tienda de Google Play para permitir la impresiÃ³n fÃ¡cil en muchas impresoras HP.<p>Compatible con estos dispositivos (en noviembre de 2013):<br>â€¢ Dispositivos Android 4.4 (KitKat)<br>â€¢ Samsung Galaxy Note 3, S4<br>â€¢ HP Slate 7<br>â€¢ HP Slate 7 HD<br>â€¢ HP Slate 8 Pro<br>â€¢ HP Slate 10 HD<br>â€¢ HP Slate 10<br>â€¢ HP Slate 21<br>â€¢ HP SlateBook<p>Impresoras HP compatibles:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://h10025.www1.hp.com/ewfrf/wc/document?docname%253Dc03733