INSERT INTO `uploads` VALUES ('565', 'northern.captain.seabattle', 'Naval Clash', '80', '1.7.10', '28', '* New version! Now play battleship on the web using different types of weapons! Sea battle begins!<p>Play classic battleship game from your childhood. Setup your ships on the field, then shoot enemy&#39;s ones.<br>The objective of this guess and shoot game is to find and sink all enemy ships. You should do it faster than your opponent.<p>Play online with your friends in our Admiral Edition.<p>Features:<br>- Nice hand drawn graphics<br>- Single player fights with your Android<br>- Multiplayer clashes via bluetooth<br>- Worldwide battles on the Web using weapons<br>- Mines, radars, anti-radars and more <br>- Coins and stars for victories<br>- Ranks for the stars, weapons for the coins<br>- Tree types of fleets for your choice<br>- High scores<br>- Global high scores<br>- Supports Honeycomb tablets<br>- Free, no Ads.<br>- App2SD<p>Take a look to Naval Clash Admiral Edition with many additional features.<p>Join us on Facebook: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/Naval.Clash.AE%26sa%3DD%26usg%3DAFQjCNE_xHzMGFP7Q19TjRhnJMkNtP2E4g&amp;sa=D&amp;usg=AFQjCNEfVnry_GQToRhSui5KqKVPHngSfA\" target=\"_blank\">https://www.facebook.com/Naval.Clash.AE</a><br>Add us on Google+: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://google.com/%252BNavalClash%26sa%3DD%26usg%3DAFQjCNFK3wtja15tnnAKzEPRhiRThvNzOg&amp;sa=D&amp;usg=AFQjCNFp7FMV7VNBBvzA-8KAOsDbhU0uLQ\" target=\"_blank\">https://google.com/+NavalClash</a><br>Follow us on Twitter @NavalClash, we are glad to hear your opinion and suggestions.<p>If you have any problem with the game do not set a low rating, just send us e-mail and we will fix it. E-mail to <a href=\"mailto:navalclash@gmail.com\">navalclash@gmail.com</a><p>The game may collect anonymous statistics about your battles.<p>This is a remake of popular paper game with two navy fleets equipped with warships and other types of battle ships. Your ship is in combat with the enemy naval forces and you need to win this war.<p>Video provided by S-Kadr Studio (<a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://s-kadr.by%26sa%3DD%26usg%3DAFQjCNEnsGnmbGyHPWqyh6kcV8IHM8iAkQ&amp;sa=D&amp;usg=AFQjCNG3fZmrJj_m73CxJB0o2KuhEs2Y_g\" target=\"_blank\">http://s-kadr.by</a>)</p></p></p></p></p></p></p></p></p>', '8', '6590716', '0', null, null, null, '1', '2015-03-19 12:50:22', '2015-03-19 12:50:22', 'Northern Captain');
