INSERT INTO `uploads` VALUES ('571', 'com.gau.go.launcherex.gowidget.clockwidget', 'GO Clock Widget', '8', '1.4', '5', 'GO Clock Widget is a time browsing tool on homescreen based on GO Launcher EX. Both analog style and digital style are supported. The analog style has two different modes that change at 6:00 and 18:00. Up to 9 different themes are supported!<p>To make it work, you must install the latest version of GO Launcher EX which is the most popular home launcher app in Android Market.<p>Available Size:<br>- 4x2<br>- 4x1<br>- 2x2<p>Actions:<br>- Set alarms<p>How to add GOWidget to your home screen?<br>- Long press on your home screen in GO Launcher EX. Press the GOwidget option and choose the widget you like. Make sure you have enough room for the widget.</p></p></p></p>', '5', '2296888', '0', null, null, null, '1', '2015-03-19 12:50:24', '2015-03-19 12:50:24', 'GO Launcher Dev Team');
