INSERT INTO `uploads` VALUES ('573', 'ca.roofdog.biketrip', 'Bike Trip', '13', '1.7.0', '14', 'Introducing Extreme Bike Trip with multiplayer races! The much awaited new entry in the Extreme Road Trip series!<p>Itâ€™s time to take your bike off the road, customize your rider and race against your friends in the new Multiplayer Race mode!<p>Choose your favourite bike from a collection of scooters, dirt bikes, cruisers and speed bikes! Customize your ride with paint jobs and use all-new power-ups to achieve the best scores!<p>Featuring signature music by Jimmy &quot;Big Giant Circles&quot; Hinson (of &quot;Extreme Road Trip 2&quot; fame).<p>== Features ==<p>* Extremely addictive gameplay!<br>* Introducing all-new Multiplayer Races!<br>* Huge gratifying explosions and crashes!<br>* 28 bikes to ride, from scooter to speed bike!<br>* Customize your rider and show off to your friends!<br>* All-new power-ups like the ejectable seat and energy drink!<br>* Catchy music that will stay with you all day<br>* Drive in dangerous and unexplored locations!<br>* Google Play Achievements and Leaderboards<br>* Free!</p></p></p></p></p>', '9', '35514900', '0', null, null, null, '1', '2015-03-19 12:50:25', '2015-03-19 12:50:25', 'Roofdog Games');
INSERT INTO `uploads` VALUES ('574', 'com.mobitobi.android.gentlealarm', 'Gentle Alarm', '69', '2.6.10', '23', '*** Disponible VersiÃ³n de prueba gratuita. ***<p>** A los compradores de la UniÃ³n Europea se les aÃ±adira el 19% de IVA al precio de venta **<p>ExplicaciÃ³n completa de todos los permisos mas abajo.<p>- La alarma despertador con mÃ¡s posibilidades del Market<br>- Discurso de entrada y salida<br>- Personalice los colores, tamaÃ±o de fuente, fondos<br>- Modo nocturno con tamaÃ±o y color de la fuente personalizable<br>- Soporte para bases (docks)<br>- Intenta que usted se despierte durante la fase de sueÃ±o ligero (opcional, ver mÃ¡s abajo)<br>- Mp3, tonos de llamada, listas de reproducciÃ³n, carpetas, radio de Internet, puede crear listas de reproducciÃ³n propias, eligiendo un artista o gÃ©nero ...<br>- Utiliza un reproductor propio para obtener un super-suave fundido de entrada de la mÃºsica<br>- Alarma silenciosa con vibraciÃ³n que aumenta lentamente<br>- Modo botones grandes para los usuarios con gafas<br>- Dar la vuelta para dormir, agitar para desactivar<br>- Puzzle o pruebas matemÃ¡ticas para comprobars si estÃ¡ despierto<br>- Soporte para Tasker y SleepBot<p>Un despertador no debe sacarle bruscamente de sus sueÃ±os. Es por eso que he creado Gentle Alarm (alarma suave) que intenta despertarle durante la fase de sueÃ±o ligero mediante una opciÃ³n de pre-alarma.<p>Los despertadores no pueden saber si usted estÃ¡ en un sueÃ±o ligero o sueÃ±o profundo (los despertaodres basados en movimientos no funcionan), pero pueden hacer sonar una pre-alarma muy suave que sÃ³lo escucharÃ¡ si usted estÃ¡ en un sueÃ±o ligero. Si usted estÃ¡ en sueÃ±o profundo, simplemente va a seguir durmiendo durante la pre-alarma.<p>La pre-alarma suena 30 minutos antes de que realmente quiera levantarse (se puede cambiar eso). Si la pre-alarma le despierta, estarÃ¡ mÃ¡s descansado que si hubiera dormido hasta que la alarma principal sonara, porque en ese momento habrÃ­a vuelto a entrar en sueÃ±o profundo. Dele una oportunidad y estoy seguro de que no se arrepentirÃ¡.<p>Por supuesto, la aplicaciÃ³n tiene todas las caracterÃ­sticas habituales de un gran reloj despertador:<br>Se puede cambiar a un modo nocturno de forma automÃ¡tica al colocar el telÃ©fono en su base/dock. Se puede acortar automÃ¡ticamente el tiempo de pausa cada vez que se pulsa la pausa. Se pueden crear automÃ¡ticamente listas de reproducciÃ³n de su artista favorito o gÃ©nero. Y le permite cambiar los colores, fuentes y fondos.<p>Permisos:<p>* RECEIVE_BOOT_COMPLETED: AsÃ­ puede activar una alarma despuÃ©s de reiniciar el telÃ©fono. Tras el reinicio, todas las alarmas de todas las aplicaciones se cancelan de forma predeterminada.<p>* WAKE_LOCK: AsÃ­ el telÃ©fono puede permanecer activo mientras suena una alarma o mientras se visualiza la pantalla de noche.<p>* DISABLE_KEYGUARD: Cuando suene la alarma, usted no tiene que desbloquear el telÃ©fono para poder apagar la alarma.<p>* VIBRATE: VibraciÃ³n<p>* WRITE_SETTINGS: Para ajustar algunas configuraciÃ³nes del sistema, tales como el modo aviÃ³n, modo silencio, etc<p>* WRITE_EXTERNAL_STORAGE: Se graban algunos datos sobre su tarjeta SD.<p>* READ_PHONE_STATE: Para evitar que una alarma suene mientras estÃ¡ hablando por telÃ©fono.<p>* READ_LOGS: Para que usted me pueda enviar los datos de depuraciÃ³n (opcional)<p>* INTERNET: Para que se puedan mostrar anuncios (en la versiÃ³n de prueba solamente). AdemÃ¡s, si la aplicaciÃ³n se bloquea, se ofrece la posibilidad de enviarme un informe de depuraciÃ³n. La aplicaciÃ³n le preguntarÃ¡ si desea enviar los datos o no. Si lo hace, se necesita una conexiÃ³n a Internet. Si no, no lo hace, pero todavÃ­a necesita la autorizaciÃ³n en la aplicaciÃ³n porque cuando usted lo desee puede enviar los datos de depuraciÃ³n.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '835795', '0', null, null, null, '1', '2015-03-19 12:50:25', '2015-03-19 12:50:25', 'mobitobi');
