INSERT INTO `uploads` VALUES ('578', 'imoblife.mtsoundsleep.deluxe', 'Sound Sleep (MT)', '18', '3.1', '27', 'Multi-language Improvement: Support Japanese Language!<p>For users who could not find the icon shown on Homescreen, please move the application to phone and reboot your phone.<p>Music Therapy for Sound Sleep is an android music application based on the famous EEG to optimize human brains. For a necessary sound sleep, Low Speed Alpha Wave (8Hz to 9Hz) set in this app will comfort your mind, assisting you to fall asleep smoothly. <p>Music Therapy for Sound Sleep Deluxe Edition provides a total of 8 Alpha Wave music melodies and 12 natural ambient sounds for your to mix and customize your ocean scene. With a re-arrangement of music sequence to bring about better musical experience.<p>Enrich Your Imagination with a Sound Mixer in the latest version!<br> <br>The latest version of Music Therapy for Sound Sleep provides a group of relaxing natural sounds for you to choose and mix, creating your own fantastic ocean scenes. These sounds help enrich your imagination thus to further relax in a pleasant surroundings with ocean waves and soothing rains. It is totally up to you to customize each track with one or several ambient sounds, with volume bars separated from the main piano melodies.<br> <br>Totally different from the so-called leisure music, subliminal music embeds Alpha Wave to various musical pieces by delicately setting the rhythm to a certain frequency, while stimulating imagination with certain sound effects. Listening to the music, our sub-consciousness is awakened. It is guiding us to a brand new discovery of our potentials, to relaxation, and to creativity.<p>Low Speed Alpha Wave has a frequency from 8Hz to 9Hz, which stimulates a state at which one is nearly asleep and cannot think clearly. To generate such a frequency in one&#39;s mind, binaural beats are applied. For example, if the left ear is presented with a steady tone of 500Hz and the right ear a steady tone of 508Hz, these two tones combine in the brain. The difference, 8Hz, is perceived by the brain and is a very effective stimulus for brainwave entrainment.<p>Features:<br>- Tunes with Low Speed Alpha Wave<br>- Ambient Sound Mixer with a group of natural sounds<br>- Elegant interfaces and varied music themes<br>- Elaborate descriptions<br>- Increase sleep quality and relaxed state</p></p></p></p></p></p>', '4', '24286249', '0', null, null, null, '1', '2015-03-19 12:50:26', '2015-03-19 12:50:26', 'IMOBLIFE Co. Ltd');
INSERT INTO `uploads` VALUES ('579', 'com.edwardkim.android.copyscreentextfull', 'Copy Paste It', '13', '3.0', '5', 'UNIVERSAL COPY AND PASTE!<p>**If you are upgrading from a previous version, please UNINSTALL the app and then REINSTALL. A simple update will not work.**<p>Copy text from ANY screen to your clipboard. Then, paste it into any text box by long-pressing on it.<p>Use this to have copy paste functionality from ANY app or screen!<p>- Copy text to clipboard using on-board or networked OCR recognition.<br>- Copy to clipboard by shaking phone.<br>- Copy to clppboard by long-pressing on search button.<br>- Copy to clipboard by pressing overlay button.<br>- Support for many different languages.<p>NOTE: If this version does not work because your phone is not rooted, please download &quot;Copy Text&quot;, which will work on your phone (also available on the Android market). <p>Tags: Copy Paste Clipboard</p></p></p></p></p></p>', '3', '1916232', '0', null, null, null, '1', '2015-03-19 12:50:27', '2015-03-19 12:50:27', 'Edward Kim');
INSERT INTO `uploads` VALUES ('580', 'com.epic.humansvsaliens', 'Humans vs. Aliens', '9', '1.1', '14', 'An Android Market Featured Game! An OpenFeint Top Pick! A Top 100 Game! Get it now to find out what all the buzz is about!<p>ON SALE FOR A LIMITED TIME AT $0.99!<p>Embark on an epic journey to save the Earth from the wrath of invading aliens! When aliens begin their attack, you must use your skills to fend them off with 17 unique and brilliantly animated humans ranging from flamethrowers to attack helicopters! Immerse yourself in 5 beautifully rendered locations as you unlock characters and fight off 9 different types of encroaching aliens. Fight your way through day and night against aliens that do everything from cloak themselves, walk slowly like zombies, and fly above your defenders.<p>Try your skills at Unlimited Mode and see how long you can last against an unlimited flow of aliens. Meteors rain from the sky destroying both humans and aliens, making you stay on your toes! <p>With Open Feint, you can unlock achievements and compare your scores with friends as well as the rest of the world. Featuring 23 achievements and more on the way, Humans vs. Aliens plants you against your friends, and will keep you busy for a long time to come.<p>If you previously purchased Humans vs Aliens, please contact us at the email below to get free updates.<p>If you are running a custom ROM, please contact us with any problems so we can investigate. Please note an Error 18 is an Android Market error out of our control. <p>Epic Applications is a trusted developer of over 25 mobile applications for BlackBerry and Android, including the 2009 Best Game of the Year and 2010 Best Game of the Year runner-up as voted on by the largest BlackBerry community on the planet!</p></p></p></p></p></p></p>', '8', '13947291', '0', null, null, null, '1', '2015-03-19 12:50:27', '2015-03-19 12:50:27', 'Epic Applications, LLC');
