INSERT INTO `uploads` VALUES ('594', 'com.noinnion.android.greader.readerpro', 'gReader', '107', '2.0.7', '24', 'â˜…â˜…â˜… &quot;gReader Is Hands Down The Incomparable King Of RSS Readers On Android.&quot; - AndroidPolice â˜…â˜…â˜…<p>gReader is a simple, fast and intuitive feed/rss reader for Android, featuring beautiful themes, podcast support and full offline support. Read all your rss/feed news in one place, where keeping up with your favorite websites is as easy as checking your email. <p>More on <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader%26sa%3DD%26usg%3DAFQjCNHcidJIX1t7Z1J614jYrhM9otWtvw&amp;sa=D&amp;usg=AFQjCNGF5qgNRjbY4PO0s9BGLWIOEl250w\" target=\"_blank\">http://noinnion.com/greader</a><p>NOTES:<br>* The Old Reader: To use The Old Reader you need to create a mobile login in TOR settings<br>* Please let us know of any issues you encounter via email.<br>* If you still get ads: Clear the cache of the market and check the license in gReader again (Menu-&gt;More-&gt;Check License)<br>* Read the FAQ before commenting: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader/support%26sa%3DD%26usg%3DAFQjCNFRlR8OsgbmTFMT_Ss0G1T_DeWhTA&amp;sa=D&amp;usg=AFQjCNHu2sExwXt02xK2fKQZHUZNyZdGaA\" target=\"_blank\">http://noinnion.com/greader/support</a><br>* Beta: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader/updates%26sa%3DD%26usg%3DAFQjCNHndJAhpEBtBIoAvkPGVm_q1aBbMQ&amp;sa=D&amp;usg=AFQjCNGkJiSG9ugaM9PYKZGuAEGdK6X6vg\" target=\"_blank\">http://noinnion.com/greader/updates</a><br>* Play Store: https://play.google.com/store/apps/details?id=com.noinnion.android.greader.readerpro<p>FEATURES (PRO):<br>* Support developers<br>* Ad-Free version<br>* Better Widgets<br>* Better Podcasts features<br>* Voice-Reading<br>* Custom Notification<p>SERVICES:<br>* Feedly Cloud: Feedly Cloud is a new way to browse the content of your favorite sites.<br>* The Old Reader: The Old Reader is a simple, web-based RSS reader with lots of great sharing features.<br>* RSS Reader: Use gReader without any online services. All data are saved locally.<p>FEATURES:<br>* Synchronization: Use gReader at home, at your office, or anywhere you go and keep your feeds, tags and shared items synched in one place.<br>* 2-Way Sync: Synchronize your read items between gReader and Feedly/The Old Reader. Keep your articles up-to-date<br>* Auto synchronization<br>* User Interface: Simple, fast and intuitive<br>* Tablet-Optimized: Read your news more comfortable on a tablet<br>* Themes: Light, Black and Dark, Sepia, Blue, Green<br>* Night Mode: Read your articles with white font on black background. Save battery and increase readability in the night.<br>* Offline Reading: Reading full article content without internet connection<br>* Mark read on scroll<br>* Podcast support<br>* Voice-Reading (Text-To-Speech)<br>* Search Filters: Search and filter keywords, save search results<br>* Folders / Tags support<br>* Notification<br>* Share articles via Email, Facebook, Twitter, ...<br>* Services: Translation, Mobilizer (Google, Instapaper, Readability)<br>* Save to Pocket (Read it later) / Instapaper / Readability<br>* Sort: by newest, by oldest, by feed<br>* Quick and Swipe actions: faster access to useful functions<br>* Rich article list (snippet and thumbnail)<br>* Widget: Icon widget with unread badge<br>* Easy Reading: Reading mode view, inverse webpage color<br>* Fullscreen mode: Enlarge your reading space<br>* HTTPS connection: Use Http Secure to get your feeds<br>* Backup/Restore: Backup/Restore your preferences<p>Try it yourself and build your own opinion.<p>PERMISSIONS:<br>* GET_ACCOUNTS, USE_CREDENTIALS: Allows access to the list of accounts for quick login.<br>* READ_LOGS: Used for feedback feature. Users could send logs to developer for identifying issues.</p></p></p></p></p></p></p></p>', '4', '421305', '0', null, null, null, '1', '2015-03-19 12:50:32', '2015-03-19 12:50:32', 'noinnion');
INSERT INTO `uploads` VALUES ('595', 'com.noinnion.android.greader.readerpro', 'gReader Pro', '106', '2.0.6', '24', 'â˜…â˜…â˜… &quot;gReader Is Hands Down The Incomparable King Of RSS Readers On Android.&quot; - AndroidPolice â˜…â˜…â˜…<p>gReader is a simple, fast and intuitive feed/rss reader for Android, featuring beautiful themes, podcast support and full offline support. Read all your rss/feed news in one place, where keeping up with your favorite websites is as easy as checking your email. <p>More on <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader%26sa%3DD%26usg%3DAFQjCNHcidJIX1t7Z1J614jYrhM9otWtvw&amp;sa=D&amp;usg=AFQjCNGF5qgNRjbY4PO0s9BGLWIOEl250w\" target=\"_blank\">http://noinnion.com/greader</a><p>NOTES:<br>* The Old Reader: To use The Old Reader you need to create a mobile login in TOR settings<br>* Please let us know of any issues you encounter via email.<br>* If you still get ads: Clear the cache of the market and check the license in gReader again (Menu-&gt;More-&gt;Check License)<br>* Read the FAQ before commenting: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader/support%26sa%3DD%26usg%3DAFQjCNFRlR8OsgbmTFMT_Ss0G1T_DeWhTA&amp;sa=D&amp;usg=AFQjCNHu2sExwXt02xK2fKQZHUZNyZdGaA\" target=\"_blank\">http://noinnion.com/greader/support</a><br>* Beta: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://noinnion.com/greader/updates%26sa%3DD%26usg%3DAFQjCNHndJAhpEBtBIoAvkPGVm_q1aBbMQ&amp;sa=D&amp;usg=AFQjCNGkJiSG9ugaM9PYKZGuAEGdK6X6vg\" target=\"_blank\">http://noinnion.com/greader/updates</a><br>* Play Store: https://play.google.com/store/apps/details?id=com.noinnion.android.greader.readerpro<p>FEATURES (PRO):<br>* Support developers<br>* Ad-Free version<br>* Better Widgets<br>* Better Podcasts features<br>* Voice-Reading<br>* Custom Notification<p>SERVICES:<br>* Feedly Cloud: Feedly Cloud is a new way to browse the content of your favorite sites.<br>* The Old Reader: The Old Reader is a simple, web-based RSS reader with lots of great sharing features.<br>* RSS Reader: Use gReader without any online services. All data are saved locally.<p>FEATURES:<br>* Synchronization: Use gReader at home, at your office, or anywhere you go and keep your feeds, tags and shared items synched in one place.<br>* 2-Way Sync: Synchronize your read items between gReader and Feedly/The Old Reader. Keep your articles up-to-date<br>* Auto synchronization<br>* User Interface: Simple, fast and intuitive<br>* Tablet-Optimized: Read your news more comfortable on a tablet<br>* Themes: Light, Black and Dark, Sepia, Blue, Green<br>* Night Mode: Read your articles with white font on black background. Save battery and increase readability in the night.<br>* Offline Reading: Reading full article content without internet connection<br>* Mark read on scroll<br>* Podcast support<br>* Voice-Reading (Text-To-Speech)<br>* Search Filters: Search and filter keywords, save search results<br>* Folders / Tags support<br>* Notification<br>* Share articles via Email, Facebook, Twitter, ...<br>* Services: Translation, Mobilizer (Google, Instapaper, Readability)<br>* Save to Pocket (Read it later) / Instapaper / Readability<br>* Sort: by newest, by oldest, by feed<br>* Quick and Swipe actions: faster access to useful functions<br>* Rich article list (snippet and thumbnail)<br>* Widget: Icon widget with unread badge<br>* Easy Reading: Reading mode view, inverse webpage color<br>* Fullscreen mode: Enlarge your reading space<br>* HTTPS connection: Use Http Secure to get your feeds<br>* Backup/Restore: Backup/Restore your preferences<p>Try it yourself and build your own opinion.<p>PERMISSIONS:<br>* GET_ACCOUNTS, USE_CREDENTIALS: Allows access to the list of accounts for quick login.<br>* READ_LOGS: Used for feedback feature. Users could send logs to developer for identifying issues.</p></p></p></p></p></p></p></p>', '4', '420385', '0', null, null, null, '1', '2015-03-19 12:50:32', '2015-03-19 12:50:32', 'noinnion');
