INSERT INTO `uploads` VALUES ('609', 'net.goroid.theend', 'TheEndApp', '218', '2.18', '14', 'The End Begins! <br>The world comes to an end; run like hell, collect duct tape, and buy goodies for your survival camp. Once the streets are deserted, everything is covered in lava, and you are alone. Yet, you hear the callâ€¦ and even in the middle of the Collapse, you know it is time to run, to survive!<br>Run!<br>The End App challenges your reflexes and offers infinite game play with progressive level design and multiple environments. Jump over the burned down police car and reach the hidden duct tape while running through the deserted city. You will be guided through 28 days with 5 challenges for each day. Practice with free-runs for a challenge or buy boosters to take the edge off, but never, ever take your eyes off the duct tape! Collect them!<br>Features:<br>Awesome, diverse 3D graphics, with vivid, rich colors.<br>The hottest topic of 2012 told from a rare perspective, making the game unique and funny.<br>Unleash crazy Power Ups, complete Master and London achievements;<br>Experience multiple environments.<br>There is a huge city to explore, with more than 100 levels.<br>Infinite, flawless and challenging game play makes TheEndApp addictive.<br>Original music, sound effects, and cool voiceovers.<br>5 characters with unique animation and original voiceovers;<br>Facebook and Twitter share integration.<br>Easy to use swipe and tilt controls.<br>Experience high display graphics.<br>Goroid put Original water effects to the end app;<br>Endless runner for free, gratis<p>Download TheEndApp and get lost in the madness! There is more action than you can handle! Donâ€™t forget: never ever take your eyes off the duct tape. Collect them!</p>', '4', '51503089', '0', null, null, null, '1', '2015-03-19 12:50:35', '2015-03-19 12:50:35', 'POSSIBLE Games');
