INSERT INTO `uploads` VALUES ('615', 'com.piviandco.agingbooth', 'AgingBooth', '9', '1.8', '6', 'PiVi &amp; Co is launching the Android version of its famous AgingBooth app (by the creators of FatBooth, BaldBooth, MixBooth, UglyBooth &amp; BoothStache), one of the most popular iPhone apps. AgingBooth for Android is available to download for free on Google Play.<p>What will you look like when youâ€™re old? And what about your friends? Find out with AgingBooth, an easy to use and amazing face aging machine on your Android device. AgingBooth is a funny (or scary!) way to instantly age face photos. Use AgingBooth on family, friends or colleagues photos and share them via email, MMS, FaceBook, Twitter.<p>Ready to face your future?<p>Features<br>â€¢ Works with photos taken with your Android device camera or from your photo gallery<br>â€¢ Auto-cropping using face detection<br>â€¢ Transformation process is instant with no internet connection needed<br>â€¢ Shake device to see before and after views<br>â€¢ Scroll results into the app gallery<br>â€¢ Save results to your photo gallery<br>â€¢ Share with your friends via email, FaceBook or Twitter<p>Warning:<br>â€¢ AgingBooth is a funny application made for entertainment purposes only and does not guarantee resemblance to the real aging process.<br>â€¢ AgingBooth works best with people between the ages of 15 and 60.<p>AgingBooth for Android is optimised for Android platform v2.3 or later. In order to help improve this version, should you have any trouble using it, please feel free to send your feedback at <a href=\"mailto:androidfeedback@piviandco.com\">androidfeedback@piviandco.com</a>.<p>Â© PiVi &amp; Co 2010-2015<p>Also by PiVi &amp; Co :<p>- BimboBooth, the app that turns you into a bimbo :<br>https://play.google.com/store/apps/details?id=com.piviandco.bimbobooth<p>- BoothStache, the mustache growing machine:<br>https://play.google.com/store/apps/details?id=com.piviandco.boothstache<p>- UglyBooth, the app that makes you feel pretty:<br>https://play.google.com/store/apps/details?id=com.piviandco.uglybooth<p>- MixBooth, the face mixing machine:<br>https://play.google.com/store/apps/details?id=com.piviandco.mixbooth<p>- FatBooth, the app that makes you fat:<br>https://play.google.com/store/apps/details?id=com.piviandco.fatbooth<p>- BaldBooth, the app that makes you bald :<br>https://play.google.com/store/apps/details?id=com.piviandco.baldbooth<p><br>More information on AgingBooth, FatBooth, BaldBooth, MixBooth, UglyBooth, BimboBooth and BoothStache on www.piviandco.com</p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '7', '6156882', '0', null, null, null, '1', '2015-03-19 12:50:37', '2015-03-19 12:50:37', 'PiVi &amp; Co');
INSERT INTO `uploads` VALUES ('616', 'net.vivekiyer.GAL', 'Corporate Addressbook', '12', '1.2.2', '4', 'Want to lookup your colleague&#39;s information in Exchange but find your Android phone lacking? <p>Unfortunately the Global Address List (GAL) lookup currently available in Android is limited in functionality. It only looks up email addresses and does not return anything more. This could be frustrating when you are trying to use your phone to look up your colleague&#39;s phone number or office location.<p>This application looks up the GAL contact database, and returns ALL data corresponding to the contact that is available on the server. It also allows you to save the contact information retrieved to your phone for easy access.<p>This app supports GAL lookups on<br> - Exchange 2003<br> - Exchange 2007<br> - Exchange 2010<br> - Google Apps for Business/Education<br> - Zimbra <p>Thanks to the people assisting with translations:<br>- jgoldhammer (DE)<br>- hourglass69 (FR)<p>This app is NOT ad-supported and is completely free and open-source. <br>See <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://code.google.com/p/corporateaddressbook/%26sa%3DD%26usg%3DAFQjCNH8AHlSYRWKuPDLqVPZWhp3A5X9Vg&amp;sa=D&amp;usg=AFQjCNF6l0Sf3Ne1d-Y1H4E22pny9UaQ-Q\" target=\"_blank\">http://code.google.com/p/corporateaddressbook/</a><p>FAQ<p>- Why does the app need so many permissions?<br>Once the app looks up a name, there are links next to the phone numbers that allow you to call or send a text to the number. In order to make these links work, the app needs the permissions to make calls and send text messages. Also in order to save the search results to your address book, the app needs to be able to access the accounts on your device and add contacts to the accounts.<p>- Is this app ad supported or paid?<br>Nopes, the app is completely free (both like beer and speech). There are no ads, and the source code is available on Google Code (<a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://code.google.com/p/corporateaddressbook/)%26sa%3DD%26usg%3DAFQjCNGqylhuP6iY_pG_WgO-UrGYEFdIXA&amp;sa=D&amp;usg=AFQjCNGM4CVw3HXhRJc91m97SMpUUxwjQg\" target=\"_blank\">http://code.google.com/p/corporateaddressbook/)</a>.<p>- Why are you asking for my credentials? Are you trying to steal my identity<br>Unfortunately there is no way to access your account information that is configured on your device. The information you enter in the app stays on the device. Please feel free to audit the code if you are still worried.<p>- This doesn&#39;t work, how can I report an issue?<br>Please feel free to email me, or report an issue at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://code.google.com/p/corporateaddressbook/issues/list%26sa%3DD%26usg%3DAFQjCNEbBbmtYqvggdcMnST-AHzDoSzeyA&amp;sa=D&amp;usg=AFQjCNFXIRxzXFt_dQSoGhH8WWAJQbEpgA\" target=\"_blank\">http://code.google.com/p/corporateaddressbook/issues/list</a><p>- Why is the app not available in my language?<br>The developers are, unfortunately, not versed in several languages - but you can help! Please join the translatioon effort at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://crowdin.net/project/corporate-addressbook/%26sa%3DD%26usg%3DAFQjCNGmhvaVNtxDtK73teN6LKQnXEI4qw&amp;sa=D&amp;usg=AFQjCNGeJKOM3-fuLfaEv_YNHtEpUUcmrg\" target=\"_blank\">http://crowdin.net/project/corporate-addressbook/</a>.<p>- I have questions not addressed in this FAQ<br>Please see the project wiki at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://code.google.com/p/corporateaddressbook/wiki/Index%26sa%3DD%26usg%3DAFQjCNEmudtf_tQ_Mfv-6kK72XzB3fdAXQ&amp;sa=D&amp;usg=AFQjCNFonQ4xmgpJg2QGcau3eStNDlSTDQ\" target=\"_blank\">http://code.google.com/p/corporateaddressbook/wiki/Index</a></p></p></p></p></p></p></p></p></p></p></p></p>', '4', '253131', '0', null, null, null, '1', '2015-03-19 12:50:38', '2015-03-19 12:50:38', 'Vivek M Iyer');
INSERT INTO `uploads` VALUES ('617', 'com.artfulbits.aiSystemWidget', 'aiSystemWidget', '3', '1.0.2', '3', 'Full name is &quot;System Monitor Widget for Android&quot;. It is an advanced system monitoring application that covers geeks curiosity: &quot;How system works?&quot;, &quot;How it consumes own resources?&quot;, &quot;What hardware do I have?&quot; and of course it comes with couple advanced reporting capabilities. <p>TO INSTALL: LONG TAP ON HOME SCREEN!</p>', '3', '380992', '0', null, null, null, '1', '2015-03-19 12:50:38', '2015-03-19 12:50:38', 'ArtfulBits Inc.');
