INSERT INTO `uploads` VALUES ('619', 'com.itbenefit.android.Minesweeper', 'Minesweeper Classic', '50', '1.17.11', '8', 'Classic Minesweeper game for your Android (also known as Mines). Exercise your strategic and logical thinking while having fun along the way! The goal is to uncover all cells that are not containing mines.<p>TIP: Use volume buttons to toggle mode Open cell/Put flag<p>Main features:<br>â€¢ Online highscores<br>â€¢ Large scrollable and zoomable game area<br>â€¢ Nice, clean and easy to use interface<p>Paid version is also available. See Minesweeper Professional. Advantages:<br>â€¢ No ads!<br>â€¢ Board Difficulty Control (3BV)<br>â€¢ Countdown timer<br>â€¢ Zoom tuning<p>German translation by CaBi Translation<p>Please feel free to contact me by email.</p></p></p></p></p>', '3', '1009681', '0', null, null, null, '1', '2015-03-19 12:50:39', '2015-03-19 12:50:39', 'IT Benefit');
