INSERT INTO `uploads` VALUES ('621', 'com.staircase3.opensignal', 'Open Signal Maps', '11', '0.90', '3', 'Con OpenSignal puede crear mapas de cobertura celular, encontrar puntos de acceso Wi-Fi, probar y mejorar tu recepciÃ³n y obtener datos mÃ¡s rÃ¡pidos.<p>âœ“ La brÃºjula indica la direcciÃ³n del origen de su seÃ±al, Â¡sÃ³lo camine hacia allÃ­!<br>âœ“ El mapa WiFi le permite localizar fÃ¡cilmente las redes pÃºblicas cercanas. <br>âœ“ Los mapas de cobertura le permiten ver los mejores lugares para la seÃ±al.<br>âœ“ La funcionalidad Speedtest le permite ver la verdadera velocidad de su conexiÃ³n (descarga, subida y latencia).<br>âœ“ NetworkRank le permite ver cual es el mejor proveedor en su Ã¡rea.<br>âœ“ Ver un mapa de las torres celulares locales.<br>âœ“ Gratis y sin publicidad<br>âœ“ Mueva hacia su torre celular para obtener mejor seÃ±al.<p>Ayude contribuyendo a nuestros mapas colaborativos imparciales de cobertura celular  y puntos de acceso inalÃ¡mbricos, mediante el uso de nuestra aplicaciÃ³n, para mejorar su conexiÃ³n.<p><b>Preguntas frecuentes</b><br>Permisos de SMS:  requerido para contar el nÃºmero de SMS enviados para rastrear su uso, los SMS nunca son leÃ­dos (Â¡use un analizador de paquetes para verificar!)<br>Permiso Ajustes del TelÃ©fono: permite reiniciar la red en ciertas versiones de Android<br>Â¿Con quÃ© frecuencia se actualizan los mapas? Â¡Los mapas son actualizados cada semana!<br>Â¿Faltan torres celulares? No todas las torres y enrutadores inalÃ¡mbricos estÃ¡n en nuestra base de datos. Â¡Con tu ayuda trabajamos en ello!<p><br>Moverse en la direcciÃ³n de su antena de telefonÃ­a mÃ³vil no siempre mejorarÃ¡ la recepciÃ³n debido a los efectos de interferencia/geografÃ­a local.<p>Los datos son colaborativos - las ubicaciones inalÃ¡mbricas y de las antenas son calculadas por triangulaciÃ³n.<p>Â¡Cada vez que utilice la aplicaciÃ³n que estÃ¡s ayudando a mejorarla! Al ayudarnos a expandir nuestra base de datos wifi y mejorar nuestros mapas de cobertura estÃ¡ haciendo que la aplicaciÃ³n funcione mejor para todos los demÃ¡s que la utilizan. Â¡Gracias por su contribuciÃ³n!<p>Si quiere ayudar a probar versiones nuevas, Ãºnase a nuestra comunidad en Google+ y el programa de beta abierto: opnsg.nl/beta_community<p>Twitter: @opensignal_es</p></p></p></p></p></p></p></p>', '3', '1106745', '0', null, null, null, '1', '2015-03-19 12:50:39', '2015-03-19 12:50:39', 'OpenSignal.com');
INSERT INTO `uploads` VALUES ('622', 'com.pinger.textfree.call', 'Textfree with Voice', '143', '2.3.1', '7', 'Get Textfree Voice: the free calling app and free (SMS) app that gives you a real US phone number so you can send free text and SMS messages to anyone or any group, even if they donâ€™t have a free texting app. Using your data or WiFi connection, Text Free keeps you in touch with friends and family through free SMS messaging, group messaging, picture messaging, international texting &amp; calling, and voicemail. All for free. <p>REAL PHONE NUMBER INCLUDED<br>Having your own local phone number means you can call your grandmaâ€™s landline, order a pizza, SMS any number, and of course, hit up all your friends, even if they donâ€™t have a smartphone. <p>SEND UNLIMITED FREE TEXTS &amp; PICTURES<br>With Textfree you get free SMS texting plus calling, totally free and unlimited. You can even send picture messages to all your friends, even if they donâ€™t have Textfree!<p>GROUP CHATTING<br>Textfree is perfect for group messaging with all your contacts. You can create groups, leave groups, add participants and let everyone be part of the conversation.   <p>FREE CALLING &amp; VOICEMAIL<br>Textfree-to-Textfree calling and any incoming calls are always free. Outbound calling minutes are easy to earn or super cheap to buy. You can also set up your own custom voicemail.<p>TURN ANY DEVICE INTO A PHONE<br>No phone? No Problem. Textfree turns your desktop, tablet, or other Android devices into a phone so you can text and call for free. Plus, calls sound even better over WiFi. <p>AND SO MUCH MORE<br>â€¢	Texting and calling are free back to the US and Canada from anywhere in the world when you have a data connection or WiFi <br>â€¢	Speaking of the world, Textfree is perfect for making free calls and sending free texts while youâ€™re abroad.<br>â€¢	Use Textfree as a free second phone line<br>â€¢	Free texting to the US and 35+ countries For a list of those countries visit: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://r.pinger.com/text-intl%26sa%3DD%26usg%3DAFQjCNEn2ruJIlJ2eB6wI-vvRbJfny3qSw&amp;sa=D&amp;usg=AFQjCNHg-E-GlQGK9xmGGkvik_lDUWIEVg\" target=\"_blank\">http://r.pinger.com/text-intl</a><br>â€¢	Sync your contacts with their Facebook photo<br>â€¢	Know the instant your texts are read <br>â€¢	Block numbers, if needed <br>â€¢	Log in securely from any device <br>â€¢	Choose custom ringtones, text tones and backgrounds <br>â€¢	Turn your Android device into a free phone.<br>â€¢	FREE TEXTING + CALLING APP for both the US and Canada.<br>â€¢	FREE texting and calling plus 10 FREE minutes of outbound calling<br>â€¢	Send unlimited free texts, plus get free unlimited incoming calls from anyone, anywhere in the world.<br>â€¢	Textfree is the original free texting app that you can use with WiFi.<br>â€¢	Send text via your regular number or send free text with your Textfree number<br>â€¢	Free voicemail, too<br>â€¢	Call and SMS any number in the US and Canada, even if you donâ€™t have a calling plan.<br>â€¢	Make Calls on WiFi<br>â€¢	Your texts are 100% free. Pics are 100% free. Incoming calls are 100% free.<br>â€¢	Earn free minutes for outbound calls<br>â€¢	Never miss a message<br>â€¢	Send hi-res pics to anyone on AT&amp;T, Boost, Sprint, T-Mobile, Verizon and Virgin<br>â€¢	Want some light reading? Our terms of service are here: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://r.pinger.com/and-eula%26sa%3DD%26usg%3DAFQjCNF1zWKkdo4cZWIRvpSSsR4vNP7M_w&amp;sa=D&amp;usg=AFQjCNGjt3fPcsKb_wR-g3ColmP9r42elA\" target=\"_blank\">http://r.pinger.com/and-eula</a><p>OTHER IMPORTANT STUFF<br>â€¢	Emergency calls are not supported <br>â€¢	Textfree is ad-supported, so you will see ads from time to time. <br>â€¢	When roaming, additional carrier data charges may apply. Contact your carrier for details. <br>â€¢	If your contacts arenâ€™t on Textfree, they might have to pay regular carrier charges for texts and pictures. If thatâ€™s the case, be a good friend and tell them about Textfree.<br>â€¢	Requires OS 2.1+<p>TEXT FROM THE WEB<br>â€¢ pinger.com/tfw</p></p></p></p></p></p></p></p>', '8', '9944025', '0', null, null, null, '1', '2015-03-19 12:50:39', '2015-03-19 12:50:39', 'Pinger, Inc.');
