INSERT INTO `uploads` VALUES ('630', 'at.bitfire.davdroid', 'DAVdroid', '54', '0.6.12', '5', 'DAVdroid is the only all-in-one synchronization solution for both contacts (CardDAV) and calendars (CalDAV). The app is easy to set up and integrates perfectly with your favorite calendar/contacts app (including default apps). It can also be used seperately, if you either have CalDAV or CardDAV.<p><b>Compatible with most CalDAV/CardDAV servers and services, including OwnCloud, iCloud and OS X Server!</b><p>After installing, you can add a DAVdroid account from within the app. See <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://davdroid.bitfire.at/configuration%26sa%3DD%26usg%3DAFQjCNHL8JM3KH2KsS3RxFRqvw9PYbDYzg&amp;sa=D&amp;usg=AFQjCNG-ERvmxh9jR8L5rTjIxuK8muCDsw\" target=\"_blank\">http://davdroid.bitfire.at/configuration</a> for help.<p><b>Key features:</b><p>âŠ› Use DAV calendars (CalDAV) and address-books (CardDAV) in a single app<br>âŠ› Two-way synchronization (server â†” client)<br>âŠ› Native Android 4+ implementation<br>âŠ› Flawless integration with your device and favorite apps<br>âŠ› Easy setup (resource auto-detection)<br>âŠ› Fast algorithms for high performance (CTag/ETag support)<br>âŠ› Optimized for phones and tablets<br>âŠ› DAVdroid JB Workaround verfÃ¼gbar<br>âŠ› ... and finally â€“ it&#39;s open source!<p><b>Important compatibility notes</b><p>For <b>all Android 4.1 and all Samsung users:</b> There&#39;s an Android bug that causes accounts to be lost after a device reboot. To avoid this issue, please install the free app &quot;DAVdroid JB Workaround&quot;. <b>Samsung users:</b> The problem doesn&#39;t occur if you download DAVdroid using Samsung Store.<p>On some <b>Android 4.4.2 devices</b>, DAVdroid accounts will disappear after an app update. If you experience this issue, please install the free app &quot;DAVdroid JB Workaround&quot;. Details: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://davdroid.bitfire.at/faq/entry/account-gone-after-updating%26sa%3DD%26usg%3DAFQjCNGGYxVxqsoL8kJsmVorW6ATxgYHcg&amp;sa=D&amp;usg=AFQjCNHdtXr18hP13uQVO5d7XYaN9oT6zA\" target=\"_blank\">http://davdroid.bitfire.at/faq/entry/account-gone-after-updating</a><p><b>Galaxy S5 users:</b> There are numerous reports that the Samsung Galaxy S5 (only affects Samsung original firmware) contact editor crashes when using it with third-party contacts providers (like DAVdroid or similar apps). Details and workarounds: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://davdroid.bitfire.at/faq/entry/galaxy-s5-contact-app-crashes%26sa%3DD%26usg%3DAFQjCNG0gmpgjv7f3P9kFzVuly31IIQ01w&amp;sa=D&amp;usg=AFQjCNGQad0pg37WYPNMBaeljKZBRh79GQ\" target=\"_blank\">http://davdroid.bitfire.at/faq/entry/galaxy-s5-contact-app-crashes</a><p>There are issues with <b>some HTC firmwares</b> and contact synchronisation: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://davdroid.bitfire.at/faq/entry/htc-contact-problems%26sa%3DD%26usg%3DAFQjCNFbrrh-PbMeaEy5UHX_kWj6uXcifw&amp;sa=D&amp;usg=AFQjCNEN5Fus-s9rYG_kvTVVxLHRKiEdcg\" target=\"_blank\">http://davdroid.bitfire.at/faq/entry/htc-contact-problems</a><p>DAVdroid must not be moved to the SD card! This will cause strange behaviour, including account and data loss.<p>If you&#39;re using self-signed certificates, you might find our free and open-source app CAdroid useful to import your certificate.<p><b>Get the best out of this app â€¦</b><p>âŠ› â€¦ when using with your own DAV server (Radicale, DAViCal, SabreDAV, Baikal, â€¦) and HTTPS â€“ so you own and control all your data while having the comfort of synchronization between various devices. Or use a hosted DAV service you trust or the one of your company.<br>âŠ› â€¦ and combine it with Evolution / Lightning / etc. on your laptop / PC<p><b>Why is it secure?</b><p>âŠ› Source code is available (see homepage)<br>âŠ› No need for giving your contacts/calendars to Facebook, Google, etc. Use your own server (or a trusted one)!<br>âŠ› SSL is recommended to protected your communication so synchronization is secure even when using open Wi-Fi networks.<p><b>Successfully tested with:</b><p>âŠ› AOL<br>âŠ› Apple&#39;s Calendar and Contacts Server<br>âŠ› Apple iCloud<br>âŠ› BaÃ¯kal<br>âŠ› contactzilla<br>âŠ› CozyCloud<br>âŠ› DAViCal<br>âŠ› eGroupware<br>âŠ› fastmail<br>âŠ› fruux<br>âŠ› gmx<br>âŠ› Horde<br>âŠ› Mac OS X Server<br>âŠ› mailbox.org<br>âŠ› mail.de<br>âŠ› Kerio Connect<br>âŠ› KolabNow<br>âŠ› OwnCloud<br>âŠ› posteo.de<br>âŠ› Radicale<br>âŠ› SOGo<br>âŠ› Synology DSM<br>âŠ› web.de<br>âŠ› Yahoo (calendars only)<br>âŠ› Yandex<br>âŠ› Zimbra Server (Community Edition)</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '14', '1258300', '0', null, null, null, '1', '2015-03-19 12:50:40', '2015-03-19 12:50:40', 'bitfire web engineering');
INSERT INTO `uploads` VALUES ('631', 'de.softxperience.android.today', 'Today Widget', '4', '1.2.1', '3', 'Simple 1x1 widget for home screen. Shows the current weekday, date and month. Nothing more, nothing less.<p>Click on it to open calendar.<p>Just go to home screen and select Add -&gt; Widget and choose Today Widget.<p>Support for Froyo, HTC, Motorola, Samsung Galaxy Tab</p></p></p>', '3', '12777', '0', null, null, null, '1', '2015-03-19 12:50:40', '2015-03-19 12:50:40', 'SoftXperience');
