INSERT INTO `uploads` VALUES ('635', 'com.antutu.ABenchMark', 'AnTuTu Benchmark', '3311', '3.3.1', '3', 'AnTuTu benchmark is the most popular Android smartphone and tablet benchmarking app in the world!.Â <br>â˜† Over 100,000,000 users<br>â˜† Benchmark app used during Google I/O 2014<br>â˜† No.1 benchmark app, used as an industry standard by leading technology companies and hardware review sites.<br>With the Click and Go test suite, Antutu will comprehensively test all aspects of a device, including UX, GPU, RAM, CPU, I/O and more. Each item is individually assessed and given a score. These scores can be uploaded to the Antutu database, and then used to rank your device among all other Android devices.<p>Benchmark Items:Â <br>â˜† User Experience (UX) â€“ Overall device performance with detailed scores.<br>â˜† CPU Tests â€“ Measures the power of the CPU, and gives hard numbers for its actual performance.<br>â˜† CPU Single Test-- Measures the power of CPU by running CPU single test algorithms.<br>â˜† RAM Tests â€“ Investigate the real processing capability of the RAM.<br>â˜† GPU Tests â€“ Measure the performance of real graphics processing, 3D effects, games, and video playing.<br>â˜† I/O Tests â€“ A direct score that reflects on the actual input/output (I/O) performance your system permits.<br>Get your Antutu benchmark score and ranking! Compare and share with your friends!<br>For secial version (Antutu X version),please find it on our website:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://soft.antutu.com/soft/Antutu-X-Benchmark.apk%26sa%3DD%26usg%3DAFQjCNHZepYoFJ8dyKNJvAsQWMN24GXgew&amp;sa=D&amp;usg=AFQjCNG45O4M5lfb2PeUyq6gq4ryL0CDPQ\" target=\"_blank\">http://soft.antutu.com/soft/Antutu-X-Benchmark.apk</a><p>NOTE:Â <br>The Antutu benchmark score of your device is mainly defined by your hardware configuration, but can also be influenced by other elements, including system mode, current device temperature, running apps and more. The score may be vary slightly every time you test.<br>Follow us on Twitter:Â <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/antutulabs%26sa%3DD%26usg%3DAFQjCNGmg3gkO_KCVuIwqXuUPMNPNnT7LQ&amp;sa=D&amp;usg=AFQjCNEEjQ8qnccxqiCdBaGBree5JInCwQ\" target=\"_blank\">https://twitter.com/antutulabs</a><br>Find us on Facebook:Â <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/antutulabs%26sa%3DD%26usg%3DAFQjCNGYOcPb5s960XAx1_edaCVC5OFvRg&amp;sa=D&amp;usg=AFQjCNEPa44WrrWEbJKPb_TpxNIAYcVaMw\" target=\"_blank\">https://www.facebook.com/antutulabs</a><br>For any suggestions or feedback, we hope to get your great ideas via email :Â <a href=\"mailto:support@antutu.com\">support@antutu.com</a></p></p>', '9', '9783075', '0', null, null, null, '1', '2015-03-19 12:50:41', '2015-03-19 12:50:41', 'AnTuTu');
