INSERT INTO `uploads` VALUES ('645', 'com.pandora.android', 'Pandora', '13', '1.5.2', '9', 'Great music discovery is effortless and free with Pandora. Just start with the name of one of your favorite artists, songs, genres or composers and we&#39;ll do the rest. It&#39;s easy to create personalized stations that play only music you&#39;ll love.<p>Tap into an entire world of music, including almost a century of popular recordings - new and old, well known and obscure. Create up to 100 personalized radio stations with your free account. <p>Not sure where to start? Create a free account to explore hundreds of music and comedy genre stations.<p>Already a Pandora listener? Even easier. Just log in and enjoy the same free radio service. Your Pandora is the same across the web, on your phone, on your TV, and in your car - access your free personalized radio wherever you want to hear great music or comedy. <p>Note: Pandora may use large amounts of data and carrier data charges may apply. For best results, we recommend you connect your device to trusted WiFi networks when available.</p></p></p></p>', '3', '1166105', '0', null, null, null, '1', '2015-03-19 12:50:52', '2015-03-19 12:50:52', 'Pandora');
