INSERT INTO `uploads` VALUES ('650', 'imoblife.memorybooster.lite', 'Memory Booster Lite', '7', '2.3', '5', 'Acelerador de Memoria es una herramienta fuerte de optimizaciÃ³n de RAM diseÃ±ada especialmente para los usuarios de mÃ³vil Andriod. EstÃ¡ diseÃ±ado para ayudar a los usuarios en resolver los problemas de gestiÃ³n de memoria del mÃ³vil  Android, y atravÃ©s de ordenar fragmentaciones de memoria reparar fugas de memoria debido a algunos procesos de  aplicaciÃ³n se recolecciona las basuras, asÃ­ se lograrÃ¡ a liberar la memoria, acelerar la velocidad del sistema y ahorrar energÃ­a. <p>CaracterÃ­sticas:<br>1. Informar y supervisar el estado de memoria a tiempo.                                              <br>Por los grÃ¡ficos de actualizaciones oportunas, el Acelerador de Memoria muestra la memoria total y libre actual y la que ha utilizada.<br>2. Establecer objetivos de rendimiento<br>Se establece umbral para auto optimizaciÃ³n, el acelerador se mantendrÃ¡ la memoria disponible por encima del umbral, y se optimizarÃ¡ inmediatamente cuando la memoria estÃ© bajo del umbral. <br>3. Un clic con el botÃ³n para optimizaciÃ³n rÃ¡pida.<br>AdemÃ¡s de funciÃ³n de optimizaciÃ³n automÃ¡tica, el Acelerador de Memoria tambiÃ©n le permite optimizar rÃ¡pidamente con un clic de forma manual.<br>4. OptimizaciÃ³n automÃ¡tica en el fondo<br>Configura el intervalo de tiempo para optimizaciÃ³n automÃ¡tica, el acelerador marcharÃ¡ en el fondo, se va a optimizar automÃ¡ticamente segÃºn el intervalo configurado de tiempo.<br>5. ProtecciÃ³n del sistema de Android<br>El acelerador siempre mira los recursos del sistema y se recoleccionarÃ¡ las basuras una vez que se alcanzca un punto crÃ­tico.<br>6. Y otros<br>Otras funciones, por ejemplo, Task Killer(Asesino de tareas integrado), Whitelist Maneger(GestiÃ³n de lista blanca), AdministraciÃ³n de nivel de optimizaciÃ³n y el log (registro) de optimizciÃ³n de memoria ect, todo esto ayudarÃ¡ el acelerador de refuerzo para llevar a cabo de manera mÃ¡s eficiente.</p>', '3', '236789', '0', null, null, null, '1', '2015-03-19 12:50:52', '2015-03-19 12:50:52', 'AIO Toolbox Inc.');
