INSERT INTO `uploads` VALUES ('660', 'com.bulkypix.asterix', 'Asterix', '9', '1.5.0', '14', 'Estamos en el aÃ±o 50 a.C.; toda la Galia estÃ¡ ocupada por los romanosâ€¦ Â¿Toda? Â¡No! Una aldea habitada por irreductibles galos resiste y continuarÃ¡ resistiendo al invasor.<p>MEGABOFETÃ“N<br>Bebe tu pociÃ³n mÃ¡gica, carga el puÃ±o de AstÃ©rix y propulsa a tu romano lo mÃ¡s lejos posible.<p>ESTÃN LOCOS ESTOS ROMANOS<br>Desbloquea mÃ¡s de 20 objetos (casco, capa, helio, etc.) y personajes (ObÃ©lix, Ideafix y otros legionarios) que te ayudarÃ¡n a mandar a tu romano lo mÃ¡s lejos posible.<p>EL MUNDO DE ASTÃ‰RIX<br>Atraviesa los lugares mÃ¡s emblemÃ¡ticos de las aventuras de AstÃ©rix, desde la aldea gala hasta Egipto, pasando por el campamento romano de PetibÃ³num, Lutecia y, por supuesto, Romaâ€¦ Â¡sin olvidar a los piratas, por Tutatis!<p>SENCILLO Y DIVERTIDO<br>AstÃ©rix MegabofetÃ³n es un juego dirigido a galos de todas las edades. Carga el puÃ±o de AstÃ©rix girando el dedo y haz que el romano despegue de manera inmediata.<p>COLECCIONA LOS PERSONAJES DE ASTÃ‰RIX<br>Colecciona las 30 tarjetas de los personajes de AstÃ©rix, recogiÃ©ndolas a lo largo de los niveles o intercambiÃ¡ndolas con tus amigos. CÃ©sar estarÃ¡ encantado de contarte su historia.<p>DESAFÃA A TUS AMIGOS<br>Derrota a tus amigos; sus rÃ©cords aparecen marcados por romanos inflados con helio que encontrarÃ¡s a lo largo del camino<p>galo,romano,bofetÃ³n,paf,roma,francia,lutecia,jabalÃ­,laurel,tarjeta,trueno,egipto,mundo</p></p></p></p></p></p></p>', '8', '30616371', '0', null, null, null, '1', '2015-03-19 12:50:53', '2015-03-19 12:50:53', 'BulkyPix');
