INSERT INTO `uploads` VALUES ('676', 'com.colapps.reminder', 'COL Reminder', '57', '2.05', '3', 'COL Reminder is a remind-application for your Android phone.<p><br><b>Available in over 40 Languages !!</b><br>(english, german, italian, france, swedish, spanish, chinese, polish, korean, hungarian, turkish, czech, slovak, ...)<p>It helps you in reminding different things which you don&#39;t want to forget.<br>But pls. do not mix it up with a to-do list.<p><b>Do you want some samples ?</b><p>â˜… Is there a need to make an urgent phone call tomorrow?<br>No problem with the COL reminder. Just set up a calling reminder and the program will notifiy you exactly about the appointment - just one finger tap and the call will be transferred automatically.<p>â˜… Is there a need to do something urgent at home?<br>No problem with the COL reminder. Just set up a text reminder and you will get the notification at the exact time.<p>â˜… Is there a need in reminding you about the parking time (short - term parking zone) ?<br>No problem with the COL reminder. Just set up the parking reminder and you will never pay for a parking ticket again.<p>â˜… Now with Location Based Reminders<p>â˜… Now with MyBackup Integration Support!<br>Backup your COL Reminder data and settings with MyBackup!<p>â˜… Now with DashClock Widget Extension<br>Show your reminders on your lockscreen</p></p></p></p></p></p></p></p></p>', '3', '632969', '0', null, null, null, '1', '2015-03-19 12:50:57', '2015-03-19 12:50:57', 'COLapps');
