INSERT INTO `uploads` VALUES ('691', 'com.mrgreensoft.nrg.player', 'NRG Player', '16', '1.0.0', '9', 'NRGPlayer - reproductor de mÃºsica hermosa libre para Android con ecualizador, reproduce las canciones de las carpetas y la interfaz de usuario personalizable. <br>Â <br>Â <br>CaracterÃ­sticas principales: <br>Â <p>â€¢ reproducciÃ³n de formatos populares <br>Escuche canciones en todos los formatos populares. <p>Â <br>â€¢ Formatos Lossless <br>Escuche canciones en formatos sin pÃ©rdida de calidad, que su reproductor de mÃºsica por defecto no podÃ­a jugar antes. Nuestra aplicaciÃ³n tiene su propio motor de audio. <p>Â <br>â€¢ 10 bandas de ecualizador grÃ¡fico con presets <br>Elegir presets estÃ¡ndar o crear uno propio. Para abrirlo, toque el botÃ³n EQL en la esquina inferior derecha. A continuaciÃ³n, pulsa el botÃ³n On / Off para encenderlo / off. <p>Â <br>â€¢ Los efectos de sonido <br>Obtenga la mejor calidad de sus auriculares usÃ¡ndolos con efectos flexibles. Abrir ecualizador y pase a la segunda pestaÃ±a con efectos. <p>Â <br>â€¢ Los colores de la interfaz personalizada y fondo <br>Cambiar apariencia dependiendo de su propio estilo. ExprÃ©sate! Para personalizar el menÃº de opciones de tomas de interfaz (pequeÃ±o engranaje en la esquina superior derecha o el botÃ³n de menÃº del dispositivo). A continuaciÃ³n, pulsa en ConfiguraciÃ³n -&gt; Aspecto -&gt; &quot;Colores y fondo&quot; o &quot;Skins&quot; para cambiar todo aspecto del reproductor. <p>Â <br>â€¢ Conveniente rebobinado cÃ­rculo para audiolibros y podcasts <br>Ajustar la velocidad de rebobinado para facilitar la navegaciÃ³n en pistas largas. Abra ConfiguraciÃ³n -&gt; Controles -&gt; velocidad de rebobinado. Por ejemplo, x1 / 8 Velocidad le permite retroceder en 8 cÃ­rculos completos en lugar de uno. Esto hace que su navegaciÃ³n ocho veces mÃ¡s fÃ¡cil. <p>Â <br>â€¢ Botones de volumen de control de la reproducciÃ³n <br>Cambie las pistas con los botones de volumen. Usted no tiene que sacar el telÃ©fono del bolsillo. Es una gran manera de utilizar NRGPlayer para el deporte. Para activar esta caracterÃ­stica abre Ajustes -&gt; Controles -&gt; botones de volumen. <p>Â <br>â€¢ Interruptor carpetas, Ã¡lbumes o artistas en un solo movimiento <br>Abra la biblioteca de medios pulsando sobre el botÃ³n AÃ±adir en la esquina inferior izquierda. Encuentre su directorio favorito, Ã¡lbum o artista y pulse sobre el botÃ³n de reproducciÃ³n pequeÃ±o triÃ¡ngulo en el lado izquierdo del elemento de la lista. Regrese a la pantalla principal. Ahora se puede deslizar hacia la derecha o hacia la izquierda en la cola de reproducciÃ³n para cambiar. Utilice NRGPlayer como el reproductor de mÃºsica para el coche. <p>Â <br>â€¢ Juega toda tu colecciÃ³n en tres grifos <br>1. Pulse sobre el botÃ³n AÃ±adir para abrir la biblioteca de medios. <br>2. Pulsa en la pestaÃ±a &quot;Canciones&quot; <br>3. Pulse sobre el juego icono en la parte izquierda de cualquier elemento de la lista <br>Cola de reproducciÃ³n se crearÃ¡ automÃ¡ticamente para usted. Puede cambiar el &quot;azar&quot; en la pantalla principal (por encima de botÃ³n de avance). <p>Â <br>â€¢ El sistema de lista de reproducciÃ³n Unique <br>Puede seleccionar pistas en 5 categorÃ­as: carpetas, canciones, Ã¡lbumes, artistas y en la nube. Agregarlos a lista de reproducciÃ³n en un solo toque. No hay fronteras entre directorios y mediateca mÃ¡s. SÃ³lo tiene que pulsar el botÃ³n ADD en la esquina inferior izquierda. A continuaciÃ³n, pulsa en las casillas de verificaciÃ³n en la parte derecha de cualquier elemento de la lista. Cuando se selecciona todo lo que quieres es simplemente pulsa &quot;Add&quot; o el botÃ³n &quot;Play&quot;. <p>Â <br>â€¢ Pantalla de inicio y widgets de la pantalla de bloqueo <br>Usted puede elegir uno de widgets de la pantalla de tres de origen: 4x1, 4x2, 4x3, y un widget de la pantalla de bloqueo! <p>Â <br>â€¢ Compatibilidad con auriculares <br>Deje su dispositivo en el bolsillo! Usted puede ajustar el audÃ­fono en la configuraciÃ³n de Pantalla: Ajustes -&gt; Controles -&gt; Auricular. <p>Â <br>â€¢ Sleep timer <br>No se preocupe por dormir con reproductor. Se apaga automÃ¡ticamente por temporizador de apagado automÃ¡tico. Para abrir el sueÃ±o temporizador toque en Ajustes -&gt; Controles -&gt; temporizador Sleep. <p>Â <br>Utilice <a href=\"mailto:support@nrgplayer.com\">support@nrgplayer.com</a> de informes de errores.</p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '4', '2039838', '0', null, null, null, '1', '2015-03-19 12:51:02', '2015-03-19 12:51:02', 'NRG Mobile Software');
