INSERT INTO `uploads` VALUES ('696', 'tv.peel.samsung.app', 'Samsung WatchON', '6047', '6.4.7', '25', 'WatchON, made smarter by Peel,  turns your smartphone into a remote control.  Now your remote is smart.  Not only can you control your TV, set-top box, DVR and other devices from your Samsung phone, but Peel will recommend to you great shows and movies based on your preferences and past viewing behavior.  No more worrying about what to watch or how to find your favorite content.  And no more worrying about losing your remote control!<p>You can search, discover, explore, and access whatâ€™s on live TV, and on-demand movies and TV shows - across multiple video-on-demand providers. <p>You can start watching video-on-demand on your smart phone or tablet, and then sit down and relax while you continue it on the big screen.  (Please note that video-on-demand may not be  available in your country.)<br>Peel powers the most popular smart remote with 80 million activated users and more than 4 billion smart remote commands a month across the world. <p>The latest version of WatchOn by Peel  also allows you to share and engage with others around your favorite TV shows.  Each TV show has its own page with a built-in Twitter feed.  Peelâ€™s smart Twitter algorithms pull in all the relevant trending Tweets so you donâ€™t miss out on any of the conversations.  Share a â€œPeel-Inâ€ link and your friends can tune right into the show you are watching.<p>The more you tune-in with WatchON, the smarter it gets. <p>Peel has show and movie content listings for 110 countries and is optimized to work on 3500 brands of TVs and 600 set-top boxes.    But nobody is perfect and we are constantly working to improve our app so you have the best experience possible.<p>If you are having trouble with TV listings or getting the remote to work properly on a particular device, please contact <a href=\"mailto:help@peel.com\">help@peel.com</a> directly rather than post the problem in a review. This will allow us to help you most quickly and effectively and solve the problem for others in our community.<p>What our users are saying:<p>***** Jonna Gazzano, July 1, 2014 <br> Awesome. I only got it to mess with my husband but I find myself using all the time now because I only know where my phone is before I know where my remotes are.<p>***** Reymundo Aguayo, May 7, 2014. Finally One remote for all my tvs and cable boxes<br>***** Les Baker, May 7, 2014.   Great app if you lost your remote or if its out of batteries.</p></p></p></p></p></p></p></p></p>', '16', '31257067', '0', null, null, null, '1', '2015-03-19 12:51:05', '2015-03-19 12:51:05', 'Peel Technologies');
INSERT INTO `uploads` VALUES ('697', 'com.natenai.glowhockey', 'Glow Hockey', '13', '1.2.12', '14', '[NEWS] Glow Hockey 2 is now available! Including 2 players on the same device.<br>*******************************<p>Glow Hockey delivers a new style of hockey game. Easy to play, hard to master. Challenge yourself with the computer opponents!<p>FEATURES:<br>+ 2-player mode (on the same device).<br>+ Colorful glow graphics.<br>+ Smooth and responsive game play.<br>+ Realistic physics.<br>+ Quick play mode (single player), challenge yourself with 4 difficulty levels (easy to insane).<br>+ 4 selectable paddles and pucks.<br>+ Vibrate when goal.<br>+ Support almost all Android devices for mips, x86, armeabi, and armeabi-v7a.<p>See game play video: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.natenai.com/iphone/glow_hockey%26sa%3DD%26usg%3DAFQjCNFxVc-opslfsGJnkPldJgX0guUUlA&amp;sa=D&amp;usg=AFQjCNFpYqQRu848kwOP4YbgmIN5C0SDJA\" target=\"_blank\">http://www.natenai.com/iphone/glow_hockey</a></p></p></p>', '4', '6359295', '0', null, null, null, '1', '2015-03-19 12:51:06', '2015-03-19 12:51:06', 'Natenai Ariyatrakool');
INSERT INTO `uploads` VALUES ('698', 'grandmaster.awesomeonoff', 'Awesome On Off', '13', '2.0', '3', 'Simply pick your phone up, to turn the screen on &#39;Awesome On&#39;.  Gently.  No shaking or flipping.  Use simple gestures near the proximity sensor (or the shortcut icons) to turn the screen off, 2 flings &#39;Awesome Off&#39;, 3 flings &#39;Ultimate Off&#39; (Ultimate Version Only).<p>Watch the short video to see how it works.  There are other similar apps, but we strongly believe ours is the best in terms of practicality and pure awesomeness.<p>We wanted to bring you something simple, but very useful and effective.  Something you would enjoy using everyday with absolutely no side effects.  There are battery saving options to minimise the impact on battery.  We have steadily measured around 3% battery consumption for the whole day on our test devices.<p>We hope it works just as good on your phone.<p><br>** NOTE **<br>In general, we recommend turning off AOO completely when you are moving or walking.  That is why you have the convenient Start/Stop shortcut icon.  Basically the idea is to have AOO running when you are at home, office, school or in public transport etc.<br>This doesn&#39;t apply to Ultimate Users.  Ultimate Users have &#39;Ultimate Off&#39;.<p><br>*** IMPORTANT NOTE ***<br>Unfortunately in some devices, the accelerometer sensor cannot be used when the screen is OFF.  Awesome On will not work on these devices.<br>Please do not give a low rating if this is unfortunately the case.<br>Link to list of devices:<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.saltwebsites.com/2012/android-accelerometers-screen-off%26sa%3DD%26usg%3DAFQjCNEf0oxP6cGglbxnnIfKT02Uy8pdCQ&amp;sa=D&amp;usg=AFQjCNFSEDPNIDZf53ErbY_nQenDVAPCrA\" target=\"_blank\">http://www.saltwebsites.com/2012/android-accelerometers-screen-off</a><p>Android 4.0.4 and 4.1 Users - There is a well known bug that was introduced in 4.0.4 that causes the screen to turn on again after &#39;Awesome Off&#39;. We recommend changing your lock screen to &#39;none&#39; for the time being.<p><br>** Features **<p>Screen On<br>- Simply tilt the phone up, to turn the screen on.<p>Screen Off<br>- Fling your hand 2 times, near the proximity sensor, to turn the screen off.<br>- Or simply click &#39;Screen Off&#39; icon.<p>Other Features<br>- Separate shortcut icons for &#39;Start/Stop&#39;, &#39;Settings&#39; and &#39;Screen Off&#39;.<br>- Awesome On Sensitivity.<br>- Awesome Off Sensitivity.<br>- Battery Saving Mode.  Tip: Test first disabled.<br>- Remove notification option. And gracefully handles situations where Android restarts Awesome On Off when notification is removed.<br>- Disable Awesome Off while running landscape applications.<br>- While you&#39;re on a phone call, Awesome On Off will not be active.<br>- Aweseom On Bypass Non-Security Lockscreen option. <br>- Vibrate.<p>Ultimate Version Features<br>- The Ultimate feature.  When you&#39;re about to hit the road, fling your hand 3 times (or simply click the &#39;Ultimate Off&#39; shortcut icon) to turn the screen off.  Awesome On Off is completely idle until you manually turn the screen on again.  You never need to Start/Stop manually with the shortcut icon.  You are in total control.<br>- Ultimate Off audio confirmation.<br>- Start on boot.<br>- No Ads.  The Free version shows an Ad every 20th time the screen is turned on.  You can easily close the Ad, should not be disruptive for daily use even with the free version.<p>About Battery Saving Mode<br>- When the screen is off, depending on the Battery level and type of background apps you have running, Android can decide to put the CPU to full sleep.  Awesome On will not work when the CPU is in full sleep.  When Battery Saving Mode is enabled, Awesome On Off will not interfere and let the CPU go to full sleep as usual.  You can disable Battery Saving Mode completely or set a desired interval to keep the CPU partially awake, ensuring Awesome On will always work.</p></p></p></p></p></p></p></p></p></p></p></p>', '8', '450493', '0', null, null, null, '1', '2015-03-19 12:51:06', '2015-03-19 12:51:06', 'grandmaster');
INSERT INTO `uploads` VALUES ('699', 'it.rortos.f18carrierlanding', 'F18 Carrier Landing', '581', '5.81', '0', 'Simulador de vuelo para telÃ©fonos mÃ³viles: el sistema de vuelo mÃ¡s avanzado. <br>Aterrizar en un portaaviones es una de las tareas mÃ¡s complicadas que debe acometer un piloto de cazas. La cubierta de vuelo solo mide 150 metros de largo, lo justo para detener tu F/A-18 Hornet. ConviÃ©rtete en un piloto de primera y diviÃ©rtete realizando acrobacias y las maniobras mÃ¡s complicadas. <br>Los F/A-18 SuperHornet estÃ¡n disponibles a partir de hoy con una cabina virtual en 3D y grÃ¡ficos de gran realismo. <br>PodrÃ¡s controlar todas las superficies mÃ³viles, trenes de aterrizaje, flaps, slats y alerones, y tambiÃ©n podrÃ¡s volver a ver tus acciones en un fantÃ¡stico modo de REPETICIÃ“N multicÃ¡mara y compartir al instante las mejores imÃ¡genes. <br>Consigue trofeos y tus mejores puntuaciones en Game Center. <br>Para una competiciÃ³n mundial. <br>Â¡Feliz aterrizaje! <p>Incluye: <br>*Cabina virtual en 3D <br>*Repostaje durante el vuelo. <br>* RepeticiÃ³n multicÃ¡mara con paneo dinÃ¡mico. <br>* Dos escenarios completos. <br>* CampaÃ±a de juego con 12 misiones, base terrestre y reconocimiento fotogrÃ¡fico a baja altitud. <br>* Aterrizaje en portaaviones y bases terrestres totalmente personalizadas en funciÃ³n de las condiciones climÃ¡ticas y horarias. <br>*Escuela de aviaciÃ³n. <br>*Modo de vuelo libre. <br>*Sistema de control con paneo dinÃ¡mico. <br>*Sistema de aproximaciÃ³n I.F.L.O.L.S. <br>*Comunicaciones por radio. <br>*Modo simulador para aÃ±adir mÃ¡s realismo a los controles. <br>*Control remoto: es posible conectar dos dispositivos y usar el control remoto en todos los instrumentos.<p>Aeronaves: <br>* McDonnell Douglas F/A-18 Super Hornet <br>* Grumman F-14 Super Tomcat<br>* Grumman C-2 Greyhound<br>* Grumman A-6 Intruder <br>* McDonnell Douglas F4E Phantom II<p>* McDonnell Douglas AV-8B Harrier II [disponibles para su compra] <br>* Lockheed Martin F35B Lightning II [disponibles para su compra]<br>* Mikoyan Gurevich MiG-29K Fulcrum [disponibles para su compra]</p></p></p>', '8', '39157795', '0', null, null, null, '1', '2015-03-19 12:51:06', '2015-03-19 12:51:06', 'RORTOS');
INSERT INTO `uploads` VALUES ('700', 'je.fit.pro', 'JEFIT PRO', '49', '5.0303', '27', 'Get back in the gym and improve your life with JEFIT, a personal trainer in your pocket!<p>JEFIT Pro is the ultimate FREE fitness, bodybuilding and workout trainer for all individuals looking for that extra step and motivation to get back into the gym and achieve their fitness goals<p>This is the Pro ads-free version of the JEFIT Workout Exercise Trainer, it includes all the functions from JEFIT Free plus some extra features for paying users :<p>With over 1300+ unique exercises with descriptions and animations, ability to create personal workout routines and daily fitness plans, tracking body statistics, view workout progress, adding friends and interacting with the community for motivation; you won&#39;t feel intimidated again!<p>** USER REVIEWS :<br>- â€œBest bodybuilding and workout trainer ever! Can&#39;t believe this tool is free!&quot;<br>- â€œBest bodybuilding and fitness log I have found so far! Especially for FREE! Well worth the downloadâ€<br>- â€œJEFIT is the BEST Workout and Fitness logger EVER! The combination of downloadable daily workout routines and tracking your progress online is great! Also its FREEâ€<br>- â€œJEFIT is the best FREE workout and fitness planner on the market, never go to the gym without this toolâ€<p>** MAJOR FEATURES :<br>- 1300+ weight training exercises in the largest exercise database<br>- Workout routine database with community created daily workout routines and fitness plans<br>- Two - Way Sync<br>- Easily track your workouts, create fitness routines, stay motivated and build muscle <br>- View your body and lifting progress keep you motivated for further training and weight lifting<br>- Fully customizable routines and exercises to create daily workout programs<p>** WORKOUT ROUTINE PLANNER :<br>- Create your own daily custom fitness plans personalized to your goals to help you get in shape and improve your health<br>- Download community created weight training routines for both men and women<br>- Routines specific for your goals, i.e getting six pack abs, building a lean body, lose weight, increase strength<p>** DETAILED EXERCISE DATABASE :<br>- Search weight lifting and muscle building exercises to create your own daily fitness routines<br>- Exercises for all major weight lifting equipment including barbell, dumbbells, kettlebells, strength and cardio machines and more<br>- Detailed exercise instructions and animations<br>- Track cardio, yoga, fitness and strength training exercises<br>- Create your own custom exercises and view progress your favorite exercises<p>** USER-FRIENDLY INTERFACE :<br>- Quick and simple tracking of your weight/reps and sets for exercises<br>- Save your best lifting record for each exercise<p>** WORKOUT WITH FRIENDS :<br>- Connect with and add friends to help stay motivated<br>- Compete, challenge, share your progress and compare stats with the community<br>- Log into your profile page to update your friends on how you are doing with your training progress<br>- Share your workouts via email, Facebook, Google+ and Twitter<p>** TWO - WAY SYNC<br>- Sync your workout data and save your lifting and body stat progress<br>- Download from community created strength routines and daily fitness plans<p><br>* To utilize the sync feature, a JEFIT Account is required to back up your data and keep track of your workouts on the website. You can create a FREE Account at www.jefit.com<p>JEFIT is brought to you by Jefit Inc, the top workout, fitness and bodybuilding trainer. See why millions of bodybuilders, fitness enthusiasts, and exercisers have chosen JEFIT to stay on track with their fitness goals and improve their workouts<p>It is a personal trainer in your pocket!</p></p></p></p></p></p></p></p></p></p></p></p></p>', '8', '9344651', '0', null, null, null, '1', '2015-03-19 12:51:07', '2015-03-19 12:51:07', 'Jefit Inc.');
