INSERT INTO `uploads` VALUES ('702', 'com.joeprogrammer.blik', 'Blik Calendar Widget', '22', '1.3.2', '10', 'Why use a boring calendar widget that only has words when a picture can tell the story better?<p>Blik reads your calendar and *automatically* shows the best picture for each event. You see a picture, the start time, and an important word from every event so that you can see what&#39;s coming up on your agenda.<p>You end up with a quick visual guide to your upcoming events. Your calendar has never been easier to &quot;read&quot;.<p><br>The free/trial version of Blik comes with 390+ pictures and 700+ keywords rules.<p>The Pro version unlocks another 300+ keyword rules so that your calendar events are matched up to pictures even better.<p>You can create your own keyword rules for single calendar events in the free/trial version and in the Pro version you can create your own keyword rules that apply to all your calendar events.<p><br>Check out the Blik Settings screen under the Help section for helpful Tips (like how to subscribe to a holiday calendar).<p>PERMISSIONS:<br>Your personal information (READ_CALENDAR) - required to get calendar event information.<br>Network communication (INTERNET and ACCESS_NETWORK_STATE) - required for Pro License Key check; advertising in free version.<p><p>Known issue(s):<br>&gt; Crashes can happen on the Samsung Edge.<br>&gt; Facebook events may be displayed with incorrect starting times. Use Blik Advanced Setting value to manually adjust the display for all Facebook start times.<br>&gt; Facebook declined events will still show up.<p><br>---=== When DAYLIGHT SAVINGS TIME changes ===---<br>If your phone is showing events off by an hour, you may need to power it down and reboot so that your phone picks up the time change from your cell provider.<p><br>-- Important Note --<br>If you are having problems with your calendar events not syncing, go to <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://android.joeprogrammer.com/blikhelp/synchelp.html%26sa%3DD%26usg%3DAFQjCNH8mTTYea2C_i8tMUUDFDRFRWv5GA&amp;sa=D&amp;usg=AFQjCNFxtgtn-jj2x74-L5A_3d2t6aAlXA\" target=\"_blank\">http://android.joeprogrammer.com/blikhelp/synchelp.html</a> for information and instructions on how to correct the problem.</p></p></p></p></p></p></p></p></p></p></p>', '3', '921476', '0', null, null, null, '1', '2015-03-19 12:51:08', '2015-03-19 12:51:08', 'JoeProgrammer, Inc');
INSERT INTO `uploads` VALUES ('703', 'com.ellismarkov.bball', 'Basket Ball', '8', '1.2', '14', 'NEW: Checkout the sequel of this game - search for &quot;Tip-Off Basketball&quot; on the market or go to <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://bit.ly/tip-off-android-market%26sa%3DD%26usg%3DAFQjCNFyy9FCamL1N_S5CUENVk5oRuBVQw&amp;sa=D&amp;usg=AFQjCNGym09SzTGde--b-0biSuBncNonWw\" target=\"_blank\">http://bit.ly/tip-off-android-market</a><p>BasketBall game. 5 different game modes. Physics engine included that simulates real game.<p>Submit your score online and compare with other players.</p></p>', '4', '1205932', '0', null, null, null, '1', '2015-03-19 12:51:09', '2015-03-19 12:51:09', 'MB');
INSERT INTO `uploads` VALUES ('704', 'com.kauf.talking.baum.TalkingGeorgetheGiraffe', 'Talking George the Giraffe', '1', '1.0', '23', 'Hable con George la jirafa. Ã‰l contesta con su voz divertida y reacciona a lo que dices o tu toque. AdemÃ¡s, jugar con George y su Piano! Juegue su canciÃ³n favorita y George les encantarÃ¡ cantar para usted. George tambiÃ©n tiene 4 juegos dentro de emocionante, con muchos niveles para jugar! <br>George es una jirafa torpe que vive en la sabana africana con una gran cantidad de otros animales. Descubra mÃ¡s acerca de su personalidad y de sus vecinos. HabrÃ¡ una gran cantidad de animales que pasan por, como una manada de cebras, un feroz jaguar, un enorme elefante, un antÃ­lope rÃ¡pida etc <p>â˜… â˜… â˜… CaracterÃ­sticas: â˜… â˜… â˜… <br>âœ” alta calidad de grÃ¡ficos 3D <br>âœ” interacciÃ³n por voz fresca <br>âœ” Piano con cantos George <br>âœ” juego de toque emocionante con 20 niveles en el interior. Atrapa a los animales de hilado como por ejemplo: La pantera negro, el gran rinoceronte, ciervo, etc No tocar los rojos! <br>âœ” Casa juego <br>âœ” Gran juego de los nÃºmeros - comprobar ahora el coeficiente intelectual y la memoria del cerebro <br>âœ” 1to60 juego incl. 1-60, A a la Z, 2 4 6 ..., 1 3 5 ..., hexagonales, nÃºmeros romanos, tabla periÃ³dica, octal, etc <br>âœ” Muchas animaciones diferentes <br>âœ” DiversiÃ³n para todos <br>âœ” Piano <p>Contenido Extra: <br>â˜… Comics &amp; Cartoons: Tenemos cÃ³mics relacionados con diferentes temas como por ejemplo: coches, mÃºsica, tv, perros, comida, el cine, los deportes y muchos muchos mÃ¡s. <p>â˜… Bromas ColecciÃ³n: Chistes divididas en diferentes categorÃ­as. Va a encontrar chistes sobre: â€‹â€‹tiempo, trabajo, gatos, guardabosques, gerente, camarero, etc <p>â˜… Conocimientos generales: <br>Â¿Sabes todo sobre la historia, las mÃ¡quinas, la geologÃ­a, la geografÃ­a, la biologÃ­a, el medio ambiente, la economÃ­a, la gente, la ciencia, etc? Pregunte a sus amigos y comprobar lo que saben. <p>â˜… Photo Fun: <br>Crear imÃ¡genes / fotos divertidas y falsos y enviar por correo electrÃ³nico, compartir fotos con Whatsapp, Twitter, Skype, otra herramienta de mensajerÃ­a o subirlos a Face Book, Flickr, Dropbox, etc Ahora usted puede ser uno de los mejores amigos hablando, la transformaciÃ³n de sÃ­ mismo o un colega suyo, en un pingÃ¼ino, un bebÃ© dulce, un burro, una ardilla, un avestruz, un ratÃ³n, etc <p>â˜… Tienda online de juguetes, aparatos electrÃ³nicos, joyas elegantes, etc <p>â˜… Trailers de vÃ­deo: la secciÃ³n de vÃ­deo con diferentes trailers de aplicaciones calientes. <p>â˜… Pegatinas <br>DÃ© a sus fotografÃ­as un toque personal. Seleccione una foto de la galerÃ­a o una imagen que ya estÃ¡ falsificada. Tome la foto seleccionada y comenzar a personalizar eligiendo entre numerosas pegatinas. Usted serÃ¡ mucho donde elegir en la selecciÃ³n de la etiqueta de cool. Contiene pegatinas con diversos temas como, sombreros, pelucas (peinados), araÃ±as, crÃ¡neos, gafas de sol, expresiones boca como besos, objetos de terror con sangre, etc Deje que sus imÃ¡genes se comunican algo o crear algunos cÃ³mics, escribiendo algunas cosas divertidas en burbujas. <p>â˜… Kids pintura: herramienta sÃºper entretenido para tratar de hacer un dibujo con la punta del dedo. TambiÃ©n hay una gran cantidad de imÃ¡genes de dibujos animados predefinidos que pueden ser de color, como un poderoso tigre, un oso panda, una larga serpiente, un conejo (conejo), un zorro astuto, coches, pistas, un transbordador espacial, cohetes rÃ¡pidos y muchos mÃ¡s . Descubre el artista que llevas! <p>â˜… Pares: Encuentre las mismas imÃ¡genes que buscan en la pizarra y entrenar tu memoria con este fresco match-2 juego. <p>â˜… Sliding Puzzle: Toca y desliza las piezas del rompecabezas al que pertenecen para recrear la imagen original. <p>â˜… Up Pair: FÃ³sforo encima de las imÃ¡genes que van de la mano (que tienen algo en comÃºn). <p>â˜… Dos jugadores de Super Duel: DesafÃ­a a tus amigos y ver quiÃ©n tiene los reflejos mÃ¡s rÃ¡pidos.<p>â˜… Cuestionario: Pon a prueba tus conocimientos generales.<p>Esta es una aplicaciÃ³n gratis - descarga gratuita y disfrutar de ella!</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '3321025', '0', null, null, null, '1', '2015-03-19 12:51:09', '2015-03-19 12:51:09', 'Kaufcom Games Apps Widgets');
INSERT INTO `uploads` VALUES ('705', 'com.CatfishBlues.Hyperwave', 'Hyperwave', '14', '1.0.5', '14', 'â˜… Now supports any Android Controllers / Gamepads (HID) !!<br>â˜… From the creators of Hyperlight!<p>â˜… Built for NVIDIA Tegra! (including Shield)<br>â˜… Hyperwave is now MOGA Enhanced! Available at major retailers, carrier stores and online at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.MOGAanywhere.com%26sa%3DD%26usg%3DAFQjCNEWfIQTekxX0yaiScCaayogPgSKFQ&amp;sa=D&amp;usg=AFQjCNE7XKxMRWFsm1cy0ETbcJlBJOq7_w\" target=\"_blank\">http://www.MOGAanywhere.com</a><p>&quot;Hyperwave certainly doesnâ€™t put a foot wrong when it comes to visual presentation.&quot; PocketGamer<p>Finally, after over an year, the battle against the evil aliens invaders continues with Hyperwave, the new neon retro space shooter of the hyper-series created by the same team of Hyperlight!<p>Hyperwave combines the mechanics of classic arcade games of the old 80â€™s with those of modern sci-fi shooters, offering a both familiar and innovative gameplay which includes all the elements that make great a traditional shoot &#39;em up, but reproposed in a different context in which a strong strategic component is added to fast-paced action!!<p>Your goal is to defend the last shield that protects humanity by destroying all the endless waves of cosmic enemies before they can damage it.<p>Hyperwaveâ€™s space-fighter is really powerful and is able to enhance its attack power significantly also using a wide assortment of weapons, special-powers and useful drones that will give you an hand in the difficult mission of containing the alien horde.<p>â˜… Features â˜… <br>* Universal App: runs in HD on Hi-Res Android devices. <br>* Great gameplay, attack and defend at the same time! <br>* Stunning 2.5D neon-style graphics, effects and animated backgrounds. <br>* Arcade mode with 50 different waves. <br>* Infinity mode for an endless challenge! <br>* 12 vulcan upgrades and 5 different special weapons. <br>* 3 devastating special-powers and smart friends drones to command. <br>* Wide variety of enemies to face, each with its own peculiar behavior. <br>* Several exciting techno musics! <br>* Google Play Games for achievements and global leaderboards!! <p><br>For any problem with the game contact us at: <a href=\"mailto:support@catfishbluesgames.com\">support@catfishbluesgames.com</a><br>---------------------------------------------------<br>Enjoy our LATEST games: <p>- Let&#39;s Play Ball<br>- Scarecrow in Zombie Land<br>- Devil Slayer Gunman<br>- Caveman Dino Rush<br>- Alien Apocalypse<br>- Zombies After Me!<br>- Deadly Moto Racing</p></p></p></p></p></p></p></p></p>', '8', '24876623', '0', null, null, null, '1', '2015-03-19 12:51:09', '2015-03-19 12:51:09', 'CatfishBlues Games');
INSERT INTO `uploads` VALUES ('706', 'au.com.phil.abduction', 'Abduction! World Attack', '11', '1.1.5', '17', 'Your friends have been abducted by aliens! Use tilt controls to follow the ufo, picking up power-ups as you go, but watch you don&#39;t fall...<p>Eurogamer.net: &quot;Abduction is incredibly addictive, as anyone who&#39;s ever tried a game of its sort before can attest, but with a big world map, unlockables and plenty of characters, it&#39;s also got incentives to keep you playing beyond just higher scores. It&#39;s wonderfully presented, with bright suns and stars that shine behind the platforms the further up you get, adorable little characters and varied environments. It&#39;s superb value for money, too.<p>9/10&quot;</p></p>', '1', '1496771', '0', null, null, null, '1', '2015-03-19 12:51:10', '2015-03-19 12:51:10', 'Psym Mobile');
