INSERT INTO `uploads` VALUES ('716', 'com.acj0.classbuddypro', 'Class Buddy Pro', '50', '1.50', '5', '<b>CLASS BUDDY PRO</b><p>Schedule management helper for busy school life. <p>. Featured in Android market&#39;s staff picks.<br>. Featured in T-mobile&#39;s Top picks.<br>. Featured in AndroidGuys&#39;s 50+ Essential Android Apps for Back-to-School<p><b>PRO VERSION</b><p>Due to Play store policy, you have only 15-minutes refund window. Please try Demo version before purchase. <p><b>KEY FEATURES</b><p>Organize your<br>. Terms and semesters<br>. Courses<br>. Events such as class meetings, assignment, exam, quiz, etc...<br>. Scores<br>. Grade and GPA<p>Import and Export<br>. Import events from CSV file<br>. Import events from Google Docs<br>. Export events to SD card (TXT,CSV)<br>. Export events to email/text<br>. Export events to Google Docs<br>. Auto-Sync to Google calendar<p>Others<br>. Customizable Home screen Widget<br>. Simple task manager<br>. Simple expense manager<br>. Backup and restore<br>. Reminder<br>. Password protection<br>. and many more...</p></p></p></p></p></p></p></p>', '7', '2196497', '0', null, null, null, '1', '2015-03-19 12:51:11', '2015-03-19 12:51:11', 'm-Surf Lab.');
