INSERT INTO `uploads` VALUES ('719', 'com.fardjad.android.wifixmanager', 'WiFix Manager', '7', '1.32', '3', 'It seems many people having issues with WiFi in 4.0 builds when SIM-Card is inserted.<br>WiFix tries to solve this problem by changing the WiFi country code.<p>Using WiFix Manager you can easily install/update WiFix.<p>NOTE: Make sure to dial *#94349# (*#WIFIX#) after installing WiFix.<p>Visit <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.fardjad.com/android/wifix/%26sa%3DD%26usg%3DAFQjCNHu6ILuEvJ7qB0Wo2BdonAfQPUnNA&amp;sa=D&amp;usg=AFQjCNHLWrjlZOC2KZeYG9_01N7N_5XAiw\" target=\"_blank\">http://www.fardjad.com/android/wifix/</a> for more info.<p>WiFix and WiFix Manager are licensed under a Creative Commons Attribution-NonCommercial-NoDerivs 3.0 Unported License. Visit <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://creativecommons.org/licenses/by-nc-nd/3.0/%26sa%3DD%26usg%3DAFQjCNEeMs7cN8KT3GkGKtB_hMFjTKsKMA&amp;sa=D&amp;usg=AFQjCNE5Vl-KlD1j5H0oBA7VXn384vSA2Q\" target=\"_blank\">http://creativecommons.org/licenses/by-nc-nd/3.0/</a> for more information.</p></p></p></p>', '3', '60857', '0', null, null, null, '1', '2015-03-19 12:51:11', '2015-03-19 12:51:11', 'Fardjad');
