INSERT INTO `uploads` VALUES ('721', 'com.goethe.f50languages', '50 languages', '53', '4.7', '35', 'Las 100 lecciones que 50 idiomas provee versan sobre situaciones cotidianas, facilitando una rÃ¡pida y fÃ¡cil apropiaciÃ³n del idioma deseado. Esta aplicaciÃ³n GRATUITA tiene 30 lecciones. Escuche nuestros archivos de audio en su reproductor de mp3 en el momento que usted considere mÃ¡s adecuado: mientras espera por el tren o autobÃºs, o al viajar. El mejor mÃ©todo consiste en aprender una lecciÃ³n por dÃ­a y repasar lo aprendido de forma regular.<p>El material de 50idiomas (www.50idiomas.com) equivale a los niveles A1 y A2 estipulados por la UniÃ³n Europea. 50idiomas no sÃ³lo es apropiado para colegiales, vosotros adultos tambiÃ©n podÃ©is refrescar vuestros conocimientos escolares al utilizarlo. Diversos institutos de lenguas incorporan el uso de nuestros archivos de audio para maximizar la efectividad de sus cursos. 50idiomas estÃ¡ disponible en mÃ¡s de 40 idiomas y cuenta con aproximadamente 1600 combinaciones lingÃ¼Ã­sticas: del hÃºngaro al inglÃ©s, del inglÃ©s al espaÃ±ol, del espaÃ±ol al chino, etc.<p>El objetivo principal de 50idiomas, el cual es un proyecto sin fines de lucro, es de estimular el aprendizaje de lenguas extranjeras y por ende, profundizar el entendimiento entre personas provenientes de diferentes culturas.</p></p>', '4', '10716469', '0', null, null, null, '1', '2015-03-19 12:51:12', '2015-03-19 12:51:12', '50languages');
