INSERT INTO `uploads` VALUES ('723', 'inputmethod.latin.perfectkeyboard', 'Perfect keyboard', '8', '1.0.5', '3', 'There are numerous keyboard replacements in the Android Market that aim at giving you the perfect typing experience, but  a lot of them forget that only you know your perfect experienceâ€”thatâ€™s what perfect keyboard strives to achieve. Perfect keyboard offers you countless customizable settings for the look, feel, touch response, word suggestions, and just about everything you might need changed for your Perfect keyboard. If you like to have your phoneâ€™s keyboard vibrate when you type something, we have a setting for that. If youâ€™d rather have a picture of your beautiful family as your keyboardâ€™s background rather than a boring plain background, we have a setting for that. Give Perfect Keyboard a try, and after a few tweaks we are certain youâ€™ll have your very own Perfect Keyboard. <br>Note: Perfect Keyboard works only on Android 2.2 and up<p>Detailed Specifications:<p>âˆš Multitouch keyboard<br>âˆš User dictionary, built-in dictionary, International  dictionaries (separate downloads from the Market)<br>âˆš Configurable auto correction<br>âˆš Redesigned and optimized keyboard layout and style<br>âˆš 8 Keyboard themes ( gingerbread,iPhone keyboard,honeycomb,icecreamsandwich and more).<br>-  Configurable colors for the keyboard buttons, background and text<br>âˆš Configurable color for the word suggestion font <br>âˆš Speech to text (select languages only)<br>âˆš Next word prediction<br>âˆš Custom vibration intensity (haptic feedback)<br>âˆš Long press &quot;Enter&quot; key to bring up smiley alternatives<br>âˆš Long press on &quot;/&quot; key in URL mode to bring up domains (you can configure the domains in the settings to better fit)<br>âˆš Configurable sound style and volume ( Samsung,iPhone,android)<br>âˆš Cursor Keys - swipe up on the space key to display.<br>âˆš T9/compact layout.<br>âˆš Gestures.<br>âˆš Shortcuts (auto-text like in blackberry)<br>âˆš External skins (some of better keyboard skins)<br>âˆš Alt symbols on the keyboard.<br>âˆš Split layout for tablets. <br>âˆš configure the layout of the keyboard (key height,row gap etc)<p><br>Tips:<p>#Change Appearance and Themes:<br>To change appearance go to settings -&gt; appearance<p>#About &quot;collecting data&quot; warning message:<br>That warning message is a part of the Android operating system, and it appears whenever a third party keyboard is enabled. You don&#39;t have to worry because the keyboard don&#39;t have permission to internet access.<p>Please report your bugs via email . If you report bugs in a Market comment I CAN&#39;T help you.<p>Supported languages layout: English(QWERTY,Dvorak,AZERTY), French (ASERTY,QWERTY,QWERTZ), Hebrew, Arabic, German, Czech(QWERTY,QWERTZ), Bulgarian, Catalan, Spanish, Esperanto, Danish, Italian, Finnish, Georgian, Russian, Ukrainian, Latvian, Swedish,Latin, Dutch, Portuguese, Slovakian, Slovenian, Greek, Rumanian, Serbian, Hungarian,Swiss,Polish.<p>reviews:<br>AndroidTapp:<br>Perfect Keyboard is an excellent keyboard replacement application.<p>TalkAndroid:<br>When it comes to customizations, nobody does it better than Perfect Keyboard.<p>user reviews:<p>Jonah:<br>Great Keyboard, I&#39;ve tried em all (swiftkey x, Swype, SlideIt,Thumb keyboard) none of them compare.<p>Ben:<br>Very good keyboard! Super customizable and has EVERYTHING I wanted in a keyboard. Like the title says, a perfect keyboard.<p>tags:best android keyboard,gingerbread,keyboards,texting pro,T9 keyboard,compact multiling,keyboard. arrow,a.i.type free,touchpal, go hackers keyboard,Jelly Bean</p></p></p></p></p></p></p></p></p></p></p></p></p>', '8', '1875292', '0', null, null, null, '1', '2015-03-19 12:51:12', '2015-03-19 12:51:12', 'My Perfect Apps');
