INSERT INTO `uploads` VALUES ('729', 'com.thomassafca.theme.touchwiz', 'GALAXY S4', '356', '3.5.6', '10', 'CyanogenMod 11, 10.2, 10.1, 10, 9 &amp; AOKP: Galaxy S4 TouchWiz theme for the T-Mobile theme chooser<p>Please read all of this before complaining the theme doesnt work!!<br>If you have a problem, please send me an email instead of leaving a negative comment. I can help you via email, not via a comment..<p>FAQ<p>* Trebuchet force closes. <br>  Solution: <br>- Go to recovery and select factory reset<br>- Download the theme but do NOT set it<br>- Go to Settings --&gt; Apps --&gt; Trebuchet and remove all possible data<br>- Now enjoy the theme! <p>* Theme is inproperly compiled error. Solution: Set system theme, reboot your phone, set TouchWiz theme<p>* When installing this theme, you may ignore the &quot;Sorry, this theme is missing assets for your device&#39;s screen size.&quot; message!<p>********************************************************<p>Designed for both HDPI and XHDPI devices! Works on CM10, CM9 and AOKP ROMS!<p>MDPI users please read this: <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forum.xda-developers.com/showthread.php?t%253D1668910%26sa%3DD%26usg%3DAFQjCNFzzwUUdw8o_0RCuRJICmRuCwu-Xw&amp;sa=D&amp;usg=AFQjCNHlDJuykD4GffBBYq9LztcKLoxalg\" target=\"_blank\">http://forum.xda-developers.com/showthread.php?t=1668910</a><p>Please have a look at this xda thread for instructions and feedback!<p><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://forum.xda-developers.com/showthread.php?t%253D1751952%26sa%3DD%26usg%3DAFQjCNFt9qWeZHxwZO0EJfF-j4sQeDYXQw&amp;sa=D&amp;usg=AFQjCNEaCNB8JMC2xBU5Bu_fe84kxsCBwQ\" target=\"_blank\">http://forum.xda-developers.com/showthread.php?t=1751952</a><p>[Themed (non)-system apps]<br>- Apex Launcher<br>- Nova Launcher<br>- Trebuchet<br>- Default launcher<br>- Action Launcher Pro<br>- ADW Launcher EX<br>- Apollo<br>- Android music player<br>- Poweramp<br>- Go Contacts EX<br>- Go Dialer EX<br>- exDialer &amp; Contacts<br>- Root Explorer<br>- ASTRO Filemanager<br>- OI Filemanager<br>- ES File Explorer<br>- Solid Exporer Beta<br>- Camera ICS<br>- Camera ICS+<br>- Camera JB+<br>- Camera Launcher for Nexus 7<p>Now supporting Android 4.1 Jelly Bean! (CM10)<br>Now supporting Android 4.2 Jelly Bean! (CM10.1)<br>Now supporting Android 4.3 JellyBean! (CM10.2)<br>Now supporting Android 4.4 KitKat! (CM11)</p></p></p></p></p></p></p></p></p></p></p></p>', '14', '9065628', '0', null, null, null, '1', '2015-03-19 12:51:14', '2015-03-19 12:51:14', 'thomassafca');
