INSERT INTO `uploads` VALUES ('733', 'com.bfs.ninjump', 'NinJump', '7002', '1.2.1', '14', '&quot;Yet another brilliant slice of freebie fun&quot; -Pocket Gamer<br>&quot;You really need to give Ninjump a try&quot; -Touch Arcade<br>&quot;Check out Ninjump, it&#39;s extremely fun&quot; -148 Apps<br>&quot;This is fast becoming one of my favorites&quot; -The App Era<p>Rise to the top and become a ninja master in NINJUMP, the latest FREE game from Backflip Studios, makers of PAPER TOSS!<p>In this fast paced ninja climbing game, your goal is to rise as high as you can while avoiding killer squirrels, angry birds, enemy ninjas, throwing stars and exploding bombs. With a simple tap you can jump from one wall to the other, knocking obstacles from the air as you do. Take down three enemies of the same kind to trigger mega-jump bonuses. Collect shields to plow through your opponents with. Just watch out for ledges and other ninjas because they will knock you off and send you to your doom!<p>You will be amazed by the gorgeous graphics, rich gameplay, immersive music and the insanely addictive quality of this game.<p>Features include:<br>-Simple single-tap gameplay<br>-Ninjas<br>-Killer squirrels<br>-More ninjas<br>-Beautiful graphics<br>-Awesome bonuses<br>-Original sound and music<br>-Papaya Leaderboards<br>-Challenge a friend via email<br>-Post scores on Facebook or Twitter<p>At Backflip Studios making fun games is priority one! We have seen over 34,000,000 downloads across our library of games and greatly value your support and feedback.<p>Try PAPER TOSS our other hit FREE game!<p>Follow us on twitter: @backflipstudios<p>Thanks for playing!</p></p></p></p></p></p></p></p>', '7', '9602815', '0', null, null, null, '1', '2015-03-19 12:51:16', '2015-03-19 12:51:16', 'Backflip Studios, Inc.');
