INSERT INTO `uploads` VALUES ('736', 'com.selticeapps.pool', 'Touch Pool 2D', '45', '2.9.12', '12', 'Pool game with many fun ways to play! <p>Play individual games like Make 8 and Make 15 or take on the computer at 8 Ball or 9 Ball.  Or try a challenge mode like Run the Table or Marathon.<p>This game is more than most pool games, it&#39;s loaded with fun, interesting ways to play to keep you coming back for more.<p>Play 2-Player vs a friend (sinlge phone) in any of the multiplayer game modes.<p>Try some fun new game modes like Run the Table, Flick Challenge, Marathon and Gold Balls!<p>========================<p>The magic of this pool game is that it has traditional pool games like 8-Ball &amp; 9-Ball vs the Computer, but it ALSO has fun &amp; unique ways to play pool for an endless amount of fun.<p>The following 12+ pool game modes include:<p>Single Player Pool Game Modes:<br>- First to 8 (free form)<br>- First to 15 (free form)<br>- In Order<br>- Solids First<br>- 8 Ball Last<p>Pool Games vs the Computer:<br>- First to 4 (free form pool)<br>- First to 8 (free form pool)<br>- 8 Ball<br>- 9 Ball<p>Challenge Modes:<br>- Run the Table (you can&#39;t miss)<br>- Flick Challenge<br>- 3 Minute Challenge<br>- 5 Minute Challenge<p>Pool is a game that so many of us have played in our homes, in college, in bars and basements. Now you have a fun pool game in your pocket with Touch Pool 2D.<p>Enjoy this fun and full featured pool game on your phone today.<p>All sales are final after 48 hours from the time of your purchase.  Google allows for a refund within 15 minutes of your purchase.<p>This game was originally designed for smaller phone screens.  It depends on the individual device as to whether or not it supports the ability to stretch the game to full-screen.</p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '1601023', '0', null, null, null, '1', '2015-03-19 12:51:17', '2015-03-19 12:51:17', 'Seltice Systems LLC');
INSERT INTO `uploads` VALUES ('737', 'com.sec.app.samsungprintservice', 'Samsung Print Service Plugin', '36', '1.4.140401', '5', 'The Samsung Print Service Plug-In provides native printing support on Android devices.<p>1) Samsung Galaxy Devices - Samsung Print Service plug-in is pre-installed app on selected Samsung&#39;s Android OS smart phones and tablets (see compatibility list below). <p>2) Android KitKat(4.4) Devices-  Samsung Print Service plug-in extends Android&#39;s printing feature in Android 4.4(Kitkat) to support printing on Samsung Printers. <p>The plug-in enables printing to many Samsung laser printers, and MFPs without the need for third party apps or additional print drivers. Easily print photos, web pages and documents when your mobile device is connected to a compatible Samsung printer through a wireless network or a direct wireless connection to the printer. Control print settings including color, number of copies, paper orientation and paper type.<br>When plug-in updates are available your device will notify you. Please adjust your settings to automatically update this plugâ€in, or accept updates manually. <p>In Galaxy devices this plug-in is integrated into operating system and cannot be uninstalled or moved to SD card.<br>If your device is not listed below, this plug-in is not compatible with your device at this time. If your Android OS device does not have printing functionality builtâ€in to the OS, please download Samsung Mobile Print app from the Google Play store to enable easy printing to Samsung printers.<p>Compatibility List<br>Samsung Android devices having Android version 4.2 and above.<br>All other devices running Android version 4.4 and above.<p>Supported Printer/MFPs Model List<br>* M2020/M2070 Series<br>* C410/C460 Series<br>* CLP-300/31x/32x/350/360/610/620/660/670/680/770/775 Series<br>* CLX-216x/316x/317x/318x/838x/854x/9252/9352/92x1/93x1 Series<br>* ML-1865W/2150/2160/2165/2250/2525/257x/2580/285x/2950/305x/3300/347x/331x/371x/405x/455x/551x/651x Series<br>* SCX-1490/2000/320x/340x/4623/4x21/4x24/4x26/4x28/470x/472x/4x33/5x35/5x37/6545/6555/8030/8040/8123/8128 Series<br>* SF-650, SF-760 Series<br>* M262x/282x/267x/287x Series</p></p></p></p></p></p>', '9', '10140294', '0', null, null, null, '1', '2015-03-19 12:51:17', '2015-03-19 12:51:17', 'Samsung Electronics');
INSERT INTO `uploads` VALUES ('738', 'net.spc.app.svrmon', 'Server monitor', '7', '1.0.6', '3', 'Provide a widget for monitoring of your servers with ability of manual refresh.<br>To check the accessibility of server, the application uses one of three protocols: HTTP, TCP or ECHO.<p>Allows you to use standard ping tools for check any hosts.<br>Allows receive a list of IP entries for selected host (nslookup like)<p>Also allows you to check the route to the selected host with help traceroute command. This operation requires the ROOT access and may be not accessible for some devices!</p></p>', '7', '129029', '0', null, null, null, '1', '2015-03-19 12:51:17', '2015-03-19 12:51:17', 'DevSpace');
