INSERT INTO `uploads` VALUES ('745', 'com.vg.MonsterDashHillRacer', 'Monster Dash Hill Racer', '7', '1.6', '19', 'Itâ€™s a dark day for humanity large groups of monsters are running free on earth. It seems that these underworld demons somehow found a way to escape from there devildom realm. Reports of scared people are starting to reach the government. They have only one solution left and that is to call you. A great hero without no fear as one of the greatest car drivers you need to race through the realm of these monsters and fight those creatures from the inside. Al you need to do is some hill climb racing, shoot those monsters on your way and clear the path of zombies, mummyâ€™s, demons and vampires with your awesome cars, trucks and other vehicles. Use the awesome force of your bumper to hit those nasty zombiesâ€™ hordes that stand between you and saving humanity for its doom.<p>Crash your way through levels full of scary monsters in this cool monster dash racing game! Monster Car Hill Racer is a race game full of great hill climbs, large drops and of course monsters that will try to slow you down from your goal. Those angry monsters will try anything to prevent you from saving the world from extinction. <p>They only gave you some background information about how these monsters where able to escape the pits of hell! It seems they have broken and removed the four magic seals on the gate between the two dimensions, so the gate between the human world and the underworld known as devildom is open and those scary creatures are starting to collect souls of the living. The government decides to send you in to reclose the gate! The task is clear you need to find those magical seals to close the gate. Travel through the different Monster Car Hill Racer game worlds, drive over and crash into zombies, mummies, demons and vampires. <p>Monster Car Hill Racer game features:     <p>â€¢	Large amount of different kind of monsters, zombies, vampires, mummies and demons will try to slow you down. <br>â€¢	Monster Car Hill Racer has a large amount of different vehicles to drive with. Drive with common cars, busses, 4x4, Humvee, trucks, a large construction vehicle and some military stuff like a tank and missile launcher. <br>â€¢	Monster Car Hill Racer is a monster dash game with stunning visual graphics, vehicles and weapons.<br>â€¢	Upgrade your car, truck, bus or tank with guns boosters and loads of other stuff to make it to the finish line.<br>â€¢	Crash, dash and kill the hordes of different monsters, and save the world from its doom.<br>â€¢	Drive your car, truck or other crazy vehicle as far as possible before the gas is running out<br>â€¢	Countless hours of gameplay with 4 different adventure world <br>â€¢	Upgrade the different vehicles with unique upgrades seven different components are available to upgrade like: engines, gear boxes, tires, your awesome bumper, and the fuel tank.<br>â€¢	Game is designed to work both on low resolution and high end resolution devices<p>So get ready to face the challenges of this new racing game, with levels full of unique hill climbing environments which you can conquer with different vehicles. Become the hero the world needs and save it from the monster hordes! Enjoy Monster Car Hill Racer<p>Please give use some support by rating our game or by liking our Facebook page or follow us on twitter!<br>Facebook - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://www.facebook.com/VascoGames%26sa%3DD%26usg%3DAFQjCNEkctJ6OigzzN-scYm8OJgbVXkh6w&amp;sa=D&amp;usg=AFQjCNEP4UQIBLs2afGakqgIGM1LgxUDIQ\" target=\"_blank\">https://www.facebook.com/VascoGames</a> <br>Twitter - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://twitter.com/VascoGames%26sa%3DD%26usg%3DAFQjCNEoYL0BxOHXiLCMH7MiCF2S7MsNFw&amp;sa=D&amp;usg=AFQjCNE9vEFnwgs55BntTic21EfQpuzqNg\" target=\"_blank\">https://twitter.com/VascoGames</a></p></p></p></p></p></p>', '9', '37869439', '0', null, null, null,