INSERT INTO `uploads` VALUES ('762', 'com.ArtInGames.AirAttackHDLite', 'AirAttack HD Lite', '3', '1.2', '14', 'Air Attack HD - is Award Winning next-generation top down air combat shooter with stunning 3D graphics alongside great audio, effects and awesome gameplay.<p>Over 1 000 000 Downloads on iPhone / iPad<p>Unity Awards 2010 - Grand Prix<p>Features in Lite version:<br>* 3 Great Missions<br>* 24 Different Enemy Types<br>* 3 Unique Planes<br>* Numerous Upgrades and Special Weapons<br>* Amazing Lighting and Special Effects<br>* Orchestral Music<br>* 3 Difficulty Modes<br>* Arcade and Survival Mode<br>* Realtime Physics<br>* Destructible Bridges and Buildings<br>* WW2 Shmup with Amazing 3D environments enhanced with LightMaps and SpecularMaps<br>* 3 Huge End Level Bosses<br>* 7 Control Types: Touch, Relative, Tilt, Joypad, Mouse, Keyboard, Gamepad<br>* MOGA, NVIDIA Shield, XBox360, PS3, HID controllers support<br>* App2SD support<br>* NVIDIA Tegra based devices support - THD<br>* Portrait/Landscape orientation<br>* Xperia PLAY optimized<p>If you like games like 1942, 1943, Siberian Strike, iFighter, Air Strike, Flying Shark, DoDonPachi, Espgaluda, Swiv, Sky Force, Warblade, this game is for you.<p>AirAttack HD is now MOGA Enhanced! Available at major retailers, carrier stores and online at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.MOGAanywhere.com%26sa%3DD%26usg%3DAFQjCNEWfIQTekxX0yaiScCaayogPgSKFQ&amp;sa=D&amp;usg=AFQjCNE7XKxMRWFsm1cy0ETbcJlBJOq7_w\" target=\"_blank\">http://www.MOGAanywhere.com</a><p>If you got any problems with AirAttack HD please send us an e-mail, we will do our best to help you.</p></p></p></p></p></p>', '6', '27554600', '0', null, null, null, '1', '2015-03-19 12:51:24', '2015-03-19 12:51:24', 'Art In Games');
