INSERT INTO `uploads` VALUES ('769', 'lysesoft.andexplorer', 'AndExplorer', '8', '1.3', '3', 'AndExplorer is a file manager/explorer. It allows browsing files/folders stored on device and sdcard. It can sort by name, size and date. Copy/Paste, rename, delete, create folder, send/share features are available. It is able to uncompress ZIP, GZIP and TAR files too. Encrypted (password protected) ZIP archives supported. No permission other than storage/write one needed. No ads. AndExplorer can be called from another application with Intent facilities. Search and ZIP compression features are available in Pro version only.<p>Keywords: file manager file explorer browser ZIP GZIP TAR archive multilanguage copy/paste send share small footprint free</p>', '1', '260051', '0', null, null, null, '1', '2015-03-19 12:51:26', '2015-03-19 12:51:26', 'LYSESOFT');
