INSERT INTO `uploads` VALUES ('771', 'nl.letsconstruct.concrete', 'Concrete design', '27', '0.32', '5', 'Civil engineering app to determine the amount of reinforcement in a concrete section for preliminary design.<p>Features:<br>*Checks reinfocement<br>*Checks compression zone<br>*Checks cracking <br>*Metric&amp;US units (in Settings)<br>*Integrated with our Beam Design app<p>Explanation of the permissions:<br>* SDCard storage is needed to be able to send an image by email (You will find a folder Dako on your SDCard)<br>* For Non-pro users, Google ads are running, which requires Internet connection and Access network state. No internet traffic whatsoever is generated for Pro users.</p></p>', '7', '504232', '0', null, null, null, '1', '2015-03-19 12:51:26', '2015-03-19 12:51:26', 'LetsConstruct');
INSERT INTO `uploads` VALUES ('772', 'com.adinfinitum.spring_livewallpaper', 'Spring Live Wallpaper', '1', '1.00', '10', 'Spring is here and nature starts to come alive after a long cold winter. The dandelions are some of the first flowers to blossom.<p>During day a colorful dandelion sways gentle in the wind, attracting a bumblebee. In the distance a balloon flies over the idyllic landscape. <p>During night, the dandelion grows old and starts to spread its seeds in the wind.<p>This is a highly customizable Live Wallpaper with unique, stunning graphics.<p>* Turn on/off visibility of the bumblebee, the balloon and the seeds.<br>* Animations of Dandelions (changes over time) can be turned on/off.<br>* Switches between day and night automatically. You decide the hours the day starts and when the night ends.<br>* Choose amount of seeds.<br>* Choose animation speeds and frame rate (FPS).<p><br>** IMPORTANT INSTRUCTIONS **<p>* Live wallpapers are set similar to a background (not visible as a regular application). Search for &quot;Set Live Wallpaper&quot; + your phone<br>* No support for landscape orientation.<br>* If you have problems, contact us and we will help you with any issue you have!</p></p></p></p></p></p>', '7', '1824838', '0', null, null, null, '1', '2015-03-19 12:51:26', '2015-03-19 12:51:26', 'AdInfinitum');
INSERT INTO `uploads` VALUES ('773', 'com.rarlab.rar', 'RAR', '17', '5.10.build17', '3', 'RAR de RARLAB para Android es un programa de compresiÃ³n todo en uno original, libre, simple, fÃ¡cil y rÃ¡pido, un ayudante, un extractor, un gestor e incluso un explorador de archivos bÃ¡sico.<p>RAR para Android puede crear archivos RAR y ZIP y descomprimir archivos RAR, ZIP, TAR, GZ, BZ2, XZ, 7z, ISO y ARJ. La lista de funciones incluye reparaciÃ³n de archivos ZIP y RAR daÃ±ados, pruebas de velocidad compatibles com WinRAR de RARLAB, registro de recuperaciÃ³n, los volumenes habituales y de recuperaciÃ³n, cifrado, archivos sÃ³lidos, utilizaciÃ³n de mÃºltiples nucleos de CPU para comprimir datos.<p>Adicionalmente a los archivos ZIP estÃ¡ndard, la funciÃ³n de descompresiÃ³n soporta ZIP y ZIPX con compresiÃ³n BZIP2, LZMA y PPMD. La funciÃ³n de descomprimir estÃ¡ disponible para todas las versiones de archivos RAR incluyendo la Ãºltima RAR5. TambiÃ©n puede descomprimir archivos ISO en formato UDF e ISO9660.</p></p>', '14', '2967682', '0', null, null, null, '1', '2015-03-19 12:51:26', '2015-03-19 12:51:26', 'RARLAB (published by win.rar GmbH)');
