INSERT INTO `uploads` VALUES ('776', 'de.android.telnet', 'Network Signal Info', '35', '1.56', '3', '&quot;Network Signal Info&quot; provides detailed information over the currently used network, whether WiFi or cellular connection.<p>Two widgets, one for mobile- and one for WiFi-signalstrength.<br>(If you can&#39;t find widgets, please copy the app to phone memory)<p>I have put special value on the visualization of the WiFi and mobile signal strength. They are normally only divided in weakly, good and excellent. Graphically in the form of mostly &quot;only&quot; three to five bars on the Mobile Radio and three to five &quot;waves&quot; by a WiFi connection.<p>In my app I differentiate the signal strength in total 14 bars. This will give you a quick visualized and detailed information about how good the signal strength is really.<p>In addition to the much more sophisticated graphical representation of the signal strength you will see some more interesting information.<p>In &quot;Mobile Signal&quot;:<br>Network operators, Sim operator, phone type, network type, network strength in dbm and ASU, data state, data activity, country code of the mobile phone, device ID, IP address, roaming state. <p>In &quot;WiFi signal&quot;:<br>WiFi-Name (SSID), BSSID, MAC address, maximum WiFi speed, IP address, external IP address, net capability, net channel, subnet mask, Gateway IP address, DHCP server address, DNS1 and DNS2 address.<p>If you like the app, please give me a positive rating in the market.<p>The Pro version (compared to the free version) has no ads, a NEW cell tower database with more than 22 million entries, a NEW MOBILE SIGNAL TRACKER function that generates a KML file for use with Google Earth, more widgets, a MOBILE SIGNAL LOST SERVICE and much more.</p></p></p></p></p></p></p></p>', '7', '2698430', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'Andreas Kraemer, KAIBITS Software');
INSERT INTO `uploads` VALUES ('777', 'com.rostdev.fifteenpuzzle.app', 'Fifteen Puzzle', '101', '1.0.1', '8', 'Legendary game for your smartphone. <br>Fifteen Puzzle - sliding puzzle that consists of a frame of numbered square tiles in random order  with one tile missing.<br>The object of the puzzle is to place the tiles in order (with the &quot;hole&quot; in the lower-right corner) by making sliding moves that use the empty space.<p>Features :<br>â€¢Three mode<br>â€¢Modern style design<br>â€¢Time counter<br>â€¢Moves counter<br>â€¢Customization<p>Fifteen Puzzle - also called Gem Puzzle, Boss Puzzle, Game of Fifteen, Mystic Square and many others</p></p>', '14', '1170838', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'RostDev');
INSERT INTO `uploads` VALUES ('778', 'com.alarmclock.xtreme', 'Alarm Clock Xtreme', '22', '2.0.1', '3', 'Â¿Tienes problemas porque apagas el despertador y te vuelves a dormir? DespiÃ©rtate de a poco y evita desactivar Despertador Xtreme por accidente. Este despertador incluye funciones que previenen la repeticiÃ³n de la alarma en exceso y te saca de la cama.<p>Personaliza tu despertar con este reloj despertador de avanzada y utilÃ­zalo como recordatorio durante el dÃ­a. Configura la alarma de la maÃ±ana para que vaya aumentando el volumen gradualmente y te despierte con delicadeza. Usa el botÃ³n mÃ¡s grande para posponer la alarma, o soluciona problemas de matemÃ¡ticas para evitar que apagues la alarma accidentalmente. TambiÃ©n puedes hacer que la duraciÃ³n de la repeticiÃ³n de la alarma disminuya despuÃ©s de cada repeticiÃ³n y determinar la cantidad de repeticiones mÃ¡xima.<p>Las funciones incluyen: alarma con mÃºsica, alarma con canciÃ³n aleatoria, aumento gradual de volumen de alarma, matemÃ¡tica para posponer/descartar, sacudir para posponer/descartar, posponer automÃ¡ticamente, descartar automÃ¡ticamente, temporizador con cuenta atrÃ¡s y mucho mÃ¡s.<p>La versiÃ³n gratuita ofrece todas las funciones pero estÃ¡ patrocinada con anuncios. PruÃ©bala antes de comprarla. ActualÃ­zala a la versiÃ³n de pago para quitar los anuncios y el permiso de Internet.<p>To access Knowledge base, ask the community or get support, please visit <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.avg.com/mobile-support%26sa%3DD%26usg%3DAFQjCNGTlITdi8nGGCPS4M9vQe40gCfY2g&amp;sa=D&amp;usg=AFQjCNGlO9R94XP0HPM1cM0iwaZtZchBJw\" target=\"_blank\">http://www.avg.com/mobile-support</a></p></p></p></p>', '3', '228979', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'AVG Labs');
INSERT INTO `uploads` VALUES ('779', 'jp.co.taosoftware.android.widget.calendar', 'tCalendarWidget', '7', '1.0.5', '23', 'Recommended OS : Android OS 1.6 or later<p>tCalendarWidget displays a today&#39;sã€€date on the home screen.<br>This icon&#39;s date is changed every day.<br>tCalendarWidget is a AppWidget application supported by Android OS 1.5 (cupcake).<p><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.taosoftware.co.jp/en/android/calendarwidget/%26sa%3DD%26usg%3DAFQjCNHsfPsan8CJfCisLhhhAQzVJiJykQ&amp;sa=D&amp;usg=AFQjCNGIyOksjyh1TFxoJ6lz2MBxVzhzAA\" target=\"_blank\">http://www.taosoftware.co.jp/en/android/calendarwidget/</a></p></p>', '3', '23859', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'taosoftware co.,ltd');
INSERT INTO `uploads` VALUES ('780', 'com.joeykrim.rootcheck', 'Root Checker Basic', '48', '5.0.7', '3', '**** THIS APPLICATION WILL NOT INSTALL ROOT ON THE DEVICE ****<p>This application, Root Checker (Basic), will allow the user to confirm they have proper root (superuser) access configured and operational.<p>*Feel free to email me with any questions. I always reply!*<br> <br>This application provides even the newest Android user with a simple method to check their device for root (administrator or superuser) access. The application provides a very simple user interface that easily notifies the user whether or not they have properly setup root access.<p>This application will test the device for root access using a very simple, quick, and reliable method. The su binary is the most common binary used on Android devices to grant and manage root access. Root Checker will check and verify that the su binary is located in a standard location on the device. In addition, Root Checker will verify that the su binary is properly functioning in granting root access.<p>Many times users experience issues along the path of installing, configuring, and gaining root access. For some users the process can seem complex while for others the process can seem simple. Regardless of the user&#39;s technical skill set, Root Checker, will quickly and correctly verify whether or not root access is 100% functioning. The process of confirming root access is sometimes known by other terms such as, gaining superuser access or gaining administrator access. Root Checker covers all these terms as they relate to one core function, being able to execute commands through the su binary with root access.<p>If the Superuser management applications (SuperSU, etc.) are installed and working properly, these applications will prompt the user to accept or deny the root access request from Root Checker. Accepting the request will allow Root Checker to check for root access. Denying the request will result in Root Checker reporting no root access.<p>Please don&#39;t leave negative feedback about a concern, bug or issue! Instead, please email me, tweet me, contact me on my web site - <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://joeykrim.com/contact%26sa%3DD%26usg%3DAFQjCNH5hMl4LJKRjygAwUhimMQnJhbgAg&amp;sa=D&amp;usg=AFQjCNFMMI0VYK0ZDAImLM1l-Q0ba8qZVQ\" target=\"_blank\">https://joeykrim.com/contact</a>, IRC, or on the forums (XDA, RootzWiki, SDX, etc.) with your feedback, suggestions and comments!<br>I do my best to assist as many people as possible and appreciate all the support that has made this application successful! Thank you!</p></p></p></p></p></p>', '3', '377344', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'joeykrim');
INSERT INTO `uploads` VALUES ('781', 'net.andforge.wallpaper.heartMonitor', 'Heart Monitor - Live Wallpaper', '1', '1.0', '10', 'Live Wallpaper<br>-----------<p>Monitor cardÃ­aco para tu telÃ©fono!<p>Este fondo de pantalla en vivo dibuja un fresco latido del corazÃ³n-line en su escritorio.<br>Es altamente configurable para satisfacer su gusto personal.<p>Mira las capturas de pantalla para una primera impresiÃ³n y para ver todos los ajustes posibles.<p>EstÃ¡ optimizado para drenar no poder!<p>Â¡PruÃ©balo!</p></p></p></p></p>', '7', '17260', '0', null, null, null, '1', '2015-03-19 12:51:27', '2015-03-19 12:51:27', 'Mohammed El Batya');
