INSERT INTO `uploads` VALUES ('788', 'tw.nicky.CleanCache', 'Fast Clean Cache', '8', '1.0.8', '3', '1-Tap clean all cache to let you can get more available storage space.Best thing is you don&#39;t have to ROOT your phone.<p>Characters:<br>â˜… 1-click to clear all cache files.<br>â˜… Your phone doesn&#39;t need root.<br>â˜… Show the total cache size. <br>â˜… List apps that have cache files.<br>â˜… Simple and easy use.<br>â˜… Show total and free storage size<p>Recent Change:<br>v1.1.4 Enhance loading speed<br>v1.1.7 Fix Force Close<br>v1.1.8 Fix keep loading problem<br>v1.1.9 Change app&#39;s icon<br>v1.2.0 Fix force close when orientation change<br>v1.2.1 Change app&#39;s icon<br>v1.2.3 Support android1.6<br>v1.2.5 Change app&#39;s name<br>v1.2.6 Fix some device can&#39;t clean all cache problem<br>v1.2.8 Show total and free storage size<br>v1.3.3 Change app layout<br>v1.3.4 Fix bug<br>v1.3.5 Fix force close problem</p></p>', '7', '99031', '0', null, null, null, '1', '2015-03-19 12:51:30', '2015-03-19 12:51:30', 'NickyCho');
