INSERT INTO `uploads` VALUES ('790', 'com.riteshsahu.SMSBackupRestore', 'SMS Backup & Restore', '723', '7.23', '3', 'SMS Backup &amp; Restore is a simple Android app that backs up and restores your phone&#39;s text messages. <p>NOTE: <br>The backup is created locally on the phone by default unless you configure it to upload to Email, Google Drive or Dropbox. You are responsible for backup files and the files are not sent to the developer in any case.<p>On Android 4.4+ devices, if you have performed the Restore and the messages don&#39;t appear in Hangouts then:<br>- Open Hangouts and Disable SMS from Settings.<br>- Exit the Hangouts app<br>- Open Hangouts and Enable SMS from Settings.<p>APP FEATURES:<br>- Backup SMS Messages in XML format.<br>- Backup created locally on the device with options to automatically upload to Email, Google Drive or DropBox using the Add-On app.<br>- Choose a scheduled time to automatically backup.<br>- Backup format is independent of the Android version so the messages can be easily moved from one phone to another, irrespective of the Android version.<br>- Option to select which conversations to backup.<br>- View/Restore all Messages or only selected conversations.<br>- Delete all SMS Messages on the Phone.<br>- Email a backup file. <br>- The XML can then be converted to other formats, and can also be viewed on a computer. <br>- Tested on Android v1.5 to v5.0<p>This app is ad-supported and requires the Internet permissions to display the Ads. <br>If you do not want ads the they can be disabled from preferences or you can buy the paid version from the Market. <p>On newer phones with inbuilt storage the default backup location will probably be the internal storage card and not the external. <br>This is because the phone reports the storage that way. <br>If you intend to do a factory reset on the phone, please make sure you save/email a copy of the backup outside the phone before doing it. <p>Lots more info at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://android.riteshsahu.com/apps/sms-backup-restore%26sa%3DD%26usg%3DAFQjCNG0vL5b3iPiGgDZpaEgYR5BTGR_jQ&amp;sa=D&amp;usg=AFQjCNG8TjLY2xKIny5QN7-F8hJljEbhKQ\" target=\"_blank\">http://android.riteshsahu.com/apps/sms-backup-restore</a><br>FAQs can be found at <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://bit.ly/d9t7Jk%26sa%3DD%26usg%3DAFQjCNE3GTiaVfBJYVxg_ss5jGEKHHEnbg&amp;sa=D&amp;usg=AFQjCNG9KDTZzjmivh1XgjueOksk27N2yw\" target=\"_blank\">http://bit.ly/d9t7Jk</a><p>Please start the app at least once after updates so that the scheduled backups start working.<p>This App needs access to the following:<br>* Your messages: Backup and Restore messages. Receive SMS permission needed to properly handle messages received while the app is the default messaging app on Android 4.4+ devices.<br>* Storage: To create the Backup file on the SD card.<br>* Phone calls - Without this the Restore fails on some phones.<br>* Network communication: For displaying Advertisements.<br>* Your social information: To display and store the contact names in the Backup file.<br>* Run at start-up: Start scheduled Backups. <br>* View Network Connections: So that the app does not try to load Ads when there is no connection.<br>* Control Vibration: To vibrate the phone when an operation is completed.<br>* Prevent Phone from Sleeping: To prevent the phone from going to sleep/suspended state while a Backup or Restore operation is in progress.<br>* Test access to Protected Storage: To create the Backup file on the SD card.<p>Icons designed by Vlad Kitanoski of www.vk-solutions.com</p></p></p></p></p></p></p></p></p>', '7', '2152161', '0', null, null, null, '1', '2015-03-19 12:51:30', '2015-03-19 12:51:30', 'Ritesh Sahu');
INSERT INTO `uploads` VALUES ('791', 'name.markus.droesser.tapeatalk', 'Tape-a-Talk', '9760', '0.9.7.6.0', '5', 'Tape-a-Talk is a high quality voice recorder designed for simplicity and is able to record voice notes/voice memos/audio even when the display is off.<p>RECORD<p>âœ” Record in high or low quality, in background and with pause function (.wav)<br>âœ” backwards/fast-forward during a recording as on your dictation machine (.wav)<br>âœ” Record by Widget<p>SHARE<p>âœ” Send, rename and delete recordings<br>âœ” &quot;Fast&quot; Send, now with custom mail recipients<br>âœ” upload to Dropbox, FTP (needs additional apps)<p>MANAGE<p>âœ” Choose recordings as ringtone<br>âœ” Cut recordings (only wav)<br>âœ” Repair recordings (fix header information of wav-files)<br>âœ” Samplerate and -format can be configured in the settings (working modes may vary from device to device)<br>âœ” ...and much more!<p><br>Recordings are stored on the SD card (in folder &quot;tapeatalk_records&quot;).<p><br>Please note: This app shows location based ads.<p>Permissions that this app needs are:<p>- internet access (only for displaying ads)<br>- location access (for displaying location based ads)<br>- write to external storage (to store recordings)<br>- record audio<br>- change settings (to set ringtone)<p>Feel free to send me comments, critics and and general feedback via email.</p></p></p></p></p></p></p></p></p></p></p>', '7', '195695', '0', null, null, null, '1', '2015-03-19 12:51:30', '2015-03-19 12:51:30', 'Markus DrÃ¶sser');
