INSERT INTO `uploads` VALUES ('794', 'com.svox.classic.langpack.eng_usa_fem', 'US English Female Voice', '6', '2.0.1', '4', 'Did you know that your mobile can speak US English?<p>Have Grace read aloud texts from your e-book, navigation, translation and other apps in a US English female, high quality and natural-sounding voice powered by SVOX.<p>When combined with TTS-enabled apps, Grace can:<br>- give directions, allowing you to keep your eyes on the road while you&#39;re driving <br>- read a notification containing the caller / sender&#39;s name, and read the content of an incoming call / sms / mms / email<br>- read aloud your favorite e-books or pdf documents<br>- help you learn English by reading aloud the correct pronunciation<p>and much moreâ€¦ the possibilities are limitless!<br>Browse <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://svoxmobilevoices.wordpress.com%26sa%3DD%26usg%3DAFQjCNHBbmHVIhbRCwJZerXOi9IWHCKMDw&amp;sa=D&amp;usg=AFQjCNFlxRC6TRE1LN6UqEUY5gAYQkE6yA\" target=\"_blank\">http://svoxmobilevoices.wordpress.com</a> for a list of compatible apps and voice demos.<p>NEW! Pronunciation correction feature: correct the default output according to your preferences!<p>== INSTRUCTIONS ==<br>1. Install and run the voice app onceâ€¨<br>2. Install free SVOX Classic Text-to-Speech Engineâ€¨<br>3. Go to Android Settings -&gt; Voice Input &amp; Output -&gt; Text-to-Speech settings.<br>Activate SvoxClassic at the bottom of the screen.<br>Select SvoxClassic as the Default Engine.<br>4. Run the voice app, click â€œContinueâ€, then follow the instructions. <br>5. Your SVOX Voice main screen will be now visible. Donâ€™t forget to try the new pronunciations correction feature (â€˜pencilâ€™ icon)!<br>6. Download other free / paid apps to combine our voice with. For example, you could try:  Google Navigation (on Android 2.2 and later, only with Navigation &lt; 5.9), Moon+ Reader PRO, Voice Actions Plus, TalkToMe Classic, Book Speech Audio Books, Transzilla, Good Morning, WakeVoice, Pocket Blonde...<br>Browse <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://svoxmobilevoices.wordpress.com/faq/%26sa%3DD%26usg%3DAFQjCNH0FlhwU_9oyunL91FSciy-RfIE9Q&amp;sa=D&amp;usg=AFQjCNFBhOGFwgksFYBR4vfhn10QQYcmTQ\" target=\"_blank\">http://svoxmobilevoices.wordpress.com/faq/</a> for a list of frequently asked questions.<br>And now â€¦ enjoy your new SVOX voice! <p>== PRONUNCIATION CORRECTION FEATURE  - HOW TO ==<br>1. Run the voice app<br>2. Click on the â€˜pencilâ€™ icon. The pronunciation correction screen will now be shown.<br>3. Tap on the Android menu key and select â€˜Helpâ€™<p>== NOTES ==â€¨<br>1. Google Navigation requires that the Text-to-Speech voice matches the phone language. You can change the phone language in Android Settings -&gt; Language &amp; keyboard -&gt; Select languageâ€¨<br>Compatible with Google Navigation version &lt; 5.9<br>2. On Android 2.1 and earlier, only some apps, like Google Translation, support changing voices.</p></p></p></p></p></p></p>', '7', '13489017', '0', null, null, null, '1', '2015-03-19 12:51:31', '2015-03-19 12:51:31', 'SVOX Mobile Voices');
