INSERT INTO `uploads` VALUES ('797', 'alterforce.engine', 'Jewerlust', '2', '1.0.0', '8', 'Bienvenido al Antiguo Egipto!  Intercambiar y explotar joyas para viajar entre las pirÃ¡mides!<br>Jewellust es un rompecabezas de intercambio de joyas original con magnÃ­ficos grÃ¡ficos coloridos y animaciÃ³n viva.<br>Este rompecabezas es parecido a Bejeweled pero tiene muchas caracterÃ­sticas interesantes y un juego emocionante.<br>El juego es compatible con todas las resoluciones de pantalla y es muy recomendable para dispositivos en Alta DefiniciÃ³n.<br>Varios idiomas.<p>***Reglas***<br>Explotar las joyas por agrupÃ¡ndolas en tres o mÃ¡s en una fila (o una columna) antes de que acabe el tiempo.  <br>Si hubieran explotado cuatro joyas o mÃ¡s, una joya bonos aparecerÃ¡ (si estÃ¡ disponible). <br> En el modo campaÃ±a se disponen nuevos bonos durante su viaje.<br> <br>Ahora en versiÃ³n HD!<p>***Noticias del juego***<p>ubscure.com:<br>&quot;...this game is challenging enough to keep advanced gamers happy and simple enough for beginning gamers to pick up easily.&quot;<p>androidtapp.com:<br>&quot;Jewellust is really fun and addictive, one of the best puzzle games around.&quot;<p>lifeofandroid.com:<br>&quot;Jewellust is gloriously simple, yet infuriatingly challenging.&quot;<p>best-apps.t3.com:<br>&quot;...once you get into a rhythm, the game starts to eat away at your precious free time.&quot;<p>wildfire-htc.com:<br>&quot;This game captivates you and you will be playing hours on end without realizing it.&quot;<p>askyourandroid.com:<br>&quot;...I just peeped in to see what it was really about and later got glued to it, I just couldnâ€™t put it down I was determined to play to the end.&quot;<p>androidgamesreviews.com:<br>&quot;Game is very easy to play, all rules are simple. Gems are really colorull and also special graphic effects are cool and funny.&quot;<p>AndroidNetworkAwards.com:<br>&quot;Best Puzzle Game&quot;<p>NOTES: <br>- Since version 3.0.0 the game asks for some additional permissions to download apk expansion pack with HD gfx.<br>- As the game has online leaderboards, it&#39;s necessary to use the phone hardware ID (not your phone number) to identify your unique record on the leaderboards. It&#39;s only used when you post your scores online.<br>- if you have problems running this application or some bug reports please email us: <a href=\"mailto:smartpix.games@gmail.com\">smartpix.games@gmail.com</a></p></p></p></p></p></p></p></p></p></p></p>', '', '4120765', '0', null, null, null, '1', '2015-03-19 12:51:31', '2015-03-19 12:51:31', 'Smartpix Games');
