INSERT INTO `uploads` VALUES ('801', 'org.wikipedia', 'Wikipedia', '25', '1.3.4', '18', 'AplicaciÃ³n oficial de Wikipedia para Android. Wikipedia es la enciclopedia libre que contiene mÃ¡s de 32 millones de artÃ­culos en 280 idiomas y es el trabajo de referencia mÃ¡s completo y ampliamente usado que los humanos hayan recopilado. La aplicaciÃ³n ha sido reescrita desde cero y estÃ¡ mejor que nunca.<p>CaracterÃ­sticas:<br>   -Velocidad: Nuestra nueva aplicaciÃ³n nativa te permite navegar y editar Wikipedia mÃ¡s rÃ¡pido que nunca.<br>   -EdiciÃ³n: Â¡Puedes editar Wikipedia! Conectado o desconectado, te damos gracias por todas tus contribuciones.<br>   -PÃ¡ginas recientes: te proporcionamos tu historial de lectura, asÃ­ puedes teclear tantos enlaces como gustes sin perderte en ningÃºn momento.<br>   -PÃ¡ginas guardadas: puedes guardar pÃ¡ginas seleccionadas para leerlas sin conexiÃ³n y navegarlas incluso cuando no tienes una conexiÃ³n de datos.<br>   -Comparte: Usa tus aplicaciones de redes sociales existentes para compartir en la suma de todo el conocimiento humano.<br>   -Soporte de idiomas: la aplicaciÃ³n permite cambiar perfectamente a la lectura de Wikipedia escrita en cualquier idioma.<br>   -Wikipedia Zero: cargos de datos omitidos para operadores mÃ³viles participantes.<p>El cÃ³digo es completamente abierto. Si tienes experiencia con Java y el SDK de Android, ven a bifurnos! <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://github.com/Wikimedia/apps-Android-Wikipedia%26sa%3DD%26usg%3DAFQjCNFqPTqz58PPyuUuLpGkZ86YT-TTrQ&amp;sa=D&amp;usg=AFQjCNFNTC8t3F7XzaYuN7XUUyciUqV9Bg\" target=\"_blank\">https://github.com/Wikimedia/apps-Android-Wikipedia</a></p></p>', '8', '1537893', '0', null, null, null, '1', '2015-03-19 12:51:32', '2015-03-19 12:51:32', 'Wikimedia Foundation');
