INSERT INTO `versions` VALUES ('1', 'com.samalyse.tapemachine', 'TapeMachine', '47', '1.6.9', '9', 'TapeMachine is a high-quality sound recorder and editor, featuring a powerful waveform display.<p>- zoom and scratch<br>- select, export, edit, undo<br>- copy, cut, paste<br>- fade in/out, reverse, normalize<br>- looped playback<br>- time markers<br>- variable speed<br>- record when locked<br>- up to 2h/file<br>- input gain and auto-gain<br>- compact home screen widget<br>- bluetooth support<br>- powerful file manager with folders<br>- send by mail, dropbox, etc..<br>- use front or back mic (if available)<br>- set engine samplerate, latency, ..<br>- rec/play/convert WAV, AIFF, OGG, FLAC<p>The MP3 codec is available as a free add-on from the website, under certain conditions.<p>A user manual is available from the menu.<p>Please visit the website for the FAQ, ChangeLog, video and more.</p></p></p></p>', '3', null, '0', '0', '0', '2015-03-19 15:26:46', '2015-03-19 15:26:46', null, '1', null);
