INSERT INTO `versions` VALUES ('4', 'com.mathpad.mobile.android.wt.unit', 'ConvertPad - Unit Converter', '1701', '1.7.0', null, 'ConvertPad es el mÃ¡s potente y totalmente equipado convertidor de la unidad, convertidor de moneda y calculadora (mÃ¡s de 10.000.000 descargas de la  versiÃ³n del anuncio). <br>ConvertPad es intuitivo y fÃ¡cil de usar. Informa sobre todas las caracterÃ­sticas de la moneda rÃ¡pidamente, en tiempo real y sobre la conversiÃ³n en otras unidades.<br>CaracterÃ­sticas:<br>* Convertidor de la unidad universal y calculadora<br>* Conversor de divisas <br>* Soporte para mÃºltiples idiomas <br>* FunciÃ³n de personalizaciÃ³n para las Unidades favoritas <br>* CategorÃ­as definidas por el usuario<br>* OpciÃ³n de Ajustes<br>* Mesas de vapor<p>** Para &quot;el acceso a Internet&quot; y &quot;R / W en el acceso de almacenamiento externo&quot; son para la moneda de actualizaciÃ³n y copia de seguridad definidas por el usuario en la tarjeta SD, respectivamente. <br>** Por favor, deje sus valoraciones en ConvertPad. Asimismo, animarÃ¡ a la promotora a continuar esforzÃ¡ndose.<p>================<br>CAUTION: Please use the &quot;Favorite Categories&quot; in menu to see the default hidden units.<p>ConvertPad is the most powerful and fully featured Unit converter, Currency converter and Calculator. It&#39;s a simple but the most powerful unit converter. (10,000,000+ downloads). ConvertPad is intuitive and easy to use. Features fast, real time currency and unit conversion in a clean interface. <p>Features;<p>* Universal Unit converter and Calculator<br>  . Real-time conversion and calculation<br>  . Unit Comparison Table<br>  . Direct Arithmetic Calculation<br>  . Country-Specific Units<br>  . Wikipedia Search for additional Unit information<br>* Currency conversions <br>  . Option for selecting favorite exchange rate<br>  . Support 160+ Currencies<br>* Multiple languages support <br>  . Supports 25 languages.<br>  . Supports 2 preferences as primary &amp; secondary languages.<br>* Customizing feature for Favorite Units<br>  . Favorite Categories and Units<br>  . Various Sorting option<br>* User-defined Categories and Units<br>  . User-defined units in built-in categories<br>  . User&#39;s own categories and units<br>  . Formula(functional form) support for user-defined units.<br>* Various Setting option<br>  . Various Color Themes<br>  . Backup/Restore User-defined Units on SD Card<br>* Steam tables<br>  . Thermodynamic Steam tables<p>NOTE;<p>** Permission for &quot;Internet access&quot; and &quot;R/W access on external storage&quot; are for Update Currency and Backup user-defined units on SD Card respectively.<p>** Please leave your comments for ConvertPad on market. it will ENCOURAGE the developer to continue his effort.<p>Older Version: <p>v 2.7.<br>  Voice Searching<br>  Text(Keyword) Searching<br>  Reported translation errors fixed.<p>v 2.6<br>  New languages(Hindi, Romanian) added.<br>  Various translation errors fixed.<br>  App Loading speed improved.<br>  Minor bug fixed.<p>v 2.5<br>* New features<br>Â  New language(Hebrew) added.<br>Â  Searching Icon(Wikipedia) changed.<br>Â  Separate Input for Stone/Pound added.<p>v 2.4<br>  Separate Input for Feet/Inches &amp; Pounds/Ounces.<br>  Tablet size support.<br>  UI for Calculator improved.<p>v 2.3<br>  Wiki Searching for Unit information<br>  Circle/Sphere unit<br>  User interface on Setting &amp; Favorites options<p>v. 2.2<br>  Currency rate update (after the format changed from one of the providers).<br>  Number/period input issue on User-defined units<br>  User interface on Calculator<br>  Memorizing cursor location on each category<br>  (Conversion Table)<br>  Dec/Bin/Hex<br>  Shoe/Clothing/Ring Size<br>  dBm/Volts/Watts<br>  <br>v. 2.1<br>* Option for various Color themes<br>* Formula type(functional-form) input for user-defined units.(ex: 2*x+5)<br>* Reference unit option for user-defined units.<br>* Text size optimization for various devices.<br>* Memorizing feature on Calculator (Click on input field)<br>* ASME Steam tables (Thermodynamics)<br>* New language(Turkish)<br>* Minor bugs fixed.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '966066', '0', '0', '0', '2015-03-19 15:30:34', '2015-03-19 15:30:34', '3', '1', 'Sunny Moon');
