INSERT INTO `versions` VALUES ('11', 'com.google.android.chess', 'Chess', '157', '1.5.7', null, 'Chess for Android consists of a chess engine and a GUI. The application accepts moves through the touch screen, trackball, or keyboard (e2e4 pushes the king pawn, e1g1 castles king side, etc.). An optional &quot;move coach&quot; highlights valid user moves during input and last played engine move. Full game navigation buttons enable users to correct mistakes or analyze games. Games import and export as FEN/PGN to and from the clipboard or via sharing,Â load and save as file, or are set up through a position editor. A draw byÂ stalemate,Â insufficient material, theÂ fifty move rule, orÂ threefold repetitionÂ is recognized. The engine plays at various levels (including random, against itself in auto-play, or free-play, where the game can be used as a &quot;magnetic chessboard&quot;). The user can play either side and, independently, view the board from the perspective of white or black.<p>The application supports the Universal Chess Interface (UCI) and Chess Engine Communication Protocol (WinBoard and XBoard), which allows users to play against more powerful third party engines or even play tournaments between engines. Engine setup features time control, pondering, infinite analysis, hash tables, multiple threads, endgame tablebases, and opening test suites. Recognizes Chessbase compatible engines.</p>', '2', '156232', '0', '0', '0', '2015-03-19 15:52:29', '2015-03-19 15:52:29', '8', '1', 'Aart Bik');
