INSERT INTO `versions` VALUES ('16', 'com.jb.gosms.es', 'GO SMS Language Spanish', '1', '1.0', null, 'This is Spanish language for GO SMS Pro, completed close to 100%.<br>Install it and change the language in â€œSettings -- General -- Languageâ€ (GO SMS 6.0 needed)<br><b>We are looking for enthusiastic users help us translate</b><br>Please contact us: <a href=\"mailto:chenwenyong@sungymobile.com\">chenwenyong@sungymobile.com</a><br>We will give you VIP value $19.99 as compensation after the job is done', '4', '122395', '0', '0', '0', '2015-03-20 16:47:24', '2015-03-20 16:47:24', '4', '1', 'GO Dev Team');
INSERT INTO `versions` VALUES ('17', 'com.hwkrbbt.downloadall', 'Download All Files', '195', '1.95', '3', 'Previously you might have encountered the &quot;Content not support&quot; error message while trying to download APK, RAR, ZIP, MP3, DOC, XLS or other files. <p>With Download All Files you will be able to download these files to your device. This app works like a browser plugin and enables you to download all file types and allows you to save them easily to your SD card.<p>Additionally you will be able to save all your Gmail attachments.<p>This is free ad-supported version of Download All Files. If you like it, check out the ad-free Download All Files PRO.<p>*It does NOT work for streaming videos like YouTube because of Google policy.<p>MORE THAN 15 MILLION DOWNLOADS ALL OVER THE WORLD!!!</p></p></p></p></p>', '7', '448255', '0', '0', '0', '2015-03-20 16:47:38', '2015-03-20 16:47:38', null, '1', null);
INSERT INTO `versions` VALUES ('18', 'com.funkyfresh.samba', 'Samba Filesharing on Android', '1', '1.0', '3', 'Access your Android device over wifi as a Windows shared folder.<p>* Samba Filesharing server for Android   [ Recently updated for JellyBean probs ].<br>* Your Android device becomes visible to other Windows (&amp; SMB compatible) computers on your network.<br>* The &#39;external&#39; storage in your Android device is accessible as a network shared folder.<br>* Copy files and folders to and from your Android device using drag and drop.<br>* Customisable username, password, Windows workgroup name, and device network (NETBIOS) name.<p>Requirements:<br>* Your Android device must already be rooted and a SuperUser app installed.<p>Notes:<br>* On the first run, make sure you catch the SuperUser Auth request to allow the Samba Filesharing app root access.<br>* If an update from an earlier version fails, try a full uninstall (either from the application manager of your Android device, or the file sharing app &#39;Menu -&gt; Settings -&gt; Uninstall&#39; option), then re-install from Android Market.<br>* If you experience problems accessing your device, be sure to try all three methods: Network browser, specifying \\\\name, &amp; also \\\\ipaddress.<br>* You may see &#39;com.funkyfresh.samba&#39; remain in the Android process list even though you have disabled it from auto-starting. This is normal - whenever the WIFI interface transitions up/down the app needs to run temporarily to check its settings as to whether it should start/stop the filesharing server, after that, its done.  Android will kill the inactive process if your device is running low on memory, otherwise the process remains inactive in memory for faster loading next time you launch it.<br>* PÃ©rsio Menezes: Thanks for the new logo!<p><br>SAMBA - Opening Windows to a wider world <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.samba.org/%26sa%3DD%26usg%3DAFQjCNGw0qSslTrNXVKWutUvDcwnYvs8cA&amp;sa=D&amp;usg=AFQjCNGUqjmDIbbLSMAEM3rlVzOXkSl72g\" target=\"_blank\">http://www.samba.org/</a><p>See &#39;Menu -&gt; Settings -&gt; About&#39; in the app for a pointer to information about Samba GNU Licensing &amp; Source code changes.</p></p></p></p></p>', '6', '1983379', '0', '0', '0', '2015-03-20 16:47:44', '2015-03-20 16:47:44', null, '1', null);
INSERT INTO `versions` VALUES ('19', 'com.darshancomputing.BatteryIndicatorPro', 'Battery Indicator Pro', '52', '4.0.1', null, 'BatteryBot is the original battery indicator app for Android, released in 2009 as simply &quot;Battery Indicator&quot;.  Both the free and the Pro versions have maintained a 4.5+ star rating in Google Play from the beginning. It offers two modes: the original status bar indicator and now also a desktop widget.  You can use either or both, as you please.<p>For those who want more than is offered in the free version, or for those who just like to support small, independent developers like me, this Pro version remains lightweight while packing in many useful features:<p>BatteryBot Pro monitors and shows your battery charge level (percent) as an icon in your status bar, with temperature, health, voltage, and time since plugged / unplugged in the notification area. It also has user-configurable alarms, logs, and widgets.<p>Features:<br>â€¢ Automatic time-remaining estimates based on recent usage<br>â€¢ Several icon sets (including fully configurable green, amber, red, and black icons)<br>â€¢ Small (1x1) and large (4x1) app widgets<br>â€¢ Notification (with status bar icon) is now optional -- can be used as just a desktop widget<br>â€¢ Battery logging. You can log the battery state (charge, status, voltage, temperature) and browse the logs on the phone or export to CSV.<br>â€¢ Manually or automatically disable / reenable device lock screen / lockscreen / keyguard<br>â€¢ Alarms (full, charge above X, charge below X, temperature above X, or health failure)<br>â€¢ Control the notification priority on Android 4.1+ (For example, you can set to &quot;minimum&quot; to hide the icon but keep the notification in the tray.)<br>â€¢ Lots of configurability of behavior and appearance.<br>â€¢ The charging indicator (the bolt under the number that indicates when the device is being charged) for the sets that have it is optional in the Pro version.<br>â€¢ Very lightweight (please email me if you think otherwise, and I&#39;ll help you figure out what&#39;s wrong â€” I promise this app will not drain your battery!)<br>â€¢ Shows 1% increments even on most Motorola devices (option needs to be enabled on devices that default to 10% increments)<br>â€¢ Well-tested and supported on all major versions of Android (2.1, 2.2, 2.3, 3.0, 3.1, 4.0, 4.1, 4.2; Eclair, Froyo, Gingerbread, Honeycomb, Ice Cream Sandwich / ICS, Jelly Bean) and form factors (small phones, medium phones, large phones, 7-inch tablets, 10-inch tablets).<br>â€¢ Open source<p>~~~~<p>A one-time purchase now gets you free updates for life on all your Android devices.<p>~~~~<p>All requested app permissions are explained on the project website.<p>~~~~<p>Please email me if you have any questions or comments.<p>~~~~<p>If you wish to help beta-test new releases, there&#39;s now a Google+ community for that.  &quot;BatteryBot Pro Beta Testers&quot; <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttps://plus.google.com/communities/108365502089038835850%26sa%3DD%26usg%3DAFQjCNHIEDXh1GFiYEuYt7zq6TU00BYT1w&amp;sa=D&amp;usg=AFQjCNF9Ul6U0goWAHlSxHq3OYVjyosECw\" target=\"_blank\">https://plus.google.com/communities/108365502089038835850</a><p>~~~~<p>Here&#39;s the BatteryBot business model / philosophy:<p>1) Ads are annoying. For some apps, ads might make sense, but a system utility should not have ads.<p>2) The free version should be simple but useful; it shouldn&#39;t feel crippled.<p>3) Some people choose to purchase the Pro version because they want extra features, some because they want more customization, and many because they just want to say &quot;thanks&quot; for the free version and support small, independent developers like myself.</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '4', '866655', '0', '0', '0', '2015-03-20 18:14:46', '2015-03-20 18:14:46', '3', '1', 'Darshan Computing, LLC');
