INSERT INTO `versions` VALUES ('48', 'com.chartcross.gpstestplus', 'GPS Test Plus', '12', '1.1.1', '3', 'All the features of GPS Test plus:-<br>â˜… <b>WAYPOINT NAVIGATION</b><br>â˜… <b>HEAD UP DISPLAY</b><br>â˜… <b>DIGITAL FONTS (Great in the car)</b><p>Now shows symbols for <b>GLONASS</b> satellites <p>The GPS Test Plus app for Android is a utility that shows GPS information read from your phones internal GPS. Will support GLONASS phones.<p>The navigation functions can replace your &#39;Car Finder&#39; app and also be used for Geocaching. It records the last twelve saved locations, so you can navigate a simple route as well.<p>If you like this app, please like GPS Test on Facebook: -<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/GpsTest%26sa%3DD%26usg%3DAFQjCNGMtNTGyoCRN4wWmufzKwdprPRhrA&amp;sa=D&amp;usg=AFQjCNEoDqxShyaEuEtvtF4yB_lSGNqGQg\" target=\"_blank\">http://www.facebook.com/GpsTest</a><p>GPS Test Plus has five screens full of information: -<p>1) GPS signal (SNR) bar chart, showing the signal strength for each satellite, as well as the accuracy and status of the GPS.<p>2) Satellite positions in the sky (skyview), shown on a rotating compass.<p>3) Your current location on the earth shown as text and on a world map. The current position of the sun and the day/night transition curve is also shown.<p>4) Your current speed, heading and altitude shown as text or as dials.<p>5) The current time read from the GPS and the local time in your current timezone, as well as the sunrise and sunset times at your location.<p>Useful for navigation or geocaching. <p>Supported Coordinate Grids:-<br>OSGB, UTM, MGRS, USNG, CH1903, Maidenhead.<p>Supported Datums:-<br>WGS84, NAD83, NAD27, ED50, AGD66, AGD84, SAD69<p>All the features of GPS Test, plus:-<p>* Speedometer, Altimeter and Compass dials.<br>* Seven segment display font.<br>* Dot matrix display font.<br>* HUD display mode for windscreens.<br>(The display is mirrored so that it shows the right way round when the phone is placed on a car&#39;s dash and the reflection is viewed in the windscreen).<br>* Share location.<p>The app has several colour schemes, which could be used to match other instrumentation, used along side the app. It has a &quot;night mode&quot; colour scheme as well.<p>Works on Honeycomb O/S and large screen tablets.<p>Blog for GPSTest <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://gpstestapp.blogspot.com/%26sa%3DD%26usg%3DAFQjCNFeFe984JLgHnxzNQVw_9RBgMKD1g&amp;sa=D&amp;usg=AFQjCNH954xmDq64kEgnBZ2MoGXGNjkfnA\" target=\"_blank\">http://gpstestapp.blogspot.com/</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '181264', '0', '0', '0', '2015-03-20 18:35:35', '2015-03-20 18:35:35', null, '1', null);
INSERT INTO `versions` VALUES ('49', 'com.chartcross.gpstestplus', 'GPS Test Plus', '14', '1.1.3', '3', 'All the features of GPS Test plus:-<br>â˜… <b>WAYPOINT NAVIGATION</b><br>â˜… <b>HEAD UP DISPLAY</b><br>â˜… <b>DIGITAL FONTS (Great in the car)</b><p>Now shows symbols for <b>GLONASS</b> satellites <p>The GPS Test Plus app for Android is a utility that shows GPS information read from your phones internal GPS. Will support GLONASS phones.<p>The navigation functions can replace your &#39;Car Finder&#39; app and also be used for Geocaching. It records the last twelve saved locations, so you can navigate a simple route as well.<p>If you like this app, please like GPS Test on Facebook: -<br><a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://www.facebook.com/GpsTest%26sa%3DD%26usg%3DAFQjCNGMtNTGyoCRN4wWmufzKwdprPRhrA&amp;sa=D&amp;usg=AFQjCNEoDqxShyaEuEtvtF4yB_lSGNqGQg\" target=\"_blank\">http://www.facebook.com/GpsTest</a><p>GPS Test Plus has five screens full of information: -<p>1) GPS signal (SNR) bar chart, showing the signal strength for each satellite, as well as the accuracy and status of the GPS.<p>2) Satellite positions in the sky (skyview), shown on a rotating compass.<p>3) Your current location on the earth shown as text and on a world map. The current position of the sun and the day/night transition curve is also shown.<p>4) Your current speed, heading and altitude shown as text or as dials.<p>5) The current time read from the GPS and the local time in your current timezone, as well as the sunrise and sunset times at your location.<p>Useful for navigation or geocaching. <p>Supported Coordinate Grids:-<br>OSGB, UTM, MGRS, USNG, CH1903, Maidenhead.<p>Supported Datums:-<br>WGS84, NAD83, NAD27, ED50, AGD66, AGD84, SAD69<p>All the features of GPS Test, plus:-<p>* Speedometer, Altimeter and Compass dials.<br>* Seven segment display font.<br>* Dot matrix display font.<br>* HUD display mode for windscreens.<br>(The display is mirrored so that it shows the right way round when the phone is placed on a car&#39;s dash and the reflection is viewed in the windscreen).<br>* Share location.<p>The app has several colour schemes, which could be used to match other instrumentation, used along side the app. It has a &quot;night mode&quot; colour scheme as well.<p>Works on Honeycomb O/S and large screen tablets.<p>Blog for GPSTest <a href=\"https://www.google.com/url?q=https://www.google.com/url?q%3Dhttp://gpstestapp.blogspot.com/%26sa%3DD%26usg%3DAFQjCNFeFe984JLgHnxzNQVw_9RBgMKD1g&amp;sa=D&amp;usg=AFQjCNH954xmDq64kEgnBZ2MoGXGNjkfnA\" target=\"_blank\">http://gpstestapp.blogspot.com/</a></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '185247', '0', '0', '0', '2015-03-20 18:35:37', '2015-03-20 18:35:37', null, '1', null);
