gos de barras (EAN8, EAN13, Code39, Code 128)<br>- Comparte tus cÃ³digos QR a travÃ©s de:<br>Â Â &gt; EMAIL<br>Â Â &gt; Mensajes de texto<br>Â Â &gt; Redes Sociales (Facebook, Twitter, Flipboard, Google Plus)<br>Â Â &gt; WIFI<br>Â Â &gt; BLUETOOTH<br>- AUTO-ARCHIVE cada cÃ³digo QR descifrado en una simple cronologÃ­a.<br>- Pasar directamente a direcciones web decodificados.<p>________________________<p>Idiomas de interfaz de usuario: InglÃ©s, EspaÃ±ol, Italiano.<br>________________________<p><br>CHANGELOG<p> Nueva versiÃ³n 1.4.2:<br>1) correcciÃ³n de errores principal para dispositivos Android 2.1 en la actividad resultado de la exploraciÃ³n;<br>2) resolviÃ³ accidente al azar en la historia;<br>3) la correcciÃ³n de errores menores.<p>Antigua versiÃ³n 1.4.1<br>1) Interfaz de usuario mejorada y la experiencia del usuario;<br>2) IntegraciÃ³n completa con ICS 4.x;<br>3) AÃ±adida la posibilidad de guardar contactos en la agenda;<br>4) Se agregÃ³ la opciÃ³n para guardar el resultado al portapapeles;<br>5) AÃ±adida la posibilidad de buscar a travÃ©s de la historia;<br>6) AÃ±adida la posibilidad de activar / desactivar la vibraciÃ³n;<br>7) AÃ±adida la posibilidad de activar / desactivar el sonido de escaneo se completo;<br>8) AÃ±adida la posibilidad de guardar los eventos de calendario directamente en su calendario;<br>9) AÃ±adida la posibilidad de cambiar el color del qr codificado.<br>______________________________<br>Antigua versiÃ³n 1.4:<br>1) la revoluciÃ³n de la interfaz de usuario (deslizar, etc);<br>2) Se ha aÃ±adido la funciÃ³n de decodificaciÃ³n de imÃ¡genes;<br>3) Se ha aÃ±adido la funciÃ³n para la descodificaciÃ³n de URL.<br>______________________________<p>Antigua versiÃ³n 1.3:<br>1) El soporte completo para el idioma InglÃ©s, espaÃ±ol e italiano;<br>2) nuevo estilo de interfaz de usuario;<br>3) aÃ±adir el reconocimiento automÃ¡tico del tipo del escaneado qr / cÃ³digo de barras;<br>4) aÃ±adir la redirecciÃ³n automÃ¡tica al contenido de la qr / cÃ³digo de barras