INSERT INTO `versions` VALUES ('51', 'com.ihandysoft.carpenter.toolkit', 'Carpenter', '9', '1.1.6', '3', '! Las herramientas de Carpintero mÃ¡s ligeras, atractivas y utiles del mundo, ahora en tu Phone! <p>!Consigue 5 herramientas profesionales en UNA sola aplicaciÃ³n por la mitad de precio de comprar una!<p>***************************************************<p>Puedes leer de crÃ­ticos de aplicaciones y usuarios satisfechos:<p>Â¨No solo son utiles estas herramientas, tambiÃ©n son fabulosas, con efectos de madera y brillo que las hacen parecer salidas del taller de Leonardo da VinciÂ¨ - OÂ´Reilly Media, Â¨Mejor AplicaciÃ³n IphoneÂ¨<p>Â¨Top 20 Aplicaciones para el iPhone de 2009Â´ Tribune Media<p>Â¨AplicaciÃ³n del DÃ­a del Padre para el papa NÃºmero 1Â¨ -CNN <p>Â¨Verdaderamente Ãºtil y me gusta mucho el estilo de la experiencia de usuario. Soy un usuario quisquilloso pero tengo que decir que estas herramientas estÃ¡n bien hechas y que merecen el precioÂ¨ -- nuestro cliente<p>***************************************************<p>Hay 5 herramientas en esta aplicaciÃ³n:<br>- Un peso de plomada,, la forma que tienes mÃ¡s sencilla de comprobar la verticalidad de lÃ­neas o paredes.<br>- Un Nivelador de superfÃ­cie, la mejor herramienta para nivelar cualquier superfÃ­cie plana.<br>- Un nivel de burbuja, el mismo que puedes encontrar en una ferreteria, y mÃ¡s atractiva. <br>- Un transportador de Ã¡ngulos para medir angulos de 0 a 180 grados.<br>- Un Regla de centimetros o pulgadas. !Pasandola de izquierda a derecha, tu regla puede medir cosas mÃ¡s largas que tu Phone! <br>- Una vez calibrada, el peso plomada, el nivelador de superfÃ­cie y el nivel de burbuja pueden ser usadas como un inclinÃ³metro/ clinÃ³metro para averigurar los Ã¡ngulos en la pantalla.<p>!Disfrutalos! <p>***************************************************<p>Unos pocos trucos para mejorar la experiencia de Carpintero iHandy<p>- El peso plomada, nivelador de superfÃ­cie y nivel de burbuja<br>Calibralos antes de usarlos para una medida profesional.<p>- Usa el peso plomada para medir la verticalidad de una pared.<br>Dos maneras de comprobar la verticalidad de una pared: <br>1. Pon la parte posterior de tu Phone en la pared que quieras medir ( Recomendado) <br>Si la sombra del peso plomada estÃ¡ en el eje de las X ( y igual a 0) es que tu pared esta perfectamente recta y vertical con respecto al suelo. Acuerdate que de esta manera la lectura de Â¨xÂ¨ NO tiene porque ser cero.<br>La parte posterior del Phone no es totalmente plana. Pero es lo bastante precisa para usar la parte plana de tu Phone.<br>2. Pon un extremo de tu Phone en la pared que mides.<br>Si la sombra del peso plomada estÃ¡ en el eje de las Y (x igual a cero), esto indica que tu pared esta perfectamente plana y vertical con respecto al suelo. Por favor acuerdate de esta manera &quot;y&quot; NO tiene que ser cero.<p>- COMO MEDIR LA PENDIENTE DE UNA SUPERFÃCIE<br>Varios modos para medir la pendiente de una superfÃ­cie son: <br>1. Usar el Nivelador de superfÃ­cie ( Recomendado)<br>Coloca tu Phone en una superfÃ­cie inclinada ( El borde del Phone debe estar alineado con la pendiente de la superfÃ­cie. Para comprobar esto, simplemente comprueba que la lectura de la &quot;y&quot; es igual a cero).<br>La lectura de Â´xÂ´ es el Ã¡ngulo de la pendiente de la superfÃ­cie medida.<br>2. Uso de Nivel de burbuja<br>Coloca un borde o la parte posterior de tu Phone encima de la superfÃ­cie inclinada.<br>(El borde del Phone debe estar alineado con la direcciÃ³n inclinada de la superfÃ­cie).<br>La lectura es el Ã¡ngulo de la superfÃ­cie inclinada.<p>Si la superfÃ­cie es casi vertical con respecto al suelo, sugerimos que uses el peso plomada para medir la superfÃ­cie.<p><br>- INSTRUCCIONES DE CALIBRAJE<p>Por favor vaya a &quot;Ayuda e Instrucciones&quot; en la pÃ¡gina de ajustes de iHandy Flotador</p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p></p>', '3', '7068622', '0', '0', '0', '2015-03-20 18:35:53', '2015-03-20 18:35:53', null, '1', null);
