INSERT INTO `versions` VALUES ('72', 'com.koushikdutta.klaxon', 'Klaxon', '222', '2.2.2', null, 'REOPEN KLAXON AFTER UPDATING, ANDROID CANCELS ALARMS ON UPDATES AND REINSTALLS!<p>4.3.1 Fixed force close.<br>4.2.9 Added flight mode and expire options.<p>Google &quot;genie widget&quot; to add weather to the clock.<p>Flip to snooze!<br>Desk clock<br>Configure: snooze, music, ringtone, max volume, volume ramp, alarm names, vibration, and more!</p></p></p>', '2', '245756', '0', '0', '0', '2015-03-20 18:36:56', '2015-03-20 18:36:56', '3', '1', 'ClockworkMod');
